(186, 359, 'ru', 0, NULL, '<a href="%s">Пожалуйста, обновите WordPress</a>.', NULL, '', 0, '2021-05-15 11:46:21'),
(187, 360, 'ru', 0, NULL, '<strong>Конфликт значений VHOST и SUBDOMAIN_INSTALL.</strong> В качестве параметра режима поддоменов будет использовано значение константы SUBDOMAIN_INSTALL.', NULL, '', 0, '2021-05-15 11:46:21'),
(188, 361, 'ru', 0, NULL, '<strong>Не удалось найти сайт %1$s.</strong> Поиск выполнялся в таблице %2$s базы данных %3$s. Это правильно?', NULL, '', 0, '2021-05-15 11:46:21'),
(189, 362, 'ru', 0, NULL, '<strong>В базе данных отсутствуют таблицы.</strong> Это значит, что MySQL не запущен, WordPress неправильно установлен, либо кто-то удалил таблицу %s. Стоит проверить базу данных.', NULL, '', 0, '2021-05-15 11:46:21'),
(190, 363, 'ru', 0, NULL, '<strong>ОШИБКА</strong>: %1$s в %2$s может содержать только числа, буквы и подчёркивания.', NULL, '', 0, '2021-05-15 11:46:21'),
(191, 364, 'ru', 0, NULL, '<strong>ОШИБКА</strong>: Cookies заблокированы из-за неожиданного вывода на экран. Посмотрите <a href="%1$s">документацию</a> или обратитесь за помощью на <a href="%2$s">форумы поддержки</a>.', NULL, '', 0, '2021-05-15 11:46:21'),
(192, 365, 'ru', 0, NULL, '<strong>ОШИБКА</strong>: Cookies либо заблокированы, либо не поддерживаются вашим браузером. Чтобы использовать WordPress, нужно <a href="%s">разрешить cookies</a>.', NULL, '', 0, '2021-05-15 11:46:21'),
(193, 366, 'ru', 0, NULL, '<strong>ОШИБКА</strong>: Регистрация не удалась. Пожалуйста, свяжитесь с <a href="mailto:%s">администратором</a>!', NULL, '', 0, '2021-05-15 11:46:21'),
(194, 367, 'ru', 0, NULL, '<strong>ОШИБКА</strong>: Неверное имя пользователя, email или пароль.', NULL, '', 0, '2021-05-15 11:46:21'),
(195, 368, 'ru', 0, NULL, '<strong>ОШИБКА</strong>: Введите имя пользователя или email.', NULL, '', 0, '2021-05-15 11:46:21'),
(196, 369, 'ru', 0, NULL, '<strong>ОШИБКА</strong>: Пожалуйста, введите имя пользователя.', NULL, '', 0, '2021-05-15 11:46:21'),
(197, 370, 'ru', 0, NULL, '<strong>ОШИБКА</strong>: пожалуйста, введите корректный адрес email.', NULL, '', 0, '2021-05-15 11:46:21'),
(198, 371, 'ru', 0, NULL, '<strong>ОШИБКА</strong>: пожалуйста, заполните необходимые поля (имя, email).', NULL, '', 0, '2021-05-15 11:46:21'),
(199, 372, 'ru', 0, NULL, '<strong>ОШИБКА</strong>: пожалуйста, введите комментарий.', NULL, '', 0, '2021-05-15 11:46:21'),
(200, 373, 'ru', 0, NULL, '<strong>ОШИБКА</strong>: Пожалуйста, введите ваш адрес email.', NULL, '', 0, '2021-05-15 11:46:21') ;
