(1036, 1211, 'ru', 0, NULL, 'Эй! Выглядит так, как будто вы только что вставили HTML в визуальный редактор виджета Текст. Наверное лучше было вставить его в вкладку &#8220;Текст&#8221; Альтернативно, попробуйте новый виджет &#8220;Пользовательского HTML&#8221;!', NULL, '', 0, '2021-05-15 11:46:21'),
(1037, 1212, 'ru', 0, NULL, 'Привет, ###USERNAME###!\n\nЭто уведомление подтверждает, что ваш адрес email на сайте «###SITENAME###» успешно изменён на ###NEW_EMAIL###.\n\nЕсли вы не меняли адрес, пожалуйста, напишите администратору сайта на\n###ADMIN_EMAIL###\n\nЭто письмо было отправлено на ###EMAIL###\n\nУспехов,\nКоманда сайта «###SITENAME###»\n###SITEURL###', NULL, '', 0, '2021-05-15 11:46:21'),
(1038, 1213, 'ru', 0, NULL, 'Привет, ###USERNAME###!\n\nЭто уведомление подтверждает успешную смену вашего пароля на сайте «###SITENAME###».\n\nЕсли вы не меняли пароль, пожалуйста, напишите администратору сайта на\n###ADMIN_EMAIL###\n\nЭто письмо было отправлено на ###EMAIL###\n\nУспехов,\nКоманда сайта «###SITENAME###»\n###SITEURL###', NULL, '', 0, '2021-05-15 11:46:21'),
(1039, 1214, 'ru', 0, NULL, 'Привет,\n\nЭто уведомление подтверждает смену адреса электронной почты администратора на\n ###SITENAME###.\n\nНовый адрес администратора - ###NEW_EMAIL###.\n\nЭто сообщение было отправлено на ###OLD_EMAIL###\n\nУспехов,\nКоманда сайта ###SITENAME###\n###SITEURL###', NULL, '', 0, '2021-05-15 11:46:21'),
(1040, 1215, 'ru', 0, NULL, 'Привет,\n\nЭто уведомление подтверждает что email адрес администратора сети был изменен на\n###SITENAME###.\n\nНовый email адрес администратора сети - ###NEW_EMAIL###.\n\nЭто сообщение было отправлено на ###OLD_EMAIL###\n\nУспехов,\nКоманда сайта ###SITENAME###\n###SITEURL###', NULL, '', 0, '2021-05-15 11:46:21'),
