(1045, 1220, 'ru', 0, NULL, 'Подсказка: Рекомендуется задать пароль длиной не менее двенадцати символов. Чтобы сделать его надёжнее, используйте буквы верхнего и нижнего регистра, числа и символы наподобие ! " ? $ % ^ &amp; ).', NULL, '', 0, '2021-05-15 11:46:21'),
