(1054, 1229, 'ru', 0, NULL, 'Сколько элементов отображать?', NULL, '', 0, '2021-05-15 11:46:21'),
(1055, 1230, 'ru', 0, NULL, 'Привет ###USERNAME###,\n\nВы недавно запросили смену адреса электронной почты вашей учетной записи.\n\nЕсли это на самом деле вы, то подтвердите замену нажав на ссылку ниже:\n###ADMIN_URL###\n\nВы можете проигнорировать и удалить сообщение, для того\nчтобы не предпринимать никаких действий.\n\nЭто сообщение было отправлено на ###EMAIL###\n\nУспехов,\nКоманда сайта ###SITENAME###\n###SITEURL###', NULL, '', 0, '2021-05-15 11:46:21'),
(1056, 1231, 'ru', 0, NULL, 'Привет ###USERNAME###,\n\nВы недавно запросили смену адреса электронной почты\nадминистратора сети.\n\nЕсли это на самом деле так, пожалуйста, нажмите на ссылку ниже, чтобы изменить его:\n###ADMIN_URL###\n\nВы можете проигнорировать и удалить это сообщение, чтобы\nне предпринимать никаких действий.\n\nЭто сообщение было отправлено на ###EMAIL###\n\nУспехов,\nКоманда сайта ###SITENAME###\n###SITEURL###', NULL, '', 0, '2021-05-15 11:46:21'),
(1057, 1232, 'ru', 0, NULL, 'Привет, USERNAME!\n\nВаш новый сайт в сети «SITE_NAME» успешно создан по адресу:\nBLOG_URL\n\nВы можете войти в панель управления со следующими координатами:\n\nИмя пользователя: USERNAME\nПароль: PASSWORD\nАдрес для входа: BLOG_URLwp-login.php\n\nМы надеемся, что вам понравится новый сайт. Спасибо!\n\n--Команда сайта «SITE_NAME»', NULL, '', 0, '2021-05-15 11:46:21'),
(1058, 1233, 'ru', 0, NULL, 'Привет, USERNAME!\n\nВаша учётная запись настроена.\n\nВы можете войти, используя эту информацию:\nИмя пользователя: USERNAME\nПароль: PASSWORD\nLOGINLINK\n\nСпасибо!\n\n--Команда сайта «SITE_NAME»', NULL, '', 0, '2021-05-15 11:46:21'),
(1059, 1234, 'ru', 0, NULL, 'Привет!\n\nНачиная с версии 5.2 WordPress может определять возникающие ошибки с плагинами или темой на сайте и присылать вам подобные сообщения автоматически.\n###CAUSE###\nСначала зайдите на ваш сайт (###SITEURL###) и проверьте все видимые проблемы. Далее, зайдите на страницу, на которой возникла ошибка (###PAGEURL###) и проверьте видимые проблемы на ней.\n\n###SUPPORT###\n\nЕсли ваш сайт сломан и вы не сможете нормально войти в консоль, теперь можно использовать специальный "режим восстановления", который позволит безопасно войти в консоль для дальнейших действий.\n\n###LINK###\n\nВ целях безопасности действие этой ссылки истекает через ###EXPIRES###. Но не беспокойтесь, если ошибка возникнет снова по истечении этого времени, то вам будет выслана новая ссылка.\n\nДля решения проблемы вам потребуется следующая информация:\n\n###DEBUG###\n\n###DETAILS###', NULL, '', 0, '2021-05-15 11:46:21'),
(1060, 1235, 'ru', 0, NULL, 'Привет,\n\nБыл получен запрос на следующее действие для вашей учетной записи:\n\n     ###DESCRIPTION###\n\nДля подтверждения этого запроса нажмите на следующую ссылку:\n###CONFIRM_URL###\n\nВы можете проигнорировать и удалить это сообщение,\nесли вы не хотите совершать это действие.\n\nС наилучшими пожеланиями,\nКоманда сайта ###SITENAME###\n###SITEURL###', NULL, '', 0, '2021-05-15 11:46:21'),
(1061, 1236, 'ru', 0, NULL, 'Привет,\n\nЗапрос на действие с персональными данными был подтвержден на ###SITENAME###:\n\nПользователь: ###USER_EMAIL###\nЗапрос: ###DESCRIPTION###\n\nВы можете посмотреть и управлять запросами на этой странице:\n\n###MANAGE_URL###\n\nС наилучшими пожеланиями,\nКоманда сайта ###SITENAME###\n###SITEURL###', NULL, '', 0, '2021-05-15 11:46:21'),
(1062, 1237, 'ru', 0, NULL, 'Привет,\n\nВаш запрос на удаление персональных данных на ###SITENAME### был выполнен.\n\n Если у вас есть какие-либо последующие вопросы или проблемы, свяжитесь с администрацией сайта.\n\nДля подробной информации вы также можете прочитать нашу политику конфиденциальности: ###PRIVACY_POLICY_URL###\n\nС наилучшими пожеланиями,\nКоманда сайта ###SITENAME###\n###SITEURL###', NULL, '', 0, '2021-05-15 11:46:21'),
(1063, 1238, 'ru', 0, NULL, 'Привет,\n\nВаш запрос на удаление персональных данных на ###SITENAME### был выполнен.\n\nЕсли у вас есть какие-либо последующие вопросы или проблемы, свяжитесь с администрацией сайта.\n\nС наилучшими пожеланиями,\nКоманда сайта ###SITENAME###\n###SITEURL###', NULL, '', 0, '2021-05-15 11:46:21'),
