(1075, 1250, 'ru', 0, NULL, 'Id', NULL, '', 0, '2021-05-15 11:46:21'),
(1076, 1251, 'ru', 0, NULL, 'Id должен начинаться с буквы, и содержать только буквы, цифры, тире, точки, запятые или знак подчеркивания.', NULL, '', 0, '2021-05-15 11:46:21'),
(1077, 1252, 'ru', 0, NULL, 'Если произошла ошибка, просто проигнорируйте это письмо, и ничего не произойдёт.', NULL, '', 0, '2021-05-15 11:46:21'),
(1078, 1253, 'ru', 0, NULL, 'Если вы добавите видеоролик, изображение будет использовано как резервный вариант во время загрузки видео.', NULL, '', 0, '2021-05-15 11:46:21'),
(1079, 1254, 'ru', 0, NULL, 'Если вы администратор сети &#8212; убедитесь, что MySQL работает и в таблицах нет ошибок.', NULL, '', 0, '2021-05-15 11:46:21'),
(1080, 1255, 'ru', 0, NULL, 'Если вы не активируете ваш сайт в течение двух дней, вам придётся регистрироваться заново.', NULL, '', 0, '2021-05-15 11:46:21'),
(1081, 1256, 'ru', 0, NULL, 'Если вы не активируете своё имя пользователя в течение двух дней, вам придётся регистрироваться заново.', NULL, '', 0, '2021-05-15 11:46:21'),
(1082, 1257, 'ru', 0, NULL, 'Если вы не знаете, как настроить доступ к базе данных, следует <strong>обратиться к хостинг-провайдеру</strong>. Если проблему так и не удалось решить &#8212; возможно, вам помогут на <a href="%s">форуме поддержки WordPress</a>.', NULL, '', 0, '2021-05-15 11:46:21'),
(1083, 1258, 'ru', 0, NULL, 'Если вы ещё не получили письмо со ссылкой для активации, можно сделать несколько вещей:', NULL, '', 0, '2021-05-15 11:46:21'),
(1084, 1259, 'ru', 0, NULL, 'Если вы хотите вставить текст с форматированием из Microsoft Word, попробуйте отключить этот режим. Редактор автоматически очистит текст, скопированный из Word.', NULL, '', 0, '2021-05-15 11:46:21'),
(1085, 1260, 'ru', 0, NULL, 'Если вы не собираетесь использовать отличный домен, оставьте его для новых пользователей. А теперь приступайте!', NULL, '', 0, '2021-05-15 11:46:21'),
(1086, 1261, 'ru', 0, NULL, 'Если вы по-прежнему видите это сообщение &#8212; убедитесь, что в базе данных содержатся следующие таблицы:', NULL, '', 0, '2021-05-15 11:46:21'),
(1087, 1262, 'ru', 0, NULL, 'Если вы не знаете, что означают эти термины &#8212; возможно, стоит обратиться к хостинг-провайдеру. Если и после этого вам понадобится помощь &#8212; всегда можно посетить <a href="%s">форум поддержки WordPress</a>.', NULL, '', 0, '2021-05-15 11:46:21'),
(1088, 1263, 'ru', 0, NULL, 'Если ваш сайт не отображается, свяжитесь с администратором этой сети.', NULL, '', 0, '2021-05-15 11:46:21'),
(1089, 1264, 'ru', 0, NULL, 'Если ваша тема поддерживает множественные меню, ясные названия помогут вам с управлением ими.', NULL, '', 0, '2021-05-15 11:46:21'),
(1090, 1265, 'ru', 0, NULL, 'Если используемая тема имеет области виджетов, то вы можете также добавить туда меню. Зайдите на <a href="%s">панель управления виджетами</a> и добавьте &#8220;Виджет меню навигации&#8221;, чтобы отображать меню на боковой панели или в подвале.', NULL, '', 0, '2021-05-15 11:46:21'),
