(1116, 1291, 'ru', 0, NULL, 'В скромной деревушке провинции Ламанчи жил идальго, по имени Дон Кехана. Как и всякий дворянин, он гордился своим благородным происхождением, свято хранил древний щит и родовое копье и держал у себя на дворе тощую клячу и борзую собаку. Три четверти его доходов уходили на похлебку из овощей с говядиной да винегрет, который ему подавали на ужин; по пятницам он постился, довольствуясь тарелкой варенной на воде чечевицы, зато по воскресеньям лакомился жареным голубем.', NULL, '', 0, '2021-05-15 11:46:21'),
