(2362, 2537, 'ru', 0, NULL, 'В праздничные дни Дон Кехана надевал кафтан из тонкого сукна, бархатные штаны и сафьяновые туфли, а в будни носил костюм из грубого сукна домашней работы. В доме у него жила экономка, которой перевалило за сорок лет, племянница, которой не было еще двадцати, и старый, дряхлый слуга. Самому идальго было лет под пятьдесят; он был тощ, как скелет, – кожа да кости, но, несмотря на ужасную худобу, отличался большой выносливостью.', NULL, '', 0, '2021-05-15 11:46:22'),
