(2480, 2655, 'ru', 0, NULL, 'Эти предварительные приготовления были улажены, он не хотел больше откладывать исполнение своего замысла, побуждаемый к этому мыслью о том, что весь мир теряет из-за его промедления, видя, какие ошибки, обиды и несправедливости он намеревается исправить, злоупотребления устранить и обязанности исполнить.', NULL, '', 0, '2021-05-15 11:46:22'),
(2481, 2656, 'ru', 0, NULL, 'Итак, вы должны знать, что вышеназванный идальго всякий раз, когда у него было время для досуга (а в основном это был круглый год), предавался чтению рыцарских книг с таким пылом и жадностью, что почти полностью забывал о своих спортивных занятиях и даже об управлении своим имуществом; и до такой степени его рвение и страсть дошли до того, что он продал много акров пахотной земли, чтобы купить рыцарские книги для чтения, и приносил домой столько книг, сколько мог достать.', NULL, '', 0, '2021-05-15 11:46:22'),
(2482, 2657, 'ru', 0, NULL, 'Эта XML-карта сайта создана WordPress для улучшения индексации содержимого сайта в поисковых системах.', NULL, '', 0, '2021-05-15 11:46:22'),
