(2906, 3081, 'ru', 0, NULL, 'Вы создадите меню, назначите место для него, добавите элементы меню, такие как ссылки на страницы и рубрики. Если ваша тема поддерживает несколько областей для меню, возможно вам нужно создать больше чем одно.', NULL, '', 0, '2021-05-15 11:46:22'),
