(2908, 3083, 'ru', 0, NULL, 'Ваша учётная запись активирована. Теперь можно <a href="%1$s">войти</a> на сайт, используя выбранное имя пользователя (%2$s). Пожалуйста, проверьте почтовый ящик %3$s, там будут пароль и инструкции для входа. Если вы не получили письмо, проверьте корзину или папку со спамом. Если в течение часа вы так и не получите письмо, вы можете <a href="%4$s">сбросить ваш пароль</a>.', NULL, '', 0, '2021-05-15 11:46:22'),
(2909, 3084, 'ru', 0, NULL, 'Ваша учётная запись активирована. Можно <a href="%1$s">войти</a> или вернуться на <a href="%2$s">главную страницу</a>.', NULL, '', 0, '2021-05-15 11:46:22'),
(2910, 3085, 'ru', 0, NULL, 'Ваша учётная запись активирована. Можно <a href="%1$s">перейти на ваш сайт</a> или <a href="%2$s">авторизоваться</a>', NULL, '', 0, '2021-05-15 11:46:22'),
(2911, 3086, 'ru', 0, NULL, 'Ваша учётная запись активирована!', NULL, '', 0, '2021-05-15 11:46:22') ;
