(3462, 3637, 'ru', 0, NULL, '<a href="https://ru.wordpress.org/support/forum/multisite/" target="_blank">Форумы поддержки</a>', NULL, '', 0, '2021-05-15 11:46:23'),
(3463, 3638, 'ru', 0, NULL, '<code>_blank</code> &mdash; новое окно или вкладка.', NULL, '', 0, '2021-05-15 11:46:23'),
(3464, 3639, 'ru', 0, NULL, '<code>_none</code> &mdash; то же окно или вкладка.', NULL, '', 0, '2021-05-15 11:46:23'),
(3465, 3640, 'ru', 0, NULL, '<code>_top</code> &mdash; текущее окно или вкладка, без фреймов.', NULL, '', 0, '2021-05-15 11:46:23'),
(3466, 3641, 'ru', 0, NULL, '<strong>%s</strong> &#8212; этот блок позволяет привязать к записи изображение, не вставляя его. Это обычно имеет смысл, если ваша тема оформления выводит миниатюры записей на главной странице, в заголовке и т.д.', NULL, '', 0, '2021-05-15 11:46:23'),
(3467, 3642, 'ru', 0, NULL, '<strong><em>Запомните этот пароль!</em></strong> Он абсолютно <em>случаен</em> и создан специально для вас.', NULL, '', 0, '2021-05-15 11:46:23'),
(3468, 3643, 'ru', 0, NULL, '<strong>Активность</strong> &#8212; показывает запланированные и недавно опубликованные записи, а также самые свежие комментарии с возможностью их модерировать.', NULL, '', 0, '2021-05-15 11:46:23'),
(3469, 3644, 'ru', 0, NULL, '<strong>Совет:</strong> Если вы редактируете тему, используемую в настоящий момент, подумайте о возможном нарушении работоспособности сайта.', NULL, '', 0, '2021-05-15 11:46:23'),
(3470, 3645, 'ru', 0, NULL, '<strong>На виду</strong> &mdash; отображает краткий отчёт о содержимом вашего сайта, включая тему оформления и версию WordPress.', NULL, '', 0, '2021-05-15 11:46:23'),
(3471, 3646, 'ru', 0, NULL, '<strong>Настройки блока</strong> &#8212; нажмите на заголовок блока, чтобы развернуть или свернуть его. Некоторые блоки, добавленные плагинами, могут иметь дополнительные настройки &#8212; при наведении курсора на их заголовок появится ссылка &laquo;Настроить&raquo;.', NULL, '', 0, '2021-05-15 11:46:23'),
(3472, 3647, 'ru', 0, NULL, '<strong>Блок кнопок:</strong> вы сможете выбрать горизонтальный или вертикальный макет, а ещё можно установить ширину кнопки на заданный процент.', NULL, '', 0, '2021-05-15 11:46:23'),
(3473, 3648, 'ru', 0, NULL, '<strong>При нажатии на стрелку справа от любого элемента меню</strong> в редакторе откроется стандартный набор настроек. Дополнительные настройки, такие как цель ссылки, классы CSS, отношение к ссылке и описание, можно включить и выключить на вкладке &laquo;Настройки экрана&raquo;.', NULL, '', 0, '2021-05-15 11:46:23'),
(3474, 3649, 'ru', 0, NULL, '<strong>Комментарии</strong> &mdash; комментарии не удаляются, но данные о пользователе анонимизируются, включая адрес Email, IP, и используемый браузер (User Agent) включая данные об используемой ОС.', NULL, '', 0, '2021-05-15 11:46:23'),
(3475, 3650, 'ru', 0, NULL, '<strong>Комментарии</strong> &mdash; для всех комментариев пользователя, адрес Email, IP, браузер/ОС (User Agent), дата и время, содержимое комментария, ссылка на содержимое.', NULL, '', 0, '2021-05-15 11:46:23'),
(3476, 3651, 'ru', 0, NULL, '<strong>Локальные мероприятия сообщества</strong> &mdash; IP адрес пользователя используемый виджетом локальных мероприятий сообщества в консоли WordPress.', NULL, '', 0, '2021-05-15 11:46:23'),
(3477, 3652, 'ru', 0, NULL, '<strong>Локальные мероприятия сообщества</strong> &mdash; IP адрес пользователя используемый виджетом локальных мероприятий сообщества в консоли WordPress.', NULL, '', 0, '2021-05-15 11:46:23'),
(3478, 3653, 'ru', 0, NULL, '<strong>Совместим</strong> с вашей версией WordPress.', NULL, '', 0, '2021-05-15 11:46:23'),
(3479, 3654, 'ru', 0, NULL, '<strong>Соединение с сервером утеряно.</strong> Сохранение отключено, пока соединение не будет восстановлено.', NULL, '', 0, '2021-05-15 11:46:23'),
(3480, 3655, 'ru', 0, NULL, '<strong>Удалить</strong> вызывает экран с подтверждением, где можно навсегда удалить с сайта как самого пользователя, так и созданные им записи. Можно также удалить сразу нескольких пользователей с помощью меню Действия.', NULL, '', 0, '2021-05-15 11:46:23'),
(3481, 3656, 'ru', 0, NULL, '<strong>Описание</strong> &#8212; по умолчанию не отображается, однако некоторые темы могут его показывать.', NULL, '', 0, '2021-05-15 11:46:23'),
(3482, 3657, 'ru', 0, NULL, '<strong>Обсуждение</strong> &#8212; можно включить или выключить комментарии и уведомления. Если к вашей записи есть комментарии, здесь можно читать и проверять их.', NULL, '', 0, '2021-05-15 11:46:23'),
(3483, 3658, 'ru', 0, NULL, '<strong>Перетаскивание</strong> &#8212; чтобы перегруппировать блоки, сделайте щелчок на заголовке выбранного блока, начните перетаскивать его и отпустите, когда увидите прямоугольник с пунктирной рамкой на том месте, куда вы хотите поместить блок.', NULL, '', 0, '2021-05-15 11:46:23'),
(3484, 3659, 'ru', 0, NULL, '<strong>Перетащите</strong> ваши файлы в специальную область ниже. Можно перетащить сразу несколько файлов.', NULL, '', 0, '2021-05-15 11:46:23'),
(3485, 3660, 'ru', 0, NULL, '<strong>Редактировать</strong> открывает экран редактирования профиля пользователя. Туда также можно попасть, нажав на имя пользователя.', NULL, '', 0, '2021-05-15 11:46:23'),
(3486, 3661, 'ru', 0, NULL, '<strong>&laquo;Редактировать&raquo;</strong> &#8212; открывает экран редактирования этой записи. Туда также можно попасть, нажав на заголовок записи.', NULL, '', 0, '2021-05-15 11:46:23'),
(3487, 3662, 'ru', 0, NULL, '<strong>Ошибка:</strong> Этот плагин <strong>требует более новой версии PHP</strong>.', NULL, '', 0, '2021-05-15 11:46:23'),
(3488, 3663, 'ru', 0, NULL, '<strong>Ошибка:</strong> Этот плагин <strong>требует более новой версии WordPress</strong>.', NULL, '', 0, '2021-05-15 11:46:23'),
(3489, 3664, 'ru', 0, NULL, '<strong>ОШИБКА</strong>: Префикс таблиц может содержать только числа, буквы и символы подчёркивания.', NULL, '', 0, '2021-05-15 11:46:23'),
(3490, 3665, 'ru', 0, NULL, '<strong>ОШИБКА</strong>: Некорректный префикс таблиц.', NULL, '', 0, '2021-05-15 11:46:23'),
(3491, 3666, 'ru', 0, NULL, '<strong>ОШИБКА</strong>: Префикс таблиц не может быть пустым.', NULL, '', 0, '2021-05-15 11:46:23'),
(3492, 3667, 'ru', 0, NULL, '<strong>ОШИБКА:</strong> Не удалось подключиться к серверу. Пожалуйста, убедитесь, что параметры верны.', NULL, '', 0, '2021-05-15 11:46:23'),
(3493, 3668, 'ru', 0, NULL, '<strong>Ошибка</strong>: Страница опций %s не найдена в белом списке.', NULL, '', 0, '2021-05-15 11:46:23'),
(3494, 3669, 'ru', 0, NULL, '<strong>Ошибка</strong>: Пароли не совпадают. Введите одинаковые пароли в оба поля.', NULL, '', 0, '2021-05-15 11:46:23'),
(3495, 3670, 'ru', 0, NULL, '<strong>ОШИБКА</strong>: Пароль не должен содержать символ "\\".', NULL, '', 0, '2021-05-15 11:46:23'),
(3496, 3671, 'ru', 0, NULL, '<strong>ОШИБКА</strong>: Пожалуйста, введите ник.', NULL, '', 0, '2021-05-15 11:46:23'),
(3497, 3672, 'ru', 0, NULL, '<strong>ОШИБКА</strong>: Пожалуйста, введите пароль.', NULL, '', 0, '2021-05-15 11:46:23'),
(3498, 3673, 'ru', 0, NULL, '<strong>ОШИБКА</strong>: Пожалуйста, введите адрес e-mail.', NULL, '', 0, '2021-05-15 11:46:23'),
(3499, 3674, 'ru', 0, NULL, '<strong>Изменение размеров шрифта в разных местах:</strong> теперь элементы управления размером шрифта находятся именно там, где они вам нужны, в блоках «Список» и «Код». Больше не нужно переходить к другому экрану, чтобы внести это единственное изменение!', NULL, '', 0, '2021-05-15 11:46:23'),
(3500, 3675, 'ru', 0, NULL, '<strong>Формат</strong> &mdash; Формат записи определяет то, как тема оформления будет отображать определённую запись, к примеру, вы можете иметь запись <em>стандартная</em> с заголовком и параграфами или короткую <em>заметку</em> без заголовка и с небольшим количеством текста. Ваша тема может включать все или несколько из доступных 10 форматов. <a href="https://wordpress.org/support/article/post-formats/#supported-formats">Узнайте больше о каждом формате записи</a>.', NULL, '', 0, '2021-05-15 11:46:23'),
(3501, 3676, 'ru', 0, NULL, '<strong>Выравнивание на полную высоту:</strong> вы когда-нибудь хотели, чтобы блок, например блок обложки, заполнял все окно? Теперь вы можете это сделать.', NULL, '', 0, '2021-05-15 11:46:23'),
(3502, 3677, 'ru', 0, NULL, '<strong>Важно:</strong> Перед обновлением <a href="%1$s">создайте резервную копию вашей базы данных и файлов</a>. Для помощи с обновлениями посетите страницу документации по <a href="%2$s">обновлениям WordPress</a>.', NULL, '', 0, '2021-05-15 11:46:23'),
(3503, 3678, 'ru', 0, NULL, '<strong>Несовместим</strong> с вашей версией WordPress.', NULL, '', 0, '2021-05-15 11:46:23'),
(3504, 3679, 'ru', 0, NULL, '<strong>Информация</strong> &mdash;  URL сайта не должно часто редактироваться, так как это может создать проблемы с корректной работой сайта. Показаны дата регистрации и последнего обновления. Администраторы сети могут пометить сайт как скрытый, спам, удаленный или "для взрослых", для удаления его из открытых списков или отключения.', NULL, '', 0, '2021-05-15 11:46:23'),
(3505, 3680, 'ru', 0, NULL, '<strong>Вставка перетаскиванием</strong>: перетаскивайте блоки и паттерны блоков из панели вставки прямо в запись.', NULL, '', 0, '2021-05-15 11:46:23'),
(3506, 3681, 'ru', 0, NULL, '<strong>Медиафайлы</strong> &mdash; список URL медиафайлов загруженных пользователем.', NULL, '', 0, '2021-05-15 11:46:23'),
(3507, 3682, 'ru', 0, NULL, '<strong>Название</strong> &#8212; определяет, как элемент будет отображаться на вашем сайте.', NULL, '', 0, '2021-05-15 11:46:23'),
(3508, 3683, 'ru', 0, NULL, '<strong>Заметка: Этот инструмент только собирает данные WordPress и соместимых с ним плагинов, так что возможно вам потребуется сделать больше для обеспечения запросов по удалению данных. Вам также потребуется обеспечить удаление данных собранных или хранимых третьей стороной, если вы используете их сервисы в вашем бизнесе или на сайте.</strong>', NULL, '', 0, '2021-05-15 11:46:23'),
(3509, 3684, 'ru', 0, NULL, '<strong>Заметка: Этот инструмент только собирает данные WordPress и соместимых с ним плагинов, так что возможно вам потребуется сделать больше для обеспечения запросов экспорта данных. Вам также потребуется обеспечить экспорт данных собранных или хранимых третьей стороной, если вы используете их сервисы в вашем бизнесе или на сайте.</strong>', NULL, '', 0, '2021-05-15 11:46:23'),
(3510, 3685, 'ru', 0, NULL, '<strong>Порядок</strong> &#8212; страницы обычно сортируются по алфавиту, но вы можете задать свой собственный порядок, введя число (1 &#8212 первая и т.д.) в это поле.', NULL, '', 0, '2021-05-15 11:46:23'),
(3511, 3686, 'ru', 0, NULL, '<strong>Родительская</strong> &#8212; рубрики, в отличие от меток, могут иметь иерархию. Например, вы можете завести рубрику &laquo;Джаз&raquo;, внутри которой будут дочерние рубрики &laquo;Бибоп&raquo; и &laquo;Биг-бэнды&raquo;. Полностью произвольно. Чтобы создать подрубрику, просто выберите другую рубрику в списке &laquo;Родительская&raquo;.', NULL, '', 0, '2021-05-15 11:46:23'),
(3512, 3687, 'ru', 0, NULL, '<strong>Родительская</strong> &#8212; вы можете организовать иерархию страниц. Например, создать страницу &laquo;Обо мне&raquo;, внутри которой будут страницы &laquo;Биография&raquo; и &laquo;Моя собака&raquo;. По уровню вложенности нет никаких ограничений.', NULL, '', 0, '2021-05-15 11:46:23'),
(3513, 3688, 'ru', 0, NULL, '<strong>Обратите внимание:</strong> Все изменения, сделанные вами в файлах тем, будут утеряны. Для изменения можно создавать <a href="%s">дочерние темы</a>.', NULL, '', 0, '2021-05-15 11:46:23'),
(3514, 3689, 'ru', 0, NULL, '<strong>Редактор записи</strong> &#8212; введите текст вашей записи. Есть два режима редактирования: визуальный и текстовый. Переключаться между ними можно нажатием на соответствующую вкладку.', NULL, '', 0, '2021-05-15 11:46:23') ;
INSERT INTO `wp_icl_string_translations` ( `id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES
(3515, 3690, 'ru', 0, NULL, '<strong>&laquo;Просмотреть&raquo;</strong> &#8212; показывает, как будет выглядеть ваш черновик после публикации. &laquo;Перейти&raquo; &#8212; открывает запись на внешней части сайта. Какая из этих двух ссылок будет отображаться, зависит от статуса записи.', NULL, '', 0, '2021-05-15 11:46:23'),
(3516, 3691, 'ru', 0, NULL, '<strong>Информация профиля</strong> &mdash; адрес Email, имя пользователя, отображаемое имя пользователя, ник, имя, фамилия, описание/биография и дата регистрации.', NULL, '', 0, '2021-05-15 11:46:23'),
(3517, 3692, 'ru', 0, NULL, '<strong>Опубликовать</strong> &#8212; можно задать условия публикации записи в блоке &laquo;Опубликовать&raquo;. Чтобы посмотреть дополнительные варианты для разделов &laquo;Статус&raquo;, &laquo;Видимость&raquo; и &laquo;Опубликовать (сразу)&raquo;, нажмите ссылку &laquo;Изменить&raquo; рядом с ними. В разделе &laquo;Видимость&raquo; можно защитить запись паролем или постоянно отображать её наверху (прилепить). С помощью пункта &laquo;Защищено паролем&raquo; можно задать пароль для просмотра записи. Пункт &laquo;Личное&raquo; скрывает запись от всех, кроме редакторов и администраторов. Раздел &laquo;Опубликовать (сразу)&raquo; позволяет установить дату в будущем или прошлом, так что вы можете запланировать запись или опубликовать её задним числом.', NULL, '', 0, '2021-05-15 11:46:23'),
(3518, 3693, 'ru', 0, NULL, '<strong>Быстрый черновик</strong> &#8212; позволяет создать новую запись и сохранить её как черновик. Также выводит 3 последних черновика, созданных вами.', NULL, '', 0, '2021-05-15 11:46:23'),
(3519, 3694, 'ru', 0, NULL, '<strong>&laquo;Свойства&raquo;</strong> &#8212; предоставляет быстрый доступ к метаданным записи, позволяя изменять настройки записи прямо на этом экране.', NULL, '', 0, '2021-05-15 11:46:23'),
(3520, 3695, 'ru', 0, NULL, '<strong>Случайно:</strong> Показывать разные изображения на каждой странице.', NULL, '', 0, '2021-05-15 11:46:23'),
(3521, 3696, 'ru', 0, NULL, '<strong>Удалить</strong> позволяет удалить пользователя с сайта. Его записи останутся нетронутыми. Можно также удалить сразу нескольких пользователей с помощью меню Действия.', NULL, '', 0, '2021-05-15 11:46:23'),
(3522, 3697, 'ru', 0, NULL, '<strong>Мои блоки:</strong> несколько улучшений сделали их более стабильными и простыми в использовании. И теперь они автоматически сохраняются вместе с записью, когда вы нажимаете кнопку «Обновить».', NULL, '', 0, '2021-05-15 11:46:23'),
(3523, 3698, 'ru', 0, NULL, '<strong>Настройки экрана</strong> &#8212; используйте вкладку &laquo;Настройки экрана&raquo;, чтобы выбрать нужные блоки.', NULL, '', 0, '2021-05-15 11:46:23'),
(3524, 3699, 'ru', 0, NULL, '<strong>Отправить обратные ссылки</strong> &#8212; способ уведомить блоги на устаревших платформах, что вы сослались на них. Введите адреса, на которые вы хотите отправить обратные ссылки. Если вы ссылаетесь на блог под управлением WordPress &#8212; уведомление будет отправлено ему автоматически, заполнять это поле не требуется.', NULL, '', 0, '2021-05-15 11:46:23'),
(3525, 3700, 'ru', 0, NULL, '<strong>Данные сессии</strong> &mdash; данные о входе пользователя, IP, время ичтечения сессии, тип браузера и ОС (User Agent), время последнего входа.', NULL, '', 0, '2021-05-15 11:46:23'),
(3526, 3701, 'ru', 0, NULL, '<strong>Настройки</strong> &mdash; Эта страница показывает список всех настроек относящихся к этому сайту, некоторые были созданы WordPress, другие же созданы плагинами активированными вами. Обратите внимение на то, что некоторые поля затенены и содержат сериализованные данные, вы не можете напрямую изменять эти значения из за способа сохранения их в базе данных.', NULL, '', 0, '2021-05-15 11:46:23'),
(3527, 3702, 'ru', 0, NULL, '<strong>Состояние здоровья сайта</strong> &mdash; сообщает о потенциальных проблемах, которые стоит решить для улучшения производительности и безопасности вашего сайта.', NULL, '', 0, '2021-05-15 11:46:23'),
(3528, 3703, 'ru', 0, NULL, '<strong>Ярлык</strong> &#8212; вариант названия, подходящий для URL. Обычно содержит только латинские буквы в нижнем регистре, цифры и дефисы.', NULL, '', 0, '2021-05-15 11:46:23'),
(3529, 3704, 'ru', 0, NULL, '<strong>Блок значков социальных сетей:</strong> теперь можно изменять размер значков.', NULL, '', 0, '2021-05-15 11:46:23'),
(3530, 3705, 'ru', 0, NULL, '<strong>Шаблон</strong> &#8212; в некоторых темах для определённых страниц могут быть особые шаблоны с дополнительными функциями или другим дизайном. Вы увидите их в этом списке.', NULL, '', 0, '2021-05-15 11:46:23'),
(3531, 3706, 'ru', 0, NULL, '<strong>Не удалось найти родительскую тему.</strong> Чтобы использовать эту дочернюю тему, нужно сначала установить родительскую тему %s.', NULL, '', 0, '2021-05-15 11:46:23'),
(3532, 3707, 'ru', 0, NULL, '<strong>Темы и плагины</strong> &mdash; чтобы обновить отдельные темы и плагины, отметьте их галочками, затем <strong>нажмите на соответствующую кнопку &laquo;Обновить&raquo;</strong>. Чтобы обновить все темы или плагины сразу, перед нажатием на кнопку поставьте галочку в верхней части таблицы, чтобы выбрать все элементы.', NULL, '', 0, '2021-05-15 11:46:23'),
(3533, 3708, 'ru', 0, NULL, '<strong>Темы</strong> &mdash; Эта область показывает темы, которые не были разрешены для сети. Включение темы в этом меню сделает ее доступной для этого сайта, это не активирует тему, но сделает ее доступной в меню сайта "Внешний вид". Для включения темы для всей сети смотрите экран <a href="%s">Темы сети</a>,', NULL, '', 0, '2021-05-15 11:46:23'),
(3534, 3709, 'ru', 0, NULL, '<strong>Заголовок</strong> &#8212; введите заголовок вашей записи. После этого под ним появится постоянная ссылка, которую можно изменить.', NULL, '', 0, '2021-05-15 11:46:23'),
(3535, 3710, 'ru', 0, NULL, '<strong>Переводы</strong> &mdash; файлы перевода WordPress для вашего языка обновляются вместе с другими файлами. Но если они устарели, вы можете <strong>нажать кнопку &laquo;Обновить переводы&raquo;</strong>.', NULL, '', 0, '2021-05-15 11:46:23'),
(3536, 3711, 'ru', 0, NULL, '<strong>&laquo;Удалить&raquo;</strong> &#8212; убирает запись из этого списка и помещает её в корзину, откуда можно удалить её навсегда.', NULL, '', 0, '2021-05-15 11:46:23'),
(3537, 3712, 'ru', 0, NULL, '<strong>Пользователи</strong> &mdash; Тут показаны пользователи ассоциированные с сайтом. Вы также можете изменить им роль, сбросить пароль или удалить их с сайта. Удаление пользователя с сайта не удаляет их их сети.', NULL, '', 0, '2021-05-15 11:46:23'),
(3538, 3713, 'ru', 0, NULL, 'В <strong>версии %1$s</strong> исправлена %2$s ошибка.', NULL, '', 0, '2021-05-15 11:46:23'),
(3539, 3714, 'ru', 0, NULL, 'В <strong>версии %1$s</strong> исправлены %2$s ошибки.', NULL, '', 0, '2021-05-15 11:46:23'),
(3540, 3715, 'ru', 0, NULL, 'В <strong>версии %1$s</strong> решена проблема с безопасностью и исправлена %2$s ошибка.', NULL, '', 0, '2021-05-15 11:46:23'),
(3541, 3716, 'ru', 0, NULL, 'В <strong>версии %1$s</strong> решена проблема с безопасностью и исправлены %2$s ошибки.', NULL, '', 0, '2021-05-15 11:46:23'),
(3542, 3717, 'ru', 0, NULL, 'В <strong>версии %1$s</strong> решены несколько проблем с безопасностью и исправлена %2$s ошибка.', NULL, '', 0, '2021-05-15 11:46:23'),
(3543, 3718, 'ru', 0, NULL, 'В <strong>версии %1$s</strong> решены несколько проблем с безопасностью и исправлены %2$s ошибки.', NULL, '', 0, '2021-05-15 11:46:23'),
(3544, 3719, 'ru', 0, NULL, 'В <strong>версии %s</strong> решена проблема с безопасностью.', NULL, '', 0, '2021-05-15 11:46:23'),
(3545, 3720, 'ru', 0, NULL, 'В <strong>версии %s</strong> решены несколько проблем с безопасностью.', NULL, '', 0, '2021-05-15 11:46:23'),
(3546, 3721, 'ru', 0, NULL, '<strong>Предупреждение:</strong> Изменять код активных плагинов не рекомендуется.', NULL, '', 0, '2021-05-15 11:46:23'),
(3547, 3722, 'ru', 0, NULL, '<strong>Внимание:</strong> Этот плагин <strong>не был протестирован</strong> с вашей версией WordPress.', NULL, '', 0, '2021-05-15 11:46:23'),
(3548, 3723, 'ru', 0, NULL, '<strong>Предупреждение:</strong> эти страницы не должны совпадать со страницей политики конфиденциальности!', NULL, '', 0, '2021-05-15 11:46:23'),
(3549, 3724, 'ru', 0, NULL, '<strong>Внимание:</strong> Эти страницы не должны быть одинаковыми!', NULL, '', 0, '2021-05-15 11:46:23'),
(3550, 3725, 'ru', 0, NULL, '<strong>Добро пожаловать</strong> &#8212; отображает ссылки на задачи, наиболее часто выполняемые при создании нового сайта.', NULL, '', 0, '2021-05-15 11:46:23'),
(3551, 3726, 'ru', 0, NULL, '<strong>Новости и мероприятия WordPress</strong> &mdash; Предстоящие мероприятия рядом с вами, а также свежие новости официального проекта WordPress и <a href="%s">WordPress Planet</a>.', NULL, '', 0, '2021-05-15 11:46:23'),
(3552, 3727, 'ru', 0, NULL, '<strong>WordPress</strong> &mdash; обновить WordPress очень просто; достаточно <strong>нажать на кнопку &laquo;Обновить сейчас&raquo;</strong>, когда будет доступна новая версия.', NULL, '', 0, '2021-05-15 11:46:23'),
(3553, 3728, 'ru', 0, NULL, '<a href="%s">Статическую страницу</a> (выберите ниже)', NULL, '', 0, '2021-05-15 11:46:23'),
(3554, 3729, 'ru', 0, NULL, 'Сессия PHP была создана вызовом функции %1$s. Это препятствует работе REST API и петлевых запросов. Сессия должна быть закрыта функцией %2$s перед выполнением любых HTTP-запросов.', NULL, '', 0, '2021-05-15 11:46:23'),
(3555, 3730, 'ru', 0, NULL, 'Упрощённая цветовая палитра по умолчанию', NULL, '', 0, '2021-05-15 11:46:23'),
(3556, 3731, 'ru', 0, NULL, 'Автор комментария', NULL, '', 0, '2021-05-15 11:46:23'),
(3557, 3732, 'ru', 0, NULL, 'Комментарий ожидает проверки', NULL, '', 0, '2021-05-15 11:46:23'),
(3558, 3733, 'ru', 0, NULL, 'Доступно новое незначительное обновление версии WordPress для вашего сайта. Часто незначительные обновления версии решают проблемы безопасности, поэтому это очень важно устанавливать их.', NULL, '', 0, '2021-05-15 11:46:23'),
(3559, 3734, 'ru', 0, NULL, 'Доступна новая версия WordPress.', NULL, '', 0, '2021-05-15 11:46:23'),
(3560, 3735, 'ru', 0, NULL, 'Ссылка для сброса пароля отправлена пользователю %s.', NULL, '', 0, '2021-05-15 11:46:23'),
(3561, 3736, 'ru', 0, NULL, 'Плагин предотвращает обновления отключением %s.', NULL, '', 0, '2021-05-15 11:46:23'),
