(3642, 3817, 'ru', 0, NULL, 'Всё в порядке! Вы успешно прошли эту часть установки. WordPress теперь может подключиться к вашей базе данных. Если вы готовы, пришло время&hellip;', NULL, '', 0, '2021-05-15 11:46:23'),
