(3645, 3820, 'ru', 0, NULL, 'Все загруженные вами файлы перечислены в библиотеке файлов, где самые свежие идут впереди.', NULL, '', 0, '2021-05-15 11:46:23'),
(3646, 3821, 'ru', 0, NULL, 'Все загруженные вами файлы перечислены в библиотеке файлов, где самые свежие идут впереди. Чтобы настроить отображение этого экрана, можно использовать вкладку &laquo;Настройки экрана&raquo;.', NULL, '', 0, '2021-05-15 11:46:23'),
