(3658, 3833, 'ru', 0, NULL, 'Вы также можете просматривать избранные, популярные и свежие темы. Если вы нашли тему, которая вам понравилась, её можно просмотреть или установить.', NULL, '', 0, '2021-05-15 11:46:23'),
(3659, 3834, 'ru', 0, NULL, 'Всегда использовать https при посещении панели администрирования', NULL, '', 0, '2021-05-15 11:46:23'),
(3660, 3835, 'ru', 0, NULL, 'Американский английский', NULL, '', 0, '2021-05-15 11:46:23'),
(3661, 3836, 'ru', 0, NULL, 'Использование подключения по HTTPS - более безопасный способ просмотра сети. Многие службы сегодня обязательно требуют HTTPS. Протокол HTTPS также позволяет использовать преимущества, которые могут ускорить работу сайта, улучшить ранжирование в поисковых системах и улучшить доверие посетителей, помогая им защитить их конфиденциальность в сети.', NULL, '', 0, '2021-05-15 11:46:23'),
(3662, 3837, 'ru', 0, NULL, 'Обнаружена активная PHP сессия', NULL, '', 0, '2021-05-15 11:46:23'),
(3663, 3838, 'ru', 0, NULL, 'Анонимизированная строка создаваемая из вашего адреса email ("хеш") может предоставляться сервису Gravatar, чтобы определить используете ли вы его. Политика конфиденциальности Gravatar доступна здесь: https://automattic.com/privacy/ . После одобрения комментария ваше изображение профиля будет видимым публично в контексте вашего комментария.', NULL, '', 0, '2021-05-15 11:46:23'),
(3664, 3839, 'ru', 0, NULL, 'Приложение запрашивает подключение к вашей учётной записи.', NULL, '', 0, '2021-05-15 11:46:23'),
(3665, 3840, 'ru', 0, NULL, 'Автоматическое обновление WordPress завершить не удалось &#8212; <a href="%s">пожалуйста, попробуйте ещё раз</a>.', NULL, '', 0, '2021-05-15 11:46:23'),
(3666, 3841, 'ru', 0, NULL, 'Автоматическое обновление WordPress завершить не удалось! Пожалуйста, сообщите администратору сайта.', NULL, '', 0, '2021-05-15 11:46:23'),
(3667, 3842, 'ru', 0, NULL, 'Аватар &#8212; это изображение рядом с вашим именем, помогающее опознать ваш комментарий на сайтах, поддерживающих эту функцию. Здесь вы можете настроить отображение аватаров для посетителей, оставляющих комментарии на вашем сайте.', NULL, '', 0, '2021-05-15 11:46:23'),
(3668, 3843, 'ru', 0, NULL, 'При обновлении %1$s произошла ошибка: %2$s', NULL, '', 0, '2021-05-15 11:46:23'),
(3669, 3844, 'ru', 0, NULL, 'Произошла ошибка. Пожалуйста, попробуйте снова.', NULL, '', 0, '2021-05-15 11:46:23'),
