(3677, 3852, 'ru', 0, NULL, 'Шаблон загруженного приложения', NULL, '', 0, '2021-05-15 11:46:23'),
(3678, 3853, 'ru', 0, NULL, 'Пароли приложений', NULL, '', 0, '2021-05-15 11:46:23'),
(3679, 3854, 'ru', 0, NULL, 'Пароли приложений позволяют авторизацию для неинтерактивных систем, таких как XML-RPC или REST API, без необходимости указывать ваш настоящий пароль. Пароли приложений могут быть легко отозваны, их нельзя использовать для обычного входа на ваш сайт.', NULL, '', 0, '2021-05-15 11:46:23'),
(3680, 3855, 'ru', 0, NULL, 'Пароли приложения предоставляют доступ к <a href="%1$s">%2$s блогу для которого у вас есть доступ в этой установке WordPress</a>.', NULL, '', 0, '2021-05-15 11:46:23'),
(3681, 3856, 'ru', 0, NULL, 'Пароли приложения предоставляют доступ к <a href="%1$s">%2$s блогам для которых у вас есть доступ в этой установке WordPress</a>.', NULL, '', 0, '2021-05-15 11:46:23'),
