(3689, 3864, 'ru', 0, NULL, 'Вы уверены, что хотите удалить эти файлы и данные?', NULL, '', 0, '2021-05-15 11:46:23'),
(3690, 3865, 'ru', 0, NULL, 'Вы уверены, что хотите удалить эти файлы?', NULL, '', 0, '2021-05-15 11:46:23'),
(3691, 3866, 'ru', 0, NULL, 'Вы уверены, что хотите удалить эту тему?\n\n«Отмена» — вернуться, «OK» — удалить.', NULL, '', 0, '2021-05-15 11:46:23'),
(3692, 3867, 'ru', 0, NULL, 'Статьи на этом сайте могут включать встраиваемое содержимое (например видео, изображения, статьи и др.), подобное содержимое ведет себя так же, как если бы посетитель зашел на другой сайт.', NULL, '', 0, '2021-05-15 11:46:23'),
(3693, 3868, 'ru', 0, NULL, 'Перейдите <a href="%s">в консоль</a>, чтобы удалить эту страницу и создать новые. Успехов!', NULL, '', 0, '2021-05-15 11:46:23'),
(3694, 3869, 'ru', 0, NULL, 'Как владелец вебсайта, вы должны соблюдать национальные или международные законы о конфиденциальности персональных данных. К примеру, вам может потребоваться создать и показывать посетителям страницу политики конфиденциальности.', NULL, '', 0, '2021-05-15 11:46:23'),
