(3724, 3899, 'ru', 0, NULL, 'Автоматические обновления', NULL, '', 0, '2021-05-15 11:46:23'),
(3725, 3900, 'ru', 0, NULL, 'Автоматические обновления отключены <span class="count">(%s)</span>', NULL, '', 0, '2021-05-15 11:46:23'),
(3726, 3901, 'ru', 0, NULL, 'Автоматические обновления включены <span class="count">(%s)</span>', NULL, '', 0, '2021-05-15 11:46:23'),
(3727, 3902, 'ru', 0, NULL, 'Автоматические обновления доступны только для плагинов известных в каталоге WordPress.org или включающих совместимую систему обновлений.', NULL, '', 0, '2021-05-15 11:46:23'),
(3728, 3903, 'ru', 0, NULL, 'Автообновления могут быть включены или отключены для значительных выпусков WordPress и каждого отдельного плагина или темы. Плагины или темы с включенным автообновлением будут отображать приблизительную дату следующего автообновления. Автообновления зависят от системы планирования задач WP-Cron.', NULL, '', 0, '2021-05-15 11:46:23'),
(3729, 3904, 'ru', 0, NULL, 'Автообновления могут быть включены или отключены для каждого отдельного плагина. Плагины с включенным автообновлением будут отображать приблизительную дату следующего автообновления. Автообновления зависят от системы планирования задач WP-Cron.', NULL, '', 0, '2021-05-15 11:46:23'),
(3730, 3905, 'ru', 0, NULL, 'Автообновления могут быть включены или отключены для каждой отдельной темы. Темы с включенным автообновлением будут отображать приблизительную дату следующего автообновления. Автообновления зависят от системы планирования задач WP-Cron.', NULL, '', 0, '2021-05-15 11:46:23'),
(3731, 3906, 'ru', 0, NULL, 'Автоматические обновления отключены', NULL, '', 0, '2021-05-15 11:46:23'),
(3732, 3907, 'ru', 0, NULL, 'Автоматические обновления включены', NULL, '', 0, '2021-05-15 11:46:23'),
(3733, 3908, 'ru', 0, NULL, 'Автоматические обновления для плагинов и тем отключены, это не позволит вашему сайту автоматически перейти на новые версии при их доступности.', NULL, '', 0, '2021-05-15 11:46:23'),
(3734, 3909, 'ru', 0, NULL, 'Автоматические обновления для плагинов и/или тем похоже отключены, но настройки все ещё позволяют отображение. Это приведет к тому, что автоматические обновления не будут работать как должны.', NULL, '', 0, '2021-05-15 11:46:23'),
(3735, 3910, 'ru', 0, NULL, 'Автоматическое обновление для плагинов было отключено. Ваш сайт не будет автоматически обновлять их до новой версии.', NULL, '', 0, '2021-05-15 11:46:23'),
(3736, 3911, 'ru', 0, NULL, 'Автоматическое обновление для тем было отключено. Ваш сайт не будет автоматически обновлять их до новой версии.', NULL, '', 0, '2021-05-15 11:46:23'),
