(3751, 3926, 'ru', 0, NULL, 'ТЕСТИРУЕТЕ БЕТА-ВЕРСИЮ?\n=======================\n\nЭто сообщение приходит тем, кто использует версию WordPress в разработке.\n\nЕсли вы считаете, что эти проблемы могут быть вызваны ошибкой в WordPress --\nпожалуйста, сообщите о ней.\n * Создайте тему на форуме поддержки: https://ru.wordpress.org/support/forum/alphabeta/\n * Или напишите в багтрекер: https://core.trac.wordpress.org/\n\nСпасибо! -- Команда WordPress', NULL, '', 0, '2021-05-15 11:46:23'),
(3752, 3927, 'ru', 0, NULL, 'Повторять', NULL, '', 0, '2021-05-15 11:46:23'),
