(3754, 3929, 'ru', 0, NULL, 'Фон обновлён. <a href="%s">Перейдите на сайт</a>, чтобы посмотреть, как он выглядит.', NULL, '', 0, '2021-05-15 11:46:23'),
(3755, 3930, 'ru', 0, NULL, 'Фоновые обновления', NULL, '', 0, '2021-05-15 11:46:23'),
