(3758, 3933, 'ru', 0, NULL, 'Фоновые обновления используются для автоматических обновлений безопасности WordPress в рамках одной ветки значительных выпусков.', NULL, '', 0, '2021-05-15 11:46:23'),
(3759, 3934, 'ru', 0, NULL, 'Фоновые обновления могут работать некорректно', NULL, '', 0, '2021-05-15 11:46:23'),
(3760, 3935, 'ru', 0, NULL, 'Обязательно сохраните его в безопасном месте. Вы не сможете снова получить его.', NULL, '', 0, '2021-05-15 11:46:23'),
(3761, 3936, 'ru', 0, NULL, 'Поскольку это сеть сайтов, можно добавлять существующие в ней учётные записи, указав имя пользователя или e-mail и выбрав роль. Чтобы иметь больше возможностей &#8212; например, назначать пароль &#8212; нужно быть администратором сети и использовать ссылку для редактирования профиля пользователя, которая появляется под его именем в разделе &laquo;Управление сетью&raquo; &rarr; &laquo;Все пользователи&raquo;.', NULL, '', 0, '2021-05-15 11:46:23'),
(3762, 3937, 'ru', 0, NULL, 'Перед появлением комментария', NULL, '', 0, '2021-05-15 11:46:23'),
