(3765, 3940, 'ru', 0, NULL, 'Для начала выберите тему в выпадающем меню и нажмите кнопку &laquo;Выбрать&raquo;. Появится список шаблонов темы. Нажмите на имя любого файла, чтобы загрузить его в редактор.', NULL, '', 0, '2021-05-15 11:46:23'),
(3766, 3941, 'ru', 0, NULL, 'Введите здесь информацию о подключении к базе данных. Если вы в ней не уверены, свяжитесь с хостинг-провайдером.', NULL, '', 0, '2021-05-15 11:46:23'),
