(3786, 3961, 'ru', 0, NULL, 'Автор: %s.', NULL, '', 0, '2021-05-15 11:46:23'),
(3787, 3962, 'ru', 0, NULL, 'WordPress самостоятельно не собирает никаких аналитических данных. Тем не менее, многие хостинги совершают сбор анонимных данных. Вы также могли установить плагин предоставляющий возможности веб-аналитики. В таком случае добавьте информацию из этого плагина сюда.', NULL, '', 0, '2021-05-15 11:46:23'),
(3788, 3963, 'ru', 0, NULL, 'По умолчанию WordPress не собирает никаких персональных данных о посетителях, кроме указанных на странице профиля пользователя для зарегистрированных пользователей. Впрочем, некоторые ваши плагины могут собирать персональные данные и другую информацию. Вам следует добавить эту информацию ниже.', NULL, '', 0, '2021-05-15 11:46:23'),
(3789, 3964, 'ru', 0, NULL, 'По умолчанию, WordPress не делится никакими персональными данными.', NULL, '', 0, '2021-05-15 11:46:23'),
(3790, 3965, 'ru', 0, NULL, 'WordPress не имеет своей формы контактов. Если вы используете плагин контактной формы, используйте этот раздел для указания какие данные собираются при заполнении формы контактов и как долго вы будете хранить их. К примеру, вам можно указать, что вы будете сохранять данные от форм в течение какого-то периода с целью предоставления обслуживания клиенту, но вы не будете использовать эти данные с целью  маркетинга.', NULL, '', 0, '2021-05-15 11:46:23'),
(3791, 3966, 'ru', 0, NULL, 'По умолчанию новые пользователи получают письмо с уведомлением, что их добавили на этот сайт. В этом письме также содержится ссылка для сброса пароля. Снимите галочку, если вы не хотите отправлять новому пользователю приветственное письмо.', NULL, '', 0, '2021-05-15 11:46:23'),
(3792, 3967, 'ru', 0, NULL, 'Классы CSS (необязательно)', NULL, '', 0, '2021-05-15 11:46:23'),
