(3802, 3977, 'ru', 0, NULL, 'Возможности', NULL, '', 0, '2021-05-15 11:46:23'),
(3803, 3978, 'ru', 0, NULL, 'Конвертер рубрик и меток', NULL, '', 0, '2021-05-15 11:46:23'),
(3804, 3979, 'ru', 0, NULL, 'Рубрики можно выборочно преобразовать в метки с помощью <a href="%s">конвертера рубрик в метки</a>.', NULL, '', 0, '2021-05-15 11:46:23'),
(3805, 3980, 'ru', 0, NULL, 'Рубрики удалены.', NULL, '', 0, '2021-05-15 11:46:23'),
(3806, 3981, 'ru', 0, NULL, 'У рубрик есть иерархия, т.е. они могут быть вложенными и содержать подрубрики. У меток иерархии нет, и вложенными они быть не могут. Иногда владельцы сайтов начинают использовать один вариант, но затем понимают, что для их содержимого другой подошёл бы лучше.', NULL, '', 0, '2021-05-15 11:46:23'),
(3807, 3982, 'ru', 0, NULL, 'Рубрики, в отличие от меток, могут иметь иерархию. Например, вы можете завести рубрику &laquo;Джаз&raquo;, внутри которой будут дочерние рубрики &laquo;Бибоп&raquo; и &laquo;Биг-бэнды&raquo;. Полностью произвольно.', NULL, '', 0, '2021-05-15 11:46:23'),
