(3945, 4120, 'ru', 0, NULL, 'Создание страницы очень похоже на создание записи &#8212; экран можно таким же образом настраивать при помощи перетаскивания, вкладки &laquo;Настройки экрана&raquo; и сворачивания/разворачивания блоков. На этом экране также есть удобный полноэкранный режим, доступный как в визуальном, так и в текстовом редакторе по специальной кнопке. Редактор страниц работает так же, как и редактор записей, однако в блоке &laquo;Атрибуты страницы&raquo; есть несколько элементов, присущих только страницам.', NULL, '', 0, '2021-05-15 11:46:23'),
