(4187, 4362, 'ru', 0, NULL, 'Общий регламент по защите данных ЕС требует защиты передаваемых за пределы ЕС данных о европейских резидентах по тем же стандартам как и в ЕС. Так в дополнение к перечислению того, куда передаются данные, вам нужно указать как соблюдаются стандарты вами или третьей стороной, по соглашению типа "Privacy Shield", оговоркам в контрактам или обязывающим корпоративным правилам.', NULL, '', 0, '2021-05-15 11:46:23'),
(4188, 4363, 'ru', 0, NULL, 'https://ru.wordpress.org/news/', NULL, '', 0, '2021-05-15 11:46:23'),
(4189, 4364, 'ru', 0, NULL, 'Каждый плагин и тема в каталоге WordPress.org на 100%% соответствуют GPL или аналогичной свободной лицензии, поэтому <a href="%1$s">плагины</a> и <a href="%2$s">темы</a> оттуда можно использовать без опасений. Если вы получили плагин или тему из другого источника, первым делом <a href="%3$s">поинтересуйтесь, соответствуют ли они лицензии GPL</a>. Если они несовместимы с лицензией WordPress, мы не рекомендуем их использовать.', NULL, '', 0, '2021-05-15 11:46:23'),
