(4285, 4460, 'ru', 0, NULL, 'При редактировании PHP-файлов можно использовать выпадающее меню &laquo;Документация&raquo; для выбора функций, содержащихся в файле. Кнопка &laquo;Поиск&raquo; ведёт на веб-страницу с информацией об этой функции.', NULL, '', 0, '2021-05-15 11:46:23'),
(4286, 4461, 'ru', 0, NULL, 'Для каждой статьи в RSS-ленте отображать', NULL, '', 0, '2021-05-15 11:46:23'),
(4287, 4462, 'ru', 0, NULL, 'При работе с изображениями можно нажать кнопку &laquo;Редактировать&raquo; под миниатюрой, чтобы открыть встроенный редактор изображений, поддерживающий обрезку, поворот и отражение картинки, а также отмену и повтор. Блоки справа дают вам больше возможностей не только для масштабирования и обрезки основного изображения, но и для отдельной обработки миниатюры. Можно нажать ссылку &laquo;Помощь&raquo; в этих блоках, чтобы получить дополнительную информацию.', NULL, '', 0, '2021-05-15 11:46:23'),
(4288, 4463, 'ru', 0, NULL, 'Дополнительную информацию можно найти в <a href="%s">заметке о выпуске</a>.', NULL, '', 0, '2021-05-15 11:46:23'),
(4289, 4464, 'ru', 0, NULL, 'Дополнительная информация:', NULL, '', 0, '2021-05-15 11:46:23'),
(4290, 4465, 'ru', 0, NULL, 'Подробности о версии %s можно узнать на экране "О WordPress":', NULL, '', 0, '2021-05-15 11:46:23'),
(4291, 4466, 'ru', 0, NULL, 'Большинство тем в качестве текста заголовка отображают название и краткое описание сайта, заданные в разделе <a href="%s">&laquo;Общие настройки&raquo;</a>.', NULL, '', 0, '2021-05-15 11:46:23'),
(4292, 4467, 'ru', 0, NULL, 'По причинам производительности и безопасности рекомендуется использовать %1$s версии %2$s или новее. Обратитесь в поддержку вашего хостинга для исправления ситуации.', NULL, '', 0, '2021-05-15 11:46:23'),
(4293, 4468, 'ru', 0, NULL, 'Для пользователей с регистрацией на нашем сайте мы храним ту личную информацию, которую они указывают в своем профиле. Все пользователи могут видеть, редактировать или удалить свою информацию из профиля в любое время (кроме имени пользователя). Администрация вебсайта также может видеть и изменять эту информацию.', NULL, '', 0, '2021-05-15 11:46:23'),
(4294, 4469, 'ru', 0, NULL, 'Для пользователей, не имеющих своего аватара, можно показывать либо стандартное изображение, либо созданное автоматически на основе их e-mail.', NULL, '', 0, '2021-05-15 11:46:23'),
(4295, 4470, 'ru', 0, NULL, 'В течение многих лет jQuery помогал перемещать объекты на экране так, как не могли бы базовые инструменты, но это меняется, как и jQuery.', NULL, '', 0, '2021-05-15 11:46:23'),
