(4365, 4540, 'ru', 0, NULL, 'Здесь можно найти информацию об обновлениях, установленных параметрах автоматического обновления и увидеть какие плагины или темы требуют обновлений.', NULL, '', 0, '2021-05-15 11:46:23'),
(4366, 4541, 'ru', 0, NULL, 'Привет! Днём я курьер, а вечером &#8212; подающий надежды актёр. Это мой блог. Я живу в Ростове-на-Дону, люблю своего пса Джека и пинаколаду. (И ещё попадать под дождь.)', NULL, '', 0, '2021-05-15 11:46:23'),
(4367, 4542, 'ru', 0, NULL, 'Привет,\n\nВас пригласили присоединиться к сайту «%1$s»\nв сети «%2$s» с ролью %3$s.\nПерейдите по ссылке, чтобы принять приглашение:\n%4$s', NULL, '', 0, '2021-05-15 11:46:23'),
(4368, 4543, 'ru', 0, NULL, 'Привет,\nВас пригласили присоединиться к сайту «%1$s»\nв сети «%2$s» с ролью %3$s.\nЕсли вы не хотите присоединяться к этому сайту, проигнорируйте\nэто письмо. Приглашение действительно в течение нескольких дней.\n\nПерейдите по ссылке, чтобы активировать вашу учётную запись:\n%%s', NULL, '', 0, '2021-05-15 11:46:23'),
(4369, 4544, 'ru', 0, NULL, 'Привет! Это комментарий.\nЧтобы начать модерировать, редактировать и удалять комментарии, перейдите на экран «Комментарии» в консоли.\nАватары авторов комментариев загружаются с сервиса <a href="https://ru.gravatar.com">Gravatar</a>.', NULL, '', 0, '2021-05-15 11:46:23'),
(4370, 4545, 'ru', 0, NULL, 'Скрыть', NULL, '', 0, '2021-05-15 11:46:23'),
(4371, 4546, 'ru', 0, NULL, 'Спрятать скрытые обновления', NULL, '', 0, '2021-05-15 11:46:23'),
(4372, 4547, 'ru', 0, NULL, 'Скрыть это обновление', NULL, '', 0, '2021-05-15 11:46:23'),
(4373, 4548, 'ru', 0, NULL, 'Поставить комментарий в очередь на модерацию, если он содержит более %s ссылок. (Характерная особенность спама &#8212; большое число ссылок.)', NULL, '', 0, '2021-05-15 11:46:23'),
(4374, 4549, 'ru', 0, NULL, 'Праздник', NULL, '', 0, '2021-05-15 11:46:23'),
(4375, 4550, 'ru', 0, NULL, 'Адрес WordPress', NULL, '', 0, '2021-05-15 11:46:23'),
(4376, 4551, 'ru', 0, NULL, 'Главная страница: %s', NULL, '', 0, '2021-05-15 11:46:23'),
(4377, 4552, 'ru', 0, NULL, 'Сервер', NULL, '', 0, '2021-05-15 11:46:23'),
(4378, 4553, 'ru', 0, NULL, 'Навести курсор на тему или &laquo;тапнуть&raquo;, чтобы увидеть кнопки &laquo;Активировать&raquo; и &laquo;Просмотреть&raquo;.', NULL, '', 0, '2021-05-15 11:46:23'),
(4379, 4554, 'ru', 0, NULL, 'При наведении курсора на строку в списке записей появятся ссылки, позволяющие управлять записью. Вы можете выполнить следующие действия:', NULL, '', 0, '2021-05-15 11:46:23'),
(4380, 4555, 'ru', 0, NULL, 'При наведении курсора на строку в списке пользователей появятся ссылки, позволяющие управлять пользователями. Вы можете выполнить следующие действия:', NULL, '', 0, '2021-05-15 11:46:23'),
(4381, 4556, 'ru', 0, NULL, 'При наведении курсора на строку таблицы появляются ссылки: &laquo;Изменить&raquo;, &laquo;Удалить навсегда&raquo; и &laquo;Перейти&raquo;. Нажав на &laquo;Изменить&raquo; или на имя файла, можно открыть окно для редактирования метаданных этого файла. Нажав &laquo;Удалить навсегда&raquo;, можно удалить файл из библиотеки (и всех записей, к которым он прикреплён). Ссылка &laquo;Перейти&raquo; ведёт на страницу, отображающую этот файл.', NULL, '', 0, '2021-05-15 11:46:23'),
(4382, 4557, 'ru', 0, NULL, 'Как долго мы храним ваши данные', NULL, '', 0, '2021-05-15 11:46:23'),
(4383, 4558, 'ru', 0, NULL, 'Как обновиться', NULL, '', 0, '2021-05-15 11:46:23'),
(4384, 4559, 'ru', 0, NULL, 'Как мы защищаем ваши данные', NULL, '', 0, '2021-05-15 11:46:23'),
(4385, 4560, 'ru', 0, NULL, 'Добро пожаловать', NULL, '', 0, '2021-05-15 11:46:23'),
(4386, 4561, 'ru', 0, NULL, 'Привет, ###USERNAME###!\n\nНедавно вы нажали ссылку «Удалить сайт» на вашем сайте\nи заполнили соответствующую форму.\n\nЕсли вы действительно хотите удалить сайт, нажмите на ссылку ниже.\nДругого запроса на подтверждение не будет, поэтому вы должны быть\nабсолютно уверены в своём решении:\n###URL_DELETE###\n\nЕсли вы удалите сайт, пожалуйста, подумайте о том, чтобы открыть новый\nкогда-нибудь в будущем! (Но помните, что ваш нынешний сайт и имя пользователя\nбудут навсегда утрачены.)\n\nСпасибо за использование этого сайта,\nВебмастер\n###SITENAME###\n###SITEURL###', NULL, '', 0, '2021-05-15 11:46:23'),
(4387, 4562, 'ru', 0, NULL, 'Привет, ###USERNAME###!\n\nНедавно вы запросили смену электронного адреса администратора\nна вашем сайте.\n\nЕсли это так, перейдите по следующей ссылке, чтобы изменить его:\n###ADMIN_URL###\n\nЕсли вы не хотите этого делать, просто проигнорируйте\nи удалите это письмо.\n\nЭто письмо было отправлено на ###EMAIL###\n\nУспехов,\nКоманда сайта «###SITENAME###»\n###SITEURL###', NULL, '', 0, '2021-05-15 11:46:23'),
(4388, 4563, 'ru', 0, NULL, 'Привет! Обновление плагинов и тем на вашем сайте (%s) не удалось.', NULL, '', 0, '2021-05-15 11:46:23'),
(4389, 4564, 'ru', 0, NULL, 'Привет! Обновление плагинов на вашем сайте (%s) не удалось.', NULL, '', 0, '2021-05-15 11:46:23'),
(4390, 4565, 'ru', 0, NULL, 'Привет! Некоторые плагины и темы были автоматически обновлены до их последней версии на вашем сайте %s. С вашей стороны действий не требуется.', NULL, '', 0, '2021-05-15 11:46:23'),
(4391, 4566, 'ru', 0, NULL, 'Привет! Некоторые плагины были автоматически обновлены до их последней версии на вашем сайте %s. С вашей стороны действий не требуется.', NULL, '', 0, '2021-05-15 11:46:23'),
(4392, 4567, 'ru', 0, NULL, 'Привет! Некоторые темы были автоматически обновлены до их последней версии на вашем сайте %s. С вашей стороны действий не требуется.', NULL, '', 0, '2021-05-15 11:46:23'),
(4393, 4568, 'ru', 0, NULL, 'Привет! Обновление тем на вашем сайте (%s) не удалось.', NULL, '', 0, '2021-05-15 11:46:23'),
(4394, 4569, 'ru', 0, NULL, 'Привет! Ваш сайт %1$s был автоматически обновлён до WordPress %2$s.', NULL, '', 0, '2021-05-15 11:46:23'),
(4395, 4570, 'ru', 0, NULL, 'Привет,\n\nВаш запрос на экспорт персональных данных завершен.\nВы можете скачать ваши данные нажав на ссылку ниже.\nВ целях безопасности и конфиденциальности данные будут удалены после ###EXPIRATION###,\nпожалуйста, успейте скачать их до этого времени.\n\n###LINK###\n\nС наилучшими пожеланиями,\nКоманда сайта ###SITENAME###\n###SITEURL###', NULL, '', 0, '2021-05-15 11:46:23'),
(4396, 4571, 'ru', 0, NULL, 'Тем не менее, это на вашей ответственности использовать эти ресурсы правильно, предоставлять требуемую вашей политикой конфиденциальности информацию и сохранять ее актуальной и точной.', NULL, '', 0, '2021-05-15 11:46:23'),
(4397, 4572, 'ru', 0, NULL, 'Похоже, что адрес WordPress сайта установлен константой PHP и не может быть обновлен. Вам потребуется отредактировать %1$s и удалить или обновить определения для %2$s и %3$s.', NULL, '', 0, '2021-05-15 11:46:23'),
(4398, 4573, 'ru', 0, NULL, 'Я понимаю', NULL, '', 0, '2021-05-15 11:46:23'),
(4399, 4574, 'ru', 0, NULL, 'Я уверен(а), что хочу навсегда отключить свой сайт, и осознаю, что никогда не смогу вернуть его или использовать %s снова.', NULL, '', 0, '2021-05-15 11:46:23'),
(4400, 4575, 'ru', 0, NULL, 'ID #%1$s: %2$s', NULL, '', 0, '2021-05-15 11:46:23'),
(4401, 4576, 'ru', 0, NULL, 'ID #%1$s: %2$s <strong>Извините, Вам не разрешено удалить этого пользователя.</strong>', NULL, '', 0, '2021-05-15 11:46:23'),
(4402, 4577, 'ru', 0, NULL, 'ID #%1$s: %2$s <strong>Текущий пользователь не будет удалён.</strong>', NULL, '', 0, '2021-05-15 11:46:23'),
(4403, 4578, 'ru', 0, NULL, 'Identicon (Автоматически)', NULL, '', 0, '2021-05-15 11:46:23'),
(4404, 4579, 'ru', 0, NULL, 'Если медиафайл не прикреплён ни к одной записи, вы увидите это в столбце &laquo;Используется&raquo; и сможете нажать на ссылку &laquo;Прикрепить&raquo;, чтобы открыть небольшое всплывающее окно, в котором можно найти нужную запись и прикрепить к ней файл.', NULL, '', 0, '2021-05-15 11:46:23'),
(4405, 4580, 'ru', 0, NULL, 'Когда появится обновление, вы увидите уведомление в верхней панели и в меню слева.', NULL, '', 0, '2021-05-15 11:46:23'),
(4406, 4581, 'ru', 0, NULL, 'Если нужно, WordPress будет автоматически уведомлять различные сервисы о ваших новых записях.', NULL, '', 0, '2021-05-15 11:46:23'),
(4407, 4582, 'ru', 0, NULL, 'Если по какой-то причине автоматическое создание файла не удалось, не волнуйтесь. Всё это предназначено лишь для заполнения файла настроек. Вы можете просто открыть %1$s в текстовом редакторе, внести вашу информацию и сохранить его под именем %2$s.', NULL, '', 0, '2021-05-15 11:46:23'),
(4408, 4583, 'ru', 0, NULL, 'Если с плагином что-то пойдёт не так, и вы не сможете использовать WordPress &#8212; удалите или переименуйте файл в директории %s, и плагин будет автоматически деактивирован.', NULL, '', 0, '2021-05-15 11:46:23'),
(4409, 4584, 'ru', 0, NULL, 'Если нужного вам скрипта нет в списке, <a href="%s">поищите его в каталоге плагинов</a>.', NULL, '', 0, '2021-05-15 11:46:23'),
(4410, 4585, 'ru', 0, NULL, 'Если ссылка ведёт на человека, с помощью этой формы вы можете указать ваши отношения. За дополнительной информацией обращайтесь к <a href="http://gmpg.org/xfn/">XFN</a>.', NULL, '', 0, '2021-05-15 11:46:23'),
(4411, 4586, 'ru', 0, NULL, 'Если бы корневая директория вашего сайта была <a href="%1$s">доступна для записи</a>, мы могли бы выполнить следующий шаг автоматически, но это не так. Вот правило преобразования ссылок, которое должно быть в файле %2$s. Создайте новый файл с именем %2$s в корневой директории вашего сайта. Кликните на поле и нажмите %3$s, чтобы выделить весь текст. Затем вставьте этот код в файл %2$s.', NULL, '', 0, '2021-05-15 11:46:23'),
(4412, 4587, 'ru', 0, NULL, 'Если вам абсолютно нужно внести прямые правки в этот плагин, используйте файловый менеджер для создания копии под новым именем перед изменением оригинала. Таким способом вы сможете снова включить функциональную версию, если что-то пойдет не так. ', NULL, '', 0, '2021-05-15 11:46:23'),
(4413, 4588, 'ru', 0, NULL, 'Если у вас уже есть страница политики конфиденциальности, выберите ее ниже, если же нет, то создайте её.', NULL, '', 0, '2021-05-15 11:46:23'),
(4414, 4589, 'ru', 0, NULL, 'Если вы являетесь членом регулируемой отрасли или субъектом дополнительных законов по конфиденциальности, возможно вам стоит включить эту информацию здесь.', NULL, '', 0, '2021-05-15 11:46:23'),
(4415, 4590, 'ru', 0, NULL, 'Если вы ищете страницу управления ссылками, установите плагин <a href="%s">Link Manager</a>.', NULL, '', 0, '2021-05-15 11:46:23'),
(4416, 4591, 'ru', 0, NULL, 'Вы можете просмотреть документацию плагина или спросить автора плагина про собираемые им данные и поддержку инструмента удаления данных. Эта информация может быть доступна в <a href="%s">руководстве по политикам конфиденциальности</a>.', NULL, '', 0, '2021-05-15 11:46:23'),
(4417, 4592, 'ru', 0, NULL, 'Вы можете просмотреть документацию плагина или спросить автора плагина про собираемые им данные и поддержку инструмента экспорта данных. Эта информация может быть доступна в <a href="%s">руководстве по политикам конфиденциальности</a>.', NULL, '', 0, '2021-05-15 11:46:23'),
(4418, 4593, 'ru', 0, NULL, 'При изменении вам будет выслано письмо на ваш новый адрес для подтверждения. <strong>Новый адрес не будет активирован до его подтверждения.</strong>', NULL, '', 0, '2021-05-15 11:46:23') ;
INSERT INTO `wp_icl_string_translations` ( `id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES
(4419, 4594, 'ru', 0, NULL, 'Если вы все же решили продолжить прямое редактирование, используйте файловый менеджер для создания копии под новым именем перед изменением оригинала. Таким способом вы сможете снова включить функциональную версию, если что-то пойдет не так.', NULL, '', 0, '2021-05-15 11:46:23'),
(4420, 4595, 'ru', 0, NULL, 'Если вы удалите ссылку, она будет удалена навсегда, потому что корзины для ссылок пока нет.', NULL, '', 0, '2021-05-15 11:46:23'),
(4421, 4596, 'ru', 0, NULL, 'Если вы не помните координаты, можно узнать их в службе поддержки вашего хостинг-провайдера.', NULL, '', 0, '2021-05-15 11:46:23'),
(4422, 4597, 'ru', 0, NULL, 'Если вы не хотите использовать ваш сайт %s, вы можете удалить его с помощью этой формы. Когда вы нажмёте <strong>Удалить мой сайт навсегда</strong>, мы отправим вам письмо со ссылкой. Перейдите по ней, чтобы удалить сайт.', NULL, '', 0, '2021-05-15 11:46:23'),
(4423, 4598, 'ru', 0, NULL, 'Если вы вообще не хотите выводить на сайте изображение в качестве заголовка, нажмите кнопку &laquo;Удалить изображение заголовка&raquo; в нижней части раздела &laquo;Изображение заголовка&raquo;. Если позже вы захотите вернуть его, просто выберите один из предложенных вариантов и нажмите &laquo;Сохранить изменения&raquo;.', NULL, '', 0, '2021-05-15 11:46:23'),
(4424, 4599, 'ru', 0, NULL, 'Если вы не хотите загружать собственное изображение, можно использовать одну из этих классных картинок или выводить их в случайном порядке.', NULL, '', 0, '2021-05-15 11:46:23'),
(4425, 4600, 'ru', 0, NULL, 'При редактировании или публикации статьи в браузере будет сохранен дополнительный куки, он не содержит персональных данных и содержит только ID записи отредактированной вами, истекает через 1 день.', NULL, '', 0, '2021-05-15 11:46:23'),
(4426, 4601, 'ru', 0, NULL, 'Если вы столкнётесь с проблемами и вам понадобится поддержка, вам помогут волонтёры на форумах WordPress.org.', NULL, '', 0, '2021-05-15 11:46:23'),
(4427, 4602, 'ru', 0, NULL, 'Если у вас есть архив плагина в формате .zip, здесь можно загрузить и установить или обновить его.', NULL, '', 0, '2021-05-15 11:46:23'),
(4428, 4603, 'ru', 0, NULL, 'Если у вас есть архив темы в формате .zip, здесь можно загрузить и установить или обновить её.', NULL, '', 0, '2021-05-15 11:46:23'),
(4429, 4604, 'ru', 0, NULL, 'При наличии учетной записи на сайте или если вы оставляли комментарии, то вы можете запросить файл экспорта персональных данных, которые мы сохранили о вас, включая предоставленные вами данные. Вы также можете запросить удаление этих данных, это не включает данные, которые мы обязаны хранить в административных целях, по закону или целях безопасности.', NULL, '', 0, '2021-05-15 11:46:23'),
(4430, 4605, 'ru', 0, NULL, 'Если вы добавили плагины на WordPress.org в список любимых, здесь вы можете их просмотреть.', NULL, '', 0, '2021-05-15 11:46:23'),
(4431, 4606, 'ru', 0, NULL, 'Если вы добавили темы на WordPress.org в список любимых, здесь вы можете их просмотреть.', NULL, '', 0, '2021-05-15 11:46:23'),
(4432, 4607, 'ru', 0, NULL, 'Если у вас есть записи и комментарии в другой системе, WordPress может импортировать их на этот сайт. Для начала выберите систему из списка:', NULL, '', 0, '2021-05-15 11:46:23'),
(4433, 4608, 'ru', 0, NULL, 'Если у вас пока нет ни одного меню, <strong>нажмите ссылку &laquo;создать новое меню&raquo;</strong>.', NULL, '', 0, '2021-05-15 11:46:23'),
(4434, 4609, 'ru', 0, NULL, 'Если вы просто хотите получить представление, можно просматривать избранные и популярные плагины, используя ссылки над списком. Эти разделы регулярно обновляются.', NULL, '', 0, '2021-05-15 11:46:23'),
(4435, 4610, 'ru', 0, NULL, 'Если вы знаете, что ищете, стоит воспользоваться поиском. В блоке &laquo;Поиск&raquo; можно искать плагины из каталога WordPress по определённому ключевому слову, автору или метке. Можно также выполнять поиск по каталогу, выбирая популярные метки. Более крупный шрифт метки означает, что эта метка была присвоена большему числу плагинов.', NULL, '', 0, '2021-05-15 11:46:23'),
(4436, 4611, 'ru', 0, NULL, 'Если вы оставляете комментарий на нашем сайте, вы можете включить сохранение вашего имени, адреса email и вебсайта в куки. Это делается для вашего удобства, чтобы не заполнять данные снова при повторном комментировании. Эти куки хранятся в течение одного года.', NULL, '', 0, '2021-05-15 11:46:23'),
(4437, 4612, 'ru', 0, NULL, 'Если вы оставляете комментарий, то сам комментарий и его метаданные сохраняются неопределенно долго. Это делается для того, чтобы определять и одобрять последующие комментарии автоматически, вместо помещения их в очередь на одобрение.', NULL, '', 0, '2021-05-15 11:46:23'),
(4438, 4613, 'ru', 0, NULL, 'Если хотите, можно добавить произвольные префиксы для URL-адресов рубрик и меток. Например, <code>/topics/</code> сделает ссылки на рубрики такими: <code>%s/topics/uncategorized/</code>. Если оставить поля пустыми, будут использованы значения по умолчанию.', NULL, '', 0, '2021-05-15 11:46:23'),
(4439, 4614, 'ru', 0, NULL, 'Если вам потребуется изменить больше, чем только CSS темы, то вы можете попробовать создать <a href="%s">дочернюю тему</a>.', NULL, '', 0, '2021-05-15 11:46:23'),
(4440, 4615, 'ru', 0, NULL, 'Если возникнет ошибка &#8220;headers already sent&#8221; с RSS-лентами или иные проблемы, то попробуйте деактивировать или удалить этот плагин.', NULL, '', 0, '2021-05-15 11:46:23'),
(4441, 4616, 'ru', 0, NULL, 'Если вы выберете любой вариант, кроме &laquo;Простые&raquo;, в поле &laquo;Произвольная структура&raquo; также появится путь с элементами структуры, окружёнными символами %s, где можно будет сделать дополнительные изменения.', NULL, '', 0, '2021-05-15 11:46:23'),
(4442, 4617, 'ru', 0, NULL, 'Если вы обратитесь к нам, мы также позаботимся о том, чтобы эта проблема больше никогда не возникала.', NULL, '', 0, '2021-05-15 11:46:23'),
(4443, 4618, 'ru', 0, NULL, 'Если вы попали на этот экран по ошибке и хотите открыть один из своих собственных сайтов, можно воспользоваться приведёнными ниже ссылками.', NULL, '', 0, '2021-05-15 11:46:23'),
(4444, 4619, 'ru', 0, NULL, 'Если вы запросите сброс пароля, ваш IP будет указан в email-сообщении о сбросе.', NULL, '', 0, '2021-05-15 11:46:23'),
(4445, 4620, 'ru', 0, NULL, 'Если вы временно сделали файл %s доступным для записи, чтобы мы могли автоматически создать правила преобразования ссылок, не забудьте вернуть исходные права доступа после того, как правила будут сохранены.', NULL, '', 0, '2021-05-15 11:46:23'),
(4446, 4621, 'ru', 0, NULL, 'Если вы временно сделали корневую директорию сайта доступной для записи, чтобы мы могли автоматически создать файл %s, не забудьте вернуть исходные права доступа после того, как правила будут сохранены.', NULL, '', 0, '2021-05-15 11:46:23'),
(4447, 4622, 'ru', 0, NULL, 'Если вы зарегистрированный пользователь и загружаете фотографии на сайт, вам возможно следует избегать загрузки изображений с метаданными EXIF, так как они могут содержать данные вашего месторасположения по GPS. Посетители могут извлечь эту информацию скачав изображения с сайта.', NULL, '', 0, '2021-05-15 11:46:23'),
(4448, 4623, 'ru', 0, NULL, 'Если вы используете ваш сайт в коммерческих целях и совершаете более сложный сбор или обработку персональных данных, то вам дополнительно нужно указать следующую информацию в уведомлении о конфиденциальности.', NULL, '', 0, '2021-05-15 11:46:23'),
(4449, 4624, 'ru', 0, NULL, 'Если у вас есть учетная запись на сайте и вы войдете в неё, мы установим временный куки для определения поддержки куки вашим браузером, куки не содержит никакой личной информации и удаляется при закрытии вашего браузера.', NULL, '', 0, '2021-05-15 11:46:23'),
(4450, 4625, 'ru', 0, NULL, 'Если вы хотите, чтобы посетители сайта могли зарегистрироваться сами, без участия администратора, поставьте галочку &laquo;Членство&raquo;. Для всех новых пользователей, зарегистрированных самостоятельно или администратором, можно задать роль по умолчанию.', NULL, '', 0, '2021-05-15 11:46:23'),
(4451, 4626, 'ru', 0, NULL, 'Если вы хотите преобразовать рубрики в метки (или наоборот), используйте <a href="%s">конвертер рубрик и меток</a> на экране &laquo;Импорт&raquo;.', NULL, '', 0, '2021-05-15 11:46:23'),
(4452, 4627, 'ru', 0, NULL, 'Если вам нужно экспортировать информацию с этой страницы, вы можете воспользоваться кнопкой ниже для копирования её в буфер обмена. Вы можете вставить ее в текстовый файл и сохранить на диск или, например, отправить в сообщении сотрудникам поддержки или разработчикам темы или плагина.', NULL, '', 0, '2021-05-15 11:46:23'),
(4453, 4628, 'ru', 0, NULL, 'Если вы хотите установить плагин, скачанный в другом месте, нажмите кнопку &laquo;Загрузить плагин&raquo; над списком плагинов. Вам предложат загрузить архив .zip, после чего вы сможете активировать новый плагин.', NULL, '', 0, '2021-05-15 11:46:23'),
(4454, 4629, 'ru', 0, NULL, 'Если вы хотите внести изменения, но не хотите, чтобы они были перезаписаны при обновлении плагина &#8212; возможно, вы готовы написать свой собственный плагин. Информацию о том, как редактировать плагины и писать собственные, а также просто о том, как они устроены, можно найти по ссылкам ниже.', NULL, '', 0, '2021-05-15 11:46:23'),
(4455, 4630, 'ru', 0, NULL, 'Если вы хотите удалить виджет, но сохранить его настройки на случай использования в будущем, просто перетащите его на панель &laquo;Неактивные виджеты&raquo;. Оттуда в любое время можно добавить их обратно. Особенно это может пригодиться, если вы переключаетесь на тему с меньшим количеством областей для виджетов или другими областями.', NULL, '', 0, '2021-05-15 11:46:23'),
(4456, 4631, 'ru', 0, NULL, 'Если вы хотите запустить несколько копий WordPress в одной базе, измените это значение.', NULL, '', 0, '2021-05-15 11:46:23'),
(4457, 4632, 'ru', 0, NULL, 'Если вы хотели бы расширить выбор плагинов, нажмите на кнопку &#8220;Добавить новый&#8221;, и вы сможете посмотреть или найти дополнительные плагины в <a href="%s">каталоге WordPress</a>. Плагины в каталоге WordPress создаются третьими лицами и совместимы с лицензией WordPress. Да, и они бесплатны!', NULL, '', 0, '2021-05-15 11:46:23'),
(4458, 4633, 'ru', 0, NULL, 'Если вы хотели бы расширить выбор тем, нажмите на кнопку &#8220;Добавить новую&#8221;, и вы сможете посмотреть или найти дополнительные темы в <a href="%s">каталоге WordPress</a>. Темы в каталоге WordPress создаются третьими лицами и совместимы с лицензией WordPress. Да, и они бесплатны!', NULL, '', 0, '2021-05-15 11:46:23'),
(4459, 4634, 'ru', 0, NULL, 'Если бы ваш файл %1$s был <a href="%2$s">доступен для записи</a>, мы могли бы выполнить следующий шаг автоматически, но это не так. Вот правила mod_rewrite, которые должны быть в файле %1$s. Кликните на поле и нажмите %3$s, чтобы выделить весь текст.', NULL, '', 0, '2021-05-15 11:46:23'),
(4460, 4635, 'ru', 0, NULL, 'Если бы ваш файл %1$s был <a href="%2$s">доступен для записи</a>, мы могли бы выполнить следующий шаг автоматически, но это не так. Вот правило преобразования ссылок, которое должно быть в файле %1$s. Кликните на поле и нажмите %3$s, чтобы выделить весь текст. Затем вставьте это правило внутрь элемента %4$s в файле %1$s.', NULL, '', 0, '2021-05-15 11:46:23'),
(4461, 4636, 'ru', 0, NULL, 'Если в вашей теме более одного изображения заголовка по умолчанию, либо если вы сами загрузили более одного изображения заголовка, у вас есть возможность настроить WordPress для отображения случайного изображения на каждой странице сайта. Выберите вариант &laquo;Случайно&raquo; в разделе &laquo;Загруженные изображения&raquo; или &laquo;Изображения по умолчанию&raquo;.', NULL, '', 0, '2021-05-15 11:46:23'),
(4462, 4637, 'ru', 0, NULL, 'Если ваш сайт предоставляет услуги, включающие автоматическое принятие решений, к примеру возможность клиенту получить кредит или сбор данных для рекламного профиля, то вам нужно указать, что подобное имеет место быть, как используется информация, какие решения принимаются на основе собраных данных и какие права пользователь имеет по принимаемым без вмешательства человека решениям.', NULL, '', 0, '2021-05-15 11:46:23'),
(4463, 4638, 'ru', 0, NULL, 'Если ваш сайт получает данные о пользователях от третьей стороны, включая рекламодателей, эта информация должна быть включена в раздел уведомления о конфиденциальности по обработке данных третьей стороны.', NULL, '', 0, '2021-05-15 11:46:23'),
