(4479, 4654, 'ru', 0, NULL, 'Размеры изображений', NULL, '', 0, '2021-05-15 11:46:23'),
(4480, 4655, 'ru', 0, NULL, 'Номер версии ImageMagick', NULL, '', 0, '2021-05-15 11:46:23'),
(4481, 4656, 'ru', 0, NULL, 'Строка версии ImageMagick', NULL, '', 0, '2021-05-15 11:46:23'),
(4482, 4657, 'ru', 0, NULL, 'Изображения размером <strong>%1$d &times; %2$d пикселей</strong> будут использованы без изменения.', NULL, '', 0, '2021-05-15 11:46:23'),
(4483, 4658, 'ru', 0, NULL, 'Изображения должны быть не меньше %s в высоту.', NULL, '', 0, '2021-05-15 11:46:23'),
(4484, 4659, 'ru', 0, NULL, 'Изображения должны быть не меньше %s в ширину.', NULL, '', 0, '2021-05-15 11:46:23'),
(4485, 4660, 'ru', 0, NULL, 'Imagick лимиты ресурсов', NULL, '', 0, '2021-05-15 11:46:23'),
(4486, 4661, 'ru', 0, NULL, 'Импорт', NULL, '', 0, '2021-05-15 11:46:23'),
(4487, 4662, 'ru', 0, NULL, 'Импорт записей и медиафайлов из Tumblr с помощью их API.', NULL, '', 0, '2021-05-15 11:46:23'),
(4488, 4663, 'ru', 0, NULL, 'Импорт записей и комментариев из Movable Type или TypePad.', NULL, '', 0, '2021-05-15 11:46:23'),
(4489, 4664, 'ru', 0, NULL, 'Импорт записей из LiveJournal с помощью их API.', NULL, '', 0, '2021-05-15 11:46:23'),
(4490, 4665, 'ru', 0, NULL, 'Импорт записей из RSS-ленты.', NULL, '', 0, '2021-05-15 11:46:23'),
(4491, 4666, 'ru', 0, NULL, 'Импорт записей, комментариев и пользователей из Blogger.', NULL, '', 0, '2021-05-15 11:46:23'),
(4492, 4667, 'ru', 0, NULL, 'Импорт записей, страниц, комментариев, произвольных полей, рубрик и меток из файла экспорта WordPress.', NULL, '', 0, '2021-05-15 11:46:23'),
(4493, 4668, 'ru', 0, NULL, 'Важно:', NULL, '', 0, '2021-05-15 11:46:23'),
(4494, 4669, 'ru', 0, NULL, 'С версией 5.7 jQuery будет более сфокусированным и менее навязчивым, с меньшим количеством сообщений в консоли.', NULL, '', 0, '2021-05-15 11:46:23'),
(4495, 4670, 'ru', 0, NULL, 'Объясните в нескольких словах, о чём этот сайт.', NULL, '', 0, '2021-05-15 11:46:23'),
(4496, 4671, 'ru', 0, NULL, 'В дополнению к списку собираемых персональных данных, вам нужно указать зачем вы их собираете.  Эти объяснения должны обосновывать законность сбора данных и их хранение или факт согласия данный пользователем.', NULL, '', 0, '2021-05-15 11:46:23'),
(4497, 4672, 'ru', 0, NULL, 'Скорее всего, эти данные были предоставлены вашим хостинг-провайдером. Если у вас нет этой информации, свяжитесь с их службой поддержки. А если есть&hellip;', NULL, '', 0, '2021-05-15 11:46:23'),
(4498, 4673, 'ru', 0, NULL, 'В большинстве случаев WordPress будет устанавливать технические обновления и обновления безопасности автоматически в фоновом режиме.', NULL, '', 0, '2021-05-15 11:46:23'),
(4499, 4674, 'ru', 0, NULL, 'В предыдущих версиях WordPress все скрипты импорта были встроенными. Теперь они оформлены в виде плагинов, поскольку большинство людей используют их только один раз или редко.', NULL, '', 0, '2021-05-15 11:46:23'),
(4500, 4675, 'ru', 0, NULL, 'В ответ на', NULL, '', 0, '2021-05-15 11:46:23'),
(4501, 4676, 'ru', 0, NULL, 'В ответ на: %s', NULL, '', 0, '2021-05-15 11:46:23'),
(4502, 4677, 'ru', 0, NULL, 'В столбце <strong>&laquo;Автор&raquo;</strong>, помимо имени, e-mail и сайта автора, отображается также его IP-адрес. Нажав на эту ссылку, вы увидите все комментарии, сделанные с этого IP-адреса.', NULL, '', 0, '2021-05-15 11:46:23'),
(4503, 4678, 'ru', 0, NULL, 'В столбце <strong>&laquo;Комментарий&raquo;</strong>, наведя курсор на любой комментарий, можно одобрить его, ответить (и одобрить), изменить его свойства, отредактировать, пометить как спам или удалить.', NULL, '', 0, '2021-05-15 11:46:23'),
(4504, 4679, 'ru', 0, NULL, 'В столбце <strong>&laquo;В ответ на&raquo;</strong> содержатся три элемента. Текст &#8212; это название записи, к которой был сделан комментарий, и ссылка на редактирование этой записи. Ссылка &laquo;Просмотреть запись&raquo; ведёт на эту запись на внешней части сайта. Небольшое облако с цифрой показывает, сколько одобренных комментариев получила эта запись. Если есть комментарии, ожидающие проверки, отображается красный кружок с их количеством. Нажав на него, можно увидеть только непроверенные комментарии к этой записи.', NULL, '', 0, '2021-05-15 11:46:23'),
(4505, 4680, 'ru', 0, NULL, 'В столбце <strong>&laquo;Отправлен&raquo;</strong> отображается ссылка с датой и временем отправки комментария. Нажав на неё, можно перейти к этому комментарию на внешней части сайта.', NULL, '', 0, '2021-05-15 11:46:23'),
(4506, 4681, 'ru', 0, NULL, 'В разделе &laquo;Текст заголовка&raquo; на этой странице можно выбрать, отображать ли текст или скрыть его. Можно также указать цвет текста, нажав кнопку &laquo;Выбрать цвет&raquo; и введя корректный HEX-код, принятый в HTML (например, &laquo;#ff0000&raquo; &#8212; красный), или выбрав цвет с помощью появившегося инструмента.', NULL, '', 0, '2021-05-15 11:46:23'),
(4507, 4682, 'ru', 0, NULL, 'В этом разделе нужно объяснить как долго хранятся персональные данные собранные или обработанные сайтом. Это в рамках вашей ответственности определить планы на каждый набор данных и причины, по которым вы будете их хранить, тем не менее стоит указать данную информацию здесь. Например, можете указать то, что данные контактных форм хранятся полгода, веб-аналитика - год, а данные о покупках клиентов - 10 лет.', NULL, '', 0, '2021-05-15 11:46:23'),
(4508, 4683, 'ru', 0, NULL, 'В этом разделе нужно объяснить меры, принимаемые для защиты данных ваших пользователей. Это включает технические меры, такие как шифрование, меры безопасности типа 2-факторной авторизации и меры на стороне персонала (пройденные ими курсы по защите данных). Если вы проводили оценку воздействия (Privacy Impact Assessment (PIA)), вы также можете упомянуть это.', NULL, '', 0, '2021-05-15 11:46:23'),
(4509, 4684, 'ru', 0, NULL, 'Тут следует перечислить какие процедуры принимаются для защиты от взлома, возможного или реального, например внутренние системы обнаружения, механизм контактов или программы поощрения за поиск ошибок.', NULL, '', 0, '2021-05-15 11:46:23'),
(4510, 4685, 'ru', 0, NULL, 'В этом разделе нужно объяснить какие права есть у пользователей на их данные и как они могут воспользоваться ими.', NULL, '', 0, '2021-05-15 11:46:23'),
(4511, 4686, 'ru', 0, NULL, 'В этом разделе нужно перечислить все пересылки данных за пределы ЕС и привести меры защиты данных по стандартам ЕС. Это может включать ваш веб-хостинг, облачное хранилище и другие услуги третьих сторон.', NULL, '', 0, '2021-05-15 11:46:23'),
(4512, 4687, 'ru', 0, NULL, 'Тут следует назвать и перечислить все третьи стороны с кем вы делитесь данными сайта, включая партнеров, облачные сервисы, платежные шлюзы и другие провайдеры услуг. Укажите какие данные вы предоставляете им и зачем. Дайте ссылки на их уведомления о конфиденциальности, если возможно.', NULL, '', 0, '2021-05-15 11:46:23'),
(4513, 4688, 'ru', 0, NULL, 'В этом подразделе нужно отметить какие персональные данные вы собираете от пользователей и посетителей, они могут включать имя, адрес email, личные настройки учетной записи, операционные данные, такие как данные о покупках, технические данные, такие как информация о куки.', NULL, '', 0, '2021-05-15 11:46:23'),
(4514, 4689, 'ru', 0, NULL, 'В этом разделе вам следует добавить адрес (URL) вашего сайта, имя компании, организации или отдельных людей стоящих за ним, а также точную контактную информацию.', NULL, '', 0, '2021-05-15 11:46:23'),
(4515, 4690, 'ru', 0, NULL, 'Здесь вам следует указать метод связи с вами по вопросам конфиденциальности.  Если у вас есть офицер по защите данных, укажите его/её имя и полные контактные данные.', NULL, '', 0, '2021-05-15 11:46:23'),
(4516, 4691, 'ru', 0, NULL, 'В этом подразделе вам нужно перечислить куки используемые вашим сайтом, включая устанавливаемые плагинами, социальными сетями и аналитикой. Мы предоставили список куки используемых WordPress по умолчанию.', NULL, '', 0, '2021-05-15 11:46:23'),
(4517, 4692, 'ru', 0, NULL, 'В этом подразделе следует добавить каким пакетом веб-аналитики вы пользуетесь, как пользователи могут исключить себя из отслеживания и ссылку на политику конфиденциальности поставщика веб-аналитики, если такая имеется.', NULL, '', 0, '2021-05-15 11:46:23'),
(4518, 4693, 'ru', 0, NULL, 'В этом подразделе нужно отметить какая информация сохраняется вместе с комментариями. Мы уже отметили то, что собирает WordPress по умолчанию.', NULL, '', 0, '2021-05-15 11:46:23') ;
