(4676, 4851, 'ru', 0, NULL, 'Управление страницами очень похоже на управление записями, и экран можно настраивать таким же образом.', NULL, '', 0, '2021-05-15 11:46:23'),
(4677, 4852, 'ru', 0, NULL, 'Многие пользователи для быстрой проверки комментариев применяют горячие клавиши. По ссылке справа вы найдёте дополнительную информацию.', NULL, '', 0, '2021-05-15 11:46:23'),
(4678, 4853, 'ru', 0, NULL, 'Многие плагины собирают или хранят персональные данные в базе данных WordPress или удалённо. Любой запрос на удаление персональных данных должен поддерживать также и удаление данных в плагинах.', NULL, '', 0, '2021-05-15 11:46:23'),
(4679, 4854, 'ru', 0, NULL, 'Многие плагины собирают или хранят персональные данные в базе данных WordPress или удалённо. Любой запрос экспорта персональных данных должен поддерживать также и экспорт данных плагинов.', NULL, '', 0, '2021-05-15 11:46:23'),
(4680, 4855, 'ru', 0, NULL, 'Большинство тем выводят по умолчанию некоторые виджеты, пока вы не добавите свои, однако они не отображаются автоматически при редактировании боковых колонок. Добавив свой первый виджет, вы сможете добавить и остальные с панели &laquo;Доступные виджеты&raquo;.', NULL, '', 0, '2021-05-15 11:46:23'),
(4681, 4856, 'ru', 0, NULL, 'Отметить запрос экспорта для &#8220;%s&#8221; как завершенный.', NULL, '', 0, '2021-05-15 11:46:23'),
