(4711, 4886, 'ru', 0, NULL, 'Меню могут отображаться в областях, предусмотренных темой оформления, или в областях для виджетов, если добавить туда виджет &#8220;Меню навигации&#8221; на экране <a href="%1$s">&laquo;Виджеты&raquo;</a>. Если ваша тема не поддерживает произвольные меню (темы по умолчанию %2$s и %3$s поддерживают), вы можете узнать как добавить поддержку самостоятельно, прочитав документацию по ссылке на боковой панели.', NULL, '', 0, '2021-05-15 11:46:23'),
