(4725, 4900, 'ru', 0, NULL, 'Самые свежие', NULL, '', 0, '2021-05-15 11:46:23'),
(4726, 4901, 'ru', 0, NULL, 'В большинстве случаев плагины корректно работают с ядром WordPress и другими плагинами. Впрочем, иногда код одного плагина может стать помехой для другого, вызывая проблемы совместимости. Если на вашем сайте происходят странные вещи, причина может быть в этом. Попробуйте деактивировать все плагины и повторно активировать их в различных комбинациях, чтобы определить, какой из них стал причиной проблемы.', NULL, '', 0, '2021-05-15 11:46:23'),
(4727, 4902, 'ru', 0, NULL, 'Большинство тем оформления отображают название сайта в верхней части каждой страницы, в заголовке окна браузера и RSS-лентах. Краткое описание также отображается во многих темах.', NULL, '', 0, '2021-05-15 11:46:23'),
