(4742, 4917, 'ru', 0, NULL, 'Нужна помощь в составлении вашей новой страницы политики конфиденциальности? <a href="%1$s" %2$s>Посмотрите наше руководство%3$s</a> для рекомендаций по включению содержимого, а также политик предлагаемых вашими плагинами и темой.', NULL, '', 0, '2021-05-15 11:46:23'),
(4743, 4918, 'ru', 0, NULL, 'Нужна помощь в составлении вашей новой страницы политики конфиденциальности? Посмотрите наше руководство для рекомендаций по требуемому содержимому и политике предлагаемой вашими плагинами и темой.', NULL, '', 0, '2021-05-15 11:46:23'),
