(4764, 4939, 'ru', 0, NULL, 'Новые пользователи получают письмо с уведомлением, что их добавили на этот сайт. В этом письме также содержится их пароль. Поставьте галочку, если вы не хотите отправлять пользователю приветственное письмо.', NULL, '', 0, '2021-05-15 11:46:23'),
