(4811, 4986, 'ru', 0, NULL, 'Обратите внимание, что для полной приватности этого недостаточно; ваш сайт всё равно виден другим посетителям и не все поисковые системы следуют этой директиве.', NULL, '', 0, '2021-05-15 11:46:23'),
(4812, 4987, 'ru', 0, NULL, 'Обратите внимание, что для обрезки изображения достаточно нажать на него (иконка &laquo;Обрезать&raquo; уже выбрана) и выбрать желаемую часть, удерживая кнопку мыши. Затем нажмите &laquo;Сохранить&raquo;, чтобы записать результат.', NULL, '', 0, '2021-05-15 11:46:23'),
(4813, 4988, 'ru', 0, NULL, 'Примечание: Эти настройки не блокируют доступ к вашему сайту. Будут ли они учитываться &mdash; зависит от поисковых систем.', NULL, '', 0, '2021-05-15 11:46:23'),
