(4818, 4993, 'ru', 0, NULL, 'Теперь разрешить отложенную загрузку окон iframe стало просто. По умолчанию WordPress добавляет атрибут <code>loading="lazy"</code> в теги iframe, если указаны и ширина, и высота.', NULL, '', 0, '2021-05-15 11:46:23') ;
