(4823, 4998, 'ru', 0, NULL, 'Цифры', NULL, '', 0, '2021-05-15 11:46:23'),
(4824, 4999, 'ru', 0, NULL, 'На этом экране можно установить свежую версию WordPress, а также обновить темы, плагины и переводы из каталога WordPress.org.', NULL, '', 0, '2021-05-15 11:46:23'),
(4825, 5000, 'ru', 0, NULL, 'После создания WXR-файла его можно импортировать на другой сайт под управлением WordPress или другой платформы, поддерживающей этот формат.', NULL, '', 0, '2021-05-15 11:46:23'),
(4826, 5001, 'ru', 0, NULL, 'Как только вы получили список тем, любую из них можно просмотреть и установить. Нажмите на миниатюру темы, которую вы хотели бы просмотреть. Откроется полноэкранное окно просмотра, чтобы вы могли составить более полное впечатление о теме.', NULL, '', 0, '2021-05-15 11:46:23'),
(4827, 5002, 'ru', 0, NULL, 'Выделив область, можно её отрегулировать, указав размер в пикселях. Минимальный размер области равен размеру миниатюры, заданному на странице &laquo;Настройки медиафайлов&raquo;.', NULL, '', 0, '2021-05-15 11:46:23'),
(4828, 5003, 'ru', 0, NULL, 'Как только вы нажмёте &laquo;Подтвердить удаление&raquo;, пользователь будет удалён навсегда.', NULL, '', 0, '2021-05-15 11:46:23'),
(4829, 5004, 'ru', 0, NULL, 'Как только вы нажмёте &laquo;Подтвердить удаление&raquo;, эти пользователи будут удалены навсегда.', NULL, '', 0, '2021-05-15 11:46:23'),
(4830, 5005, 'ru', 0, NULL, 'Когда вы сохраните файл, можно использовать функцию импорта на другом сайте под управлением WordPress, чтобы импортировать содержимое этого сайта.', NULL, '', 0, '2021-05-15 11:46:23'),
