(4834, 5009, 'ru', 0, NULL, 'Одна или несколько таблиц базы данных недоступны. Чтобы попытаться восстановить их с помощью WordPress, нажмите кнопку &laquo;Починить базу данных&raquo;. Исправление может занять некоторое время &#8212; пожалуйста, наберитесь терпения.', NULL, '', 0, '2021-05-15 11:46:23'),
(4835, 5010, 'ru', 0, NULL, 'Один или более плагинов не могли быть загружены.', NULL, '', 0, '2021-05-15 11:46:23'),
