(4864, 5039, 'ru', 0, NULL, 'Часовой пояс PHP по умолчанию изменён после загрузки WordPress вызовом функции %s. Это может повлиять на корректный расчёт значений даты и времени.', NULL, '', 0, '2021-05-15 11:46:23'),
(4865, 5040, 'ru', 0, NULL, 'Часовой пояс PHP по умолчанию установлен WordPress при загрузке. Это необходимо для корректного расчёта значений даты и времени.', NULL, '', 0, '2021-05-15 11:46:23'),
(4866, 5041, 'ru', 0, NULL, 'PHP — язык программирования, используемый для создания WordPress. Используя актуальные версии PHP, вы улучшаете производительность и безопасность своего сайта. Минимально рекомендуемая версия PHP — %s.', NULL, '', 0, '2021-05-15 11:46:23'),
(4867, 5042, 'ru', 0, NULL, 'PHP max input variables', NULL, '', 0, '2021-05-15 11:46:23'),
