(4869, 5044, 'ru', 0, NULL, 'Лимит памяти PHP (только для экранов администрирования)', NULL, '', 0, '2021-05-15 11:46:23'),
(4870, 5045, 'ru', 0, NULL, 'Расширения PHP выполняют многие задачи на сервере для обеспечения работы вашего сайта. Обычно любые изменения в них производятся системным администратором сервера.', NULL, '', 0, '2021-05-15 11:46:23'),
(4871, 5046, 'ru', 0, NULL, 'PHP post max size (максимальный размер POST-запроса)', NULL, '', 0, '2021-05-15 11:46:23'),
(4872, 5047, 'ru', 0, NULL, 'Сессии PHP, созданные вызовом функции %1$s, могут препятствовать работе REST API и петлевых запросов. Активная сессия должна быть закрыта функцией %2$s перед выполнением любых HTTP-запросов.', NULL, '', 0, '2021-05-15 11:46:23'),
