(4882, 5057, 'ru', 0, NULL, 'Страницы похожи на записи тем, что у них тоже есть заголовок, текст и метаданные, но отличаются от них тем, что не принадлежат к хронологическому потоку блога, а являются постоянными. Страницам не присваиваются рубрики и метки, однако они могут иметь иерархию. Можно разместить одну страницу под другой, указав её в качестве родительской и получив группу связанных между собой страниц.', NULL, '', 0, '2021-05-15 11:46:23'),
