(4898, 5073, 'ru', 0, NULL, 'Структура постоянных ссылок обновлена. Теперь уберите разрешение на запись с файла web.config!', NULL, '', 0, '2021-05-15 11:46:23'),
(4899, 5074, 'ru', 0, NULL, 'Постоянная ссылка:', NULL, '', 0, '2021-05-15 11:46:23'),
(4900, 5075, 'ru', 0, NULL, 'Постоянные ссылки', NULL, '', 0, '2021-05-15 11:46:23'),
(4901, 5076, 'ru', 0, NULL, 'Постоянные ссылки указывают на ваши страницы и записи, а также архивы рубрик и меток. Постоянная ссылка &#8212; это веб-адрес, используемый в качестве ссылки на ваше содержимое. Адрес каждой записи должен быть постоянным и никогда не меняться, поэтому такие ссылки и называются постоянными.', NULL, '', 0, '2021-05-15 11:46:23'),
(4902, 5077, 'ru', 0, NULL, 'Постоянные ссылки могут содержать полезную информацию &#8212; например, дату записи, заголовок и другие элементы. Можно выбрать один из предложенных вариантов или создать собственный, выбрав пункт &laquo;Произвольно&raquo;.', NULL, '', 0, '2021-05-15 11:46:23'),
(4903, 5078, 'ru', 0, NULL, 'Удалить комментарий навсегда', NULL, '', 0, '2021-05-15 11:46:23'),
(4904, 5079, 'ru', 0, NULL, 'Экспорт персональных данных', NULL, '', 0, '2021-05-15 11:46:23'),
