(4907, 5082, 'ru', 0, NULL, 'Персональные данные создаются не только при взаимодействии пользователя с сайтом, но также генерируются и техническими процессами, такими как формы контактов, комментарии, куки, данные аналитики и вставки от третих сторон.', NULL, '', 0, '2021-05-15 11:46:23'),
