(4916, 5091, 'ru', 0, NULL, 'Обратитесь к администратору сети для управления автоматическим обновлением плагинов.', NULL, '', 0, '2021-05-15 11:46:23'),
(4917, 5092, 'ru', 0, NULL, 'Пожалуйста, отредактируйте содержимое вашей политики конфиденциальности, удаляя обобщения и добавляя информацию из ваших тем и плагинов. После публикации политики конфиденциальности не забудьте добавить её в меню навигации.', NULL, '', 0, '2021-05-15 11:46:23'),
(4918, 5093, 'ru', 0, NULL, 'Пожалуйста, введите корректное название меню.', NULL, '', 0, '2021-05-15 11:46:23') ;
