(4986, 5161, 'ru', 0, NULL, 'Плагины расширяют и дополняют функциональность WordPress. После установки плагина можно активировать или деактивировать его здесь.', NULL, '', 0, '2021-05-15 11:46:23'),
(4987, 5162, 'ru', 0, NULL, 'Плагины расширяют и дополняют функциональность WordPress. Можно установить их из <a href="%s">каталога плагинов WordPress</a> автоматически, либо загрузить архив плагина в формате .zip, нажав на кнопку в верхней части страницы.', NULL, '', 0, '2021-05-15 11:46:23'),
(4988, 5163, 'ru', 0, NULL, 'Плагины расширяют функциональность вашего сайта, например формой контактов, возможностями магазина и много чем ещё. Они глубоко интегрированы в ваш сайт и поддержание их актуальности очень важно.', NULL, '', 0, '2021-05-15 11:46:23'),
(4989, 5164, 'ru', 0, NULL, 'Плагины подключаются к WordPress, расширяя его функциональность дополнительными возможностями. Плагины создаются независимо от ядра WordPress тысячами разработчиков по всему миру. Все плагины в официальном <a href="%s">каталоге WordPress</a> совместимы с лицензией WordPress.', NULL, '', 0, '2021-05-15 11:46:23'),
