(5010, 5185, 'ru', 0, NULL, 'Публикация через e-mail позволяет вам отправлять на свой сайт письма с текстами записей. Для этого вам необходимо создать скрытый e-mail с POP3-доступом. Любое сообщение, пришедшее на этот адрес, будет опубликовано, поэтому лучше держать этот адрес в тайне.', NULL, '', 0, '2021-05-15 11:46:23'),
