(5405, 5580, 'ru', 0, NULL, '&laquo;Тапните&raquo; или наведите курсор на любую тему, затем нажмите кнопку &laquo;Просмотреть&raquo;, чтобы просмотреть эту тему и изменить её настройки в отдельном полноэкранном окне. Кнопку &laquo;Просмотреть&raquo; также можно найти в нижней части окна информации о теме. Таким образом можно просмотреть и настроить любую из установленных тем.', NULL, '', 0, '2021-05-15 11:46:23'),
(5406, 5581, 'ru', 0, NULL, 'Шаблон таксономии', NULL, '', 0, '2021-05-15 11:46:23'),
(5407, 5582, 'ru', 0, NULL, 'Благодарим за установку свежей версии! Пожалуйста, перейдите на страницу <a href="%s">&laquo;Обновить сеть&raquo;</a>, чтобы обновить все сайты.', NULL, '', 0, '2021-05-15 11:46:23'),
(5408, 5583, 'ru', 0, NULL, 'Спасибо вам за творчество с <a href="%s">WordPress</a>.', NULL, '', 0, '2021-05-15 11:46:23'),
(5409, 5584, 'ru', 0, NULL, 'Спасибо за работу в сети &laquo;%s&raquo;, ваш сайт удалён. Счастливого пути и до встречи!', NULL, '', 0, '2021-05-15 11:46:23'),
(5410, 5585, 'ru', 0, NULL, 'Спасибо. Пожалуйста, проверьте ваш почтовый ящик на предмет ссылки для подтверждения вашего действия. Сайт не будет удалён, пока вы не нажмёте на эту ссылку.', NULL, '', 0, '2021-05-15 11:46:23'),
(5411, 5586, 'ru', 0, NULL, 'Этот пользователь не может быть добавлен на этот сайт.', NULL, '', 0, '2021-05-15 11:46:23'),
(5412, 5587, 'ru', 0, NULL, 'Этот пользователь уже является участником сайта.', NULL, '', 0, '2021-05-15 11:46:23'),
(5413, 5588, 'ru', 0, NULL, 'Значение "%1$s" меньше чем "%2$s".', NULL, '', 0, '2021-05-15 11:46:23'),
(5414, 5589, 'ru', 0, NULL, 'Константа %1$s в файле %2$s больше не нужна.', NULL, '', 0, '2021-05-15 11:46:23'),
(5415, 5590, 'ru', 0, NULL, 'Директива %1$s в %2$s определяет возможность загрузки файлов на сайт.', NULL, '', 0, '2021-05-15 11:46:23'),
(5416, 5591, 'ru', 0, NULL, 'Строка %1$s в заголовке плагина считается устаревшей. Используйте %2$s.', NULL, '', 0, '2021-05-15 11:46:23'),
(5417, 5592, 'ru', 0, NULL, 'Таблица %1$s повреждена. Сообщается следующая ошибка: %2$s.  WordPress попытается исправить эту таблицу&hellip;', NULL, '', 0, '2021-05-15 11:46:23'),
(5418, 5593, 'ru', 0, NULL, '%s константа определена и включена.', NULL, '', 0, '2021-05-15 11:46:23'),
(5419, 5594, 'ru', 0, NULL, 'Включен фильтр %s.', NULL, '', 0, '2021-05-15 11:46:23'),
(5420, 5595, 'ru', 0, NULL, 'Функция %s была отключена, некоторые настройки медиафайлов недоступны.', NULL, '', 0, '2021-05-15 11:46:23'),
(5421, 5596, 'ru', 0, NULL, 'Плагин импорта %s неработоспособен или не установлен.', NULL, '', 0, '2021-05-15 11:46:23'),
