(5425, 5600, 'ru', 0, NULL, 'Таблица %s в порядке.', NULL, '', 0, '2021-05-15 11:46:23'),
(5426, 5601, 'ru', 0, NULL, '&laquo;Ярлык&raquo; &#8212; это вариант названия, подходящий для URL. Обычно содержит только латинские буквы в нижнем регистре, цифры и дефисы.', NULL, '', 0, '2021-05-15 11:46:23'),
(5427, 5602, 'ru', 0, NULL, 'Первая свобода', NULL, '', 0, '2021-05-15 11:46:23'),
(5428, 5603, 'ru', 0, NULL, 'Вторая свобода', NULL, '', 0, '2021-05-15 11:46:23'),
(5429, 5604, 'ru', 0, NULL, 'Третья свобода', NULL, '', 0, '2021-05-15 11:46:23'),
(5430, 5605, 'ru', 0, NULL, 'Четвёртая свобода', NULL, '', 0, '2021-05-15 11:46:23'),
(5431, 5606, 'ru', 0, NULL, '<a href="https://codex.wordpress.org/Glossary#Character_set">Кодировка</a> вашего сайта (рекомендуется UTF-8)', NULL, '', 0, '2021-05-15 11:46:23'),
(5432, 5607, 'ru', 0, NULL, 'Заголовок авторизации предоставляется разрешёнными приложениями третьей стороны. Без этого заголовка приложения не смогут подключиться к вашему сайту.', NULL, '', 0, '2021-05-15 11:46:23'),
(5433, 5608, 'ru', 0, NULL, 'Заголовок авторизации функционирует как ожидается.', NULL, '', 0, '2021-05-15 11:46:23'),
(5434, 5609, 'ru', 0, NULL, 'Запрос на авторизацию приложения не разрешён.', NULL, '', 0, '2021-05-15 11:46:23'),
(5435, 5610, 'ru', 0, NULL, 'Панель &laquo;Доступные виджеты&raquo; содержит все виджеты, которые можно выбрать. Как только вы перетащите виджет в боковую колонку, он откроется для настройки параметров. Закончив настройку, нажмите кнопку &laquo;Сохранить&raquo;, и виджет появится на сайте. Если нажать на ссылку &laquo;Удалить&raquo;, виджет будет удалён.', NULL, '', 0, '2021-05-15 11:46:23'),
(5436, 5611, 'ru', 0, NULL, 'Ссылка &laquo;Конвертер рубрик и меток&raquo; на этом экране ведёт на экран &laquo;Импорт&raquo;, где этот конвертер доступен для скачивания как один из плагинов. После его установки ссылка &laquo;Активировать плагин и запустить импорт&raquo; приведёт вас на страницу, где можно сконвертировать метки в рубрики или наоборот.', NULL, '', 0, '2021-05-15 11:46:23'),
(5437, 5612, 'ru', 0, NULL, 'Интерфейс настройки позволяет просмотреть изменения на сайте перед их публикацией. Вы можете переходить на другие страницы сайта в режиме предпросмотра. Для некоторых редактируемых элементов будут показаны кнопки редактирования.', NULL, '', 0, '2021-05-15 11:46:23'),
(5438, 5613, 'ru', 0, NULL, 'В меню &laquo;Документация&raquo; под редактором перечислены все функции, обнаруженные в файле плагина. При нажатии на кнопку &laquo;Поиск&raquo; откроется веб-страница с информацией об этой функции.', NULL, '', 0, '2021-05-15 11:46:23'),
(5439, 5614, 'ru', 0, NULL, 'В блоке &laquo;Дополнительно&raquo; можно настроить префиксы, которые будут видны в адресах архивов. Например, адрес страницы со всеми записями из рубрики &laquo;Без рубрики&raquo; может иметь вид <code>/topics/uncategorized</code> вместо <code>/category/uncategorized</code>.', NULL, '', 0, '2021-05-15 11:46:23'),
(5440, 5615, 'ru', 0, NULL, 'Используемая вашим сервером версия PHP - %1$s, однако загруженный плагин требует %2$s.', NULL, '', 0, '2021-05-15 11:46:23'),
(5441, 5616, 'ru', 0, NULL, 'Используемая вашим сервером версия PHP - %1$s, однако загруженная тема требует %2$s.', NULL, '', 0, '2021-05-15 11:46:23'),
(5442, 5617, 'ru', 0, NULL, 'Настройки конфиденциальности требуют наличия JavaScript.', NULL, '', 0, '2021-05-15 11:46:23'),
(5443, 5618, 'ru', 0, NULL, 'Запрос к REST API завершился с неожиданным результатом: (%1$d) %2$s.', NULL, '', 0, '2021-05-15 11:46:23'),
(5444, 5619, 'ru', 0, NULL, 'REST API не работает корректно', NULL, '', 0, '2021-05-15 11:46:23'),
(5445, 5620, 'ru', 0, NULL, 'REST API не смог корректно обработать параметр запроса %s.', NULL, '', 0, '2021-05-15 11:46:23'),
(5446, 5621, 'ru', 0, NULL, 'REST API выдал ошибку', NULL, '', 0, '2021-05-15 11:46:23'),
(5447, 5622, 'ru', 0, NULL, 'REST API выдал неожиданный результат', NULL, '', 0, '2021-05-15 11:46:23'),
(5448, 5623, 'ru', 0, NULL, 'REST API доступен', NULL, '', 0, '2021-05-15 11:46:23'),
(5449, 5624, 'ru', 0, NULL, 'REST API — один из способов коммуникации WordPress и других приложений с сервером. К примеру, экран редактора блоков использует его для отображения и сохранения ваших записей и страниц.', NULL, '', 0, '2021-05-15 11:46:23'),
(5450, 5625, 'ru', 0, NULL, 'Запрос к REST API неудачен из-за ошибки.', NULL, '', 0, '2021-05-15 11:46:23'),
(5451, 5626, 'ru', 0, NULL, 'SQL сервер &mdash; ПО используемое WordPress для работы с базой данных, в которой хранится всё содержимое сайта и его настройки.', NULL, '', 0, '2021-05-15 11:46:23'),
(5452, 5627, 'ru', 0, NULL, 'Проверка здоровья сайта для %1$s заменена %2$s.', NULL, '', 0, '2021-05-15 11:46:23'),
(5453, 5628, 'ru', 0, NULL, 'Отображение информации о здоровье сайта требует включенного JavaScript.', NULL, '', 0, '2021-05-15 11:46:23'),
(5454, 5629, 'ru', 0, NULL, 'Текстовый режим позволяет вводить HTML-код. Обратите внимание, что при переключении в текстовый режим теги &lt;p&gt; и &lt;br&gt; преобразуются в переводы строк, чтобы сделать текст более читаемым. При наборе можно использовать один перевод строки вместо тега &lt;br&gt; и два перевода вместо тега &lt;p&gt;. При выводе текста на сайте переводы строк будут автоматически преобразованы обратно в теги.', NULL, '', 0, '2021-05-15 11:46:23'),
(5455, 5630, 'ru', 0, NULL, 'Экран установки темы требует JavaScript.', NULL, '', 0, '2021-05-15 11:46:23'),
(5456, 5631, 'ru', 0, NULL, 'Класса обхода с именем %s не существует.', NULL, '', 0, '2021-05-15 11:46:23'),
(5457, 5632, 'ru', 0, NULL, 'Команда хостинга WordPress поддерживает список расширений требуемых и рекомендуемых в <a href="%1$s" %2$s>этом руководстве %3$s</a>.', NULL, '', 0, '2021-05-15 11:46:23'),
(5458, 5633, 'ru', 0, NULL, 'Команда WordPress', NULL, '', 0, '2021-05-15 11:46:23'),
(5459, 5634, 'ru', 0, NULL, 'Адрес WordPress и адрес сайта могут совпадать (example.com) или отличаться; например, когда файлы ядра WordPress расположены в подкаталоге (example.com/wordpress).', NULL, '', 0, '2021-05-15 11:46:23'),
(5460, 5635, 'ru', 0, NULL, 'Команда WordPress предлагает вам свою помощь. Перешлите это письмо на %s, и мы свяжемся с вами, чтобы обеспечить работоспособность вашего сайта.', NULL, '', 0, '2021-05-15 11:46:23'),
(5461, 5636, 'ru', 0, NULL, 'Компания &laquo;Штучки XYZ&raquo; была основана в 1971 году и с тех пор производит качественные штучки. Компания находится в Готэм-сити, имеет штат из более чем 2000 сотрудников и приносит много пользы жителям Готэма.', NULL, '', 0, '2021-05-15 11:46:23'),
(5462, 5637, 'ru', 0, NULL, 'Текущая тема повреждена. Восстановлена тема по умолчанию.', NULL, '', 0, '2021-05-15 11:46:23'),
(5463, 5638, 'ru', 0, NULL, 'Проверка адреса email администратора будет повторена через %s.', NULL, '', 0, '2021-05-15 11:46:23'),
(5464, 5639, 'ru', 0, NULL, 'Необходимое количество предоставляемой информации может отличаться в зависимости от локальных или национальных предписаний. К примеру, вам возможно требуется предоставить юридический адрес, фактический адрес или регистрационный номер организации.', NULL, '', 0, '2021-05-15 11:46:23'),
(5465, 5640, 'ru', 0, NULL, 'ID приложения должно являться UUID.', NULL, '', 0, '2021-05-15 11:46:23'),
(5466, 5641, 'ru', 0, NULL, 'Пропорции &#8212; это соотношение ширины и высоты. При изменении размера выделенной области можно сохранить пропорции, зажав Shift. Укажите желаемые пропорции в полях ниже, например 1:1 (квадрат), 4:3, 16:9 и т.д.', NULL, '', 0, '2021-05-15 11:46:23'),
(5467, 5642, 'ru', 0, NULL, 'Файл вложения не найден.', NULL, '', 0, '2021-05-15 11:46:23'),
(5468, 5643, 'ru', 0, NULL, 'Не удалось проверить подлинность %s, так как подпись не была найдена.', NULL, '', 0, '2021-05-15 11:46:23'),
(5469, 5644, 'ru', 0, NULL, 'Не удалось проверить подлинность %s, так как данная система не поддерживает проверку подписей.', NULL, '', 0, '2021-05-15 11:46:23'),
(5470, 5645, 'ru', 0, NULL, 'Не удалось проверить подлинность %s.', NULL, '', 0, '2021-05-15 11:46:23'),
(5471, 5646, 'ru', 0, NULL, 'Неверный заголовок авторизации.', NULL, '', 0, '2021-05-15 11:46:23'),
(5472, 5647, 'ru', 0, NULL, 'Отсутствует заголовок авторизации.', NULL, '', 0, '2021-05-15 11:46:23'),
(5473, 5648, 'ru', 0, NULL, 'Редактор блоков требует JavaScript. Пожалуйста, включите JavaScript в настройках вашего браузера или попробуйте плагин <a href="%s">Classic Editor</a>.', NULL, '', 0, '2021-05-15 11:46:23'),
(5474, 5649, 'ru', 0, NULL, 'Положение блоков &laquo;Имя&raquo;, &laquo;Адрес&raquo; и &laquo;Описание&raquo; зафиксировано, однако можно перемещать все остальные, перетаскивая их курсором мыши. Можно также скрыть неиспользуемые блоки на вкладке &laquo;Настройки экрана&raquo;, либо свернуть их, нажав на заголовок блока.', NULL, '', 0, '2021-05-15 11:46:23'),
(5475, 5650, 'ru', 0, NULL, 'На экране &laquo;Консоль&raquo; доступны следующие блоки:', NULL, '', 0, '2021-05-15 11:46:23'),
(5476, 5651, 'ru', 0, NULL, 'Контрольная сумма файла (%1$s) не соответствует ожидаемому значению (%2$s).', NULL, '', 0, '2021-05-15 11:46:23'),
(5477, 5652, 'ru', 0, NULL, 'Цвета воспринимаются одинаково от светлого к темному в каждом диапазоне, что означает, что они начинаются с белого и становятся темнее на одинаковую величину с каждым шагом.', NULL, '', 0, '2021-05-15 11:46:23'),
(5478, 5653, 'ru', 0, NULL, 'Константа %s не может быть активна при установке WordPress.', NULL, '', 0, '2021-05-15 11:46:23'),
(5479, 5654, 'ru', 0, NULL, 'Текущая тема не поддерживает изображение заголовка с гибкими размерами.', NULL, '', 0, '2021-05-15 11:46:23'),
(5480, 5655, 'ru', 0, NULL, 'Текущая тема не поддерживает произвольное изображение заголовка.', NULL, '', 0, '2021-05-15 11:46:23'),
(5481, 5656, 'ru', 0, NULL, 'Текущая тема вызвала следующую ошибку: "%s".', NULL, '', 0, '2021-05-15 11:46:23'),
(5482, 5657, 'ru', 0, NULL, 'Текущая тема выделена цветом и отображается первой.', NULL, '', 0, '2021-05-15 11:46:23'),
(5483, 5658, 'ru', 0, NULL, 'Текущий пользователь должен иметь возможность редактирования пользователей.', NULL, '', 0, '2021-05-15 11:46:23'),
(5484, 5659, 'ru', 0, NULL, 'Текущая выбранная страница политики конфиденциальности не существует. Создайте или выберите новую страницу.', NULL, '', 0, '2021-05-15 11:46:23'),
(5485, 5660, 'ru', 0, NULL, 'Текущая выбранная страница политики конфиденциальности удалена в корзину. Создайте или выберите новую страницу, вы также можете  <a href="%s">восстановить страницу из корзины</a>.', NULL, '', 0, '2021-05-15 11:46:23'),
(5486, 5661, 'ru', 0, NULL, 'Процесс обновления может занять некоторое время. Пожалуйста, наберитесь терпения.', NULL, '', 0, '2021-05-15 11:46:23'),
(5487, 5662, 'ru', 0, NULL, 'Описание по умолчанию не отображается, однако некоторые темы могут его показывать.', NULL, '', 0, '2021-05-15 11:46:23'),
(5488, 5663, 'ru', 0, NULL, 'Директивы (строки) между `BEGIN %1$s` и `END %1$s`\nсозданы автоматически и подлежат изменению только через фильтры WordPress.\nСделанные вручную изменения между этими маркерами будут перезаписаны.', NULL, '', 0, '2021-05-15 11:46:23'),
(5489, 5664, 'ru', 0, NULL, 'Подсчет используемого места занял слишком много времени. Возможно, что  у вас слишком много подпапок и файлов.', NULL, '', 0, '2021-05-15 11:46:23'),
(5490, 5665, 'ru', 0, NULL, 'Код ошибки был %s.', NULL, '', 0, '2021-05-15 11:46:23'),
(5491, 5666, 'ru', 0, NULL, 'Поля на этом экране определяют основные настройки вашего сайта.', NULL, '', 0, '2021-05-15 11:46:23'),
(5492, 5667, 'ru', 0, NULL, 'Файл %1$s уже существует уровнем выше директории WordPress. Если вам нужно сбросить любой из находящихся в нём параметров, сначала удалите его. Теперь можно <a href="%2$s">запустить установку</a>.', NULL, '', 0, '2021-05-15 11:46:23'),
(5493, 5668, 'ru', 0, NULL, 'Файл %1$s уже существует. Если вам нужно сбросить любой из находящихся в нём параметров, сначала удалите его. Теперь можно <a href="%2$s">запустить установку</a>.', NULL, '', 0, '2021-05-15 11:46:23'),
(5494, 5669, 'ru', 0, NULL, 'Папка %1$s определена как находящаяся под управлением системы контроля версий файлов (%2$s), но фильтр %3$s разрешает обновления.', NULL, '', 0, '2021-05-15 11:46:23'),
(5495, 5670, 'ru', 0, NULL, 'Папка %1$s определена как находящаяся под управлением системы контроля версий файлов (%2$s).', NULL, '', 0, '2021-05-15 11:46:23'),
(5496, 5671, 'ru', 0, NULL, 'Следующие плагины не удалось обновить:', NULL, '', 0, '2021-05-15 11:46:23'),
(5497, 5672, 'ru', 0, NULL, 'Для следующих плагинов доступны обновления. Выберите, какие из них вы хотите обновить, затем нажмите &laquo;Обновить плагины&raquo;.', NULL, '', 0, '2021-05-15 11:46:23'),
(5498, 5673, 'ru', 0, NULL, 'Следующие плагины успешно обновлены:', NULL, '', 0, '2021-05-15 11:46:23'),
(5499, 5674, 'ru', 0, NULL, 'Следующие темы установлены, однако являются неполными.', NULL, '', 0, '2021-05-15 11:46:23'),
(5500, 5675, 'ru', 0, NULL, 'Следующие темы не удалось обновить:', NULL, '', 0, '2021-05-15 11:46:23'),
(5501, 5676, 'ru', 0, NULL, 'Для следующих тем доступны обновления. Выберите, какие из них вы хотите обновить, затем нажмите &laquo;Обновить темы&raquo;.', NULL, '', 0, '2021-05-15 11:46:23'),
(5502, 5677, 'ru', 0, NULL, 'Следующие темы успешно обновлены:', NULL, '', 0, '2021-05-15 11:46:23'),
(5503, 5678, 'ru', 0, NULL, 'Следующие переводы не удалось обновить:', NULL, '', 0, '2021-05-15 11:46:23'),
(5504, 5679, 'ru', 0, NULL, 'Следующие переводы успешно обновлены:', NULL, '', 0, '2021-05-15 11:46:23'),
(5505, 5680, 'ru', 0, NULL, 'Расширение ftp для PHP недоступно', NULL, '', 0, '2021-05-15 11:46:23'),
(5506, 5681, 'ru', 0, NULL, 'Просмотр библиотеки файлов в режиме сетки требует JavaScript. <a href="%s">Переключиться в режим списка</a>.', NULL, '', 0, '2021-05-15 11:46:23'),
(5507, 5682, 'ru', 0, NULL, 'Скрипт установки попытался открыть случайный адрес (%s) на вашем домене.', NULL, '', 0, '2021-05-15 11:46:23'),
(5508, 5683, 'ru', 0, NULL, 'Элемент, который вы пытаетесь переместить в корзину, не существует.', NULL, '', 0, '2021-05-15 11:46:23'),
(5509, 5684, 'ru', 0, NULL, 'Элемент, который вы пытаетесь восстановить из корзины, не существует.', NULL, '', 0, '2021-05-15 11:46:23'),
(5510, 5685, 'ru', 0, NULL, 'В языковом пакете отсутствуют файлы %1$s или %2$s.', NULL, '', 0, '2021-05-15 11:46:23'),
(5511, 5686, 'ru', 0, NULL, 'В меню навигации слева расположены ссылки на все экраны управления WordPress, а при наведении курсора появляются подменю. Можно свернуть меню в узкую полоску иконок, нажав на ссылку &laquo;Свернуть меню&raquo; внизу.', NULL, '', 0, '2021-05-15 11:46:23'),
(5512, 5687, 'ru', 0, NULL, 'Петлевой запрос вернул неожиданный ответ http - %d, было невозможно определить насколько это влияет на работоспособность.', NULL, '', 0, '2021-05-15 11:46:23'),
(5513, 5688, 'ru', 0, NULL, 'Петлевой запрос к вашему сайту успешен.', NULL, '', 0, '2021-05-15 11:46:23'),
(5514, 5689, 'ru', 0, NULL, 'Петлевой запрос к вашему сайту не удался. Возможности, зависящие от его работоспособности, не могут работать так, как должны.', NULL, '', 0, '2021-05-15 11:46:23'),
(5515, 5690, 'ru', 0, NULL, 'Основная папка WordPress', NULL, '', 0, '2021-05-15 11:46:23'),
(5516, 5691, 'ru', 0, NULL, 'Меню успешно удалено.', NULL, '', 0, '2021-05-15 11:46:23'),
(5517, 5692, 'ru', 0, NULL, 'Это меню предназначено для редактирования информации специфичной для отдельных сайтов, особенно если раздел администратора сайта недоступен.', NULL, '', 0, '2021-05-15 11:46:23'),
(5518, 5693, 'ru', 0, NULL, 'Элемент меню успешно удалён.', NULL, '', 0, '2021-05-15 11:46:23'),
(5519, 5694, 'ru', 0, NULL, 'Блок управления меню в верхней части экрана используется для выбора меню, которое будет отображаться в редакторе ниже.', NULL, '', 0, '2021-05-15 11:46:23'),
(5520, 5695, 'ru', 0, NULL, 'Папка обязательных (MU) плагинов', NULL, '', 0, '2021-05-15 11:46:23'),
(5521, 5696, 'ru', 0, NULL, 'Название определяет, как элемент будет отображаться на вашем сайте.', NULL, '', 0, '2021-05-15 11:46:23'),
