INSERT INTO `wp_icl_string_translations` ( `id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES
(5523, 5698, 'ru', 0, NULL, 'Сеть уже существует.', NULL, '', 0, '2021-05-15 11:46:23'),
(5524, 5699, 'ru', 0, NULL, 'Новый API роботов позволяет включать директивы фильтров в метатег robots, а API по умолчанию включает директиву <code>max-image-preview: large</code>. Это означает, что поисковые системы могут показывать предварительный просмотр изображений большего размера (если блог не отмечен как <em>закрытый</em>), что поможет увеличить ваш трафик.', NULL, '', 0, '2021-05-15 11:46:23'),
(5525, 5700, 'ru', 0, NULL, 'Новая страница должна включать помощь и предложения по вашей политике конфиденциальности.', NULL, '', 0, '2021-05-15 11:46:23'),
(5526, 5701, 'ru', 0, NULL, 'Рекомендуемое расширение %s не установлено или отключено.', NULL, '', 0, '2021-05-15 11:46:23'),
(5527, 5702, 'ru', 0, NULL, 'Настройки ниже относятся к конфигурации вашего сервера. Для внесения изменений, при их необходимости, вам следует обратиться в техническую поддержку вашего хостинга.', NULL, '', 0, '2021-05-15 11:46:23'),
(5528, 5703, 'ru', 0, NULL, 'Архив не содержит файлов.', NULL, '', 0, '2021-05-15 11:46:23'),
(5529, 5704, 'ru', 0, NULL, 'Архив не удалось установить.', NULL, '', 0, '2021-05-15 11:46:23'),
(5530, 5705, 'ru', 0, NULL, 'Родительская тема, <strong>%1$s %2$s</strong>, уже установлена.', NULL, '', 0, '2021-05-15 11:46:23'),
(5531, 5706, 'ru', 0, NULL, 'Пароль, выбранный вами при установке.', NULL, '', 0, '2021-05-15 11:46:23'),
(5532, 5707, 'ru', 0, NULL, 'Плагин %1$s был деактивирован из-за ошибки: %2$s', NULL, '', 0, '2021-05-15 11:46:23'),
(5533, 5708, 'ru', 0, NULL, 'Плагин не может быть обновлен по причине:', NULL, '', 0, '2021-05-15 11:46:23'),
(5534, 5709, 'ru', 0, NULL, 'Плагин не содержит файлов.', NULL, '', 0, '2021-05-15 11:46:23'),
(5535, 5710, 'ru', 0, NULL, 'У плагина нет корректного заголовка.', NULL, '', 0, '2021-05-15 11:46:23'),
(5536, 5711, 'ru', 0, NULL, 'Плагин создал %d символ <strong>неожиданного вывода</strong> при активации.', NULL, '', 0, '2021-05-15 11:46:23'),
(5537, 5712, 'ru', 0, NULL, 'Плагин создал %d символа <strong>неожиданного вывода</strong> при активации.', NULL, '', 0, '2021-05-15 11:46:23'),
(5538, 5713, 'ru', 0, NULL, 'Плагин произвёл неожиданный вывод на экран.', NULL, '', 0, '2021-05-15 11:46:23'),
(5539, 5714, 'ru', 0, NULL, 'Используется свежая версия плагина.', NULL, '', 0, '2021-05-15 11:46:23'),
(5540, 5715, 'ru', 0, NULL, 'Папка плагинов', NULL, '', 0, '2021-05-15 11:46:23'),
(5541, 5716, 'ru', 0, NULL, 'Сайта, выбранного основным, не существует.', NULL, '', 0, '2021-05-15 11:46:23'),
(5542, 5717, 'ru', 0, NULL, 'URL отклонения должно использовать безопасное подключение.', NULL, '', 0, '2021-05-15 11:46:23'),
(5543, 5718, 'ru', 0, NULL, 'Требуемое расширение %s не установлено или отключено.', NULL, '', 0, '2021-05-15 11:46:23'),
(5544, 5719, 'ru', 0, NULL, 'Запланированное задание %s было пропущено. Ваш сайт все ещё работает,  но возможно есть проблемы с автоматическим обновлением или отложенной публикацией записей.', NULL, '', 0, '2021-05-15 11:46:23'),
(5545, 5720, 'ru', 0, NULL, 'Запланированное задание %s было пропущено. Ваш сайт все ещё работает, но возможно есть проблемы с публикацией запланированных записей или автоматическим обновлением.', NULL, '', 0, '2021-05-15 11:46:23'),
(5546, 5721, 'ru', 0, NULL, 'Поиск по установленным плагинам ищет ключевые слова в их названии, описании и имени автора.', NULL, '', 0, '2021-05-15 11:46:23'),
(5547, 5722, 'ru', 0, NULL, 'Поиск по установленным темам ищет ключевые слова в их названии, описании, имени автора и метках.', NULL, '', 0, '2021-05-15 11:46:23'),
(5548, 5723, 'ru', 0, NULL, 'Выбранный плагин удален.', NULL, '', 0, '2021-05-15 11:46:23'),
(5549, 5724, 'ru', 0, NULL, 'Выбранные плагины удалены.', NULL, '', 0, '2021-05-15 11:46:23'),
(5550, 5725, 'ru', 0, NULL, 'Параметр для %1$s в настоящее время установлен как 0, это может вызвать некоторые проблемы при попытке загрузить файлы с помощью функций плагина или темы, которые зависят от различных методов загрузки. Рекомендуется установить для этого параметра фиксированное значение, в идеале соответствующее значению %2$s, поскольку некоторые методы загрузки читают значение 0 как отключённое или не имеющее ограничений.', NULL, '', 0, '2021-05-15 11:46:23'),
(5551, 5726, 'ru', 0, NULL, 'Установленное значение %1$s меньше чем %2$s, это может приводить к некоторым проблемам с загрузкой файлов.', NULL, '', 0, '2021-05-15 11:46:23'),
(5552, 5727, 'ru', 0, NULL, 'Седьмой параметр, передаваемый в %s, должен быть целым числом представляющим позицию меню.', NULL, '', 0, '2021-05-15 11:46:23'),
(5553, 5728, 'ru', 0, NULL, 'Состояние здоровья сайта показывает критическую информацию о конфигурации WordPress и элементы требующие вашего внимания.', NULL, '', 0, '2021-05-15 11:46:23'),
(5554, 5729, 'ru', 0, NULL, 'Подсчет используемого места невозможен. Папка недоступна, возможно на неё установлены неверные права доступа.', NULL, '', 0, '2021-05-15 11:46:23'),
(5555, 5730, 'ru', 0, NULL, 'Указанные ниже числа определяют максимальные размеры изображения в пикселях при добавлении его в библиотеку файлов.', NULL, '', 0, '2021-05-15 11:46:23'),
(5556, 5731, 'ru', 0, NULL, 'Расширение ssh2 для PHP недоступно', NULL, '', 0, '2021-05-15 11:46:23'),
(5557, 5732, 'ru', 0, NULL, 'URL успешного результата должно использовать безопасное подключение.', NULL, '', 0, '2021-05-15 11:46:23'),
(5558, 5733, 'ru', 0, NULL, 'Предлагаемое содержимое для политики конфиденциальности должно быть добавлено действием %s (или позже). Пожалуйста, смотрите включенную документацию.', NULL, '', 0, '2021-05-15 11:46:23'),
(5559, 5734, 'ru', 0, NULL, 'Предлагаемое содержимое для политики конфиденциальности должно быть добавлено в wp-admin действием %s (или позже).', NULL, '', 0, '2021-05-15 11:46:23'),
(5560, 5735, 'ru', 0, NULL, 'Предлагаемый текст политики конфиденциальности изменился. Пожалуйста, <a href="%s">просмотрите руководство</a>  и обновите вашу политику конфиденциальности.', NULL, '', 0, '2021-05-15 11:46:23'),
(5561, 5736, 'ru', 0, NULL, 'Просматриваемая тема полностью интерактивна &mdash; переходите по ссылкам, чтобы посмотреть, как в этой теме выглядят записи, архивы и шаблоны других страниц. В разных темах настройки могут отличаться, в зависимости от того, какие функции поддерживает просматриваемая тема. Чтобы применить изменения и сразу же активировать тему, нажмите кнопку &laquo;Сохранить и активировать&raquo; над меню.', NULL, '', 0, '2021-05-15 11:46:23'),
(5562, 5737, 'ru', 0, NULL, 'Тема не может быть обновлена по причине:', NULL, '', 0, '2021-05-15 11:46:23'),
(5563, 5738, 'ru', 0, NULL, 'Тема не содержит файлов.', NULL, '', 0, '2021-05-15 11:46:23'),
(5564, 5739, 'ru', 0, NULL, 'Используется свежая версия темы.', NULL, '', 0, '2021-05-15 11:46:23'),
(5565, 5740, 'ru', 0, NULL, 'В теме отсутствует файл %s.', NULL, '', 0, '2021-05-15 11:46:23'),
(5566, 5741, 'ru', 0, NULL, 'В теме отсутствует таблица стилей %s.', NULL, '', 0, '2021-05-15 11:46:23'),
(5567, 5742, 'ru', 0, NULL, 'Используемая вами тема не поддерживает виджеты, а значит, нет и возможности настраивать боковые колонки. Для получения дополнительной информации посмотрите <a href="https://developer.wordpress.org/themes/functionality/widgets/">инструкцию по доработке темы</a>.', NULL, '', 0, '2021-05-15 11:46:23'),
(5568, 5743, 'ru', 0, NULL, 'Папка тем', NULL, '', 0, '2021-05-15 11:46:23'),
(5569, 5744, 'ru', 0, NULL, 'Расположение заголовка и редактора записи зафиксировано, однако вы можете перемещать все остальные блоки путём перетаскивания. Можно также сворачивать и разворачивать их, нажимая на заголовок блока. На вкладке &laquo;Настройки экрана&raquo; можно включить дополнительные блоки (&laquo;Отрывок&raquo;, &laquo;Отправить обратные ссылки&raquo;, &laquo;Произвольные поля&raquo;, &laquo;Обсуждение&raquo;, &laquo;Ярлык&raquo;, &laquo;Автор&raquo;), а также выбрать разметку экрана в 1 или 2 столбца.', NULL, '', 0, '2021-05-15 11:46:23'),
(5570, 5745, 'ru', 0, NULL, 'Инструмент связывает данные, хранимые WordPress, с предоставленным адресом Email, включая данные профиля и комментарии.', NULL, '', 0, '2021-05-15 11:46:23'),
(5571, 5746, 'ru', 0, NULL, 'Обновление не может быть установлено, так как WordPress %1$s требует MySQL версии %2$s или выше. У вас используется версия %3$s.', NULL, '', 0, '2021-05-15 11:46:23'),
(5572, 5747, 'ru', 0, NULL, 'Обновление не может быть установлено, так как WordPress %1$s требует PHP версии %2$s или выше и MySQL версии %3$s или выше. У вас используется PHP %4$s и MySQL %5$s.', NULL, '', 0, '2021-05-15 11:46:23'),
(5573, 5748, 'ru', 0, NULL, 'Обновление не может быть установлено, так как WordPress %1$s требует PHP версии %2$s или выше. У вас используется версия %3$s.', NULL, '', 0, '2021-05-15 11:46:23'),
(5574, 5749, 'ru', 0, NULL, 'Это обновление не может быть установлено, поскольку WordPress %1$s требует наличия PHP расширения %2$s.', NULL, '', 0, '2021-05-15 11:46:23'),
(5575, 5750, 'ru', 0, NULL, 'Обновление не может быть установлено, потому что нам не удастся скопировать некоторые файлы. Обычно это связано с неверными правами на файлы.', NULL, '', 0, '2021-05-15 11:46:23'),
