(5577, 5752, 'ru', 0, NULL, 'Обновление %s не удалось.', NULL, '', 0, '2021-05-15 11:46:23'),
(5578, 5753, 'ru', 0, NULL, 'Процесс обновления начался. На некоторых серверах он может занять какое-то время &#8212; пожалуйста, наберитесь терпения.', NULL, '', 0, '2021-05-15 11:46:23'),
