INSERT INTO `wp_icl_string_translations` ( `id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES
(5623, 5798, 'ru', 0, NULL, 'Не выбраны пользователи для удаления.', NULL, '', 0, '2021-05-15 11:46:23'),
(5624, 5799, 'ru', 0, NULL, 'Некоторые элементы меню некорректны. Проверьте или удалите их.', NULL, '', 0, '2021-05-15 11:46:23'),
(5625, 5800, 'ru', 0, NULL, 'Несохранённые изменения будут потеряны. «ОК» — продолжить, «Отмена» — вернуться в редактор изображений.', NULL, '', 0, '2021-05-15 11:46:23'),
(5626, 5801, 'ru', 0, NULL, 'В настоящее время никаких мероприятий рядом с %1$s не запланировано. Хотите <a href="%2$s">организовать что-то</a>?', NULL, '', 0, '2021-05-15 11:46:23'),
(5627, 5802, 'ru', 0, NULL, 'Мероприятий рядом с вами пока не запланировано. Хотите <a href="%s">организовать</a>?', NULL, '', 0, '2021-05-15 11:46:23'),
(5628, 5803, 'ru', 0, NULL, 'Доступна новая версия %1$s, но обновление не будет работать с вашей версией PHP. <a href="%2$s" %3$s>Посмотрите подробности о версии %4$s</a> или <a href="%5$s">информацию об обновлении PHP</a>.', NULL, '', 0, '2021-05-15 11:46:23'),
(5629, 5804, 'ru', 0, NULL, 'Доступна свежая версия %1$s. Можно <a href="%2$s" %3$s>посмотреть информацию о версии %4$s</a> или <a href="%5$s" %6$s>обновить сейчас</a>.', NULL, '', 0, '2021-05-15 11:46:23'),
(5630, 5805, 'ru', 0, NULL, 'Доступна свежая версия %1$s. <a href="%2$s" %3$s>Посмотреть информацию о версии %4$s</a>.', NULL, '', 0, '2021-05-15 11:46:23'),
(5631, 5806, 'ru', 0, NULL, 'Доступна свежая версия %1$s. <a href="%2$s" %3$s>Посмотреть информацию о версии %4$s</a>. <em>Автоматическое обновление этого плагина невозможно.</em>', NULL, '', 0, '2021-05-15 11:46:23'),
(5632, 5807, 'ru', 0, NULL, 'Доступна свежая версия %1$s. <a href="%2$s" %3$s>Посмотреть информацию о версии %4$s</a>. <em>Автоматическое обновление этой темы невозможно.</em>', NULL, '', 0, '2021-05-15 11:46:23'),
(5633, 5808, 'ru', 0, NULL, 'Ожидается подтверждение смены адреса e-mail администратора на %s.', NULL, '', 0, '2021-05-15 11:46:23'),
(5634, 5809, 'ru', 0, NULL, 'Ожидается подтверждение смены вашего адреса e-mail на %s.', NULL, '', 0, '2021-05-15 11:46:23'),
(5635, 5810, 'ru', 0, NULL, 'Найдена более свежая копия записи, сохранённая автоматически. <a href="%s">Просмотреть копию</a>', NULL, '', 0, '2021-05-15 11:46:23'),
(5636, 5811, 'ru', 0, NULL, 'Недостаточно места на диске, чтобы завершить обновление.', NULL, '', 0, '2021-05-15 11:46:23'),
(5637, 5812, 'ru', 0, NULL, 'Возникла ошибка при обновлении файла. Возможно вам требуется что-то исправить и попробовать обновить его снова.', NULL, '', 0, '2021-05-15 11:46:23'),
(5638, 5813, 'ru', 0, NULL, 'Нет необходимости менять CSS здесь &mdash; можно отредактировать и сделать предварительный просмотр изменений в <a href="%s">встроенном редакторе CSS</a>.', NULL, '', 0, '2021-05-15 11:46:23'),
(5639, 5814, 'ru', 0, NULL, 'Эти плагины не требуют обновления:', NULL, '', 0, '2021-05-15 11:46:23'),
(5640, 5815, 'ru', 0, NULL, 'Следующие плагины не удалось обновить:', NULL, '', 0, '2021-05-15 11:46:23'),
(5641, 5816, 'ru', 0, NULL, 'Эти плагины могут быть активными на других сайтах сети.', NULL, '', 0, '2021-05-15 11:46:23'),
(5642, 5817, 'ru', 0, NULL, 'Эти настройки изменяют откуда и как загружаются компоненты WordPress.', NULL, '', 0, '2021-05-15 11:46:23'),
(5643, 5818, 'ru', 0, NULL, 'Эти настройки могут быть изменены для каждой отдельной статьи.', NULL, '', 0, '2021-05-15 11:46:23'),
(5644, 5819, 'ru', 0, NULL, 'Рекомендации основаны на плагинах, установленных у вас и у других пользователей.', NULL, '', 0, '2021-05-15 11:46:23'),
(5645, 5820, 'ru', 0, NULL, 'Эти темы не требуют обновления:', NULL, '', 0, '2021-05-15 11:46:23'),
(5646, 5821, 'ru', 0, NULL, 'Следующие темы не удалось обновить:', NULL, '', 0, '2021-05-15 11:46:23'),
(5647, 5822, 'ru', 0, NULL, 'Эти сайты могут собирать данные о вас, использовать куки, внедрять дополнительное отслеживание третьей стороной и следить за вашим взаимодействием с внедренным содержимым, включая отслеживание взаимодействия, если у вас есть учетная запись и вы авторизовались на том сайте.', NULL, '', 0, '2021-05-15 11:46:23'),
(5648, 5823, 'ru', 0, NULL, 'Их можно разворачивать и сворачивать нажатием на заголовок, упорядочивать перетаскиванием заголовка или нажатием на стрелки вверх/вниз.', NULL, '', 0, '2021-05-15 11:46:23'),
(5649, 5824, 'ru', 0, NULL, 'Эта <a href="%1$s">дочерняя тема</a> требует наличия родительской &#8212; %2$s.', NULL, '', 0, '2021-05-15 11:46:23'),
(5650, 5825, 'ru', 0, NULL, 'Этот адрес используется в целях администрирования. Если вы смените его, на новый адрес будет отправлено письмо для подтверждения. <strong>Новый адрес вступит в силу только после подтверждения.</strong>', NULL, '', 0, '2021-05-15 11:46:23'),
(5651, 5826, 'ru', 0, NULL, 'Этот набор изменений больше не может быть изменен.', NULL, '', 0, '2021-05-15 11:46:23'),
(5652, 5827, 'ru', 0, NULL, 'Эта дочерняя тема наследует шаблоны из родительской &#8212; %s.', NULL, '', 0, '2021-05-15 11:46:23'),
(5653, 5828, 'ru', 0, NULL, 'Этот комментарий уже одобрен.', NULL, '', 0, '2021-05-15 11:46:23'),
