(5656, 5831, 'ru', 0, NULL, 'Этот комментарий в настоящее время одобрен.', NULL, '', 0, '2021-05-15 11:46:23'),
(5657, 5832, 'ru', 0, NULL, 'Этот комментарий в настоящее время находится в корзине.', NULL, '', 0, '2021-05-15 11:46:23'),
(5658, 5833, 'ru', 0, NULL, 'Этот комментарий в настоящее время помечен как спам.', NULL, '', 0, '2021-05-15 11:46:23'),
(5659, 5834, 'ru', 0, NULL, 'Этот комментарий в корзине. Пожалуйста, восстановите его, если хотите отредактировать.', NULL, '', 0, '2021-05-15 11:46:23'),
(5660, 5835, 'ru', 0, NULL, 'Это означает, что подключение к WordPress.org недоступно.', NULL, '', 0, '2021-05-15 11:46:23'),
(5661, 5836, 'ru', 0, NULL, 'Эти данные используются для общих улучшений WordPress, которые включают защиту вашего сайта поиском и автоматической установкой новых обновлений. Также они используются для формирования статистики, такой как показана на <a href="%s">странице статистики WordPress.org</a>.', NULL, '', 0, '2021-05-15 11:46:23'),
(5662, 5837, 'ru', 0, NULL, 'Этот черновик из <a href="%s">неопубликованных изменений оформления</a>. Вы можете редактировать, но нет необходимости публиковать их сейчас, публикация произойдет автоматически вместе с этими изменениями.', NULL, '', 0, '2021-05-15 11:46:23'),
(5663, 5838, 'ru', 0, NULL, 'Этот формат, который мы назвали расширенным RSS для WordPress (WXR), будет содержать все ваши записи, произвольные поля, рубрики и метки.', NULL, '', 0, '2021-05-15 11:46:23'),
(5664, 5839, 'ru', 0, NULL, 'Этот скрипт для импорта не установлен. Пожалуйста, установите его на <a href="%s">основном сайте</a>.', NULL, '', 0, '2021-05-15 11:46:23'),
(5665, 5840, 'ru', 0, NULL, 'Это дочерняя тема для %s.', NULL, '', 0, '2021-05-15 11:46:23'),
(5666, 5841, 'ru', 0, NULL, 'Этот файл находится в родительской теме.', NULL, '', 0, '2021-05-15 11:46:23'),
(5667, 5842, 'ru', 0, NULL, 'Это пример страницы. От записей в блоге она отличается тем, что остаётся на одном месте и отображается в меню сайта (в большинстве тем). На странице &laquo;Детали&raquo; владельцы сайтов обычно рассказывают о себе потенциальным посетителям. Например, так:', NULL, '', 0, '2021-05-15 11:46:23'),
(5668, 5843, 'ru', 0, NULL, 'Это не просто плагин, он символизирует надежду и энтузиазм целого поколения, выраженные в двух словах из песни, наиболее известной в исполнении Луиса Армстронга: &laquo;Hello, Dolly&raquo;. После активации плагина на каждой странице панели управления в правом верхнем углу будет отображаться случайная строка из этой песни.', NULL, '', 0, '2021-05-15 11:46:23'),
(5669, 5844, 'ru', 0, NULL, 'Этот элемент уже удалён.', NULL, '', 0, '2021-05-15 11:46:23'),
(5670, 5845, 'ru', 0, NULL, 'Локализованная версия содержит и перевод и разные другие исправления для локализации.', NULL, '', 0, '2021-05-15 11:46:23'),
(5671, 5846, 'ru', 0, NULL, 'Возможно, ваш сайт недоступен или повреждён. Без паники; это можно исправить.', NULL, '', 0, '2021-05-15 11:46:23'),
(5672, 5847, 'ru', 0, NULL, 'Это поле метаданных несовместимо с редактором блоков.', NULL, '', 0, '2021-05-15 11:46:23'),
(5673, 5848, 'ru', 0, NULL, 'Поле метаданных из плагина %s не совместимо c редактором блоков.', NULL, '', 0, '2021-05-15 11:46:23'),
(5674, 5849, 'ru', 0, NULL, 'Эта новая оптимизированная цветовая палитра сокращает цвета, которые ранее были в исходном коде WordPress, до семи основных цветов и диапазона из 56 оттенков, которые соответствуют <a href="%s">рекомендуемому коэффициенту контрастности WCAG 2.0 AA</a> к белому или черному.', NULL, '', 0, '2021-05-15 11:46:23'),
(5675, 5850, 'ru', 0, NULL, 'Эта страница открывает прямой доступ к настройкам вашего сайта. Тут легко что-то сломать, пожалуйста, будьте очень осторожны!', NULL, '', 0, '2021-05-15 11:46:23'),
(5676, 5851, 'ru', 0, NULL, 'Эта страница показывает подробности о конфигурации вашего сайта WordPress. Если что-либо может быть улучшено, вы увидите это на <a href="%s">странице состояния сайта</a>.', NULL, '', 0, '2021-05-15 11:46:23'),
(5677, 5852, 'ru', 0, NULL, 'Этот пароль не будет храниться на сервере.', NULL, '', 0, '2021-05-15 11:46:23'),
(5678, 5853, 'ru', 0, NULL, 'Этот плагин не будет работать с вашей версией PHP.', NULL, '', 0, '2021-05-15 11:46:23'),
(5679, 5854, 'ru', 0, NULL, 'Этот плагин не будет работать с вашей версией WordPress. ', NULL, '', 0, '2021-05-15 11:46:23'),
(5680, 5855, 'ru', 0, NULL, 'Этот плагин не будет работать с вашими текущими версиями WordPress и PHP.', NULL, '', 0, '2021-05-15 11:46:23'),
(5681, 5856, 'ru', 0, NULL, 'Код плагина не мог быть корректно загружен и приостановлен в режиме восстановления.', NULL, '', 0, '2021-05-15 11:46:23'),
(5682, 5857, 'ru', 0, NULL, 'Плагин уже установлен.', NULL, '', 0, '2021-05-15 11:46:23'),
(5683, 5858, 'ru', 0, NULL, 'Этот плагин может быть активным на других сайтах сети.', NULL, '', 0, '2021-05-15 11:46:23'),
(5684, 5859, 'ru', 0, NULL, 'Предпросмотр в редакторе недоступен.', NULL, '', 0, '2021-05-15 11:46:23'),
(5685, 5860, 'ru', 0, NULL, 'Это привело к сообщению об ошибке: %s', NULL, '', 0, '2021-05-15 11:46:23'),
(5686, 5861, 'ru', 0, NULL, 'На этом экране можно выбрать структуру постоянных ссылок. Вы можете выбрать один из предложенных вариантов или создать произвольную структуру URL.', NULL, '', 0, '2021-05-15 11:46:23'),
(5687, 5862, 'ru', 0, NULL, 'Этот экран позволяет изменить поля для метаданных, относящиеся к файлу из библиотеки.', NULL, '', 0, '2021-05-15 11:46:23'),
(5688, 5863, 'ru', 0, NULL, 'На этом экране вы можете управлять запросами экспорта персональных данных.', NULL, '', 0, '2021-05-15 11:46:23'),
(5689, 5864, 'ru', 0, NULL, 'На этом экране вы можете управлять запросами удаления или очистки персональных данных.', NULL, '', 0, '2021-05-15 11:46:23'),
(5690, 5865, 'ru', 0, NULL, 'Этот экран содержит настройки, влияющие на отображение вашего содержимого.', NULL, '', 0, '2021-05-15 11:46:23'),
(5691, 5866, 'ru', 0, NULL, 'Этот экран используется для сопоставления меню областям, предусмотренным темой оформления.', NULL, '', 0, '2021-05-15 11:46:23'),
(5692, 5867, 'ru', 0, NULL, 'Этот экран используется для управления редакциями.', NULL, '', 0, '2021-05-15 11:46:23'),
(5693, 5868, 'ru', 0, NULL, 'Этот экран используется для управления установленными темами. За исключением тем по умолчанию, входящих в комплект WordPress, темы оформления создаются третьими лицами.', NULL, '', 0, '2021-05-15 11:46:23'),
(5694, 5869, 'ru', 0, NULL, 'Этот экран используется для управления вашими меню навигации.', NULL, '', 0, '2021-05-15 11:46:23'),
(5695, 5870, 'ru', 0, NULL, 'Этот экран используется для настройки заголовка вашей темы.', NULL, '', 0, '2021-05-15 11:46:23'),
(5696, 5871, 'ru', 0, NULL, 'На этом экране перечислены все существующие пользователи вашего сайта. Каждый пользователь имеет одну из пяти ролей, назначенных администратором: администратор, редактор, автор, участник или подписчик. Пользователи, не являющиеся администраторами, после авторизации увидят в меню консоли меньше возможностей, в зависимости от своей роли.', NULL, '', 0, '2021-05-15 11:46:23'),
(5697, 5872, 'ru', 0, NULL, 'На этом экране приведены ссылки на плагины для импорта данных из платформ управления содержимым. Выберите нужную платформу и нажмите &laquo;Установить&raquo; в появившемся окне. Если вашей платформы нет в списке, нажмите на ссылку для поиска других плагинов импорта &#8212; возможно, среди них есть плагин и для вашей платформы.', NULL, '', 0, '2021-05-15 11:46:23'),
(5698, 5873, 'ru', 0, NULL, 'На этом экране доступны все ваши записи. Вы можете настроить отображение этого экрана согласно своим предпочтениям.', NULL, '', 0, '2021-05-15 11:46:23'),
(5699, 5874, 'ru', 0, NULL, 'Этот экран предоставляет много возможностей по настройке управления и отображения комментариев и ссылок на ваши записи/страницы. Их на самом деле так много, что все они здесь не поместятся! :) Обратитесь к документации по ссылкам справа, чтобы получить информацию о каждой настройке.', NULL, '', 0, '2021-05-15 11:46:23'),
(5700, 5875, 'ru', 0, NULL, 'Этот экран показывает пользователю все его сайты в этой сети, а также позволяет выбрать основной сайт. С помощью ссылок под каждым сайтом пользователь может перейти на внешнюю часть сайта или в консоль.', NULL, '', 0, '2021-05-15 11:46:23'),
(5701, 5876, 'ru', 0, NULL, 'Эта боковая колонка недоступна и больше не отображается на вашем сайте. Чтобы полностью убрать эту неактивную колонку, удалите с неё все виджеты.', NULL, '', 0, '2021-05-15 11:46:23'),
(5702, 5877, 'ru', 0, NULL, 'Похоже, что этот сайт использует систему контроля версий. Автоматические обновления были отключены.', NULL, '', 0, '2021-05-15 11:46:23'),
(5703, 5878, 'ru', 0, NULL, 'Этот сайт автоматически обновляется при выходе каждой новой версии WordPress.', NULL, '', 0, '2021-05-15 11:46:23'),
(5704, 5879, 'ru', 0, NULL, 'Этот сайт автоматически обновляется только при выходе выпусков технического обновления и безопасности WordPress.', NULL, '', 0, '2021-05-15 11:46:23'),
(5705, 5880, 'ru', 0, NULL, 'Этот сайт не получает обновлений для новых выпусков WordPress.', NULL, '', 0, '2021-05-15 11:46:23'),
(5706, 5881, 'ru', 0, NULL, 'Этот текстовый шаблон поможет вам создать политику конфиденциальности вашего сайта.', NULL, '', 0, '2021-05-15 11:46:23'),
(5707, 5882, 'ru', 0, NULL, 'У этой темы ещё нет голосов.', NULL, '', 0, '2021-05-15 11:46:23'),
(5708, 5883, 'ru', 0, NULL, 'Эта тема уже установлена и не требует обновления', NULL, '', 0, '2021-05-15 11:46:23'),
(5709, 5884, 'ru', 0, NULL, 'Эта тема уже установлена.', NULL, '', 0, '2021-05-15 11:46:23'),
(5710, 5885, 'ru', 0, NULL, 'Эта тема повреждена.', NULL, '', 0, '2021-05-15 11:46:23'),
(5711, 5886, 'ru', 0, NULL, 'Эта тема требует наличия родительской темы. Проверяем, установлена ли она&#8230;', NULL, '', 0, '2021-05-15 11:46:23'),
(5712, 5887, 'ru', 0, NULL, 'В этом часовом поясе не используется летнее время.', NULL, '', 0, '2021-05-15 11:46:23'),
(5713, 5888, 'ru', 0, NULL, 'В этом часовом поясе в настоящий момент действует летнее время.', NULL, '', 0, '2021-05-15 11:46:23'),
(5714, 5889, 'ru', 0, NULL, 'В этом часовом поясе в настоящий момент действует зимнее время.', NULL, '', 0, '2021-05-15 11:46:23'),
(5715, 5890, 'ru', 0, NULL, 'Этот инструмент помогает владельцам сайтов соответствовать местным законам и регуляторным актам, позволяя удалить или анонимизировать данные определённого пользователя.', NULL, '', 0, '2021-05-15 11:46:23'),
(5716, 5891, 'ru', 0, NULL, 'Этот инструмент помогает владельцам сайтов соответствовать местным законам и регуляторным актам, экспортируя известные о пользователе данные в архив .zip.', NULL, '', 0, '2021-05-15 11:46:23'),
(5717, 5892, 'ru', 0, NULL, 'Это обновление не будет работать с текущей версией PHP.', NULL, '', 0, '2021-05-15 11:46:23'),
(5718, 5893, 'ru', 0, NULL, 'Это обновление не будет работать с вашей версией WordPress. ', NULL, '', 0, '2021-05-15 11:46:23'),
(5719, 5894, 'ru', 0, NULL, 'Это обновление не будет работать с вашими версиями WordPress и PHP.', NULL, '', 0, '2021-05-15 11:46:23'),
(5720, 5895, 'ru', 0, NULL, 'Этот пользователь имеет права суперадминистратора.', NULL, '', 0, '2021-05-15 11:46:23'),
(5721, 5896, 'ru', 0, NULL, 'Этот виджет требует JavaScript.', NULL, '', 0, '2021-05-15 11:46:23'),
(5722, 5897, 'ru', 0, NULL, 'Будет показано, когда кто-то наводит курсор на ссылку из списка, или (возможно) под ссылкой.', NULL, '', 0, '2021-05-15 11:46:23') ;
INSERT INTO `wp_icl_string_translations` ( `id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES
(5723, 5898, 'ru', 0, NULL, 'Эта функция удалит все элементы из списка неактивных виджетов. Вы не сможете вернуть сделанные изменения.', NULL, '', 0, '2021-05-15 11:46:23'),
(5724, 5899, 'ru', 0, NULL, 'Сюда входят все ваши записи, страницы, комментарии, произвольные поля, рубрики и метки, меню и произвольные типы записей.', NULL, '', 0, '2021-05-15 11:46:23'),
(5725, 5900, 'ru', 0, NULL, 'Это предоставит доступ к <a href="%1$s">%2$s блогу для которого у вас есть доступ в этой установке WordPress</a>.', NULL, '', 0, '2021-05-15 11:46:23'),
(5726, 5901, 'ru', 0, NULL, 'Это предоставит доступ к <a href="%1$s">%2$s блогам для которых у вас есть доступ в этой установке WordPress</a>.', NULL, '', 0, '2021-05-15 11:46:23'),
(5727, 5902, 'ru', 0, NULL, 'Эта функция удалит фоновое изображение. Вы не сможете вернуть сделанные изменения.', NULL, '', 0, '2021-05-15 11:46:23'),
(5728, 5903, 'ru', 0, NULL, 'Эта функция удалит изображение заголовка. Вы не сможете вернуть сделанные изменения.', NULL, '', 0, '2021-05-15 11:46:23'),
(5729, 5904, 'ru', 0, NULL, 'Текущее содержимое в редакторе будет заменено последней сохранённой версией. С помощью кнопок «Отменить» и «Повторить» в редакторе можно будет вернуть старое содержимое или оставить восстановленную версию.', NULL, '', 0, '2021-05-15 11:46:23'),
(5730, 5905, 'ru', 0, NULL, 'Эта функция восстановит исходное фоновое изображение. Вы не сможете вернуть сделанные изменения.', NULL, '', 0, '2021-05-15 11:46:23'),
(5731, 5906, 'ru', 0, NULL, 'Эта функция восстановит исходное изображение заголовка. Вы не сможете вернуть сделанные изменения.', NULL, '', 0, '2021-05-15 11:46:23'),
(5732, 5907, 'ru', 0, NULL, 'Три колонки', NULL, '', 0, '2021-05-15 11:46:23'),
(5733, 5908, 'ru', 0, NULL, 'Настройки миниатюры', NULL, '', 0, '2021-05-15 11:46:23'),
(5734, 5909, 'ru', 0, NULL, 'Подсказка по настройкам миниатюры', NULL, '', 0, '2021-05-15 11:46:23'),
(5735, 5910, 'ru', 0, NULL, 'Размер миниатюры', NULL, '', 0, '2021-05-15 11:46:23'),
(5736, 5911, 'ru', 0, NULL, 'Часовой пояс', NULL, '', 0, '2021-05-15 11:46:23'),
(5737, 5912, 'ru', 0, NULL, 'Заголовок и редактор', NULL, '', 0, '2021-05-15 11:46:23'),
(5738, 5913, 'ru', 0, NULL, 'Чтобы активировать виджет, перетащите его на боковую колонку или нажмите на него. Чтобы деактивировать виджет или удалить его настройки, перетащите его обратно.', NULL, '', 0, '2021-05-15 11:46:23'),
(5739, 5914, 'ru', 0, NULL, 'Чтобы добавить ссылку, <strong>раскройте блок &laquo;Произвольные ссылки&raquo;, введите URL и текст ссылки, затем нажмите &laquo;Добавить в меню&raquo;</strong>.', NULL, '', 0, '2021-05-15 11:46:23'),
(5740, 5915, 'ru', 0, NULL, 'Чтобы создать новое меню вместо назначения существующего, <strong>нажмите ссылку &laquo;Использовать новое меню&raquo;</strong>. Ваше новое меню будет автоматически назначено для этой области.', NULL, '', 0, '2021-05-15 11:46:23'),
(5741, 5916, 'ru', 0, NULL, 'Чтобы добавить на сайт нового пользователя, нажмите кнопку &laquo;Добавить нового&raquo; в верхней части экрана, либо ссылку &laquo;Добавить нового&raquo; в меню &laquo;Пользователи&raquo;.', NULL, '', 0, '2021-05-15 11:46:23'),
(5742, 5917, 'ru', 0, NULL, 'Чтобы добавить пользователя на сайт, заполните форму на этом экране и нажмите кнопку &laquo;Добавить нового пользователя&raquo;.', NULL, '', 0, '2021-05-15 11:46:23'),
(5743, 5918, 'ru', 0, NULL, 'Чтобы разрешить использование этой страницы для автоматического ремонта базы данных, добавьте в ваш файл %s следующую строку. После добавления перезагрузите страницу.', NULL, '', 0, '2021-05-15 11:46:23'),
(5744, 5919, 'ru', 0, NULL, 'Чтобы назначить меню для одной или нескольких областей темы, <strong>выберите меню в выпадающем списке соответствующей области</strong>. Когда закончите, <strong>нажмите &laquo;Сохранить изменения&raquo;</strong>.', NULL, '', 0, '2021-05-15 11:46:23'),
(5745, 5920, 'ru', 0, NULL, 'Чтобы обрезать изображение, нажмите на него и выделите нужную часть, удерживая кнопку мыши.', NULL, '', 0, '2021-05-15 11:46:23'),
(5746, 5921, 'ru', 0, NULL, 'Чтобы удалить файлы, нажмите кнопку &laquo;Множественный выбор&raquo; в верхней части экрана. Выберите элементы, которые хотите удалить, затем нажмите кнопку &laquo;Удалить выбранные&raquo;. Нажав кнопку &laquo;Снять выделение&raquo;, можно вернуться к просмотру файлов.', NULL, '', 0, '2021-05-15 11:46:23'),
(5747, 5922, 'ru', 0, NULL, 'Свободно распространять копии измененной вами программы.', NULL, '', 0, '2021-05-15 11:46:23'),
(5748, 5923, 'ru', 0, NULL, 'Чтобы изменить меню, назначенное для одной из областей, <strong>нажмите ссылку &laquo;Изменить&raquo; рядом с ним</strong>.', NULL, '', 0, '2021-05-15 11:46:23'),
(5749, 5924, 'ru', 0, NULL, 'Чтобы изменить существующее меню, <strong>выберите его в выпадающем списке и нажмите кнопку &laquo;Выбрать&raquo;</strong>.', NULL, '', 0, '2021-05-15 11:46:23'),
(5750, 5925, 'ru', 0, NULL, 'Для улучшения безопасности сайта рекомендуется удалить любые неиспользуемые темы. Вам стоит сохранить тему WordPress по умолчанию %1$s, текущую тему %2$s и её родительскую тему %3$s.', NULL, '', 0, '2021-05-15 11:46:23'),
(5751, 5926, 'ru', 0, NULL, 'Для улучшения безопасности сайта рекомендуется удалить любые неиспользуемые темы. Вам стоит сохранить текущую тему %1$s и её родительскую тему %2$s.', NULL, '', 0, '2021-05-15 11:46:23'),
(5752, 5927, 'ru', 0, NULL, 'Чтобы установить тему и получить возможность просмотреть её с содержимым вашего сайта и со своими настройками, нажмите кнопку &laquo;Установить&raquo; в верхней части левой панели. Тема будет автоматически загружена на ваш сайт. После загрузки тема станет доступной для активации. Можно нажать ссылку &laquo;Активировать&raquo;, либо перейти на экран &laquo;Управление темами&raquo; и нажать ссылку &laquo;Просмотреть&raquo; под миниатюрой любой из установленных тем.', NULL, '', 0, '2021-05-15 11:46:23'),
(5753, 5928, 'ru', 0, NULL, 'Для управления плагинами вашего сайта, посетите страницу плагинов: %s', NULL, '', 0, '2021-05-15 11:46:23'),
(5754, 5929, 'ru', 0, NULL, 'Для управления темами вашего сайта, посетите страницу тем: %s', NULL, '', 0, '2021-05-15 11:46:23'),
(5755, 5930, 'ru', 0, NULL, 'Чтобы переключаться между редакциями, <strong>перетаскивайте ползунок влево или вправо</strong> или <strong>используйте кнопки &laquo;Предыдущая&raquo; и &laquo;Следующая&raquo;</strong>.', NULL, '', 0, '2021-05-15 11:46:23'),
(5756, 5931, 'ru', 0, NULL, 'Чтобы осуществить запрошенное действие, WordPress необходим доступ к вашему серверу.', NULL, '', 0, '2021-05-15 11:46:23'),
(5757, 5932, 'ru', 0, NULL, 'Чтобы публиковать записи в WordPress при помощи e-mail, вам необходимо создать скрытый e-mail с POP3-доступом. Любое сообщение, пришедшее на этот адрес, будет опубликовано, поэтому лучше держать этот адрес в тайне. Вот, например, три произвольных имени, которые вы можете использовать: %1$s, %2$s, %3$s.', NULL, '', 0, '2021-05-15 11:46:23'),
(5758, 5933, 'ru', 0, NULL, 'Распространять.', NULL, '', 0, '2021-05-15 11:46:23'),
(5759, 5934, 'ru', 0, NULL, 'Чтобы изменить порядок элементов меню, <strong>перетащите их мышью или используйте клавиатуру</strong>. Оттащите или переместите элемент немного вправо, чтобы создать подменю.', NULL, '', 0, '2021-05-15 11:46:23'),
(5760, 5935, 'ru', 0, NULL, 'Чтобы восстановить редакцию, <strong>нажмите &laquo;Восстановить эту редакцию&raquo;</strong>.', NULL, '', 0, '2021-05-15 11:46:23'),
(5761, 5936, 'ru', 0, NULL, 'Запускать программу с любой целью.', NULL, '', 0, '2021-05-15 11:46:23'),
(5762, 5937, 'ru', 0, NULL, 'Изучать как программа работает, и её модификация для достижения своих целей.', NULL, '', 0, '2021-05-15 11:46:23'),
(5763, 5938, 'ru', 0, NULL, 'Наверх', NULL, '', 0, '2021-05-15 11:46:23'),
(5764, 5939, 'ru', 0, NULL, 'Чтобы использовать фоновое изображение, просто загрузите его или выберите ранее загруженное изображение из библиотеки файлов, нажав кнопку &laquo;Выбрать изображение&raquo;. Можно показывать изображение в одном экземпляре, либо замостить экран. Можно сделать фон фиксированным, чтобы содержимое сайта перемещалось поверх него, либо прокручивать его вместе с сайтом.', NULL, '', 0, '2021-05-15 11:46:23'),
(5765, 5940, 'ru', 0, NULL, 'Чтобы использовать режим поддоменов, необходимо использовать маску в записях DNS. В общем случае достаточно добавить с помощью инструмента настройки DNS запись с адресом %s, указывающую на ваш сервер.', NULL, '', 0, '2021-05-15 11:46:23'),
