(5772, 5947, 'ru', 0, NULL, 'Обратные ссылки &#8212; это способ уведомить другие блоги, что вы сослались на них. Если вы ссылаетесь на блог под управлением WordPress, <a href="%s">уведомление</a> будет отправлено ему автоматически, дополнительных действий не требуется.', NULL, '', 0, '2021-05-15 11:46:23'),
