(5956, 6131, 'ru', 0, NULL, 'Внимание! Возможно, маска DNS настроена неправильно!', NULL, '', 0, '2021-05-15 11:46:23'),
(5957, 6132, 'ru', 0, NULL, 'Внимание:', NULL, '', 0, '2021-05-15 11:46:23'),
(5958, 6133, 'ru', 0, NULL, 'Wavatar (Автоматически)', NULL, '', 0, '2021-05-15 11:46:23'),
(5959, 6134, 'ru', 0, NULL, 'Мы не можем найти %s. Попробуйте другой ближайший город. Например: Красногорск; Московская Область; Российская Федерация.', NULL, '', 0, '2021-05-15 11:46:23'),
(5960, 6135, 'ru', 0, NULL, 'У нас есть данные с описанием ошибки, произошедшей на вашем сайте.', NULL, '', 0, '2021-05-15 11:46:23'),
(5961, 6136, 'ru', 0, NULL, 'Мы предлагаем нужные вам разделы. В каждом заголовке раздела вы найдете короткое обобщение о требованиях к предоставляемой информации, что поможет вам начать наполнение. Некоторые разделы включают предлагаемое содержимое политики, другие требуется заполнить информацией с учетом вашей темы и плагинов.', NULL, '', 0, '2021-05-15 11:46:23'),
(5962, 6137, 'ru', 0, NULL, 'Рекомендуется удалить все неиспользуемые темы для улучшения безопасности сайта.', NULL, '', 0, '2021-05-15 11:46:23'),
(5963, 6138, 'ru', 0, NULL, 'Мы серьезно относимся к приватности и прозрачности сбора данных. Чтобы узнать больше о собираемых нами данных и как мы их используем, посетите <a href="%s">WordPress.org/about/privacy</a>.', NULL, '', 0, '2021-05-15 11:46:23'),
(5964, 6139, 'ru', 0, NULL, 'Мы попытались, но не смогли автоматически обновить ваш сайт.', NULL, '', 0, '2021-05-15 11:46:23'),
(5965, 6140, 'ru', 0, NULL, 'Невозможно проверить доступность новой версии WordPress.', NULL, '', 0, '2021-05-15 11:46:23'),
(5966, 6141, 'ru', 0, NULL, 'Мы также рекомендуем просматривать время от времени вашу политику конфиденциальности, особенно после установки или обновлений плагинов и тем.  В ней могут быть изменения или предложения добавить новую информацию к вашей политике.', NULL, '', 0, '2021-05-15 11:46:23'),
(5967, 6142, 'ru', 0, NULL, 'На всякий случай мы сохраним эту запись в вашем браузере.', NULL, '', 0, '2021-05-15 11:46:23'),
(5968, 6143, 'ru', 0, NULL, 'Мы используем эту информацию, чтобы создать файл %s.', NULL, '', 0, '2021-05-15 11:46:23'),
(5969, 6144, 'ru', 0, NULL, 'Мы собрали несколько ссылок для вашего удобства:', NULL, '', 0, '2021-05-15 11:46:23'),
(5970, 6145, 'ru', 0, NULL, 'Мы попробуем снова для следующей версии.', NULL, '', 0, '2021-05-15 11:46:23'),
(5971, 6146, 'ru', 0, NULL, 'Адрес', NULL, '', 0, '2021-05-15 11:46:23'),
(5972, 6147, 'ru', 0, NULL, 'ПО весервера', NULL, '', 0, '2021-05-15 11:46:23'),
(5973, 6148, 'ru', 0, NULL, 'Первый день недели', NULL, '', 0, '2021-05-15 11:46:23'),
(5974, 6149, 'ru', 0, NULL, 'Добро пожаловать', NULL, '', 0, '2021-05-15 11:46:23'),
(5975, 6150, 'ru', 0, NULL, 'Добро пожаловать на %s. Это ваша первая запись. Отредактируйте или удалите её, затем пишите!', NULL, '', 0, '2021-05-15 11:46:23'),
(5976, 6151, 'ru', 0, NULL, 'Добро пожаловать в WordPress %1$s. <a href="%2$s">Узнать больше</a>.', NULL, '', 0, '2021-05-15 11:46:23'),
(5977, 6152, 'ru', 0, NULL, 'Добро пожаловать в WordPress %1$s. Сейчас вы будете перенаправлены на экран &laquo;О WordPress&raquo;. Если этого не произошло, нажмите <a href="%2$s">сюда</a>.', NULL, '', 0, '2021-05-15 11:46:23'),
(5978, 6153, 'ru', 0, NULL, 'Добро пожаловать в WordPress!', NULL, '', 0, '2021-05-15 11:46:23'),
(5979, 6154, 'ru', 0, NULL, 'Добро пожаловать. Прежде чем мы начнём, потребуется информация о базе данных. Вот что вам необходимо знать до начала процедуры установки.', NULL, '', 0, '2021-05-15 11:46:23'),
(5980, 6155, 'ru', 0, NULL, 'Добро пожаловать в WordPress. Это ваша первая запись. Отредактируйте или удалите ее, затем начинайте создавать!', NULL, '', 0, '2021-05-15 11:46:23'),
(5981, 6156, 'ru', 0, NULL, 'Добро пожаловать в знаменитую пятиминутную установку WordPress! Просто заполните поля &#8212; и вперёд, к использованию самой мощной и гибкой персональной платформы для публикаций в мире!', NULL, '', 0, '2021-05-15 11:46:23'),
(5982, 6157, 'ru', 0, NULL, 'Добро пожаловать в консоль WordPress! Этот экран вы будете видеть после авторизации. Он даёт доступ ко всем функциям управления сайтом. Можно получить помощь по каждому экрану, нажав на вкладку &laquo;Помощь&raquo; над заголовком экрана.', NULL, '', 0, '2021-05-15 11:46:23'),
(5983, 6158, 'ru', 0, NULL, 'Какие автоматические решения принимаются на основе данных пользователей', NULL, '', 0, '2021-05-15 11:46:23'),
(5984, 6159, 'ru', 0, NULL, 'Какие принимаются процедуры против взлома данных', NULL, '', 0, '2021-05-15 11:46:23'),
(5985, 6160, 'ru', 0, NULL, 'Что такое PHP и как это влияет на мой сайт?', NULL, '', 0, '2021-05-15 11:46:23'),
(5986, 6161, 'ru', 0, NULL, 'Какие персональные данные мы собираем и с какой целью', NULL, '', 0, '2021-05-15 11:46:23'),
(5987, 6162, 'ru', 0, NULL, 'Какие у вас права на ваши данные', NULL, '', 0, '2021-05-15 11:46:23'),
(5988, 6163, 'ru', 0, NULL, 'Что нужно сделать с записями пользователя %s?', NULL, '', 0, '2021-05-15 11:46:23'),
(5989, 6164, 'ru', 0, NULL, 'Что нужно сделать с записями этих пользователей?', NULL, '', 0, '2021-05-15 11:46:23'),
(5990, 6165, 'ru', 0, NULL, 'Что нужно сделать с записями этого пользователя?', NULL, '', 0, '2021-05-15 11:46:23'),
(5991, 6166, 'ru', 0, NULL, 'От каких третьих сторон мы получаем данные', NULL, '', 0, '2021-05-15 11:46:23'),
(5992, 6167, 'ru', 0, NULL, 'Что нового', NULL, '', 0, '2021-05-15 11:46:23'),
(5993, 6168, 'ru', 0, NULL, 'О чём хотите написать?', NULL, '', 0, '2021-05-15 11:46:23'),
(5994, 6169, 'ru', 0, NULL, 'В чём отличие между рубриками и метками? Обычно в качестве меток используют произвольные ключевые слова, обозначающие важную информацию в вашей записи (имена, объекты и т.д.), которые могут встречаться или не встречаться в других записях, а в качестве рубрик &#8212; заранее определённые разделы. Если рассматривать сайт как книгу, то рубрики похожи на содержание, а метки &#8212; на алфавитный указатель.', NULL, '', 0, '2021-05-15 11:46:23'),
(5995, 6170, 'ru', 0, NULL, 'Если комментарий содержит какие-либо из этих слов в своём тексте, имени автора, URL, адресе e-mail или IP, то поместить его в <a href="edit-comments.php?comment_status=moderated">очередь на модерацию</a>. Каждое слово или IP с новой строки. Используется поиск по подстроке, то есть по слову &#8220;press&#8221; будет найдено &#8220;WordPress&#8221;.', NULL, '', 0, '2021-05-15 11:46:23'),
(5996, 6171, 'ru', 0, NULL, 'Если комментарий содержит какие-либо из этих слов в своём тексте, имени автора, URL, адресе e-mail или IP, то он будет удалён в корзину. Каждое слово или IP задается с новой строки. Используется поиск по подстроке, то есть по слову &#8220;press&#8221; будет найдено &#8220;WordPress&#8221;.', NULL, '', 0, '2021-05-15 11:46:23'),
(5997, 6172, 'ru', 0, NULL, 'При добавлении новой рубрики на этом экране заполняются следующие поля:', NULL, '', 0, '2021-05-15 11:46:23'),
(5998, 6173, 'ru', 0, NULL, 'При добавлении новой метки на этом экране заполняются следующие поля:', NULL, '', 0, '2021-05-15 11:46:23'),
(5999, 6174, 'ru', 0, NULL, 'При смене темы часто также меняются настройки и количество областей виджетов. Иногда эти конфликты делают переход к новой теме не таким гладким. Если вы сменили тему и у вас пропали виджеты, прокрутите этот экран вниз до панели &laquo;Неактивные виджеты&raquo;, где вы найдёте все свои виджеты с сохранёнными настройками.', NULL, '', 0, '2021-05-15 11:46:23'),
(6000, 6175, 'ru', 0, NULL, 'При просмотре на небольших мониторах можно нажать иконку &laquo;Свернуть&raquo; в нижней части левой панели. Панель будет скрыта, освобождая пространство для просмотра вашего сайта с новой темой. Чтобы вернуть панель, нажмите иконку &laquo;Свернуть&raquo; ещё раз.', NULL, '', 0, '2021-05-15 11:46:23'),
(6001, 6176, 'ru', 0, NULL, 'Когда используется эта настройка, на главной странице консоли в блоке &laquo;На виду&raquo; отображается памятка &laquo;Поисковые системы заблокированы&raquo;, чтобы напомнить вам, что сайт не индексируется.', NULL, '', 0, '2021-05-15 11:46:23'),
(6002, 6177, 'ru', 0, NULL, 'При массовом редактировании вы можете изменить метаданные (рубрики, автора и т.д.) сразу всех выбранных записей. Чтобы удалить запись из группы, просто нажмите на крестик рядом с её названием в появившейся области.', NULL, '', 0, '2021-05-15 11:46:23'),
(6003, 6178, 'ru', 0, NULL, 'Если посетитель оставляет комментарий на сайте, мы собираем данные указанные в форме комментария, а также IP адрес посетителя и данные user-agent браузера с целью определения спама.', NULL, '', 0, '2021-05-15 11:46:23'),
(6004, 6179, 'ru', 0, NULL, 'Когда вы присваиваете записи несколько рубрик или меток, в ссылке может оказаться только одна из них: рубрика с наименьшим ID. Это относится к структурам, включающим элементы %1$s или %2$s.', NULL, '', 0, '2021-05-15 11:46:23'),
(6005, 6180, 'ru', 0, NULL, 'Когда вы нажмёте кнопку, WordPress создаст XML-файл, который можно будет сохранить на компьютере.', NULL, '', 0, '2021-05-15 11:46:23'),
(6006, 6181, 'ru', 0, NULL, 'При входе в учетную запись мы также устанавливаем несколько куки с данными входа и настройками экрана. Куки входа хранятся в течение двух дней, куки с настройками экрана - год. Если вы выберете возможность "Запомнить меня", данные о входе будут сохраняться в течение двух недель. При выходе из учетной записи куки входа будут удалены.', NULL, '', 0, '2021-05-15 11:46:23'),
(6007, 6182, 'ru', 0, NULL, 'Когда вы публикуете новую статью, WordPress автоматически уведомляет следующие сайты служб слежения за обновлениями. Более подробно об этом написано в статье <a href="%s">&laquo;Службы слежения за обновлениями&raquo;</a> в Кодексе. Если адресов служб несколько, пишите каждый в новой строке.', NULL, '', 0, '2021-05-15 11:46:23'),
(6008, 6183, 'ru', 0, NULL, 'Тогда, когда вы сможете использовать кнопку "Обновить сейчас" в Консоль>Обновления, мы очистим эту ошибку для будущих попыток обновления.', NULL, '', 0, '2021-05-15 11:46:23'),
(6009, 6184, 'ru', 0, NULL, 'Куда мы отправляем ваши данные', NULL, '', 0, '2021-05-15 11:46:23'),
(6010, 6185, 'ru', 0, NULL, 'При проверке запланированных заданий на сайте возникла ошибка: %s', NULL, '', 0, '2021-05-15 11:46:23'),
(6011, 6186, 'ru', 0, NULL, 'Когда вы будете править файл %1$s, заодно убедитесь, что в нём заданы все 8 уникальных ключей. Их можно сгенерировать с помощью <a href="%2$s">сервиса секретных ключей WordPress.org</a>.', NULL, '', 0, '2021-05-15 11:46:23'),
(6012, 6187, 'ru', 0, NULL, 'В процессе обновления сайт будет закрыт на техническое обслуживание. После завершения обновления сайт вернётся в обычный режим.', NULL, '', 0, '2021-05-15 11:46:23'),
(6013, 6188, 'ru', 0, NULL, 'Кто мы', NULL, '', 0, '2021-05-15 11:46:23'),
(6014, 6189, 'ru', 0, NULL, 'С кем мы делимся вашими данными', NULL, '', 0, '2021-05-15 11:46:23'),
(6015, 6190, 'ru', 0, NULL, 'Широкие блоки', NULL, '', 0, '2021-05-15 11:46:23'),
(6016, 6191, 'ru', 0, NULL, 'Виджет &laquo;%s&raquo;', NULL, '', 0, '2021-05-15 11:46:23'),
(6017, 6192, 'ru', 0, NULL, 'Виджеты &#8212; это независимые блоки содержимого, которые можно размещать в областях, предусмотренных вашей темой (обычно их называют боковыми колонками). Чтобы заполнить их виджетами, перетащите заголовки в желаемую область. По умолчанию раскрывается только первая область. Чтобы заполнить остальные области, разверните их нажатием на заголовки.', NULL, '', 0, '2021-05-15 11:46:23'),
(6018, 6193, 'ru', 0, NULL, 'Виджеты можно использовать многократно. Каждому виджету можно дать заголовок для отображения на сайте, но это необязательно.', NULL, '', 0, '2021-05-15 11:46:23'),
(6019, 6194, 'ru', 0, NULL, 'В новом выпуске WordPress предлагает вам освежить цвета. Его редактор помогает вам работать в тех местах, где раньше приходилось работать с кодом или нанимать профессионала. Часто используемые элементы управления, например изменение размера шрифта, находятся во многих местах и всегда под рукой. А сделать простые изменения макета, например изображение на всю высоту, становится ещё проще.', NULL, '', 0, '2021-05-15 11:46:23'),
(6020, 6195, 'ru', 0, NULL, 'Количество слов: %s', NULL, '', 0, '2021-05-15 11:46:23'),
(6021, 6196, 'ru', 0, NULL, 'WordCamp', NULL, '', 0, '2021-05-15 11:46:23'),
(6022, 6197, 'ru', 0, NULL, 'WordPress', NULL, '', 0, '2021-05-15 11:46:23') ;
INSERT INTO `wp_icl_string_translations` ( `id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES
(6023, 6198, 'ru', 0, NULL, 'WordPress %1$s с темой оформления %2$s.', NULL, '', 0, '2021-05-15 11:46:23'),
(6024, 6199, 'ru', 0, NULL, 'WordPress %s', NULL, '', 0, '2021-05-15 11:46:23'),
(6025, 6200, 'ru', 0, NULL, 'Также доступен WordPress %s.', NULL, '', 0, '2021-05-15 11:46:23'),
(6026, 6201, 'ru', 0, NULL, 'WordPress &rsaquo; Ремонт базы данных', NULL, '', 0, '2021-05-15 11:46:23'),
(6027, 6202, 'ru', 0, NULL, 'WordPress &rsaquo; Установка', NULL, '', 0, '2021-05-15 11:46:23'),
(6028, 6203, 'ru', 0, NULL, 'WordPress &rsaquo; Настройка файла конфигурации', NULL, '', 0, '2021-05-15 11:46:23'),
(6029, 6204, 'ru', 0, NULL, 'WordPress &rsaquo; Обновление', NULL, '', 0, '2021-05-15 11:46:23'),
(6030, 6205, 'ru', 0, NULL, 'Приложение WordPress на моём смартфоне', NULL, '', 0, '2021-05-15 11:46:23'),
(6031, 6206, 'ru', 0, NULL, 'Блог WordPress', NULL, '', 0, '2021-05-15 11:46:23'),
(6032, 6207, 'ru', 0, NULL, 'Константы WordPress', NULL, '', 0, '2021-05-15 11:46:23'),
(6033, 6208, 'ru', 0, NULL, 'Новости и мероприятия WordPress', NULL, '', 0, '2021-05-15 11:46:23'),
(6034, 6209, 'ru', 0, NULL, 'Обновления WordPress', NULL, '', 0, '2021-05-15 11:46:23'),
(6035, 6210, 'ru', 0, NULL, 'Версия WordPress', NULL, '', 0, '2021-05-15 11:46:23'),
(6036, 6211, 'ru', 0, NULL, 'WordPress может также попытаться оптимизировать базу данных. В некоторых случаях это помогает увеличить производительность. Ремонт и оптимизация базы могут занять длительное время, в процессе оптимизации база будет заблокирована.', NULL, '', 0, '2021-05-15 11:46:23'),
(6037, 6212, 'ru', 0, NULL, 'WordPress может автоматически найти распространённые ошибки в базе данных и исправить их. Исправление может занять некоторое время &#8212; пожалуйста, наберитесь терпения.', NULL, '', 0, '2021-05-15 11:46:23'),
(6038, 6213, 'ru', 0, NULL, 'Ремонт базы данных WordPress', NULL, '', 0, '2021-05-15 11:46:23'),
(6039, 6214, 'ru', 0, NULL, 'Разрабатываемые обновления WordPress блокированы константой %s.', NULL, '', 0, '2021-05-15 11:46:23'),
(6040, 6215, 'ru', 0, NULL, 'Разрабатываемые обновления WordPress блокированы фильтром %s.', NULL, '', 0, '2021-05-15 11:46:23'),
(6041, 6216, 'ru', 0, NULL, 'Местонахождение папки WordPress', NULL, '', 0, '2021-05-15 11:46:23'),
(6042, 6217, 'ru', 0, NULL, 'Размер папки WordPress', NULL, '', 0, '2021-05-15 11:46:23'),
(6043, 6218, 'ru', 0, NULL, 'WordPress развивается, когда такие же пользователи, как и вы, рассказывают о нём своим друзьям, а тысячи коммерческих проектов и сервисов, построенных на WordPress, сообщают об этом своим пользователям. Нам очень приятно, когда кто-то делится хорошими отзывами, только <a href="%s">ознакомьтесь с правилами использования нашей торговой марки</a>.', NULL, '', 0, '2021-05-15 11:46:23'),
(6044, 6219, 'ru', 0, NULL, 'WordPress установлен. Желаем успешной работы!', NULL, '', 0, '2021-05-15 11:46:23'),
(6045, 6220, 'ru', 0, NULL, 'WordPress был обновлён! Прежде чем продолжить работу, нужно обновить базу данных до самой свежей версии.', NULL, '', 0, '2021-05-15 11:46:23'),
(6046, 6221, 'ru', 0, NULL, 'WordPress &#8212; свободное и открытое программное обеспечение, созданное распределённым сообществом добровольных разработчиков со всего мира. Благодаря своей <a href="%s">лицензии</a>, GPL, WordPress даёт вам необычайно широкий объём прав и свобод.', NULL, '', 0, '2021-05-15 11:46:23'),
(6047, 6222, 'ru', 0, NULL, 'Используется свежая версия WordPress.', NULL, '', 0, '2021-05-15 11:46:23'),
(6048, 6223, 'ru', 0, NULL, 'WordPress развивается силами <a href="%1$s">международной команды</a> увлечённых энтузиастов. <a href="%2$s">Примите участие в проекте</a>.', NULL, '', 0, '2021-05-15 11:46:23'),
(6049, 6224, 'ru', 0, NULL, 'WordPress развивается силами международной команды увлечённых энтузиастов.', NULL, '', 0, '2021-05-15 11:46:23'),
(6050, 6225, 'ru', 0, NULL, 'WordPress не уведомляет никакие <a href="%1$s">Службы слежения за обновлениями</a> согласно <a href="%2$s">настройкам видимости</a> вашего сайта.', NULL, '', 0, '2021-05-15 11:46:23'),
(6051, 6226, 'ru', 0, NULL, 'WordPress даёт возможность указать для постоянных ссылок и архивов собственную структуру. Это может придать вашим ссылкам эстетичность, удобство использования и обеспечить совместимость в будущем. Можно просмотреть <a href="%s">полный список доступных тегов</a>, а для начала несколько примеров.', NULL, '', 0, '2021-05-15 11:46:23'),
(6052, 6227, 'ru', 0, NULL, 'WordPress требует %1$s версии %2$s или новее. Обратитесь в поддержку вашего хостинга для исправления ситуации.', NULL, '', 0, '2021-05-15 11:46:23'),
(6053, 6228, 'ru', 0, NULL, 'Обновления безопасности и исправления ошибок WordPress блокированы %s.', NULL, '', 0, '2021-05-15 11:46:23'),
(6054, 6229, 'ru', 0, NULL, 'Обновления безопасности и исправления ошибок WordPress блокированы фильтром %s.', NULL, '', 0, '2021-05-15 11:46:23'),
(6055, 6230, 'ru', 0, NULL, 'WordPress должен исправлять некорректный XHTML-код автоматически.', NULL, '', 0, '2021-05-15 11:46:23'),
(6056, 6231, 'ru', 0, NULL, 'Сайт на WordPress: %s', NULL, '', 0, '2021-05-15 11:46:23'),
(6057, 6232, 'ru', 0, NULL, 'Доступно обновление WordPress (%s)', NULL, '', 0, '2021-05-15 11:46:23'),
(6058, 6233, 'ru', 0, NULL, 'WordPress успешно обновлён.', NULL, '', 0, '2021-05-15 11:46:23'),
(6059, 6234, 'ru', 0, NULL, 'С этого момента WordPress будет автоматически обновляться только до выпусков технического обновления и безопасности.', NULL, '', 0, '2021-05-15 11:46:23'),
(6060, 6235, 'ru', 0, NULL, 'Поддержка utf8mb4 требует MariaDB версии %s или выше. Пожалуйста, обратитесь в техническую поддержку хостинга.', NULL, '', 0, '2021-05-15 11:46:23'),
(6061, 6236, 'ru', 0, NULL, 'Поддержка utf8mb4 требует клиентскую библиотеку MySQL (%1$s) версии %2$s или выше. Пожалуйста, обратитесь в техническую поддержку хостинга.', NULL, '', 0, '2021-05-15 11:46:23'),
(6062, 6237, 'ru', 0, NULL, 'Поддержка utf8mb4 требует MySQL версии %s или выше. Пожалуйста, обратитесь в техническую поддержку хостинга.', NULL, '', 0, '2021-05-15 11:46:23'),
(6063, 6238, 'ru', 0, NULL, 'Страница на WordPress.org &#187;', NULL, '', 0, '2021-05-15 11:46:23'),
(6064, 6239, 'ru', 0, NULL, 'Сайт WordPress.org доступен', NULL, '', 0, '2021-05-15 11:46:23'),
(6065, 6240, 'ru', 0, NULL, 'Вы хотите предоставить доступ к вашей учётной записи для приложения идентифицируемого как %s? Вам не следует это делать, если вы не доверяете названному приложению.', NULL, '', 0, '2021-05-15 11:46:23'),
(6066, 6241, 'ru', 0, NULL, 'Вы хотите предоставить этому приложению доступ к вашей учётной записи? Вам не следует это делать, если вы не доверяете названному приложению.', NULL, '', 0, '2021-05-15 11:46:23'),
(6067, 6242, 'ru', 0, NULL, 'Доступна для записи', NULL, '', 0, '2021-05-15 11:46:23'),
(6068, 6243, 'ru', 0, NULL, 'Напишите свою первую запись', NULL, '', 0, '2021-05-15 11:46:23'),
(6069, 6244, 'ru', 0, NULL, 'Написание', NULL, '', 0, '2021-05-15 11:46:23'),
(6070, 6245, 'ru', 0, NULL, 'Настройки публикации', NULL, '', 0, '2021-05-15 11:46:23'),
(6071, 6246, 'ru', 0, NULL, 'X &#8212; Для ещё более зрелой аудитории', NULL, '', 0, '2021-05-15 11:46:23'),
(6072, 6247, 'ru', 0, NULL, 'XFN расшифровывается как <a href="http://gmpg.org/xfn/">XHTML Friends Network</a> (микроформат для пометки социальных взаимоотношений) и является необязательным блоком. WordPress позволяет использовать атрибуты XFN, чтобы указать ваше отношение к авторам/владельцам сайта, на который вы ссылаетесь.', NULL, '', 0, '2021-05-15 11:46:23'),
(6073, 6248, 'ru', 0, NULL, 'Ошибка XML: %1$s в строке %2$s', NULL, '', 0, '2021-05-15 11:46:23'),
(6074, 6249, 'ru', 0, NULL, 'Да, я разрешаю это подключение.', NULL, '', 0, '2021-05-15 11:46:23'),
(6075, 6250, 'ru', 0, NULL, 'Да, удалить эти файлы', NULL, '', 0, '2021-05-15 11:46:23'),
(6076, 6251, 'ru', 0, NULL, 'Да, удалить эти файлы и данные', NULL, '', 0, '2021-05-15 11:46:23'),
(6077, 6252, 'ru', 0, NULL, 'Да, перейти на страницу профиля', NULL, '', 0, '2021-05-15 11:46:23'),
(6078, 6253, 'ru', 0, NULL, 'Также доступны обновления нескольких плагинов или тем. Обновите их:', NULL, '', 0, '2021-05-15 11:46:23'),
(6079, 6254, 'ru', 0, NULL, 'Похоже вы пытаетесь напрямую редактировать плагин из консоли WordPress. Мы не рекомендуем делать этого! Это может внести несовместимости ломающие ваш сайт, также изменения могут не сохраниться при будущих обновлениях.', NULL, '', 0, '2021-05-15 11:46:23'),
(6080, 6255, 'ru', 0, NULL, 'Похоже вы пытаетесь напрямую внести изменения в тему из консоли WordPress. Мы не рекомендуем делать этого! Это может внести несовместимости ломающие ваш сайт, также изменения могут не сохраниться при будущих обновлениях.', NULL, '', 0, '2021-05-15 11:46:23'),
(6081, 6256, 'ru', 0, NULL, 'Вы собираетесь одобрить этот комментарий:', NULL, '', 0, '2021-05-15 11:46:23'),
(6082, 6257, 'ru', 0, NULL, 'Вы собираетесь удалить %s.', NULL, '', 0, '2021-05-15 11:46:23'),
(6083, 6258, 'ru', 0, NULL, 'Вы собираетесь удалить этот комментарий:', NULL, '', 0, '2021-05-15 11:46:23'),
(6084, 6259, 'ru', 0, NULL, 'Вы собираетесь удалить ссылку «%s»\n  «Отмена» — оставить, «OK» — удалить.', NULL, '', 0, '2021-05-15 11:46:23'),
(6085, 6260, 'ru', 0, NULL, 'Вы собираетесь удалить тему «%s»\n  «Отмена» — оставить, «OK» — удалить.', NULL, '', 0, '2021-05-15 11:46:23'),
(6086, 6261, 'ru', 0, NULL, 'Вы собираетесь установить WordPress %s <strong>на английском</strong>. Есть вероятность, что такое обновление повредит переводу. Возможно, стоит дождаться выхода локализованной версии.', NULL, '', 0, '2021-05-15 11:46:23'),
(6087, 6262, 'ru', 0, NULL, 'Вы собираетесь пометить этот комментарий как спам:', NULL, '', 0, '2021-05-15 11:46:23'),
(6088, 6263, 'ru', 0, NULL, 'Вы собираетесь переместить этот комментарий в корзину:', NULL, '', 0, '2021-05-15 11:46:23'),
(6089, 6264, 'ru', 0, NULL, 'Вы собираетесь удалить следующий плагин:', NULL, '', 0, '2021-05-15 11:46:23'),
(6090, 6265, 'ru', 0, NULL, 'Вы собираетесь удалить следующие плагины:', NULL, '', 0, '2021-05-15 11:46:23'),
(6091, 6266, 'ru', 0, NULL, 'Вы зашли на сайт по HTTPS, но <a href="%1$s">адрес WordPress</a> и <a href="%2$s">адрес сайта</a> не установлены для использования HTTPS по умолчанию.', NULL, '', 0, '2021-05-15 11:46:23'),
(6092, 6267, 'ru', 0, NULL, 'Вы зашли на сайт по HTTPS, но <a href="%s">адрес WordPress</a> не установлен для использования HTTPS по умолчанию.', NULL, '', 0, '2021-05-15 11:46:23'),
(6093, 6268, 'ru', 0, NULL, 'Вы редактируете страницу, на которой отображаются свежие записи.', NULL, '', 0, '2021-05-15 11:46:23'),
(6094, 6269, 'ru', 0, NULL, 'Вы используете последнюю версию WordPress, так держать!', NULL, '', 0, '2021-05-15 11:46:23'),
(6095, 6270, 'ru', 0, NULL, 'Используется режим восстановления. Это означает, что возможно возникла ошибка с темой или плагином. Для выхода из режима восстановления выйдите из учетной записи или используйте кнопку выхода. <a href="%s">Выйти из режима восстановления</a>.', NULL, '', 0, '2021-05-15 11:46:23'),
(6096, 6271, 'ru', 0, NULL, 'Вы вышли из других сессий.', NULL, '', 0, '2021-05-15 11:46:23'),
(6097, 6272, 'ru', 0, NULL, 'Вы авторизованы только в текущем браузере.', NULL, '', 0, '2021-05-15 11:46:23'),
(6098, 6273, 'ru', 0, NULL, 'Вы хотите обновить плагин. Убедитесь в том, что вы <a href="%s">создали резервную копию базы данных и файлов вашего сайта</a>.', NULL, '', 0, '2021-05-15 11:46:23'),
(6099, 6274, 'ru', 0, NULL, 'Вы хотите обновить тему. Убедитесь в том, что вы <a href="%s">создали резервную копию базы данных и файлов вашего сайта</a>.', NULL, '', 0, '2021-05-15 11:46:23'),
(6100, 6275, 'ru', 0, NULL, 'Вы пытаетесь загрузить старую версию плагина. Вы можете продолжить установку устаревшей версии, но сначала <a href="%s">создайте резервную копию базы данных и файлов вашего сайта</a>.', NULL, '', 0, '2021-05-15 11:46:23'),
(6101, 6276, 'ru', 0, NULL, 'Вы пытаетесь загрузить старую версию темы. Вы можете продолжить установку устаревшей версии, но сначала <a href="%s">создайте резервную копию базы данных и файлов вашего сайта</a>.', NULL, '', 0, '2021-05-15 11:46:23'),
(6102, 6277, 'ru', 0, NULL, 'У вас используется вкрапление %1$s, что возможно означает то, что база данных %2$s не используется.', NULL, '', 0, '2021-05-15 11:46:23'),
(6103, 6278, 'ru', 0, NULL, 'Вы используете версию %1$s. Супер! <a href="%2$s">Следите за обновлениями</a>.', NULL, '', 0, '2021-05-15 11:46:23'),
(6104, 6279, 'ru', 0, NULL, 'Вы используете версию WordPress в разработке.', NULL, '', 0, '2021-05-15 11:46:23'),
(6105, 6280, 'ru', 0, NULL, 'Вы используете версию WordPress в разработке. Эти плагины с новыми функциями также находятся в разработке. <a href="%s">Узнать больше</a>.', NULL, '', 0, '2021-05-15 11:46:23'),
(6106, 6281, 'ru', 0, NULL, 'Вы используете небезопасный браузер!', NULL, '', 0, '2021-05-15 11:46:23'),
(6107, 6282, 'ru', 0, NULL, 'Вы используете загрузчик браузера. Загрузчик WordPress позволяет выбирать одновременно несколько файлов, а также загружать их путём перетаскивания. <a href="#">Переключиться на многофайловый загрузчик</a>.', NULL, '', 0, '2021-05-15 11:46:23'),
(6108, 6283, 'ru', 0, NULL, 'Вы используете многофайловый загрузчик. Проблемы? Попробуйте <a href="%1$s" %2$s>загрузчик браузера</a>.', NULL, '', 0, '2021-05-15 11:46:23'),
(6109, 6284, 'ru', 0, NULL, 'Вы попытались войти в консоль сайта &laquo;%1$s&raquo;, но у вас на текущий момент нет туда доступа. Если вы считаете, что должны иметь доступ к сайту &laquo;%1$s&raquo;, свяжитесь с администратором сети.', NULL, '', 0, '2021-05-15 11:46:23'),
(6110, 6285, 'ru', 0, NULL, 'Вы попытались отредактировать несуществующее вложение. Может быть, оно удалено?', NULL, '', 0, '2021-05-15 11:46:23'),
(6111, 6286, 'ru', 0, NULL, 'Вы попытались отредактировать несуществующий элемент. Может быть, он удалён?', NULL, '', 0, '2021-05-15 11:46:23'),
(6112, 6287, 'ru', 0, NULL, 'Вы попытались отредактировать элемент, не являющийся вложением. Пожалуйста, попробуйте ещё раз.', NULL, '', 0, '2021-05-15 11:46:23'),
(6113, 6288, 'ru', 0, NULL, 'Можно искать темы по ключевому слову, автору или метке, либо указать более подробные критерии для поиска с помощью фильтра характеристик.', NULL, '', 0, '2021-05-15 11:46:23'),
(6114, 6289, 'ru', 0, NULL, 'Можно загрузить тему вручную, если вы уже скачали ZIP-архив на свой компьютер (убедитесь, что её источник заслуживает доверия). Также можно выбрать старомодный способ и скопировать каталог скачанной темы в директорию %s по FTP.', NULL, '', 0, '2021-05-15 11:46:23'),
(6115, 6290, 'ru', 0, NULL, 'Здесь можно добавлять ссылки, которые будут отображаться на вашем сайте &#8212; обычно с помощью <a href="%s">виджетов</a>. В качестве примера приведены ссылки на несколько сайтов сообщества WordPress.', NULL, '', 0, '2021-05-15 11:46:23'),
(6116, 6291, 'ru', 0, NULL, 'На этом экране вы можете добавлять или редактировать ссылки, указывая информацию в каждом блоке. Обязательными полями являются только адрес и имя (текст, который вы хотите отображать на сайте как ссылку).', NULL, '', 0, '2021-05-15 11:46:23'),
(6117, 6292, 'ru', 0, NULL, 'Вы также можете просмотреть список любимых плагинов пользователя, нажав ссылку &laquo;Любимые&raquo; над списком плагинов и введя имя пользователя на WordPress.org.', NULL, '', 0, '2021-05-15 11:46:23'),
(6118, 6293, 'ru', 0, NULL, 'Также можно выбрать цвет фона, нажав кнопку &laquo;Выбрать цвет&raquo; и введя корректный HEX-код, принятый в HTML (например, &laquo;#ff0000&raquo; &#8212; красный), или выбрав цвет с помощью появившегося инструмента.', NULL, '', 0, '2021-05-15 11:46:23'),
(6119, 6294, 'ru', 0, NULL, 'Вы также можете настроить отображение содержимого в RSS-лентах: максимальное количество отображаемых записей, объём отображаемого текста и кодировку. <a href="%s">Узнайте больше о RSS-лентах</a>.', NULL, '', 0, '2021-05-15 11:46:23'),
(6120, 6295, 'ru', 0, NULL, 'Вы также можете создавать записи с помощью <a href="%s">закладки &laquo;Опубликовать&raquo;</a>.', NULL, '', 0, '2021-05-15 11:46:23'),
(6121, 6296, 'ru', 0, NULL, 'В окне параметров также можно удалить отдельный элемент или перейти к расширенному редактированию.', NULL, '', 0, '2021-05-15 11:46:23'),
(6122, 6297, 'ru', 0, NULL, 'Можно также изменить или переместить в корзину сразу несколько записей. Выберите записи, отметив их галочками, затем выберите нужное действие в меню &laquo;Действия&raquo; и нажмите &laquo;Применить&raquo;.', NULL, '', 0, '2021-05-15 11:46:23') ;
INSERT INTO `wp_icl_string_translations` ( `id`, `string_id`, `language`, `status`, `value`, `mo_string`, `translator_id`, `translation_service`, `batch_id`, `translation_date`) VALUES
(6123, 6298, 'ru', 0, NULL, 'Можно также добавлять медиафайлы со многих популярных сайтов, включая Twitter, YouTube, Flickr и другие, просто скопировав адрес файла и вставив его в текст вашей записи или страницы отдельной строкой. Прочитайте эту статью, чтобы <a href="https://ru.wordpress.org/support/article/embeds/">узнать больше о вставке объектов</a>.', NULL, '', 0, '2021-05-15 11:46:23'),
(6124, 6299, 'ru', 0, NULL, 'Вы также можете одобрить или отклонить комментарий на этом экране с помощью блока &laquo;Статус&raquo;, где можно изменить и время комментария.', NULL, '', 0, '2021-05-15 11:46:23'),
(6125, 6300, 'ru', 0, NULL, 'Можно также совершать те же типы действий, включая детализацию списка с помощью фильтров, работу со страницей с помощью ссылок, появляющихся при наведении курсора, и массовое редактирование страниц с помощью меню &laquo;Действия&raquo;.', NULL, '', 0, '2021-05-15 11:46:23'),
(6126, 6301, 'ru', 0, NULL, 'Можно присваивать записям ключевые слова, используя <strong>метки</strong>. В отличие от рубрик, у меток нет иерархии &#8212; это значит, что метки не связаны между собой.', NULL, '', 0, '2021-05-15 11:46:23'),
(6127, 6302, 'ru', 0, NULL, 'Вы можете назначить отдельное меню для одной или нескольких областей темы, <strong>выбрав желаемые настройки</strong> в нижней части редактора меню. Чтобы назначить меню для всех областей темы сразу, <strong>перейдите на вкладку &laquo;Управление областями&raquo;</strong> в верхней части экрана.', NULL, '', 0, '2021-05-15 11:46:23'),
(6128, 6303, 'ru', 0, NULL, 'Можно изменить отображение этого экрана на вкладке &laquo;Настройки экрана&raquo;, указав, сколько элементов выводить и какие столбцы таблицы показывать.', NULL, '', 0, '2021-05-15 11:46:23'),
(6129, 6304, 'ru', 0, NULL, 'Вы можете изменить свой пароль, включить горячие клавиши, изменить цветовую схему экранов управления WordPress и отключить визуальный редактор (WYSIWYG). Верхнюю панель можно отключить для внешней части сайта, но в панели управления она будет отображаться всегда.', NULL, '', 0, '2021-05-15 11:46:23'),
(6130, 6305, 'ru', 0, NULL, 'Можно выбрать любое из изображений по умолчанию или загрузить своё. Можно также настроить отображение названия и краткого описания сайта.', NULL, '', 0, '2021-05-15 11:46:23'),
(6131, 6306, 'ru', 0, NULL, 'Можно выбрать одну из загруженных ранее картинок или выводить их в случайном порядке.', NULL, '', 0, '2021-05-15 11:46:23'),
(6132, 6307, 'ru', 0, NULL, 'Можно выбрать, что отображать на главной странице вашего сайта. Это могут быть записи в обратном хронологическом порядке (классический блог), либо постоянная/статическая страница. Чтобы сделать главную страницу статической, нужно создать две <a href="%s">страницы</a>. Одна станет главной, а на второй будут отображаться ваши записи.', NULL, '', 0, '2021-05-15 11:46:23'),
(6133, 6308, 'ru', 0, NULL, 'Вы можете выбрать, должен ли ваш сайт индексироваться роботами, сервисами уведомлений и веб-пауками. Если вы хотите, чтобы эти службы игнорировали ваш сайт, поставьте галочку &laquo;Попросить поисковые системы не индексировать сайт&raquo; и нажмите кнопку &laquo;Сохранить изменения&raquo; в нижней части экрана.', NULL, '', 0, '2021-05-15 11:46:23'),
(6134, 6309, 'ru', 0, NULL, 'Можно группировать ссылки, используя рубрики ссылок. Названия рубрик ссылок должны быть уникальными, а сами рубрики ссылок не имеют отношения к рубрикам, которые вы используете для записей.', NULL, '', 0, '2021-05-15 11:46:23'),
(6135, 6310, 'ru', 0, NULL, 'Можно создать файл %s вручную и вставить туда следующий текст.', NULL, '', 0, '2021-05-15 11:46:23'),
(6136, 6311, 'ru', 0, NULL, 'Можно настраивать отображение этого экрана несколькими способами:', NULL, '', 0, '2021-05-15 11:46:23'),
(6137, 6312, 'ru', 0, NULL, 'Можно настраивать отображение этого экрана с помощью вкладки &laquo;Настройки экрана&raquo; и/или выпадающих меню над таблицей ссылок.', NULL, '', 0, '2021-05-15 11:46:23'),
(6138, 6313, 'ru', 0, NULL, 'Можно настраивать отображение содержимого на этом экране несколькими способами:', NULL, '', 0, '2021-05-15 11:46:23'),
(6139, 6314, 'ru', 0, NULL, 'Можно настроить внешний вид сайта с помощью произвольного фона, не затрагивая код в файлах темы. В качестве фона может выступать изображение или цвет.', NULL, '', 0, '2021-05-15 11:46:23'),
(6140, 6315, 'ru', 0, NULL, 'Удалить рубрику ссылок можно с помощью выпадающего меню &laquo;Действия&raquo;, однако это не приведёт к удалению содержащихся в ней ссылок. Они будут перемещены в рубрику по умолчанию.', NULL, '', 0, '2021-05-15 11:46:23'),
(6141, 6316, 'ru', 0, NULL, 'Вы сможете сделать больше без необходимости писать код', NULL, '', 0, '2021-05-15 11:46:23'),
(6142, 6317, 'ru', 0, NULL, 'Можно отредактировать изображение, но сохранить миниатюру. Это может быть полезно, если вы захотите оставить квадратную миниатюру, на которой будет лишь часть изображения.', NULL, '', 0, '2021-05-15 11:46:23'),
(6143, 6318, 'ru', 0, NULL, 'При необходимости вы можете отредактировать комментарий. Это бывает полезно, если автор комментария сделал опечатку.', NULL, '', 0, '2021-05-15 11:46:23'),
(6144, 6319, 'ru', 0, NULL, 'Можно включить полноэкранный режим, нажав на иконку справа. Эта функция недоступна для старых браузеров и устройств с маленьким экраном. Функция также требует, чтобы в настройках экрана было включено растягивание редактора по высоте.', NULL, '', 0, '2021-05-15 11:46:23'),
(6145, 6320, 'ru', 0, NULL, 'Можно экспортировать содержимое вашего сайта в файл, чтобы импортировать его на другой сайт или платформу. Файл будет представлять собой XML-файл под названием WXR. В него можно включить записи, страницы, комментарии, произвольные поля, рубрики и метки. Можно выбрать только определённые записи или страницы, используя выпадающие фильтры для ограничения по рубрике, автору, диапазону дат и статусу публикации.', NULL, '', 0, '2021-05-15 11:46:23'),
(6146, 6321, 'ru', 0, NULL, 'Можно фильтровать записи по статусу, используя текстовые ссылки над списком, чтобы посмотреть записи с выбранным статусом. По умолчанию отображаются все записи.', NULL, '', 0, '2021-05-15 11:46:23'),
(6147, 6322, 'ru', 0, NULL, 'Можно фильтровать список пользователей по ролям, используя текстовые ссылки над списком, чтобы посмотреть всех пользователей, администраторов, редакторов, авторов, участников или подписчиков. По умолчанию отображаются все пользователи. Неиспользуемые роли в список не включены.', NULL, '', 0, '2021-05-15 11:46:23'),
(6148, 6323, 'ru', 0, NULL, 'На этом экране вы можете найти дополнительные темы для вашего сайта с помощью скрипта просмотра/установки тем, который отобразит темы из <a href="%s">каталога WordPress</a>. Эти темы создаются третьими лицами, распространяются бесплатно и совместимы с лицензией WordPress.', NULL, '', 0, '2021-05-15 11:46:23'),
(6149, 6324, 'ru', 0, NULL, 'Вы можете найти подробности проблемы и внести исправления на экране управления плагинами.', NULL, '', 0, '2021-05-15 11:46:23'),
(6150, 6325, 'ru', 0, NULL, 'Вы можете найти подробности проблемы и внести исправления на экране управления темами.', NULL, '', 0, '2021-05-15 11:46:23'),
(6151, 6326, 'ru', 0, NULL, 'Вы можете найти новые плагины с помощью поиска или просмотра каталога прямо на этой странице.', NULL, '', 0, '2021-05-15 11:46:23'),
(6152, 6327, 'ru', 0, NULL, 'Можно скрывать/показывать столбцы согласно вашим предпочтениям и указывать количество выводимых записей на вкладке &laquo;Настройки экрана&raquo;.', NULL, '', 0, '2021-05-15 11:46:23'),
(6153, 6328, 'ru', 0, NULL, 'Можно скрывать/показывать столбцы согласно вашим предпочтениям и указывать количество выводимых пользователей на вкладке &laquo;Настройки экрана&raquo;.', NULL, '', 0, '2021-05-15 11:46:23'),
(6154, 6329, 'ru', 0, NULL, 'Можно загружать медиафайлы, нажимая на иконки над редактором и следуя указаниям. Можно выравнивать или редактировать изображения с помощью всплывающей панели, доступной в визуальном режиме.', NULL, '', 0, '2021-05-15 11:46:23'),
(6155, 6330, 'ru', 0, NULL, 'Можно выйти из других сессий (например, на телефоне или публичном компьютере), нажав на кнопку &laquo;Выйти из других сессий&raquo;.', NULL, '', 0, '2021-05-15 11:46:23'),
(6156, 6331, 'ru', 0, NULL, 'Вы можете управлять комментариями на своём сайте, подобно тому как вы управляете записями и другим содержимым. Этот экран настраивается так же, как и другие экраны управления. Можно работать с комментариями, используя ссылки, появляющиеся при наведении курсора, либо совершая массовые действия.', NULL, '', 0, '2021-05-15 11:46:23'),
(6157, 6332, 'ru', 0, NULL, 'Можно детализировать список по типу и статусу файлов или по дате с помощью выпадающих меню над таблицей файлов.', NULL, '', 0, '2021-05-15 11:46:23'),
(6158, 6333, 'ru', 0, NULL, 'Управлять произвольным фоном и просматривать изменения теперь можно на <a href="%s">экране настройки темы</a>.', NULL, '', 0, '2021-05-15 11:46:23'),
(6159, 6334, 'ru', 0, NULL, 'Управлять произвольным заголовком и просматривать изменения теперь можно на <a href="%s">экране настройки темы</a>.', NULL, '', 0, '2021-05-15 11:46:23'),
(6160, 6335, 'ru', 0, NULL, 'Можно изменить размер исходного изображения с сохранением пропорций. Для получения наилучших результатов масштабирование следует выполнять до обрезки, отражения и поворота. Изображения можно уменьшить, но не увеличить.', NULL, '', 0, '2021-05-15 11:46:23'),
(6161, 6336, 'ru', 0, NULL, 'Можно детализировать список, отобразив только записи из определённой рубрики или за определённый месяц, используя выпадающие меню над списком. После выбора нажмите на кнопку &laquo;Фильтр&raquo;. Также можно детализировать список, нажав на автора записи, рубрику или метку в списке записей.', NULL, '', 0, '2021-05-15 11:46:23'),
(6162, 6337, 'ru', 0, NULL, 'Вы можете задать изображение, которое будет показано в верхней части вашего сайта, загрузив его со своего компьютера или выбрав из библиотеки файлов. После выбора изображения можно будет обрезать его.', NULL, '', 0, '2021-05-15 11:46:23'),
(6163, 6338, 'ru', 0, NULL, 'Вы можете выбрать язык для консоли администрирования WordPress без влияния на язык сайта используемый для посетителей.', NULL, '', 0, '2021-05-15 11:46:23'),
(6164, 6339, 'ru', 0, NULL, 'В заголовке вашего сайта можно использовать произвольное изображение. Просто загрузите и обрежьте изображение, и оно сразу попадёт на сайт. Можно также выбрать загруженное ранее изображение из библиотеки файлов, нажав кнопку &laquo;Выбрать изображение&raquo;.', NULL, '', 0, '2021-05-15 11:46:23'),
(6165, 6340, 'ru', 0, NULL, 'Можно задать максимальные размеры изображений, вставляемых в содержимое; можно также вставлять полноразмерное изображение.', NULL, '', 0, '2021-05-15 11:46:23'),
(6166, 6341, 'ru', 0, NULL, 'Можно выбрать язык, и файлы перевода будут автоматически скачаны и установлены (если файловая система доступна для записи).', NULL, '', 0, '2021-05-15 11:46:23'),
(6167, 6342, 'ru', 0, NULL, 'Можно использовать основной сайт, однако любой созданный поддомен будет недоступен. Если вы уверены, что ваши настройки DNS верны, проигнорируйте это сообщение.', NULL, '', 0, '2021-05-15 11:46:23'),
(6168, 6343, 'ru', 0, NULL, 'Содержимое можно отправлять различными способами; все они перечислены на этом экране. Верхняя часть относится к редактору в панели управления, а в остальных блоках настраиваются внешние методы публикации. Дополнительную информацию о каждом из этих методов можно получить в документации по ссылкам справа.', NULL, '', 0, '2021-05-15 11:46:23'),
(6169, 6344, 'ru', 0, NULL, 'Вы можете обновить WordPress %1$s до <a href="%2$s">WordPress %3$s</a>:', NULL, '', 0, '2021-05-15 11:46:23'),
(6170, 6345, 'ru', 0, NULL, 'Вы можете обновить её до последней ночной сборки:', NULL, '', 0, '2021-05-15 11:46:23'),
(6171, 6346, 'ru', 0, NULL, 'Вы можете загружать и вставлять медиафайлы (изображения, аудиофайлы, документы и т.д.), нажав кнопку &laquo;Добавить медиафайл&raquo;. Можно выбрать изображения и файлы, уже загруженные в библиотеку, либо загрузить новые файлы и добавить их в запись или страницу. Чтобы создать галерею, выберите изображения и нажмите кнопку &laquo;Создать новую галерею&raquo;.', NULL, '', 0, '2021-05-15 11:46:23'),
(6172, 6347, 'ru', 0, NULL, 'Здесь можно загружать файлы, не создавая запись. Это позволяет загрузить файлы для последующего использования в записях и страницах и/или получить ссылку на отдельный файл, чтобы поделиться им. Загрузить файлы можно тремя способами:', NULL, '', 0, '2021-05-15 11:46:23'),
(6173, 6348, 'ru', 0, NULL, 'Можно использовать рубрики, чтобы определять разделы вашего сайта и группировать записи по темам. По умолчанию записи попадают в рубрику &laquo;Без рубрики&raquo;, если не изменить это в <a href="%s">настройках написания</a>.', NULL, '', 0, '2021-05-15 11:46:23'),
(6174, 6349, 'ru', 0, NULL, 'Можно использовать одну из этих классных картинок или выводить их в случайном порядке.', NULL, '', 0, '2021-05-15 11:46:23'),
(6175, 6350, 'ru', 0, NULL, 'Вы можете использовать следующие элементы управления, чтобы настроить консоль согласно своим предпочтениям. Это относится и ко многим другим экранам панели управления.', NULL, '', 0, '2021-05-15 11:46:23'),
(6176, 6351, 'ru', 0, NULL, 'Можно использовать редактор для внесения изменений в PHP-файлы плагинов. Учтите, что при обновлении плагинов сделанные вами изменения будут перезаписаны.', NULL, '', 0, '2021-05-15 11:46:23'),
(6177, 6352, 'ru', 0, NULL, 'Можно использовать редактор тем для внесения изменений в отдельные CSS- и PHP-файлы вашей темы.', NULL, '', 0, '2021-05-15 11:46:23'),
(6178, 6353, 'ru', 0, NULL, 'Можно посмотреть все записи пользователя, нажав на число в столбце &laquo;Записи&raquo;.', NULL, '', 0, '2021-05-15 11:46:23'),
(6179, 6354, 'ru', 0, NULL, 'Можно просматривать записи в виде простого списка заголовков, либо с отрывками. Выберите желаемый вид на вкладке «Настройки экрана».', NULL, '', 0, '2021-05-15 11:46:23'),
(6180, 6355, 'ru', 0, NULL, 'Можно просматривать файлы в виде простой визуальной сетки или списка со столбцами. Выберите желаемый вид с помощью иконок слева над файлами.', NULL, '', 0, '2021-05-15 11:46:23'),
(6181, 6356, 'ru', 0, NULL, 'Вы не можете удалить текущего пользователя.', NULL, '', 0, '2021-05-15 11:46:23'),
(6182, 6357, 'ru', 0, NULL, 'Вы не можете редактировать это вложение, потому что оно в корзине. Пожалуйста, восстановите его и повторите попытку.', NULL, '', 0, '2021-05-15 11:46:23'),
(6183, 6358, 'ru', 0, NULL, 'Вы не можете отредактировать этот комментарий, поскольку связанная с ним запись удалена в корзину. Вы можете восстановить запись и попробовать снова.', NULL, '', 0, '2021-05-15 11:46:23'),
(6184, 6359, 'ru', 0, NULL, 'Вы не можете редактировать этот элемент, потому что он в корзине. Пожалуйста, восстановите его и повторите попытку.', NULL, '', 0, '2021-05-15 11:46:23'),
(6185, 6360, 'ru', 0, NULL, 'Вы не можете удалять пользователей.', NULL, '', 0, '2021-05-15 11:46:23'),
(6186, 6361, 'ru', 0, NULL, 'Нельзя удалить текущего пользователя.', NULL, '', 0, '2021-05-15 11:46:23'),
(6187, 6362, 'ru', 0, NULL, 'Нельзя удалить плагин, пока он активен на основном сайте.', NULL, '', 0, '2021-05-15 11:46:23'),
(6188, 6363, 'ru', 0, NULL, 'Нельзя удалить тему, пока её дочерняя тема активна.', NULL, '', 0, '2021-05-15 11:46:23'),
(6189, 6364, 'ru', 0, NULL, 'Вы не можете установить, потому что <a href="%1$s">WordPress %2$s</a> требует MySQL версии %3$s или новее. Ваша версия - %4$s.', NULL, '', 0, '2021-05-15 11:46:23'),
(6190, 6365, 'ru', 0, NULL, 'Не удаётся продолжить установку, так как <a href="%1$s">WordPress %2$s</a> требует PHP версии %3$s или выше и MySQL версии %4$s или выше. У вас PHP версии %5$s и MySQL версии %6$s.', NULL, '', 0, '2021-05-15 11:46:23'),
(6191, 6366, 'ru', 0, NULL, 'Вы не можете установить, потому что <a href="%1$s">WordPress %2$s</a> требует PHP версии %3$s или новее. Ваша версия - %4$s.', NULL, '', 0, '2021-05-15 11:46:23'),
(6192, 6367, 'ru', 0, NULL, 'Вы не можете переместить этот элемент в корзину. Его сейчас редактирует %s.', NULL, '', 0, '2021-05-15 11:46:23'),
(6193, 6368, 'ru', 0, NULL, 'Обновление невозможно, так как <a href="%1$s">WordPress %2$s</a> требует MySQL версии %3$s или новее. Ваша версия MySQL - %4$s.', NULL, '', 0, '2021-05-15 11:46:23'),
(6194, 6369, 'ru', 0, NULL, 'Не удаётся продолжить обновление, так как <a href="%1$s">WordPress %2$s</a> требует PHP версии %3$s или выше и MySQL версии %4$s или выше. У вас PHP версии %5$s и MySQL версии %6$s.', NULL, '', 0, '2021-05-15 11:46:23'),
(6195, 6370, 'ru', 0, NULL, 'Обновление невозможно, так как <a href="%1$s">WordPress %2$s</a> требует PHP версии %3$s или новее. Ваша версия PHP - %4$s.', NULL, '', 0, '2021-05-15 11:46:23'),
