(6217, 6392, 'ru', 0, NULL, 'Чтобы сохранить изменения, нужно сделать этот файл доступным для записи. Дополнительную информацию можно получить в <a href="%s">Документации об изменении прав на файлы</a>.', NULL, '', 0, '2021-05-15 11:46:23'),
(6218, 6393, 'ru', 0, NULL, 'На текущий момент для этого сайта разрешена только одна тема. Посетите страницу &laquo;Управление сетью&raquo;, чтобы <a href="%1$s">разрешить</a> или <a href="%2$s">установить</a> другие темы.', NULL, '', 0, '2021-05-15 11:46:23'),
(6220, 6395, 'ru', 0, NULL, 'На текущий момент для этого сайта разрешена только одна тема. Посетите страницу &laquo;Управление сетью&raquo;, чтобы <a href="%s">разрешить</a> другие темы.', NULL, '', 0, '2021-05-15 11:46:23'),
(6221, 6396, 'ru', 0, NULL, 'Сейчас у вас установлена только одна тема. Больше жизни! В любой момент можно выбрать более 1000 бесплатных тем из каталога WordPress: просто нажмите на вкладку <a href="%s">&laquo;Установить темы&raquo;</a> выше.', NULL, '', 0, '2021-05-15 11:46:23'),
(6222, 6397, 'ru', 0, NULL, 'Вам также стоит выделить факт сбора и хранения таких деликатных данных как, к примеру, данные о здоровье.', NULL, '', 0, '2021-05-15 11:46:23'),
