(1230, 'en', 'default', 'e0af55d5dda285e1c115ed4ed9af78f9', 'Howdy ###USERNAME###,\\n\\nYou recently requested to have the email address on your account changed.\\n\\nIf this is correct, please click on the following link to change it:\\n###ADMIN_URL###\\n\\nYou can safely ignore and delete this email if you do not want to\\ntake this action.\\n\\nThis email has been sent to ###EMAIL###\\n\\nRegards,\\nAll at ###SITENAME###\\n###SITEURL###', NULL, NULL, '', 'LINE', NULL, 10, '', '4c7febd745d8b12bfbd024affa2d913a', '', NULL),
(1231, 'en', 'default', '095c6a17c2a8a38fdb6b971c19e90e12', 'Howdy ###USERNAME###,\\n\\nYou recently requested to have the network admin email address on\\nyour network changed.\\n\\nIf this is correct, please click on the following link to change it:\\n###ADMIN_URL###\\n\\nYou can safely ignore and delete this email if you do not want to\\ntake this action.\\n\\nThis email has been sent to ###EMAIL###\\n\\nRegards,\\nAll at ###SITENAME###\\n###SITEURL###', NULL, NULL, '', 'LINE', NULL, 10, '', '81d47ce50054ae96232fa3aaec23e7f9', '', NULL),
(1232, 'en', 'default', '27801d60c727cc77a0af0b43cea6f4b6', 'Howdy USERNAME,\\n\\nYour new SITE_NAME site has been successfully set up at:\\nBLOG_URL\\n\\nYou can log in to the administrator account with the following information:\\n\\nUsername: USERNAME\\nPassword: PASSWORD\\nLog in here: BLOG_URLwp-login.php\\n\\nWe hope you enjoy your new site. Thanks!\\n\\n--The Team @ SITE_NAME', NULL, NULL, '', 'LINE', NULL, 10, '', 'c120d35021323637fc21132008c5c331', '', NULL),
(1233, 'en', 'default', '99e77b4ea57d035beec28a4aace328b5', 'Howdy USERNAME,\\n\\nYour new account is set up.\\n\\nYou can log in with the following information:\\nUsername: USERNAME\\nPassword: PASSWORD\\nLOGINLINK\\n\\nThanks!\\n\\n--The Team @ SITE_NAME', NULL, NULL, '', 'LINE', NULL, 10, '', '698d770c6d5bd26cb65845be0fdd43a3', '', NULL),
(1234, 'en', 'default', '3bf2d9e9829ce318930ee7759b39c7d9', 'Howdy!\\n\\nSince WordPress 5.2 there is a built-in feature that detects when a plugin or theme causes a fatal error on your site, and notifies you with this automated email.\\n###CAUSE###\\nFirst, visit your website (###SITEURL###) and check for any visible issues. Next, visit the page where the error was caught (###PAGEURL###) and check for any visible issues.\\n\\n###SUPPORT###\\n\\nIf your site appears broken and you can\'t access your dashboard normally, WordPress now has a special "recovery mode". This lets you safely login to your dashboard and investigate further.\\n\\n###LINK###\\n\\nTo keep your site safe, this link will expire in ###EXPIRES###. Don\'t worry about that, though: a new link will be emailed to you if the error occurs again after it expires.\\n\\nWhen seeking help with this issue, you may be asked for some of the following information:\\n###DEBUG###\\n\\n###DETAILS###', NULL, NULL, '', 'LINE', NULL, 10, '', 'd1e9be5ebd8962bcf9d23b013362302e', '', NULL),
(1235, 'en', 'default', '3a9c294343c5f8076a81c70a2e3df016', 'Howdy,\\n\\nA request has been made to perform the following action on your account:\\n\\n     ###DESCRIPTION###\\n\\nTo confirm this, please click on the following link:\\n###CONFIRM_URL###\\n\\nYou can safely ignore and delete this email if you do not want to\\ntake this action.\\n\\nRegards,\\nAll at ###SITENAME###\\n###SITEURL###', NULL, NULL, '', 'LINE', NULL, 10, '', 'c4fe39a207abd5cf1d7bdbea7c8fbd8f', '', NULL),
(1236, 'en', 'default', 'a3448d08f0fb51527fe3a8b4313869c8', 'Howdy,\\n\\nA user data privacy request has been confirmed on ###SITENAME###:\\n\\nUser: ###USER_EMAIL###\\nRequest: ###DESCRIPTION###\\n\\nYou can view and manage these data privacy requests here:\\n\\n###MANAGE_URL###\\n\\nRegards,\\nAll at ###SITENAME###\\n###SITEURL###', NULL, NULL, '', 'LINE', NULL, 10, '', 'c8c30e6dc1f7b6e1e74b1046aa55e8a5', '', NULL),
(1237, 'en', 'default', '45c6e468c22eeb80c1c730531caf17b1', 'Howdy,\\n\\nYour request to erase your personal data on ###SITENAME### has been completed.\\n\\nIf you have any follow-up questions or concerns, please contact the site administrator.\\n\\nFor more information, you can also read our privacy policy: ###PRIVACY_POLICY_URL###\\n\\nRegards,\\nAll at ###SITENAME###\\n###SITEURL###', NULL, NULL, '', 'LINE', NULL, 10, '', 'fc6d4b623463133874c256fe0e6aa334', '', NULL),
