(2655, 'en', 'default', '56fa74cebc2bd80c95e5ea017623e386', 'These preliminaries settled, he did not care to put off any longer the execution of his design, urged on to it by the thought of all the world was losing by his delay, seeing what wrongs he intended to right, grievances to redress, injustices to repair, abuses to remove, and duties to discharge.', NULL, NULL, '', 'LINE', NULL, 10, '', '4c2080a34c4cae82daffcc8fd912973c', '', NULL),
(2656, 'en', 'default', '525615af5a10ef72d4783a48710ed3fe', 'They must know, then, that the above-named gentleman whenever he was at leisure (which was mostly all the year round) gave himself up to reading books of chivalry with such ardour and avidity that he almost entirely neglected the pursuit of his field-sports, and even the management of his property; and to such a pitch did his eagerness and infatuation go that he sold many an acre of tillageland to buy books of chivalry to read, and brought home as many of them as he could get.', NULL, NULL, '', 'LINE', NULL, 10, '', '03a65d98f52011a82245a9736cb98997', '', NULL),
