(3638, 'en', 'default', '4219e9a017987428685266b8afb91d80', '<code>_blank</code> &mdash; new window or tab.', NULL, NULL, '', 'LINE', NULL, 10, '', '6afc5273e6815c3d46e0ebdb4a13b4d5', '', NULL),
(3639, 'en', 'default', '54664b363fac4157930a3f35531b297a', '<code>_none</code> &mdash; same window or tab.', NULL, NULL, '', 'LINE', NULL, 10, '', 'cba77215afd0b5d8e96ef1a01273f4d0', '', NULL),
(3640, 'en', 'default', 'd0e80edbec66288a957ad0381ae03505', '<code>_top</code> &mdash; current window or tab, with no frames.', NULL, NULL, '', 'LINE', NULL, 10, '', 'eacc121dfd228bdf407e10172ae29704', '', NULL),
(3641, 'en', 'default', '2e9457fe36435e48a296c4a614e71a4f', '<strong>%s</strong> &mdash; This allows you to associate an image with your post without inserting it. This is usually useful only if your theme makes use of the image as a post thumbnail on the home page, a custom header, etc.', NULL, NULL, '', 'LINE', NULL, 10, '', '3006d7934608817a28a556e753065609', '', NULL),
(3642, 'en', 'default', 'f067f6f2a07a9f28b8acd051de12bd8f', '<strong><em>Note that password</em></strong> carefully! It is a <em>random</em> password that was generated just for you.', NULL, NULL, '', 'LINE', NULL, 10, '', '667f6a0fa877d898323aca1fc507a99e', '', NULL),
(3643, 'en', 'default', 'ecdb52fb00d5aabe4e9d24b436f9b9fc', '<strong>Activity</strong> &mdash; Shows the upcoming scheduled posts, recently published posts, and the most recent comments on your posts and allows you to moderate them.', NULL, NULL, '', 'LINE', NULL, 10, '', '92492a427dfb72cd1b97719e8e35e896', '', NULL),
(3644, 'en', 'default', 'fded98eff7361ede97add64b23522e66', '<strong>Advice:</strong> Think very carefully about your site crashing if you are live-editing the theme currently in use.', NULL, NULL, '', 'LINE', NULL, 10, '', '15ddc9d8e549ea70f200b6c8f5f1f2eb', '', NULL),
(3645, 'en', 'default', '63140e46478f1d454a81876f4a8aac81', '<strong>At a Glance</strong> &mdash; Displays a summary of the content on your site and identifies which theme and version of WordPress you are using.', NULL, NULL, '', 'LINE', NULL, 10, '', '9651d2ac13ff3b9afbd426d37b0e016d', '', NULL),
(3646, 'en', 'default', 'b65fa8d75f92ea10c226c9c9e107cfc6', '<strong>Box Controls</strong> &mdash; Click the title bar of the box to expand or collapse it. Some boxes added by plugins may have configurable content, and will show a &#8220;Configure&#8221; link in the title bar if you hover over it.', NULL, NULL, '', 'LINE', NULL, 10, '', '54545fe38eda999a7a67927af2e0e559', '', NULL),
(3647, 'en', 'default', 'e32b08e7cca5f7bce3cd6791a89a915f', '<strong>Buttons block:</strong> now you can choose a vertical or a horizontal layout. And you can set the width of a button to a preset percentage.', NULL, NULL, '', 'LINE', NULL, 10, '', '9ed4180cb299dcd84841d94f064b2f64', '', NULL),
(3648, 'en', 'default', '2bc2b92ef21e54b7d57719af3e03b906', '<strong>Clicking the arrow to the right of any menu item</strong> in the editor will reveal a standard group of settings. Additional settings such as link target, CSS classes, link relationships, and link descriptions can be enabled and disabled via the Screen Options tab.', NULL, NULL, '', 'LINE', NULL, 10, '', '44adfce5db156b9d67e7c275453a89b9', '', NULL),
(3649, 'en', 'default', '25b883d51bec1f9d1a9bf0ba0bc896c1', '<strong>Comments</strong> &mdash; Comments are not deleted, but user data is anonymized, including Email Address, IP Address, and User Agent (Browser/OS).', NULL, NULL, '', 'LINE', NULL, 10, '', 'cf2c3e0c0b8b03950827a495ab9efd90', '', NULL),
(3650, 'en', 'default', 'c0f82ebccde3ecd85b86da527de951d5', '<strong>Comments</strong> &mdash; For any comments made by the user, Email Address, IP Address, User Agent (Browser/OS), Date/Time, Comment Content, and Content URL.', NULL, NULL, '', 'LINE', NULL, 10, '', 'a0ecef79d6168185100ad0e2237ed3a9', '', NULL),
(3651, 'en', 'default', '1eef56dd01e45adf6e85d4442cb7cbe4', '<strong>Community Events Location</strong> &mdash; The IP Address of the user used for the Upcoming Community Events shown in the dashboard widget.', NULL, NULL, '', 'LINE', NULL, 10, '', '33309cb94702494eb8ed2414cf45cd54', '', NULL),
(3652, 'en', 'default', 'b207c1596de152ac13adab1830974aae', '<strong>Community Events Location</strong> &mdash; The IP Address of the user which is used for the Upcoming Community Events shown in the dashboard widget.', NULL, NULL, '', 'LINE', NULL, 10, '', '8a5f722c9801c49f1bbc482a944f55d1', '', NULL),
(3653, 'en', 'default', 'b1223bca091660d2cb26c4403f354ea0', '<strong>Compatible</strong> with your version of WordPress', NULL, NULL, '', 'LINE', NULL, 10, '', '96c7d1203469aa395da152a984342fe8', '', NULL),
(3654, 'en', 'default', '019360949341be40f9abc62e0d947806', '<strong>Connection lost.</strong> Saving has been disabled until you&#8217;re reconnected.', NULL, NULL, '', 'LINE', NULL, 10, '', 'c7ad62cbc8e82263e1ecdbb66fe5fb52', '', NULL),
(3655, 'en', 'default', '6ca215e2e1768e48d8bcc386b5fc52cc', '<strong>Delete</strong> brings you to the Delete Users screen for confirmation, where you can permanently remove a user from your site and delete their content. You can also delete multiple users at once by using bulk actions.', NULL, NULL, '', 'LINE', NULL, 10, '', '7e6cf32fdd816b0eea4f4becac9b92d9', '', NULL),
(3656, 'en', 'default', '455ea6f84b4f4e0349d551dbb50d3a42', '<strong>Description</strong> &mdash; The description is not prominent by default; however, some themes may display it.', NULL, NULL, '', 'LINE', NULL, 10, '', 'bf0e83818cfea660dd6082860a6da784', '', NULL),
(3657, 'en', 'default', '72a914bd12c78373873416f57b033b13', '<strong>Discussion</strong> &mdash; You can turn comments and pings on or off, and if there are comments on the post, you can see them here and moderate them.', NULL, NULL, '', 'LINE', NULL, 10, '', 'feb178d959aae886b2dde85248492051', '', NULL),
(3658, 'en', 'default', '71ce1121b4c5579d8f2c8e71335b9a22', '<strong>Drag and Drop</strong> &mdash; To rearrange the boxes, drag and drop by clicking on the title bar of the selected box and releasing when you see a gray dotted-line rectangle appear in the location you want to place the box.', NULL, NULL, '', 'LINE', NULL, 10, '', '5152a8dbc58f8c3531ec3b414be417aa', '', NULL),
(3659, 'en', 'default', 'eb233701305e7a3f2c7906f8fc65e817', '<strong>Drag and drop</strong> your files into the area below. Multiple files are allowed.', NULL, NULL, '', 'LINE', NULL, 10, '', '8edfe8913a0e716cd74f3f38806c7700', '', NULL),
(3660, 'en', 'default', '9b0ce93b03db1e1cd98decc6387fa90c', '<strong>Edit</strong> takes you to the editable profile screen for that user. You can also reach that screen by clicking on the username.', NULL, NULL, '', 'LINE', NULL, 10, '', '11696b2610f2bbca1738397defd5ba29', '', NULL),
(3661, 'en', 'default', '0bdd62cf14b1ac2df851e97eed7faa8c', '<strong>Edit</strong> takes you to the editing screen for that post. You can also reach that screen by clicking on the post title.', NULL, NULL, '', 'LINE', NULL, 10, '', '74deb9541548900791736df7e47727d1', '', NULL),
(3662, 'en', 'default', 'ed2374f9d3ff94bdb484133a38cc6393', '<strong>Error:</strong> This plugin <strong>requires a newer version of PHP</strong>.', NULL, NULL, '', 'LINE', NULL, 10, '', 'b260f6763d9647dfaec623538113acd5', '', NULL),
(3663, 'en', 'default', 'ee44ff298965d7b09993a67601184216', '<strong>Error:</strong> This plugin <strong>requires a newer version of WordPress</strong>.', NULL, NULL, '', 'LINE', NULL, 10, '', '996ea00609b9a7b86c4e6169a592120c', '', NULL),
(3664, 'en', 'default', '30608372e73850a7a8fd71a2faa665eb', '<strong>Error</strong>: "Table Prefix" can only contain numbers, letters, and underscores.', NULL, NULL, '', 'LINE', NULL, 10, '', '038db20e95cae0b7ad5007ae9230e6ba', '', NULL),
(3665, 'en', 'default', '709d06584a9a88af5a7f27034384f746', '<strong>Error</strong>: "Table Prefix" is invalid.', NULL, NULL, '', 'LINE', NULL, 10, '', 'b2cc2397e4b9caa76938f4e08c0a2ddf', '', NULL),
(3666, 'en', 'default', '4936fd0e51462518e4249dc122916afe', '<strong>Error</strong>: "Table Prefix" must not be empty.', NULL, NULL, '', 'LINE', NULL, 10, '', '128bea2a3e3315028ad2a6e406a1e8d3', '', NULL),
(3667, 'en', 'default', '5aa4004c94f86b26244ca415eb7b413b', '<strong>Error</strong>: Could not connect to the server. Please verify the settings are correct.', NULL, NULL, '', 'LINE', NULL, 10, '', '0b5297ab07fc7c5827e90281c04e100b', '', NULL),
(3668, 'en', 'default', '8795eb8be16ea5dab54a6b6c7244a2ac', '<strong>Error</strong>: Options page %s not found in the allowed options list.', NULL, NULL, '', 'LINE', NULL, 10, '', '80f4bdda25e5f9ca77832919ceb932e0', '', NULL),
(3669, 'en', 'default', '772e5801b359d26918c06c3ff1e915ce', '<strong>Error</strong>: Passwords don&#8217;t match. Please enter the same password in both password fields.', NULL, NULL, '', 'LINE', NULL, 10, '', '7d43526ccef1a66281e17ffc08b5e389', '', NULL),
(3670, 'en', 'default', 'fcfd51f3b337e5cb2d86ce5a63573d59', '<strong>Error</strong>: Passwords may not contain the character "\\".', NULL, NULL, '', 'LINE', NULL, 10, '', 'a2e51c23d476ef707cf275dbb2beb301', '', NULL),
(3671, 'en', 'default', 'c0b0aac28cab4c59e56ad7d9c84d30ec', '<strong>Error</strong>: Please enter a nickname.', NULL, NULL, '', 'LINE', NULL, 10, '', 'ea68f77a8d9943841b3303cead4887b9', '', NULL),
(3672, 'en', 'default', 'c37cd59346ffdad3cb32f48fb04f8e39', '<strong>Error</strong>: Please enter a password.', NULL, NULL, '', 'LINE', NULL, 10, '', '49932d001d2b4c5317e747e1aee14834', '', NULL),
(3673, 'en', 'default', 'e60a8399deb8afe912dc2d4c3ea13ff3', '<strong>Error</strong>: Please enter an email address.', NULL, NULL, '', 'LINE', NULL, 10, '', 'eded8272858a48f070632a8635993f82', '', NULL),
(3674, 'en', 'default', 'b4fa2af88a19950eeb428cbfe997052d', '<strong>Font-size adjustment in more places:</strong> now, font-size controls are right where you need them in the List and Code blocks. No more trekking to another screen to make that single change!', NULL, NULL, '', 'LINE', NULL, 10, '', '92219cb1158bb2e4a64a9a9276982b09', '', NULL),
(3675, 'en', 'default', 'a714e868b537f3cebb76df3194b197b8', '<strong>Format</strong> &mdash; Post Formats designate how your theme will display a specific post. For example, you could have a <em>standard</em> blog post with a title and paragraphs, or a short <em>aside</em> that omits the title and contains a short text blurb. Your theme could enable all or some of 10 possible formats. <a href="https://wordpress.org/support/article/post-formats/#supported-formats">Learn more about each post format</a>.', NULL, NULL, '', 'LINE', NULL, 10, '', '73b6e32c1af8d094364baa3f81d70246', '', NULL),
(3676, 'en', 'default', '49d2eaa4774f2c7d332a18749fe62ae2', '<strong>Full-height alignment:</strong> have you ever wanted to make a block, like the Cover block, fill the whole window? Now you can.', NULL, NULL, '', 'LINE', NULL, 10, '', 'ec3c4bba83416e064676425cf0e03831', '', NULL),
(3677, 'en', 'default', '2611bbb61966ac8ca30b6e84fa17f39b', '<strong>Important:</strong> Before updating, please <a href="%1$s">back up your database and files</a>. For help with updates, visit the <a href="%2$s">Updating WordPress</a> documentation page.', NULL, NULL, '', 'LINE', NULL, 10, '', 'f0c8bd724e89cccb05c9c2d916a052d3', '', NULL),
(3678, 'en', 'default', 'adc736d6139e1287f1d9baaf718f5522', '<strong>Incompatible</strong> with your version of WordPress', NULL, NULL, '', 'LINE', NULL, 10, '', '13e0073401d88b673152424e5da67e61', '', NULL),
(3679, 'en', 'default', '996b2b4aa8413fcd0f6d148b2af946a6', '<strong>Info</strong> &mdash; The site URL is rarely edited as this can cause the site to not work properly. The Registered date and Last Updated date are displayed. Network admins can mark a site as archived, spam, deleted and mature, to remove from public listings or disable.', NULL, NULL, '', 'LINE', NULL, 10, '', '3d34da6684f8784cc40405ae4bc6550d', '', NULL),
(3680, 'en', 'default', 'c346a109aa2dee49051ffb0ca5352cff', '<strong>Inserter drag-and-drop:</strong> drag blocks and block patterns from the inserter right into your post.', NULL, NULL, '', 'LINE', NULL, 10, '', '37c9cbc7bdba735c83fd3f081aa60050', '', NULL),
(3681, 'en', 'default', 'e461df7d970f9f9bc2e64c95736c9653', '<strong>Media</strong> &mdash; A list of URLs for all media file uploads made by the user.', NULL, NULL, '', 'LINE', NULL, 10, '', '5b50fd7ccace6393569fee76c2c2f0c0', '', NULL),
(3682, 'en', 'default', '1c8ad85a1a29170a2c98285371e4ac2d', '<strong>Name</strong> &mdash; The name is how it appears on your site.', NULL, NULL, '', 'LINE', NULL, 10, '', '5febbe59b4e8c2b38e143b3cff8ae190', '', NULL),
(3683, 'en', 'default', '04dd8741dd8a75e028441495c39e4976', '<strong>Note: As this tool only gathers data from WordPress and participating plugins, you may need to do more to comply with erasure requests. You should also delete any data collected by or stored with any 3rd party services used by your business or site.</strong>', NULL, NULL, '', 'LINE', NULL, 10, '', '4febc1e776b452b3582b3f0cecccd480', '', NULL),
(3684, 'en', 'default', '815a0a390e155bcaf57cbef94d56733c', '<strong>Note: As this tool only gathers data from WordPress and participating plugins, you may need to do more to comply with export requests. You should also send the requestor any data collected by or stored with any 3rd party services used by your business or site.</strong>', NULL, NULL, '', 'LINE', NULL, 10, '', '229bc7c291b322a290fb096e27d375db', '', NULL),
(3685, 'en', 'default', 'dac04065919539b3bb81eb4152251ca4', '<strong>Order</strong> &mdash; Pages are usually ordered alphabetically, but you can choose your own order by entering a number (1 for first, etc.) in this field.', NULL, NULL, '', 'LINE', NULL, 10, '', 'f11c47af7f98788ea05b855c41902aa2', '', NULL),
(3686, 'en', 'default', '4ea8e185f297fa1e5706a8337719effe', '<strong>Parent</strong> &mdash; Categories, unlike tags, can have a hierarchy. You might have a Jazz category, and under that have child categories for Bebop and Big Band. Totally optional. To create a subcategory, just choose another category from the Parent dropdown.', NULL, NULL, '', 'LINE', NULL, 10, '', 'eec619c60b3b0a3e38f0069c120d2602', '', NULL),
(3687, 'en', 'default', '8f6225bd7662575ef84d375fec88dbd4', '<strong>Parent</strong> &mdash; You can arrange your pages in hierarchies. For example, you could have an &#8220;About&#8221; page that has &#8220;Life Story&#8221; and &#8220;My Dog&#8221; pages under it. There are no limits to how many levels you can nest pages.', NULL, NULL, '', 'LINE', NULL, 10, '', 'a7d363674bc0d711d6d160e3dbf13846', '', NULL),
(3688, 'en', 'default', 'd1bb204120db5310aec8f2490431cb76', '<strong>Please Note:</strong> Any customizations you have made to theme files will be lost. Please consider using <a href="%s">child themes</a> for modifications.', NULL, NULL, '', 'LINE', NULL, 10, '', '04573092292e1d20b219c5d37cabb34e', '', NULL),
(3689, 'en', 'default', '91cc965a84f790ad2906d697f3119a1d', '<strong>Post editor</strong> &mdash; Enter the text for your post. There are two modes of editing: Visual and Text. Choose the mode by clicking on the appropriate tab.', NULL, NULL, '', 'LINE', NULL, 10, '', 'a0bfc377e504c07ae3b7b4ee7eb27344', '', NULL),
(3690, 'en', 'default', 'b807523847b38ac8553394a6e915ef62', '<strong>Preview</strong> will show you what your draft post will look like if you publish it. View will take you to your live site to view the post. Which link is available depends on your post&#8217;s status.', NULL, NULL, '', 'LINE', NULL, 10, '', 'feb9ddd4b67850aee6a2151805f1dfa8', '', NULL),
(3691, 'en', 'default', '633fcda92663cc326f656b42d6753007', '<strong>Profile Information</strong> &mdash; user email address, username, display name, nickname, first name, last name, description/bio, and registration date.', NULL, NULL, '', 'LINE', NULL, 10, '', 'd18718a45aa29406828a4cbacc674bc8', '', NULL),
(3692, 'en', 'default', 'ad831971b7a4b43e2ef0d627e297902a', '<strong>Publish</strong> &mdash; You can set the terms of publishing your post in the Publish box. For Status, Visibility, and Publish (immediately), click on the Edit link to reveal more options. Visibility includes options for password-protecting a post or making it stay at the top of your blog indefinitely (sticky). The Password protected option allows you to set an arbitrary password for each post. The Private option hides the post from everyone except editors and administrators. Publish (immediately) allows you to set a future or past date and time, so you can schedule a post to be published in the future or backdate a post.', NULL, NULL, '', 'LINE', NULL, 10, '', 'ffea9d2f9ee57d2e3ab4a669c39607c5', '', NULL),
(3693, 'en', 'default', '66c7115df99c78b479de41aa41c142ae', '<strong>Quick Draft</strong> &mdash; Allows you to create a new post and save it as a draft. Also displays links to the 3 most recent draft posts you\'ve started.', NULL, NULL, '', 'LINE', NULL, 10, '', '7aa1d766cbdc5f0cea76bf50db690844', '', NULL),
(3694, 'en', 'default', '099f3df0632488f2c47e2658d95e0e76', '<strong>Quick Edit</strong> provides inline access to the metadata of your post, allowing you to update post details without leaving this screen.', NULL, NULL, '', 'LINE', NULL, 10, '', 'aec7db39f9755f7c2dc6e2b37c8412c2', '', NULL),
(3695, 'en', 'default', 'b7afe14ef93e550358d9308fbcdf9df0', '<strong>Random:</strong> Show a different image on each page.', NULL, NULL, '', 'LINE', NULL, 10, '', 'ba08a9ca69ff15ee804b268fc9029e72', '', NULL),
(3696, 'en', 'default', '926c63b9307b7b0b04c46f8966c7a92e', '<strong>Remove</strong> allows you to remove a user from your site. It does not delete their content. You can also remove multiple users at once by using bulk actions.', NULL, NULL, '', 'LINE', NULL, 10, '', '5238a35a539424c3c993b0d666b66904', '', NULL),
(3697, 'en', 'default', '58c1e88009b51d31992496b9bc8c6fec', '<strong>Reusable blocks:</strong> several enhancements make reusable blocks more stable and easier to use. And now they save automatically with the post when you click the Update button.', NULL, NULL, '', 'LINE', NULL, 10, '', '3aef5d2068cc8000bd834e1071aa1663', '', NULL),
(3698, 'en', 'default', 'a98be58ec342822c43f9a60f423b1d2f', '<strong>Screen Options</strong> &mdash; Use the Screen Options tab to choose which Dashboard boxes to show.', NULL, NULL, '', 'LINE', NULL, 10, '', 'ed407f0af001c6226b4cc9be2875d701', '', NULL),
(3699, 'en', 'default', 'd6ce148cfd01c369f1b23045e489b491', '<strong>Send Trackbacks</strong> &mdash; Trackbacks are a way to notify legacy blog systems that you&#8217;ve linked to them. Enter the URL(s) you want to send trackbacks. If you link to other WordPress sites they&#8217;ll be notified automatically using pingbacks, and this field is unnecessary.', NULL, NULL, '', 'LINE', NULL, 10, '', '0671b4a2f6125c4f545933974afb647d', '', NULL),
(3700, 'en', 'default', 'd65379cae9ff2dcc077d4e28a3d6f105', '<strong>Session Tokens</strong> &mdash; User login information, IP Addresses, Expiration Date, User Agent (Browser/OS), and Last Login.', NULL, NULL, '', 'LINE', NULL, 10, '', 'f3adc695d198c2850ae8457a345400aa', '', NULL),
(3701, 'en', 'default', '0d7d65c866eb8c69ac9cb51558adfa14', '<strong>Settings</strong> &mdash; This page shows a list of all settings associated with this site. Some are created by WordPress and others are created by plugins you activate. Note that some fields are grayed out and say Serialized Data. You cannot modify these values due to the way the setting is stored in the database.', NULL, NULL, '', 'LINE', NULL, 10, '', 'd354fd7e8af531c92dc88db3ef74cfe4', '', NULL),
(3702, 'en', 'default', 'dc46a752ed8e50a6aa55a3879ec7ea07', '<strong>Site Health Status</strong> &mdash; Informs you of any potential issues that should be addressed to improve the performance or security of your website.', NULL, NULL, '', 'LINE', NULL, 10, '', '20bfad7d0e2a864c37cae0136c522b2e', '', NULL),
(3703, 'en', 'default', '411d40a6a21e11c47ed8adb1c92f00b0', '<strong>Slug</strong> &mdash; The &#8220;slug&#8221; is the URL-friendly version of the name. It is usually all lowercase and contains only letters, numbers, and hyphens.', NULL, NULL, '', 'LINE', NULL, 10, '', '97af8d8b956434fb602f37b6e0e53e27', '', NULL),
(3704, 'en', 'default', '088c57a52f27b82be098373dc88746ed', '<strong>Social Icons block:</strong> now you can change the size of the icons.', NULL, NULL, '', 'LINE', NULL, 10, '', '05d21bd93eaccefc43469353459a6d63', '', NULL),
(3705, 'en', 'default', '597ef2b39aedb4e7f14e838eed92b8f7', '<strong>Template</strong> &mdash; Some themes have custom templates you can use for certain pages that might have additional features or custom layouts. If so, you&#8217;ll see them in this dropdown menu.', NULL, NULL, '', 'LINE', NULL, 10, '', '62319763264b08b9688c6a9f025316ba', '', NULL),
(3706, 'en', 'default', 'ce993a5f75691ce7176e73214153f067', '<strong>The parent theme could not be found.</strong> You will need to install the parent theme, %s, before you can use this child theme.', NULL, NULL, '', 'LINE', NULL, 10, '', 'b7bcb279eab6de0e2f5af6b67f2c9a78', '', NULL),
(3707, 'en', 'default', '83898cec1dbe4f4586c8347c1ba46120', '<strong>Themes and Plugins</strong> &mdash; To update individual themes or plugins from this screen, use the checkboxes to make your selection, then <strong>click on the appropriate &#8220;Update&#8221; button</strong>. To update all of your themes or plugins at once, you can check the box at the top of the section to select all before clicking the update button.', NULL, NULL, '', 'LINE', NULL, 10, '', '98ac0766c2d6280e0f1ccde117bde100', '', NULL),
(3708, 'en', 'default', 'b23e308c3f8aaf77e0abb955c2b42721', '<strong>Themes</strong> &mdash; This area shows themes that are not already enabled across the network. Enabling a theme in this menu makes it accessible to this site. It does not activate the theme, but allows it to show in the site&#8217;s Appearance menu. To enable a theme for the entire network, see the <a href="%s">Network Themes</a> screen.', NULL, NULL, '', 'LINE', NULL, 10, '', 'e27f32c9e1231c938c359bd433295481', '', NULL),
(3709, 'en', 'default', '2d08934c32876d0e82311f1741b4e5cb', '<strong>Title</strong> &mdash; Enter a title for your post. After you enter a title, you&#8217;ll see the permalink below, which you can edit.', NULL, NULL, '', 'LINE', NULL, 10, '', 'caebf199686f82f701abc47dd032baad', '', NULL),
(3710, 'en', 'default', 'da5abbe81c1b1941c214b1b4298822cb', '<strong>Translations</strong> &mdash; The files translating WordPress into your language are updated for you whenever any other updates occur. But if these files are out of date, you can <strong>click the &#8220;Update Translations&#8221;</strong> button.', NULL, NULL, '', 'LINE', NULL, 10, '', 'd5ff3112c75a90a53ba4a28d043eb4a7', '', NULL),
(3711, 'en', 'default', 'e47a2e6f27c9b018db4352a245cee5a2', '<strong>Trash</strong> removes your post from this list and places it in the Trash, from which you can permanently delete it.', NULL, NULL, '', 'LINE', NULL, 10, '', 'bf97872eb62839977c478c8b7e32ec5c', '', NULL),
(3712, 'en', 'default', '55c1d7dcd5c13ba5790cecd4c6cbd55f', '<strong>Users</strong> &mdash; This displays the users associated with this site. You can also change their role, reset their password, or remove them from the site. Removing the user from the site does not remove the user from the network.', NULL, NULL, '', 'LINE', NULL, 10, '', '97df9b3590027eed340d84b2abc5d08c', '', NULL),
(3713, 'en', 'default', '497641b5542b22dc5d6854613073ad40', '<strong>Version %1$s</strong> addressed %2$s bug.', NULL, NULL, '', 'LINE', NULL, 10, '', 'c13c1e08ef6aba59e1f4b7bc1ad35bf6', '', NULL),
(3714, 'en', 'default', 'ccb459ea6dea3238d4dd526be26dba4c', '<strong>Version %1$s</strong> addressed %2$s bugs.', NULL, NULL, '', 'LINE', NULL, 10, '', '89b615edaedeab58df789dd5e3a74e4a', '', NULL),
(3715, 'en', 'default', 'df609ba9ff6d652262e61c635fd87422', '<strong>Version %1$s</strong> addressed a security issue and fixed %2$s bug.', NULL, NULL, '', 'LINE', NULL, 10, '', '22c02e594d318ed13d65a617083a91d5', '', NULL),
(3716, 'en', 'default', '3cd6f317f07bc2911eac401ef22b1d3b', '<strong>Version %1$s</strong> addressed a security issue and fixed %2$s bugs.', NULL, NULL, '', 'LINE', NULL, 10, '', '702eec6470f8061630a737f38d53f062', '', NULL),
(3717, 'en', 'default', '1a58444df6e0a3d5033b661fa156d96b', '<strong>Version %1$s</strong> addressed some security issues and fixed %2$s bug.', NULL, NULL, '', 'LINE', NULL, 10, '', '3f38810d492ca368a186acfdb13b89a8', '', NULL),
(3718, 'en', 'default', '06235b6f29533b9b5969b12a8df162d6', '<strong>Version %1$s</strong> addressed some security issues and fixed %2$s bugs.', NULL, NULL, '', 'LINE', NULL, 10, '', '92da042deabc0a6a3b2479b8c699289e', '', NULL),
(3719, 'en', 'default', '900bc9524d36e0e13350b3400873564a', '<strong>Version %s</strong> addressed one security issue.', NULL, NULL, '', 'LINE', NULL, 10, '', '9e6ee027d8f8ef6ac3d2721e1a9ab052', '', NULL),
(3720, 'en', 'default', 'd237445cc6aef6932337c278ff66b5c4', '<strong>Version %s</strong> addressed some security issues.', NULL, NULL, '', 'LINE', NULL, 10, '', '28e16bb0ce72b142e79721534f1d11d4', '', NULL),
(3721, 'en', 'default', 'e835b8952a95ab3be7ed03ae1e9cef3f', '<strong>Warning:</strong> Making changes to active plugins is not recommended.', NULL, NULL, '', 'LINE', NULL, 10, '', '35a819b6497bd40c58749e0c37477771', '', NULL),
(3722, 'en', 'default', '098c48c5729f2c05969e76c83d7a78f1', '<strong>Warning:</strong> This plugin <strong>has not been tested</strong> with your current version of WordPress.', NULL, NULL, '', 'LINE', NULL, 10, '', '6255349ca348aa4c9a4f66e18dade5d2', '', NULL) ;
INSERT INTO `wp_icl_strings` ( `id`, `language`, `context`, `name`, `value`, `string_package_id`, `location`, `wrap_tag`, `type`, `title`, `status`, `gettext_context`, `domain_name_context_md5`, `translation_priority`, `word_count`) VALUES
(3723, 'en', 'default', '4c5326903082d475a84144bbc035cbd8', '<strong>Warning:</strong> these pages should not be the same as your Privacy Policy page!', NULL, NULL, '', 'LINE', NULL, 10, '', '946a8ef52ae6ed9109993f1cf66f930d', '', NULL),
(3724, 'en', 'default', '30afe4bb9e679217d99baf456b9d5040', '<strong>Warning:</strong> these pages should not be the same!', NULL, NULL, '', 'LINE', NULL, 10, '', '4619e75ddd04e800d7455d2f073e5de9', '', NULL),
(3725, 'en', 'default', '949100024350856bb528b654ef53952d', '<strong>Welcome</strong> &mdash; Shows links for some of the most common tasks when setting up a new site.', NULL, NULL, '', 'LINE', NULL, 10, '', 'e66eb81986125f51d693abfb956c7f9c', '', NULL),
(3726, 'en', 'default', 'c218af871a6a22a7734d3ee3064a2f9a', '<strong>WordPress Events and News</strong> &mdash; Upcoming events near you as well as the latest news from the official WordPress project and the <a href="%s">WordPress Planet</a>.', NULL, NULL, '', 'LINE', NULL, 10, '', '8d0a1cdda55b132500a06507c4006c83', '', NULL),
