(3962, 'en', 'default', 'a9aaa5a8c454b3604df40c08faf864cb', 'By default WordPress does not collect any analytics data. However, many web hosting accounts collect some anonymous analytics data. You may also have installed a WordPress plugin that provides analytics services. In that case, add information from that plugin here.', NULL, NULL, '', 'LINE', NULL, 10, '', 'bbb10dc461ad05c0ba1743dbb84c6a33', '', NULL),
(3963, 'en', 'default', 'a4de3012edb9e615cba657b2fb29dd24', 'By default WordPress does not collect any personal data about visitors, and only collects the data shown on the User Profile screen from registered users. However some of your plugins may collect personal data. You should add the relevant information below.', NULL, NULL, '', 'LINE', NULL, 10, '', 'eec5f990e54f0d488c9668381d51ec1c', '', NULL),
(3964, 'en', 'default', '72927f6ce8ef34a17482510ae8e43c73', 'By default WordPress does not share any personal data with anyone.', NULL, NULL, '', 'LINE', NULL, 10, '', '3e2c17f51ad2871c50487c676743a6bb', '', NULL),
(3965, 'en', 'default', 'bdcc5a96190089ab92a53a42910fc9d7', 'By default, WordPress does not include a contact form. If you use a contact form plugin, use this subsection to note what personal data is captured when someone submits a contact form, and how long you keep it. For example, you may note that you keep contact form submissions for a certain period for customer service purposes, but you do not use the information submitted through them for marketing purposes.', NULL, NULL, '', 'LINE', NULL, 10, '', '2f597e938edf13361bdf1cde1770b525', '', NULL),
(3966, 'en', 'default', '5b5dc2be55116d8466b06d4d75c19e38', 'By default, new users will receive an email letting them know they&#8217;ve been added as a user for your site. This email will also contain a password reset link. Uncheck the box if you don&#8217;t want to send the new user a welcome email.', NULL, NULL, '', 'LINE', NULL, 10, '', 'ea0cd33171ea210e9f7f548627f323a2', '', NULL),
