(3981, 'en', 'default', 'b0ca6078939acc19b65f7d3a980a50ff', 'Categories have hierarchy, meaning that you can nest sub-categories. Tags do not have hierarchy and cannot be nested. Sometimes people start out using one on their posts, then later realize that the other would work better for their content.', NULL, NULL, '', 'LINE', NULL, 10, '', 'e90a19994fd4faf5fab54f4358835df1', '', NULL),
(3982, 'en', 'default', '0f0103e212d05b86db90dd1049f37e40', 'Categories, unlike tags, can have a hierarchy. You might have a Jazz category, and under that have children categories for Bebop and Big Band. Totally optional.', NULL, NULL, '', 'LINE', NULL, 10, '', 'eca83cec51d51a36d40d677c793520b2', '', NULL),
