(4362, 'en', 'default', 'd3d0a99752e8793c0f2891b4a0dccd7d', 'European data protection law requires data about European residents which is transferred outside the European Union to be safeguarded to the same standards as if the data was in Europe. So in addition to listing where data goes, you should describe how you ensure that these standards are met either by yourself or by your third party providers, whether that is through an agreement such as Privacy Shield, model clauses in your contracts, or binding corporate rules.', NULL, NULL, '', 'LINE', NULL, 10, '', '6d750ee1a6f3c7ea9e7b07ab963c68f0', '', NULL),
