(4460, 'en', 'default', 'a67064d5d76833040d0fc4d452db45dc', 'For PHP files, you can use the Documentation dropdown to select from functions recognized in that file. Look Up takes you to a web page with reference material about that particular function.', NULL, NULL, '', 'LINE', NULL, 10, '', '8681538f37d1a74d17a24d01c81d0b6d', '', NULL),
