(4462, 'en', 'default', 'ec3b4d4004379cce2d3894a89eb2c19a', 'For images only, you can click on Edit Image under the thumbnail to expand out an inline image editor with icons for cropping, rotating, or flipping the image as well as for undoing and redoing. The boxes on the right give you more options for scaling the image, for cropping it, and for cropping the thumbnail in a different way than you crop the original image. You can click on Help in those boxes to get more information.', NULL, NULL, '', 'LINE', NULL, 10, '', 'efdea5ed6ea251bbe2cbd4857740629b', '', NULL),
