(4466, 'en', 'default', 'cdf6eaeb6e69062b9ca938030dcd7b8e', 'For most themes, the header text is your Site Title and Tagline, as defined in the <a href="%s">General Settings</a> section.', NULL, NULL, '', 'LINE', NULL, 10, '', '29252e1de6540b7bb24bb75f2c18f5c7', '', NULL),
(4467, 'en', 'default', '8a9f8ce95fbcd456affde59d95cb711d', 'For optimal performance and security reasons, we recommend running %1$s version %2$s or higher. Contact your web hosting company to correct this.', NULL, NULL, '', 'LINE', NULL, 10, '', '0338cdd51a941acf99da57531306adf1', '', NULL),
(4468, 'en', 'default', '522aadf23f305abae106a83bf430576e', 'For users that register on our website (if any), we also store the personal information they provide in their user profile. All users can see, edit, or delete their personal information at any time (except they cannot change their username). Website administrators can also see and edit that information.', NULL, NULL, '', 'LINE', NULL, 10, '', 'e72f6eaabce2f1292d15c25394db0b83', '', NULL),
