(4541, 'en', 'default', '0fe26287994e5dae9bd091faac4fae53', 'Hi there! I\'m a bike messenger by day, aspiring actor by night, and this is my website. I live in Los Angeles, have a great dog named Jack, and I like pi&#241;a coladas. (And gettin\' caught in the rain.)', NULL, NULL, '', 'LINE', NULL, 10, '', '8b149ecb0093cc6559bb2f7dfd7d54dc', '', NULL),
