(4554, 'en', 'default', '324a8e205fd6e1ed56142378c52931a8', 'Hovering over a row in the posts list will display action links that allow you to manage your post. You can perform the following actions:', NULL, NULL, '', 'LINE', NULL, 10, '', 'fec1189b4b1f2a26e07f6552c036bacd', '', NULL),
