(4560, 'en', 'default', '83218ac34c1834c26781fe4bde918ee4', 'Welcome', NULL, NULL, '', 'LINE', NULL, 10, 'Howdy', '38b4afe159bbb459ecb755ceb6025d61', '', NULL),
(4561, 'en', 'default', '72471361ae64722f169705174e2f0b49', 'Howdy ###USERNAME###,\\n\\nYou recently clicked the \'Delete Site\' link on your site and filled in a\\nform on that page.\\n\\nIf you really want to delete your site, click the link below. You will not\\nbe asked to confirm again so only click this link if you are absolutely certain:\\n###URL_DELETE###\\n\\nIf you delete your site, please consider opening a new site here\\nsome time in the future! (But remember your current site and username\\nare gone forever.)\\n\\nThanks for using the site,\\nAll at ###SITENAME###\\n###SITEURL###', NULL, NULL, '', 'LINE', NULL, 10, '', '2cbd935e2ff08060f3132ed2ba1dc3c2', '', NULL),
(4562, 'en', 'default', '6ac9551847a5df4e8a6ce78dcea1ae5b', 'Howdy ###USERNAME###,\\n\\nYou recently requested to have the administration email address on\\nyour site changed.\\n\\nIf this is correct, please click on the following link to change it:\\n###ADMIN_URL###\\n\\nYou can safely ignore and delete this email if you do not want to\\ntake this action.\\n\\nThis email has been sent to ###EMAIL###\\n\\nRegards,\\nAll at ###SITENAME###\\n###SITEURL###', NULL, NULL, '', 'LINE', NULL, 10, '', 'f8d4ed8542927878c766489d9084fda3', '', NULL),
(4563, 'en', 'default', 'baa60842ee4db94343ce84aab3617742', 'Howdy! Plugins and themes failed to update on your site at %s.', NULL, NULL, '', 'LINE', NULL, 10, '', '09c9decaee1058052e8da3b9bb5e32db', '', NULL),
