(4566, 'en', 'default', '70a4b017e62eae7443f97f85f16c18a2', 'Howdy! Some plugins have automatically updated to their latest versions on your site at %s. No further action is needed on your part.', NULL, NULL, '', 'LINE', NULL, 10, '', 'e3918535fbd72faef5d450ac9b8ffc9a', '', NULL),
