(4568, 'en', 'default', 'af3421d1c5933ac5da633cbefd362304', 'Howdy! Themes failed to update on your site at %s.', NULL, NULL, '', 'LINE', NULL, 10, '', '5c71dd34c066a8ecdaef69959a2153a3', '', NULL),
(4569, 'en', 'default', '6df497141294a21767ee39060b813331', 'Howdy! Your site at %1$s has been updated automatically to WordPress %2$s.', NULL, NULL, '', 'LINE', NULL, 10, '', '4306b2d6e77cb1136bb70913a0645764', '', NULL),
(4570, 'en', 'default', 'aa5da9e4a780bbdb0c340ce833c86d7b', 'Howdy,\\n\\nYour request for an export of personal data has been completed. You may\\ndownload your personal data by clicking on the link below. For privacy\\nand security, we will automatically delete the file on ###EXPIRATION###,\\nso please download it before then.\\n\\n###LINK###\\n\\nRegards,\\nAll at ###SITENAME###\\n###SITEURL###', NULL, NULL, '', 'LINE', NULL, 10, '', '1c2aa9f43567a968900f1c907fb5ccfb', '', NULL),
(4571, 'en', 'default', '60d97f3583f770229990ed5aeffaeb96', 'However, it is your responsibility to use those resources correctly, to provide the information that your Privacy Policy requires, and to keep that information current and accurate.', NULL, NULL, '', 'LINE', NULL, 10, '', '9f68c1ce495b76c67c63a4680e89b0de', '', NULL),
(4572, 'en', 'default', '7fba5f82ee216d3eff55f68673fe42b6', 'However, your WordPress Address is currently controlled by a PHP constant and therefore cannot be updated. You need to edit your %1$s and remove or update the definitions of %2$s and %3$s.', NULL, NULL, '', 'LINE', NULL, 10, '', '239d253d2fe1a228cfba0f633b339d8a', '', NULL),
(4573, 'en', 'default', 'c3eb5c3b9018d75cb7032deb99fe43e9', 'I understand', NULL, NULL, '', 'LINE', NULL, 10, '', 'e61852452bcf81c58f9a08188d682c36', '', NULL),
(4574, 'en', 'default', 'c68fb320a4dca20e194a57cee16f5781', 'I\'m sure I want to permanently delete my site, and I am aware I can never get it back or use %s again.', NULL, NULL, '', 'LINE', NULL, 10, '', '1444e65a4c97ea1a82fbeeeeda2f0673', '', NULL),
