(4578, 'en', 'default', '73b306231571285f343a324fc21e2242', 'Identicon (Generated)', NULL, NULL, '', 'LINE', NULL, 10, '', '3c8089a94f4a20179544b8d161592bb9', '', NULL),
(4579, 'en', 'default', 'f0b044a6cf173afd1a33d8b2ccb31307', 'If a media file has not been attached to any content, you will see that in the Uploaded To column, and can click on Attach to launch a small popup that will allow you to search for existing content and attach the file.', NULL, NULL, '', 'LINE', NULL, 10, '', '1971f6ac2a430e12344f4e1c23130b14', '', NULL),
(4580, 'en', 'default', '413ea0a127a3a100b83ec95eacabc6c3', 'If an update is available, you&#8127;ll see a notification appear in the Toolbar and navigation menu.', NULL, NULL, '', 'LINE', NULL, 10, '', '27b11d9c8aed915251b6af3836623b77', '', NULL),
(4581, 'en', 'default', '6f363b449d599453089e76b5b75a84d2', 'If desired, WordPress will automatically alert various services of your new posts.', NULL, NULL, '', 'LINE', NULL, 10, '', 'fbbda771c29199a924ff990070d6e9ef', '', NULL),
(4582, 'en', 'default', 'f729908be92047ec1a286f75adf9deac', 'If for any reason this automatic file creation doesn&#8217;t work, don&#8217;t worry. All this does is fill in the database information to a configuration file. You may also simply open %1$s in a text editor, fill in your information, and save it as %2$s.', NULL, NULL, '', 'LINE', NULL, 10, '', 'ad8149092455db3ba2b501ed0ccb8bd3', '', NULL),
(4583, 'en', 'default', '37a24e605a3cda57698e531f125740bc', 'If something goes wrong with a plugin and you can&#8217;t use WordPress, delete or rename that file in the %s directory and it will be automatically deactivated.', NULL, NULL, '', 'LINE', NULL, 10, '', 'b9b8f473d110eff046e9836bde623ed6', '', NULL),
(4584, 'en', 'default', '1dca8bf32d5cff060d7121ae1eb92dfb', 'If the importer you need is not listed, <a href="%s">search the plugin directory</a> to see if an importer is available.', NULL, NULL, '', 'LINE', NULL, 10, '', '1d1e3e79250e432f39f301f281556562', '', NULL),
(4585, 'en', 'default', 'a10861963a7d25c930c795464368e737', 'If the link is to a person, you can specify your relationship with them using the above form. If you would like to learn more about the idea check out <a href="https://gmpg.org/xfn/">XFN</a>.', NULL, NULL, '', 'LINE', NULL, 10, '', '4818d27ebae3df3025539a03d71fe65a', '', NULL),
(4586, 'en', 'default', '1433ef9097a488fa699b6908d1bcf7da', 'If the root directory of your site was <a href="%1$s">writable</a>, we could do this automatically, but it isn&#8217;t so this is the url rewrite rule you should have in your %2$s file. Create a new file, called %2$s in the root directory of your site. Click in the field and press %3$s to select all. Then insert this code into the %2$s file.', NULL, NULL, '', 'LINE', NULL, 10, '', 'a02f2f23099189e7886248ee6265d461', '', NULL),
(4587, 'en', 'default', 'd9dff3fdbe97394dbe242685a2baaddf', 'If you absolutely have to make direct edits to this plugin, use a file manager to create a copy with a new name and hang on to the original. That way, you can re-enable a functional version if something goes wrong.', NULL, NULL, '', 'LINE', NULL, 10, '', 'b29b7284479d958fc9d549fee1073e52', '', NULL),
(4588, 'en', 'default', '9c5a9c6b4c6ae1c5fb60ea2ade59d87d', 'If you already have a Privacy Policy page, please select it below. If not, please create one.', NULL, NULL, '', 'LINE', NULL, 10, '', '90c122e5176b8e48d55736c13f77a036', '', NULL),
(4589, 'en', 'default', '03191ad53bd55facfbe806e381b5aff0', 'If you are a member of a regulated industry, or if you are subject to additional privacy laws, you may be required to disclose that information here.', NULL, NULL, '', 'LINE', NULL, 10, '', 'd393238caa2225600eef5118eaa27ec1', '', NULL),
(4590, 'en', 'default', 'd20b0e79f5524d5b219510197ef8ab8e', 'If you are looking to use the link manager, please install the <a href="%s">Link Manager</a> plugin.', NULL, NULL, '', 'LINE', NULL, 10, '', 'b42c749b343c939dbe2576b189c6eb5f', '', NULL),
(4591, 'en', 'default', 'd1b8e7bc102253581dd3fa1e130e92b0', 'If you are not sure, check the plugin documentation or contact the plugin author to see if the plugin collects data and if it supports the Data Eraser tool. This information may be available in the <a href="%s">Privacy Policy Guide</a>.', NULL, NULL, '', 'LINE', NULL, 10, '', '3ff1ebc698f93b6104bd62617e6a4578', '', NULL),
(4592, 'en', 'default', '59aec3f47475a116ce6efdc7cd482c13', 'If you are not sure, check the plugin documentation or contact the plugin author to see if the plugin collects data and if it supports the Data Exporter tool. This information may be available in the <a href="%s">Privacy Policy Guide</a>.', NULL, NULL, '', 'LINE', NULL, 10, '', '0ca30d778f0c5a8fc240d66e62c0193c', '', NULL),
(4593, 'en', 'default', 'fcefef1e6a444a7b2bdfdc223d54a30e', 'If you change this, we will send you an email at your new address to confirm it. <strong>The new address will not become active until confirmed.</strong>', NULL, NULL, '', 'LINE', NULL, 10, '', 'c247c9365f8c7160fcf7a0dc21de3e03', '', NULL),
(4594, 'en', 'default', '3219753c0cb134607b3205b5f612186e', 'If you decide to go ahead with direct edits anyway, use a file manager to create a copy with a new name and hang on to the original. That way, you can re-enable a functional version if something goes wrong.', NULL, NULL, '', 'LINE', NULL, 10, '', '1b6f257b01e6981375dc758a3199ab63', '', NULL),
(4595, 'en', 'default', 'ce6795178b70755466ea7df40c7b2555', 'If you delete a link, it will be removed permanently, as Links do not have a Trash function yet.', NULL, NULL, '', 'LINE', NULL, 10, '', '874f0dfb78167b85a8bcf0569d1ba576', '', NULL),
(4596, 'en', 'default', '916912d32e90632f29686f67c773ffc8', 'If you do not remember your credentials, you should contact your web host.', NULL, NULL, '', 'LINE', NULL, 10, '', '4c58dd19bae079e039dc0383aa4b96d8', '', NULL),
(4597, 'en', 'default', '3cf74bde548a1b8deecb0a49d9de3784', 'If you do not want to use your %s site any more, you can delete it using the form below. When you click <strong>Delete My Site Permanently</strong> you will be sent an email with a link in it. Click on this link to delete your site.', NULL, NULL, '', 'LINE', NULL, 10, '', 'a11453a281985b76a8a3878322b0a388', '', NULL),
(4598, 'en', 'default', 'c7b428708659c3c01c911d65bb3ebe23', 'If you don&#8217;t want a header image to be displayed on your site at all, click the &#8220;Remove Header Image&#8221; button at the bottom of the Header Image section of this page. If you want to re-enable the header image later, you just have to select one of the other image options and click &#8220;Save Changes&#8221;.', NULL, NULL, '', 'LINE', NULL, 10, '', 'd40e2cf9e52c77edd1824c1dd7db77b9', '', NULL),
(4599, 'en', 'default', '630df4be582006585fc90ce4b93f9254', 'If you don&lsquo;t want to upload your own image, you can use one of these cool headers, or show a random one.', NULL, NULL, '', 'LINE', NULL, 10, '', '670f09b60167f2151c58a9aac9220ebf', '', NULL),
(4600, 'en', 'default', '3f2b4cfd2cad80bf7584970a3f835c02', 'If you edit or publish an article, an additional cookie will be saved in your browser. This cookie includes no personal data and simply indicates the post ID of the article you just edited. It expires after 1 day.', NULL, NULL, '', 'LINE', NULL, 10, '', '1aefc2014eb00ab096a7cc8ca09b5ee2', '', NULL),
(4601, 'en', 'default', '62c4541e6538f354865d8026c67d446e', 'If you experience any issues or need support, the volunteers in the WordPress.org support forums may be able to help.', NULL, NULL, '', 'LINE', NULL, 10, '', 'eeb98b73b769919deb0e8a7cb490efea', '', NULL),
(4602, 'en', 'default', '5b7dbede6438d4668d4d3a1ccb4cc802', 'If you have a plugin in a .zip format, you may install or update it by uploading it here.', NULL, NULL, '', 'LINE', NULL, 10, '', '7c4dcbce8f0d346a150695a4a6521286', '', NULL),
(4603, 'en', 'default', 'f36a41d08877125db1e16711b230c0a3', 'If you have a theme in a .zip format, you may install or update it by uploading it here.', NULL, NULL, '', 'LINE', NULL, 10, '', '9d81493c82c579c8a7e3cfadc5ad9d3f', '', NULL),
(4604, 'en', 'default', 'ae1bc04b5e3967feb6adc498b8d57f62', 'If you have an account on this site, or have left comments, you can request to receive an exported file of the personal data we hold about you, including any data you have provided to us. You can also request that we erase any personal data we hold about you. This does not include any data we are obliged to keep for administrative, legal, or security purposes.', NULL, NULL, '', 'LINE', NULL, 10, '', 'c0b485544617c4aba2e6cc625c5732d8', '', NULL),
(4605, 'en', 'default', '62f7387a9ef151c294e680b2fd42169e', 'If you have marked plugins as favorites on WordPress.org, you can browse them here.', NULL, NULL, '', 'LINE', NULL, 10, '', 'b8fec56cb45e1a17dc0a62f2b168910f', '', NULL),
(4606, 'en', 'default', '7292a018caf8f27efeec3ee8fdaea12d', 'If you have marked themes as favorites on WordPress.org, you can browse them here.', NULL, NULL, '', 'LINE', NULL, 10, '', '4e181b871f87a1027dd5942943ef34ea', '', NULL),
(4607, 'en', 'default', '8ba5adc334d2585a8a27cc06d82e8a3f', 'If you have posts or comments in another system, WordPress can import those into this site. To get started, choose a system to import from below:', NULL, NULL, '', 'LINE', NULL, 10, '', '02495c0abfdb5ea16804a08a9c3efe8a', '', NULL),
(4608, 'en', 'default', 'c5ecefc2c05db6570556c7385ac2e8a3', 'If you haven&#8217;t yet created any menus, <strong>click the &#8217;create a new menu&#8217; link</strong> to get started', NULL, NULL, '', 'LINE', NULL, 10, '', 'e3750bb5eb2eb05b624dbab6c20b5e59', '', NULL),
(4609, 'en', 'default', '2448f34ad2e38271ffbcf4d299c17c5d', 'If you just want to get an idea of what&#8217;s available, you can browse Featured and Popular plugins by using the links above the plugins list. These sections rotate regularly.', NULL, NULL, '', 'LINE', NULL, 10, '', '575aca988849707fdbbfd60be15902e1', '', NULL),
(4610, 'en', 'default', 'a379ef32870b64a6ef175d6e3da0bf17', 'If you know what you&#8217;re looking for, Search is your best bet. The Search screen has options to search the WordPress Plugin Directory for a particular Term, Author, or Tag. You can also search the directory by selecting popular tags. Tags in larger type mean more plugins have been labeled with that tag.', NULL, NULL, '', 'LINE', NULL, 10, '', '2dfd3ebb5bbf8256c5c0cc8fefb8b3c8', '', NULL),
(4611, 'en', 'default', 'b642d452dd24b19ed95b29d92e97240d', 'If you leave a comment on our site you may opt-in to saving your name, email address and website in cookies. These are for your convenience so that you do not have to fill in your details again when you leave another comment. These cookies will last for one year.', NULL, NULL, '', 'LINE', NULL, 10, '', 'd794b6153c4a4b8146e4b05cafb43a27', '', NULL),
(4612, 'en', 'default', 'b821f0a93d744e025849cd46e8b3baad', 'If you leave a comment, the comment and its metadata are retained indefinitely. This is so we can recognize and approve any follow-up comments automatically instead of holding them in a moderation queue.', NULL, NULL, '', 'LINE', NULL, 10, '', '2adafd60d076932c43e67845ed14dde0', '', NULL),
(4613, 'en', 'default', '864e67dda7ff0dc96db5c841bdbf98ad', 'If you like, you may enter custom structures for your category and tag URLs here. For example, using <code>topics</code> as your category base would make your category links like <code>%s/topics/uncategorized/</code>. If you leave these blank the defaults will be used.', NULL, NULL, '', 'LINE', NULL, 10, '', 'd635a782b4c7393661373e724751b36c', '', NULL),
(4614, 'en', 'default', '0f90830ab0bc1006395ba09032b55085', 'If you need to tweak more than your theme&#8217;s CSS, you might want to try <a href="%s">making a child theme</a>.', NULL, NULL, '', 'LINE', NULL, 10, '', '9bfc1371bf48f408336aaf71b65cae94', '', NULL),
(4615, 'en', 'default', '7c9ef4ea15ae7717b2fda488c0315c25', 'If you notice &#8220;headers already sent&#8221; messages, problems with syndication feeds or other issues, try deactivating or removing this plugin.', NULL, NULL, '', 'LINE', NULL, 10, '', '69593792dd79e7c5b58b5e3b6131ad6e', '', NULL),
(4616, 'en', 'default', 'd88cf31a6a2a7495378f1004aedd2741', 'If you pick an option other than Plain, your general URL path with structure tags (terms surrounded by %s) will also appear in the custom structure field and your path can be further modified there.', NULL, NULL, '', 'LINE', NULL, 10, '', '95836dfeeb583e2f855dd2ec70778194', '', NULL),
(4617, 'en', 'default', '97b78ef138769a3fcf7e03efeafe2005', 'If you reach out to us, we\'ll also ensure you\'ll never have this problem again.', NULL, NULL, '', 'LINE', NULL, 10, '', 'cea417fb3ad33a8c6e47bd88db6f8df1', '', NULL),
(4618, 'en', 'default', 'b1547fa31c5744e25be92a64e7f77beb', 'If you reached this screen by accident and meant to visit one of your own sites, here are some shortcuts to help you find your way.', NULL, NULL, '', 'LINE', NULL, 10, '', '08cbe037e394e47b4dc740a5ae61ce70', '', NULL),
(4619, 'en', 'default', 'eb11962ead7989d613ca1dd40e7e0128', 'If you request a password reset, your IP address will be included in the reset email.', NULL, NULL, '', 'LINE', NULL, 10, '', '965d1466f7239bf6870a8894f09a97e1', '', NULL),
(4620, 'en', 'default', '12c31c3cb7ab49899ec2e979d5a553f5', 'If you temporarily make your %s file writable for us to generate rewrite rules automatically, do not forget to revert the permissions after rule has been saved.', NULL, NULL, '', 'LINE', NULL, 10, '', 'fbfb20c605ce87bf0b18c0013694071e', '', NULL),
(4621, 'en', 'default', 'a98ef57dff34e18723548ccd8a286c59', 'If you temporarily make your site&#8217;s root directory writable for us to generate the %s file automatically, do not forget to revert the permissions after the file has been created.', NULL, NULL, '', 'LINE', NULL, 10, '', '55f26516c6be022a2bae7e814fdb1559', '', NULL),
(4622, 'en', 'default', '64771a7ce98863e88b3b4e2c1448f6d0', 'If you upload images to the website, you should avoid uploading images with embedded location data (EXIF GPS) included. Visitors to the website can download and extract any location data from images on the website.', NULL, NULL, '', 'LINE', NULL, 10, '', '69ef71fb437c6bf62fc83a4ccf0f54b5', '', NULL),
(4623, 'en', 'default', '28479dd04f0c4f904cbfc647df8a39f7', 'If you use your site for commercial purposes and you engage in more complex collection or processing of personal data, you should note the following information in your privacy policy in addition to the information we have already discussed.', NULL, NULL, '', 'LINE', NULL, 10, '', '26059df016ea17b5bee3abc3165cc69d', '', NULL),
(4624, 'en', 'default', '1da460523bb7264564e9f10fae383bb7', 'If you visit our login page, we will set a temporary cookie to determine if your browser accepts cookies. This cookie contains no personal data and is discarded when you close your browser.', NULL, NULL, '', 'LINE', NULL, 10, '', 'f3a409cbdccfbc10238d9beb7025ab78', '', NULL),
(4625, 'en', 'default', 'efe517a5b918a12ecb7dfd17f3877327', 'If you want site visitors to be able to register themselves, as opposed to by the site administrator, check the membership box. A default user role can be set for all new users, whether self-registered or registered by the site admin.', NULL, NULL, '', 'LINE', NULL, 10, '', '1e0104cd42ac1e2fe540ba466d5ff248', '', NULL),
(4626, 'en', 'default', 'e8953b095643b4bf6a1cd0bae7a85508', 'If you want to convert your categories to tags (or vice versa), use the <a href="%s">Categories and Tags Converter</a> available from the Import screen.', NULL, NULL, '', 'LINE', NULL, 10, '', '194c0e92da833182de4233fc3786e2b7', '', NULL) ;
INSERT INTO `wp_icl_strings` ( `id`, `language`, `context`, `name`, `value`, `string_package_id`, `location`, `wrap_tag`, `type`, `title`, `status`, `gettext_context`, `domain_name_context_md5`, `translation_priority`, `word_count`) VALUES
(4627, 'en', 'default', 'cfa60062c5bda746901212f53636e390', 'If you want to export a handy list of all the information on this page, you can use the button below to copy it to the clipboard. You can then paste it in a text file and save it to your device, or paste it in an email exchange with a support engineer or theme/plugin developer for example.', NULL, NULL, '', 'LINE', NULL, 10, '', 'aaa4d4526963b5610e85de6c3d3d0b46', '', NULL),
(4628, 'en', 'default', 'be3d2742b2dbbb1878b22b8702b6e8d7', 'If you want to install a plugin that you&#8217;ve downloaded elsewhere, click the Upload Plugin button above the plugins list. You will be prompted to upload the .zip package, and once uploaded, you can activate the new plugin.', NULL, NULL, '', 'LINE', NULL, 10, '', '313943fe8cc1a3d691aa966a6a6819c7', '', NULL),
(4629, 'en', 'default', '0b5d8aeeb0c74419d4028dca5dc744df', 'If you want to make changes but don&#8217;t want them to be overwritten when the plugin is updated, you may be ready to think about writing your own plugin. For information on how to edit plugins, write your own from scratch, or just better understand their anatomy, check out the links below.', NULL, NULL, '', 'LINE', NULL, 10, '', '8c4742c33256ee314435258e3a200070', '', NULL),
(4630, 'en', 'default', 'fc276f47f9e88e53fb9a81e0e683a057', 'If you want to remove the widget but save its setting for possible future use, just drag it into the Inactive Widgets area. You can add them back anytime from there. This is especially helpful when you switch to a theme with fewer or different widget areas.', NULL, NULL, '', 'LINE', NULL, 10, '', 'f5f6f5978f1a37ee120927289f3f6f8d', '', NULL),
(4631, 'en', 'default', 'b54fa9afe2dc888d8a5c71cc1b61b51c', 'If you want to run multiple WordPress installations in a single database, change this.', NULL, NULL, '', 'LINE', NULL, 10, '', '7ed16a5d29814e6517b04e35979dbb8c', '', NULL),
(4632, 'en', 'default', 'ce99e8b4ddb1935ad216af170d465663', 'If you would like to see more plugins to choose from, click on the &#8220;Add New&#8221; button and you will be able to browse or search for additional plugins from the <a href="%s">WordPress Plugin Directory</a>. Plugins in the WordPress Plugin Directory are designed and developed by third parties, and are compatible with the license WordPress uses. Oh, and they&#8217;re free!', NULL, NULL, '', 'LINE', NULL, 10, '', '918021f3c1c7333bbb985975acdf69b3', '', NULL),
(4633, 'en', 'default', 'ff1e9b8584871613da97bf909bf0d3d4', 'If you would like to see more themes to choose from, click on the &#8220;Add New&#8221; button and you will be able to browse or search for additional themes from the <a href="%s">WordPress Theme Directory</a>. Themes in the WordPress Theme Directory are designed and developed by third parties, and are compatible with the license WordPress uses. Oh, and they&#8217;re free!', NULL, NULL, '', 'LINE', NULL, 10, '', '85b7f40dae14e2dedd2d051b8da068b4', '', NULL),
(4634, 'en', 'default', '5074f6b262894aae8f6923d7ff9eadf1', 'If your %1$s file was <a href="%2$s">writable</a>, we could do this automatically, but it isn&#8217;t so these are the mod_rewrite rules you should have in your %1$s file. Click in the field and press %3$s to select all.', NULL, NULL, '', 'LINE', NULL, 10, '', '0651b69befec7bf871bf4d593b4eb1cf', '', NULL),
(4635, 'en', 'default', '93f3cd2b6a8fda8223f25e6fd0f47db4', 'If your %1$s file was <a href="%2$s">writable</a>, we could do this automatically, but it isn&#8217;t so this is the url rewrite rule you should have in your %1$s file. Click in the field and press %3$s to select all. Then insert this rule inside of the %4$s element in %1$s file.', NULL, NULL, '', 'LINE', NULL, 10, '', '4768687268baff9591b17ec71c06e3d6', '', NULL),
(4636, 'en', 'default', 'ae4333ffddf970f98ea2387193cc0f5b', 'If your theme has more than one default header image, or you have uploaded more than one custom header image, you have the option of having WordPress display a randomly different image on each page of your site. Click the &#8220;Random&#8221; radio button next to the Uploaded Images or Default Images section to enable this feature.', NULL, NULL, '', 'LINE', NULL, 10, '', 'aad695b974325b8e604c6a490dbf8754', '', NULL),
(4637, 'en', 'default', '3ac9c7fe01cf02c25932c2fce99d968a', 'If your web site provides a service which includes automated decision making - for example, allowing customers to apply for credit, or aggregating their data into an advertising profile - you must note that this is taking place, and include information about how that information is used, what decisions are made with that aggregated data, and what rights users have over decisions made without human intervention.', NULL, NULL, '', 'LINE', NULL, 10, '', 'c7ffd4403fc114954b738bbcbe9fea06', '', NULL),
(4638, 'en', 'default', 'b127c8939223b7c79e41917477d2e09e', 'If your web site receives data about users from third parties, including advertisers, this information must be included within the section of your privacy policy dealing with third party data.', NULL, NULL, '', 'LINE', NULL, 10, '', 'bdb7658161c5f57d631ee4aa4a631ecf', '', NULL),
(4639, 'en', 'default', '86e33eeb24e5a62590ead9de8238c36c', 'Image Address', NULL, NULL, '', 'LINE', NULL, 10, '', 'a0b6958e2893def21db5825e2c37618c', '', NULL),
(4640, 'en', 'default', 'f1daa5de35312c743db4bba47fa4e3a5', 'Image Attachment Template', NULL, NULL, '', 'LINE', NULL, 10, '', '27a67adec0d5dc34dd2623dbfeeee87c', '', NULL),
(4641, 'en', 'default', '4c6ace7405819bffddf7ee5133db4201', 'Image Caption', NULL, NULL, '', 'LINE', NULL, 10, '', '07976d81adde1eb0a9e2cf357de72a9f', '', NULL),
(4642, 'en', 'default', '2616a81775263adf3a6222d35513e15a', 'Image Crop', NULL, NULL, '', 'LINE', NULL, 10, '', '058a077b2b7b137f1db8322814327731', '', NULL),
(4643, 'en', 'default', '31b8ea2b48f332efeaaac75d92bf9596', 'Image Crop Help', NULL, NULL, '', 'LINE', NULL, 10, '', '84a79cde30df8496b6e78a6d2e84bac2', '', NULL),
(4644, 'en', 'default', '323126045a230b218de6ebd6a53fb7f8', 'Image File', NULL, NULL, '', 'LINE', NULL, 10, '', 'a8e1b0470235169b981ca3fe5d5d5f7a', '', NULL),
(4645, 'en', 'default', '4004a789fa905f7ea15db9c2f91906b5', 'Image Processing Error', NULL, NULL, '', 'LINE', NULL, 10, '', '4cd03ab760336e61d94f6850fe2cec9f', '', NULL),
(4646, 'en', 'default', '9d05878add9bf672c019a0553a08cbd9', 'Image Upload Error', NULL, NULL, '', 'LINE', NULL, 10, '', 'eea1d43c2efda3106ecc7bba368eae1e', '', NULL),
(4647, 'en', 'default', '59332018a4582cae903701e42728f002', 'Image could not be processed.', NULL, NULL, '', 'LINE', NULL, 10, '', '892363154fbfd06c954d9d19261bdae8', '', NULL),
(4648, 'en', 'default', '5c67704f232067ca9fdae2794b596986', 'Image could not be processed. Please go back and try again.', NULL, NULL, '', 'LINE', NULL, 10, '', 'ee1f96608779e88eb6bba954e5e8e94d', '', NULL),
(4649, 'en', 'default', '6ac3e4db810decc75cb5f49065e02ead', 'Image data does not exist. Please re-upload the image.', NULL, NULL, '', 'LINE', NULL, 10, '', '1de10171e664c0f2322bf883f5fd4748', '', NULL),
(4650, 'en', 'default', '59969adb3ff5274577d2b7ce23eae5c7', 'Image metadata is inconsistent.', NULL, NULL, '', 'LINE', NULL, 10, '', '17c5b8919ff4f924a3efa2b294295e91', '', NULL),
(4651, 'en', 'default', 'ec71bab863e85a2afdf09a72b05efa1f', 'Image restored successfully.', NULL, NULL, '', 'LINE', NULL, 10, '', '3e7dc8c4e77840262f5b9a46ea54292b', '', NULL),
(4652, 'en', 'default', 'cc574ecc52f326293633a74d548e9c27', 'Image rotation is not supported by your web host.', NULL, NULL, '', 'LINE', NULL, 10, '', 'f27fd855564ff3f6d9e811cf289a2308', '', NULL),
(4653, 'en', 'default', '6313deda4940bdd2f937bc94ba24774e', 'Image saved', NULL, NULL, '', 'LINE', NULL, 10, '', '6519900374972f38fd7ea72a9837a648', '', NULL),
(4654, 'en', 'default', 'bd5b1c7a7b5cb4ec09724dcc530b58b3', 'Image sizes', NULL, NULL, '', 'LINE', NULL, 10, '', '540ece7726db962f2383cf24eba6981a', '', NULL),
(4655, 'en', 'default', '9879276243d885fdaaa0c1a7e88e4e85', 'ImageMagick version number', NULL, NULL, '', 'LINE', NULL, 10, '', 'ddadd580a2f7eec8675004a34d42ef7f', '', NULL),
(4656, 'en', 'default', '2962ad4c46bb455ff39032afde8fa496', 'ImageMagick version string', NULL, NULL, '', 'LINE', NULL, 10, '', '7c99ff2c747bd7d3458d080f4cac5096', '', NULL),
(4657, 'en', 'default', '888550d203299cc95a171ae6cb09bb06', 'Images of exactly <strong>%1$d &times; %2$d pixels</strong> will be used as-is.', NULL, NULL, '', 'LINE', NULL, 10, '', 'a52264796a3ce64ba1b2e40a42e88ab0', '', NULL),
(4658, 'en', 'default', '5b59e9c3a06f10eafb7d2c536aa82d1c', 'Images should be at least %s tall.', NULL, NULL, '', 'LINE', NULL, 10, '', '2c8432e9d2bd2794170bf2e07cebbefd', '', NULL),
(4659, 'en', 'default', '98565ff01142abc065926f292c102013', 'Images should be at least %s wide.', NULL, NULL, '', 'LINE', NULL, 10, '', 'ef3aa84fe4283d2606c633be8d1c641d', '', NULL),
(4660, 'en', 'default', '75b327e259093280704eb2aeb53bca5c', 'Imagick Resource Limits', NULL, NULL, '', 'LINE', NULL, 10, '', '05782a0ffaa7ced9c07ba908a430c9f3', '', NULL),
(4661, 'en', 'default', '72d6d7a1885885bb55a565fd1070581a', 'Import', NULL, NULL, '', 'LINE', NULL, 10, '', 'cafa88c07bdc26f3af6d4a5538cdd9ad', '', NULL),
(4662, 'en', 'default', '44dfd83f2e0985cfc776c890655c9788', 'Import posts &amp; media from Tumblr using their API.', NULL, NULL, '', 'LINE', NULL, 10, '', '8968efb5a09a663dcfde485259353d80', '', NULL),
(4663, 'en', 'default', 'ff5fdccad49d0b326b4f10533b007f1c', 'Import posts and comments from a Movable Type or TypePad blog.', NULL, NULL, '', 'LINE', NULL, 10, '', '3ebb455a7e4aa3ca616d53d26b0a754a', '', NULL),
(4664, 'en', 'default', '4a8ff13f67b97a37cbf26889ccc19151', 'Import posts from LiveJournal using their API.', NULL, NULL, '', 'LINE', NULL, 10, '', '3c3513759848804fd085fd01dddfc4e4', '', NULL),
(4665, 'en', 'default', 'abfdf2f7c4628bfb617712c55ca4be5e', 'Import posts from an RSS feed.', NULL, NULL, '', 'LINE', NULL, 10, '', 'bc9aab39b07b79e21bb676c7c79ac1ba', '', NULL),
(4666, 'en', 'default', '89d2d11ff37aaa81be1f6441a1533bed', 'Import posts, comments, and users from a Blogger blog.', NULL, NULL, '', 'LINE', NULL, 10, '', '309ff4c087e7718b0d531b3f7c370570', '', NULL),
(4667, 'en', 'default', 'd3148f474a807301cc758a2d5ebdbafb', 'Import posts, pages, comments, custom fields, categories, and tags from a WordPress export file.', NULL, NULL, '', 'LINE', NULL, 10, '', 'd6d81935c359d8b169c0591233bbfe1a', '', NULL),
(4668, 'en', 'default', '7a262cb0d3d917313c8ba12f996fe83c', 'Important:', NULL, NULL, '', 'LINE', NULL, 10, '', 'f47900cc03b6df23625877cf20ee0ace', '', NULL),
(4669, 'en', 'default', '94321140891ad079152bf55f8ae38a5d', 'In 5.7, jQuery gets more focused and less intrusive, with fewer messages in the console.', NULL, NULL, '', 'LINE', NULL, 10, '', '0dd9ff8ab82c8f0fae583b899c5ce018', '', NULL),
(4670, 'en', 'default', '17a1938167ced1f88fb79a72a323dd0e', 'In a few words, explain what this site is about.', NULL, NULL, '', 'LINE', NULL, 10, '', 'da803f748d1b750af858c087f83cd4f8', '', NULL),
(4671, 'en', 'default', 'ac9a4d2e8722460793b93d7d7ceeb7a5', 'In addition to listing what personal data you collect, you need to note why you collect it. These explanations must note either the legal basis for your data collection and retention or the active consent the user has given.', NULL, NULL, '', 'LINE', NULL, 10, '', 'adcb013b4f3ca5b3df135d1b9f0798fb', '', NULL),
(4672, 'en', 'default', '911b598e98c0d31c7e5bdfd6e1136dbc', 'In all likelihood, these items were supplied to you by your Web Host. If you don&#8217;t have this information, then you will need to contact them before you can continue. If you&#8217;re all ready&hellip;', NULL, NULL, '', 'LINE', NULL, 10, '', '01afe2a4a10214c1f8f359b9da7a694c', '', NULL),
(4673, 'en', 'default', '72247007ca8dd9d5b747cd2d13855ae4', 'In most cases, WordPress will automatically apply maintenance and security updates in the background for you.', NULL, NULL, '', 'LINE', NULL, 10, '', 'f608b0ae3b2099cd13950879df8872a3', '', NULL),
(4674, 'en', 'default', '0278248c794c7dd11a47837d5861ee71', 'In previous versions of WordPress, all importers were built-in. They have been turned into plugins since most people only use them once or infrequently.', NULL, NULL, '', 'LINE', NULL, 10, '', '43ae0cedba6e9504ba24d8691432a3a9', '', NULL),
(4675, 'en', 'default', 'a2bb0c7115500cde73996940e0690f9b', 'In response to', NULL, NULL, '', 'LINE', NULL, 10, '', 'd77ad03a0a7f60ac9549623da5b39f01', '', NULL),
(4676, 'en', 'default', 'd32e65d44fb05ccf2bed3709f468c87c', 'In response to: %s', NULL, NULL, '', 'LINE', NULL, 10, '', 'e5423df2364e9344c0a8102a2aee538a', '', NULL),
(4677, 'en', 'default', 'ddfa3b051bb82c9c70d438b8e5871308', 'In the <strong>Author</strong> column, in addition to the author&#8217;s name, email address, and blog URL, the commenter&#8217;s IP address is shown. Clicking on this link will show you all the comments made from this IP address.', NULL, NULL, '', 'LINE', NULL, 10, '', '944f932d0423b726bd23dab71fea8505', '', NULL),
(4678, 'en', 'default', '78516f0126f95864e9dd3d48b6d7504f', 'In the <strong>Comment</strong> column, hovering over any comment gives you options to approve, reply (and approve), quick edit, edit, spam mark, or trash that comment.', NULL, NULL, '', 'LINE', NULL, 10, '', '68411cf81ef029f42a0ec46594a3f9c0', '', NULL),
(4679, 'en', 'default', '736a884c69e2e776847911e01962ed5c', 'In the <strong>In response to</strong> column, there are three elements. The text is the name of the post that inspired the comment, and links to the post editor for that entry. The View Post link leads to that post on your live site. The small bubble with the number in it shows the number of approved comments that post has received. If there are pending comments, a red notification circle with the number of pending comments is displayed. Clicking the notification circle will filter the comments screen to show only pending comments on that post.', NULL, NULL, '', 'LINE', NULL, 10, '', '4822826da6a691b0a139e561d29489ab', '', NULL),
(4680, 'en', 'default', 'b56a674ae848392c7a3ea42311b23998', 'In the <strong>Submitted on</strong> column, the date and time the comment was left on your site appears. Clicking on the date/time link will take you to that comment on your live site.', NULL, NULL, '', 'LINE', NULL, 10, '', 'a2c614f28de9b99b3b291eed9fc595e7', '', NULL),
(4681, 'en', 'default', 'a1e79989a368fffa040f3724cb25bb0a', 'In the Header Text section of this page, you can choose whether to display this text or hide it. You can also choose a color for the text by clicking the Select Color button and either typing in a legitimate HTML hex value, e.g. &#8220;#ff0000&#8221; for red, or by choosing a color using the color picker.', NULL, NULL, '', 'LINE', NULL, 10, '', 'bef7f0dcaa96c84388ca68674dbeea63', '', NULL),
(4682, 'en', 'default', 'bb1232b0272e71fd61576bb759fe4fcb', 'In this section you should explain how long you retain personal data collected or processed by the web site. While it is your responsibility to come up with the schedule of how long you keep each dataset for and why you keep it, that information does need to be listed here. For example, you may want to say that you keep contact form entries for six months, analytics records for a year, and customer purchase records for ten years.', NULL, NULL, '', 'LINE', NULL, 10, '', 'ab44f2d90a4122efb4d73b1271ddcd1e', '', NULL),
(4683, 'en', 'default', '9f2feaf2b829a5c3749cb3a0dec950a7', 'In this section you should explain what measures you have taken to protect your users&#8217; data. This could include technical measures such as encryption; security measures such as two factor authentication; and measures such as staff training in data protection. If you have carried out a Privacy Impact Assessment, you can mention it here too.', NULL, NULL, '', 'LINE', NULL, 10, '', '447f7c9e79da2eaf80b14485c81eef4a', '', NULL),
(4684, 'en', 'default', 'cc868b88b34779f820016d60eeb4d13f', 'In this section you should explain what procedures you have in place to deal with data breaches, either potential or real, such as internal reporting systems, contact mechanisms, or bug bounties.', NULL, NULL, '', 'LINE', NULL, 10, '', '2e2f9f76d2e53db3e5050f6eed876131', '', NULL),
(4685, 'en', 'default', '7b43f0a3a9bad71b5515c3febf1c4e85', 'In this section you should explain what rights your users have over their data and how they can invoke those rights.', NULL, NULL, '', 'LINE', NULL, 10, '', '1d494e615fc6d7af13588575aa5f764a', '', NULL),
(4686, 'en', 'default', 'e033cd0f72a714684763bb3b10497ef1', 'In this section you should list all transfers of your site data outside the European Union and describe the means by which that data is safeguarded to European data protection standards. This could include your web hosting, cloud storage, or other third party services.', NULL, NULL, '', 'LINE', NULL, 10, '', '6bab02ff41df219f416fc29c55fd9271', '', NULL),
(4687, 'en', 'default', '88afac7dd32e40bf990b8d3423dfcb5e', 'In this section you should name and list all third party providers with whom you share site data, including partners, cloud-based services, payment processors, and third party service providers, and note what data you share with them and why. Link to their own privacy policies if possible.', NULL, NULL, '', 'LINE', NULL, 10, '', 'bc39528f72dd657a817abfe0e70fa67f', '', NULL),
(4688, 'en', 'default', 'afb5c651f25a99fe9dea21458989b965', 'In this section you should note what personal data you collect from users and site visitors. This may include personal data, such as name, email address, personal account preferences; transactional data, such as purchase information; and technical data, such as information about cookies.', NULL, NULL, '', 'LINE', NULL, 10, '', '55364a8c7c34dcaec179a49ce5feb8ac', '', NULL),
(4689, 'en', 'default', '36ce374000d338cd986460ce312bcae5', 'In this section you should note your site URL, as well as the name of the company, organization, or individual behind it, and some accurate contact information.', NULL, NULL, '', 'LINE', NULL, 10, '', '3ee9c2dd60584a7dde9b3eda4294c2d0', '', NULL),
(4690, 'en', 'default', '562b66a0805d1853fa06902cdb6774d5', 'In this section you should provide a contact method for privacy-specific concerns. If you are required to have a Data Protection Officer, list their name and full contact details here as well.', NULL, NULL, '', 'LINE', NULL, 10, '', 'b783b38f8b0382d31f2e0d6b68dc26ff', '', NULL),
(4691, 'en', 'default', 'ca3d5159accd9468729ea6a9aef4d58e', 'In this subsection you should list the cookies your web site uses, including those set by your plugins, social media, and analytics. We have provided the cookies which WordPress installs by default.', NULL, NULL, '', 'LINE', NULL, 10, '', 'a7aa56fcc29c49d74ac60bfadbb28ae7', '', NULL),
(4692, 'en', 'default', '48ac74d87e61fcb5c2adf64ca48cf64e', 'In this subsection you should note what analytics package you use, how users can opt out of analytics tracking, and a link to your analytics provider&#8217;s privacy policy, if any.', NULL, NULL, '', 'LINE', NULL, 10, '', 'ef6c1a3649fca4635c6d724a7e8e9440', '', NULL),
(4693, 'en', 'default', 'b619d7c9609b9d7b1ca3e6bfbcf5309e', 'In this subsection you should note what information is captured through comments. We have noted the data which WordPress collects by default.', NULL, NULL, '', 'LINE', NULL, 10, '', 'cdf36a9314632abfed28786bb7267047', '', NULL),
(4694, 'en', 'default', 'ec27ccde34cd289565d2db48b580f59b', 'In this subsection you should note what information may be disclosed by users who can upload media files. All uploaded files are usually publicly accessible.', NULL, NULL, '', 'LINE', NULL, 10, '', '2c605f73abd62a98d1527efab250fad6', '', NULL),
(4695, 'en', 'default', '1da0f24e118e98984a0dddbce260a839', 'Inactive <span class="count">(%s)</span>', NULL, NULL, '', 'LINE', NULL, 10, '', '228fd3a7482d619ab08b0cc0d79bf92d', '', NULL),
(4696, 'en', 'default', 'e21472cab8e84362a190860f8d57200e', 'Inactive Plugins', NULL, NULL, '', 'LINE', NULL, 10, '', 'a890d783fc98916756c55879625ea9f8', '', NULL),
(4697, 'en', 'default', '2b255e45a58c340b56395c76e9221392', 'Inactive Sidebar (not used)', NULL, NULL, '', 'LINE', NULL, 10, '', '237b2839b63defb85f31315d3fcf1019', '', NULL),
(4698, 'en', 'default', '614a259cd60ac736e6ddd59e9c6f35d2', 'Inactive Themes', NULL, NULL, '', 'LINE', NULL, 10, '', '087c38f2e2081fb3227197804ece14f6', '', NULL),
(4699, 'en', 'default', 'ac6105c895cb6dcf75c78c53450b8a02', 'Inactive Widgets', NULL, NULL, '', 'LINE', NULL, 10, '', 'c522f6f2f38c5fe50947cad10691b443', '', NULL),
(4700, 'en', 'default', '5bfbab4b8ab39c894d2404942189c47c', 'Inactive plugins are tempting targets for attackers. If you&#8217;re not going to use a plugin, we recommend you remove it.', NULL, NULL, '', 'LINE', NULL, 10, '', 'b09fcb1b946fd60091a0bd0c8e2002e8', '', NULL),
