(5001, 'en', 'default', '15ba3609d6a9a8be7cc025c41ae19f62', 'Once you have generated a list of themes, you can preview and install any of them. Click on the thumbnail of the theme you&#8217;re interested in previewing. It will open up in a full-screen Preview page to give you a better idea of how that theme will look.', NULL, NULL, '', 'LINE', NULL, 10, '', '72042c37469bf256bfc5bb674562276f', '', NULL),
