(5161, 'en', 'default', '3929b55d6d5a486c2c71f53df11c0e3f', 'Plugins extend and expand the functionality of WordPress. Once a plugin is installed, you may activate it or deactivate it here.', NULL, NULL, '', 'LINE', NULL, 10, '', '83e4e8dfa6e1efae4ce164c016ab9d46', '', NULL),
(5162, 'en', 'default', 'ab4c72bffb9fd556686f54fc0a2e8d75', 'Plugins extend and expand the functionality of WordPress. You may automatically install plugins from the <a href="%s">WordPress Plugin Directory</a> or upload a plugin in .zip format by clicking the button at the top of this page.', NULL, NULL, '', 'LINE', NULL, 10, '', '946285c79d62149f8869dc91fbdebcfa', '', NULL),
(5163, 'en', 'default', 'e1916cef029819b6d0ac661ba113c382', 'Plugins extend your site&#8217;s functionality with things like contact forms, ecommerce and much more. That means they have deep access to your site, so it&#8217;s vital to keep them up to date.', NULL, NULL, '', 'LINE', NULL, 10, '', 'fa2c9f8af01810e901c2d82a826cb1e8', '', NULL),
