(5578, 'en', 'default', 'd1c6a48351b114e38e8001a309f1deae', 'Talk to your web host about OpenSSL support for PHP.', NULL, NULL, '', 'LINE', NULL, 10, '', '6ea054323241884607ccd9ffdf2e54ce', '', NULL),
(5579, 'en', 'default', '6bcb4f53845ffc2bdb40b8797754939e', 'Talk to your web host about supporting HTTPS for your website.', NULL, NULL, '', 'LINE', NULL, 10, '', '05ba5c2342e9d3af6cb8e5d1142789da', '', NULL),
(5580, 'en', 'default', 'eb75d61c0d32edf7f02ac4b9245e9066', 'Tap or hover on any theme then click the Live Preview button to see a live preview of that theme and change theme options in a separate, full-screen view. You can also find a Live Preview button at the bottom of the theme details screen. Any installed theme can be previewed and customized in this way.', NULL, NULL, '', 'LINE', NULL, 10, '', '6f6504bc3b2a415851941dc76f520261', '', NULL),
(5581, 'en', 'default', '6270d2d0bd4ea283cd688cee5979a257', 'Taxonomy Template', NULL, NULL, '', 'LINE', NULL, 10, '', 'e65bfb983d96c661a3fd4b5f50be0e6a', '', NULL),
(5582, 'en', 'default', '6f3dfb9b486505e02c34ff3f5f28c3da', 'Thank you for Updating! Please visit the <a href="%s">Upgrade Network</a> page to update all your sites.', NULL, NULL, '', 'LINE', NULL, 10, '', '0bef3c48618fe1470758e2a5f2b75daf', '', NULL),
(5583, 'en', 'default', '448e6f7bb5f111ccd7527c184b36f9f6', 'Thank you for creating with <a href="%s">WordPress</a>.', NULL, NULL, '', 'LINE', NULL, 10, '', '97d83f7dc26492a73665bc014005db93', '', NULL),
(5584, 'en', 'default', '92a7784fc2dce98ad5eb3ca9a5f87c42', 'Thank you for using %s, your site has been deleted. Happy trails to you until we meet again.', NULL, NULL, '', 'LINE', NULL, 10, '', '35e693580ea9ba889cf082c6e5124f71', '', NULL),
(5585, 'en', 'default', '286151a15b172f69875a61e94727075d', 'Thank you. Please check your email for a link to confirm your action. Your site will not be deleted until this link is clicked.', NULL, NULL, '', 'LINE', NULL, 10, '', 'db4ca56410ce7dee44f0b7e126963333', '', NULL),
(5586, 'en', 'default', 'a056acb19936fc9e7d3764e4214c8702', 'That user could not be added to this site.', NULL, NULL, '', 'LINE', NULL, 10, '', '80fcc4dba08e620d0c2e2015fe4f6907', '', NULL),
(5587, 'en', 'default', 'bb98e35aeb27abdff629c3d114e82d90', 'That user is already a member of this site.', NULL, NULL, '', 'LINE', NULL, 10, '', '41df38736cbb2f3f1e9523e57f7bef24', '', NULL),
(5588, 'en', 'default', 'd074d933f38bf26636eeeda9cd8927ea', 'The "%1$s" value is smaller than "%2$s".', NULL, NULL, '', 'LINE', NULL, 10, '', '4d48214cdf4ba1cfe7a39cf49021b6b4', '', NULL),
(5589, 'en', 'default', '183f673f0d391113a332071ba0c12443', 'The %1$s constant in your %2$s file is no longer needed.', NULL, NULL, '', 'LINE', NULL, 10, '', 'ab19bf893871e23cf2baf1343e5213f1', '', NULL),
(5590, 'en', 'default', 'aaab4084a5279c44b95b08602985c814', 'The %1$s directive in %2$s determines if uploading files is allowed on your site.', NULL, NULL, '', 'LINE', NULL, 10, '', '570c91ac52ff4f000b72672d95caa4fb', '', NULL),
(5591, 'en', 'default', '8216779f85aa7999e090808e49127b10', 'The %1$s plugin header is deprecated. Use %2$s instead.', NULL, NULL, '', 'LINE', NULL, 10, '', 'f9072082df9c34941be6f6b98f89ee15', '', NULL),
(5592, 'en', 'default', '999790af91e92512b7b4c1821587f790', 'The %1$s table is not okay. It is reporting the following error: %2$s. WordPress will attempt to repair this table&hellip;', NULL, NULL, '', 'LINE', NULL, 10, '', 'a74df7b7c0f4cea529c5be83b56bb645', '', NULL),
(5593, 'en', 'default', 'aa32988d27c26872a40aabdc8fd67eac', 'The %s constant is defined and enabled.', NULL, NULL, '', 'LINE', NULL, 10, '', '1268e2d4629db1f7fd26da9959e089d5', '', NULL),
