(5599, 'en', 'default', '77aba6400a12368a3c8e1d29765352b2', 'The %s table is already optimized.', NULL, NULL, '', 'LINE', NULL, 10, '', 'acda4c605adf6c549fe548e1eba474e9', '', NULL),
(5600, 'en', 'default', '744a1d8f5bfbd4c6d90923b7087343f7', 'The %s table is okay.', NULL, NULL, '', 'LINE', NULL, 10, '', '99653af0aeab8b08889b6223b7a8e7d4', '', NULL),
(5601, 'en', 'default', 'e0433c8fccacdcc1dec538d01a5ffb07', 'The &#8220;slug&#8221; is the URL-friendly version of the name. It is usually all lowercase and contains only letters, numbers, and hyphens.', NULL, NULL, '', 'LINE', NULL, 10, '', 'c84042caac8257ad95bc00faf92e0b6f', '', NULL),
(5602, 'en', 'default', '746b3c8b151c5ec38560aa785d61bdbf', 'The 1st Freedom', NULL, NULL, '', 'LINE', NULL, 10, '', 'b847eab338e6fa1665f6c97237ca6eb9', '', NULL),
(5603, 'en', 'default', 'efd1485952aaf52feaafbc8ec10869d5', 'The 2nd Freedom', NULL, NULL, '', 'LINE', NULL, 10, '', '1a886b223dedd0a67bfb29300ccfc41e', '', NULL),
