(5605, 'en', 'default', '87d44b846a4b149bbfb58946ca5d0df8', 'The 4th Freedom', NULL, NULL, '', 'LINE', NULL, 10, '', '867360a47126f145fafac39ae4849f46', '', NULL),
(5606, 'en', 'default', '59089758dcefccbb5306b2c1eb0417cf', 'The <a href="https://wordpress.org/support/article/glossary/#character-set">character encoding</a> of your site (UTF-8 is recommended)', NULL, NULL, '', 'LINE', NULL, 10, '', '71f4202e3fb72a0f2d3288f766d480a4', '', NULL),
(5607, 'en', 'default', '32a59725f69330dfcac2b8defcf1375c', 'The Authorization header comes from the third-party applications you approve. Without it, those apps cannot connect to your site.', NULL, NULL, '', 'LINE', NULL, 10, '', 'ed8b113ec5bec98ce2ae40548a43660a', '', NULL),
(5608, 'en', 'default', 'cfe5d0780c84646b4aacb7af4d5ba494', 'The Authorization header is working as expected.', NULL, NULL, '', 'LINE', NULL, 10, '', '2997e386636b7147c41d37a439b78d03', '', NULL),
(5609, 'en', 'default', 'c3b76979dc003b8cbf261dfe968f4e42', 'The Authorize Application request is not allowed.', NULL, NULL, '', 'LINE', NULL, 10, '', 'c2571b686dd32617fd94b4ca39ab8c12', '', NULL),
(5610, 'en', 'default', '554b7ac84f1fa573ee1867a3a2c02d09', 'The Available Widgets section contains all the widgets you can choose from. Once you drag a widget into a sidebar, it will open to allow you to configure its settings. When you are happy with the widget settings, click the Save button and the widget will go live on your site. If you click Delete, it will remove the widget.', NULL, NULL, '', 'LINE', NULL, 10, '', 'c870042c568c84af431c05479fe39260', '', NULL),
(5611, 'en', 'default', '2f1a8ec3a8b277b002ea5dd3a9c166ec', 'The Categories and Tags Converter link on this screen will take you to the Import screen, where that Converter is one of the plugins you can install. Once that plugin is installed, the Activate Plugin &amp; Run Importer link will take you to a screen where you can choose to convert tags into categories or vice versa.', NULL, NULL, '', 'LINE', NULL, 10, '', '73e9ba17e991f5898b5f2b0737c9ad4c', '', NULL),
(5612, 'en', 'default', '1e2ad5c78a6bba9e430dc771728a358c', 'The Customizer allows you to preview changes to your site before publishing them. You can navigate to different pages on your site within the preview. Edit shortcuts are shown for some editable elements.', NULL, NULL, '', 'LINE', NULL, 10, '', '663621b6d079f8703d5e4a7c2aab713b', '', NULL),
(5613, 'en', 'default', '88dc13179c52b8083ec73e317b2d5338', 'The Documentation menu below the editor lists the PHP functions recognized in the plugin file. Clicking Look Up takes you to a web page about that particular function.', NULL, NULL, '', 'LINE', NULL, 10, '', 'f53280634c7e03c2413c208d3e3e68b2', '', NULL),
(5614, 'en', 'default', 'e3a6c830a45973f8caac3432d436e903', 'The Optional fields let you customize the &#8220;category&#8221; and &#8220;tag&#8221; base names that will appear in archive URLs. For example, the page listing all posts in the &#8220;Uncategorized&#8221; category could be <code>/topics/uncategorized</code> instead of <code>/category/uncategorized</code>.', NULL, NULL, '', 'LINE', NULL, 10, '', 'c686ed3a11e088be1973308ebe9e40cb', '', NULL),
(5615, 'en', 'default', '1f9987b8f1cdf43805414a9489dc5c46', 'The PHP version on your server is %1$s, however the uploaded plugin requires %2$s.', NULL, NULL, '', 'LINE', NULL, 10, '', 'a975e9d7fc32d21729a0c3a0b079e95d', '', NULL),
(5616, 'en', 'default', '0019e08d625e2cff3a43abcdcd8ae657', 'The PHP version on your server is %1$s, however the uploaded theme requires %2$s.', NULL, NULL, '', 'LINE', NULL, 10, '', '03e52a97b5db5ffea02a3e9d25e2a55e', '', NULL),
(5617, 'en', 'default', '34141cedc878abd1b2f1ba8f41b20290', 'The Privacy Settings require JavaScript.', NULL, NULL, '', 'LINE', NULL, 10, '', 'df16c6427ab2c29aa7d2d0927d897957', '', NULL),
(5618, 'en', 'default', '4d0e73c65085b8ad1af356ce738ca8b3', 'The REST API call gave the following unexpected result: (%1$d) %2$s.', NULL, NULL, '', 'LINE', NULL, 10, '', 'db053906fcdbe7dbfd16fa8555a5229c', '', NULL),
(5619, 'en', 'default', '1752b9981f3409f232fc884d29671599', 'The REST API did not behave correctly', NULL, NULL, '', 'LINE', NULL, 10, '', 'f71811a0679bdd81d6d5b5803cc8ebe3', '', NULL),
(5620, 'en', 'default', 'ffd5b6482a4676b4e698c403c63c24d7', 'The REST API did not process the %s query parameter correctly.', NULL, NULL, '', 'LINE', NULL, 10, '', '9347de6d615ea548df7632cdf9a4912b', '', NULL),
(5621, 'en', 'default', 'a1c6f7df46ba1e6c3f2ee1ce711414cc', 'The REST API encountered an error', NULL, NULL, '', 'LINE', NULL, 10, '', '30216df086ff6c233450dbb160ff2568', '', NULL),
