(5623, 'en', 'default', '9056bf97881e293b7bb2104070a0ca56', 'The REST API is available', NULL, NULL, '', 'LINE', NULL, 10, '', '2abba9fcd17588afcaf425696445eb88', '', NULL),
(5624, 'en', 'default', '6a61a1c2681c9e2ac5b18075363064a1', 'The REST API is one way WordPress, and other applications, communicate with the server. One example is the block editor screen, which relies on this to display, and save, your posts and pages.', NULL, NULL, '', 'LINE', NULL, 10, '', '7be4a4e7fef38a46f204e6b6392eef75', '', NULL),
(5625, 'en', 'default', 'b4f56ad126d61efd33f4087d2db41180', 'The REST API request failed due to an error.', NULL, NULL, '', 'LINE', NULL, 10, '', 'f89e7725ee917abd8c34c4619442ec54', '', NULL),
(5626, 'en', 'default', '161eeb341bb2b52c23412256a4af2833', 'The SQL server is a required piece of software for the database WordPress uses to store all your site&#8217;s content and settings.', NULL, NULL, '', 'LINE', NULL, 10, '', '8ed56db5804a6f693492b7b8a78802d3', '', NULL),
(5627, 'en', 'default', 'ab252d4c9c5e39c207fdb546e3ddec3c', 'The Site Health check for %1$s has been replaced with %2$s.', NULL, NULL, '', 'LINE', NULL, 10, '', '14a26a5808d376b274d32579aa554aaf', '', NULL),
(5628, 'en', 'default', 'bc102454910b3e9559abe6016a25550d', 'The Site Health check requires JavaScript.', NULL, NULL, '', 'LINE', NULL, 10, '', '6ecf812b234640a2ed8dbda2ef01e947', '', NULL),
(5629, 'en', 'default', '2bc6f983917576292a23bcbf9c5ecf74', 'The Text mode allows you to enter HTML along with your post text. Note that &lt;p&gt; and &lt;br&gt; tags are converted to line breaks when switching to the Text editor to make it less cluttered. When you type, a single line break can be used instead of typing &lt;br&gt;, and two line breaks instead of paragraph tags. The line breaks are converted back to tags automatically.', NULL, NULL, '', 'LINE', NULL, 10, '', '6822422cfd888b5560ab16ce486fcf0f', '', NULL),
(5630, 'en', 'default', '62457c7b06e9492db136c612087a8636', 'The Theme Installer screen requires JavaScript.', NULL, NULL, '', 'LINE', NULL, 10, '', 'ee81cae6fee978a72094c23881080975', '', NULL),
