(5632, 'en', 'default', '23bd39e50cd83492cbbe97609725c395', 'The WordPress Hosting Team maintains a list of those modules, both recommended and required, in <a href="%1$s" %2$s>the team handbook%3$s</a>.', NULL, NULL, '', 'LINE', NULL, 10, '', 'd39e190fed89a6ea4d14d8232ca880dd', '', NULL),
