(5634, 'en', 'default', '68804ce6aa38ab1ef7d4e33889033f7b', 'The WordPress URL and the Site URL can be the same (example.com) or different; for example, having the WordPress core files (example.com/wordpress) in a subdirectory instead of the root directory.', NULL, NULL, '', 'LINE', NULL, 10, '', '611f402fad36bf6c2938669e03586d18', '', NULL),
(5635, 'en', 'default', 'be7027f369951f13e70f11596d6f5328', 'The WordPress team is willing to help you. Forward this email to %s and the team will work with you to make sure your site is working.', NULL, NULL, '', 'LINE', NULL, 10, '', '3d2e5149e2f489b217865e5abac9d14c', '', NULL),
(5636, 'en', 'default', '7c3fa617cc659374bf5335f14e85e1f0', 'The XYZ Doohickey Company was founded in 1971, and has been providing quality doohickeys to the public ever since. Located in Gotham City, XYZ employs over 2,000 people and does all kinds of awesome things for the Gotham community.', NULL, NULL, '', 'LINE', NULL, 10, '', '7be05e2c149e3eb3da9856ca422c1635', '', NULL),
