(5639, 'en', 'default', '16a7d315d4eb5e71cf53bd119764f2a6', 'The amount of information you may be required to show will vary depending on your local or national business regulations. You may, for example, be required to display a physical address, a registered address, or your company registration number.', NULL, NULL, '', 'LINE', NULL, 10, '', '1309f621bd0055cd2c9d869996990f0c', '', NULL),
