(5641, 'en', 'default', '0d6e6952823baa88591bf01e4b2a7d9f', 'The aspect ratio is the relationship between the width and height. You can preserve the aspect ratio by holding down the shift key while resizing your selection. Use the input box to specify the aspect ratio, e.g. 1:1 (square), 4:3, 16:9, etc.', NULL, NULL, '', 'LINE', NULL, 10, '', '26728d76bfe1ad7865f61289e45209ca', '', NULL),
