(5898, 'en', 'default', '91a42b513ddc3974285f678d1b8c175f', 'This will clear all items from the inactive widgets list. You will not be able to restore any customizations.', NULL, NULL, '', 'LINE', NULL, 10, '', '5e6e58ace94509a05c7dc8415f76c471', '', NULL),
