(5900, 'en', 'default', '4179e60cf751b5b068b368ed906ffb43', 'This will grant access to <a href="%1$s">the %2$s blog in this installation that you have permissions on</a>.', NULL, NULL, '', 'LINE', NULL, 10, '', '7ccd48ef737048466312154590198611', '', NULL),
(5901, 'en', 'default', '02291f78c9a9bbf31552062359876cb7', 'This will grant access to <a href="%1$s">all %2$s blogs in this installation that you have permissions on</a>.', NULL, NULL, '', 'LINE', NULL, 10, '', '65fe1621ecabd655dac55fd3d2d9554c', '', NULL),
(5902, 'en', 'default', 'abc3d51e7c0c467ca7fcac96c524b295', 'This will remove the background image. You will not be able to restore any customizations.', NULL, NULL, '', 'LINE', NULL, 10, '', '40843ff2ca6ba5e038dcf9b98e384ee1', '', NULL),
(5903, 'en', 'default', '3509315aa342def7108b058c01400ffa', 'This will remove the header image. You will not be able to restore any customizations.', NULL, NULL, '', 'LINE', NULL, 10, '', 'c2c9b68e5fc6bebf06682b3d8047d256', '', NULL),
(5904, 'en', 'default', '416d33b1cdff2d4742e71de09eaacc01', 'This will replace the current editor content with the last backup version. You can use undo and redo in the editor to get the old content back or to return to the restored version.', NULL, NULL, '', 'LINE', NULL, 10, '', '49c535533b7429e238c1e0e5f747fb89', '', NULL),
