(5910, 'en', 'default', 'e64e8bc8063f61b3ea70ba74d3266806', 'Thumbnail size', NULL, NULL, '', 'LINE', NULL, 10, '', '004c3912371a36433150abb81373e7ec', '', NULL),
(5911, 'en', 'default', '236df51bb0e6416236e255b528346fca', 'Timezone', NULL, NULL, '', 'LINE', NULL, 10, '', '5915ad52b9e72aaf528fc0981eb3f6d6', '', NULL),
(5912, 'en', 'default', '3cd476936cc7b8e9d2b56dd0ef353ae3', 'Title and Post Editor', NULL, NULL, '', 'LINE', NULL, 10, '', 'b8b9703f0ca48b495552f41029e80cae', '', NULL),
(5913, 'en', 'default', '83fa5325fc6d9b4403e53d5fcd90c792', 'To activate a widget drag it to a sidebar or click on it. To deactivate a widget and delete its settings, drag it back.', NULL, NULL, '', 'LINE', NULL, 10, '', 'd4b9b2c2099fc269b01769667cac28f0', '', NULL),
(5914, 'en', 'default', '938b9b0ac73de7852ecf9d552bb1ff17', 'To add a custom link, <strong>expand the Custom Links section, enter a URL and link text, and click Add to Menu</strong>', NULL, NULL, '', 'LINE', NULL, 10, '', '3e1d035dbae7e5513d9e82fed3a7b333', '', NULL),
(5915, 'en', 'default', '893614bd345b053ce4ed809117822ce6', 'To add a new menu instead of assigning an existing one, <strong>click the &#8217;Use new menu&#8217; link</strong>. Your new menu will be automatically assigned to that theme location', NULL, NULL, '', 'LINE', NULL, 10, '', '8c31532238738ae3898b57622e2d0a6d', '', NULL),
(5916, 'en', 'default', 'd93444b6125d6f7511ed541f8ea2b16f', 'To add a new user for your site, click the Add New button at the top of the screen or Add New in the Users menu section.', NULL, NULL, '', 'LINE', NULL, 10, '', '18f746f02d07ad622b4a0b5c22b807d2', '', NULL),
(5917, 'en', 'default', '48159ef2176ed9c0e0578c2b8a233588', 'To add a new user to your site, fill in the form on this screen and click the Add New User button at the bottom.', NULL, NULL, '', 'LINE', NULL, 10, '', '4a4a633ddc0388eb758076a0c0751155', '', NULL),
(5918, 'en', 'default', 'c5f396e14b01d487529e01010ea6a61e', 'To allow use of this page to automatically repair database problems, please add the following line to your %s file. Once this line is added to your config, reload this page.', NULL, NULL, '', 'LINE', NULL, 10, '', 'bd269ad8c4dc92e4c0bcc905d9c04052', '', NULL),
(5919, 'en', 'default', 'b2ee790e1c8acee20705c7f91fd61181', 'To assign menus to one or more theme locations, <strong>select a menu from each location&#8217;s drop down.</strong> When you&#8217;re finished, <strong>click Save Changes</strong>', NULL, NULL, '', 'LINE', NULL, 10, '', '3113ebe0bd15886d1b13e79d91119f46', '', NULL),
(5920, 'en', 'default', '8505f0a8b67f59664790726edd041b0e', 'To crop the image, click on it and drag to make your selection.', NULL, NULL, '', 'LINE', NULL, 10, '', '12f9348aa9cb793d7d99dd7b6ea2c0b9', '', NULL),
(5921, 'en', 'default', '1a8e77c49467b205fcf969149d368c53', 'To delete media items, click the Bulk Select button at the top of the screen. Select any items you wish to delete, then click the Delete Selected button. Clicking the Cancel Selection button takes you back to viewing your media.', NULL, NULL, '', 'LINE', NULL, 10, '', '9ffec4a6ebd198c2e091d1edfd11e608', '', NULL),
(5922, 'en', 'default', '8dc687fce61fc497e3dbbfca2fb599d6', 'To distribute copies of your modified versions to others.', NULL, NULL, '', 'LINE', NULL, 10, '', '3c874efa7ef5dfcf088cff980acb8fd9', '', NULL),
(5923, 'en', 'default', 'e04eb96141dc379051c2d45c21baf2d7', 'To edit a menu currently assigned to a theme location, <strong>click the adjacent &#8217;Edit&#8217; link</strong>', NULL, NULL, '', 'LINE', NULL, 10, '', '02a6614ad27d526f06c00055e9d36b75', '', NULL),
(5924, 'en', 'default', '759e3687dbefb5670eb444bb69549e84', 'To edit an existing menu, <strong>choose a menu from the drop down and click Select</strong>', NULL, NULL, '', 'LINE', NULL, 10, '', '90ef2d63481fd79ab0c09c14d93bc812', '', NULL),
(5925, 'en', 'default', '65073b83a4da7e244df30e7b14e4be5e', 'To enhance your site&#8217;s security, we recommend you remove any themes you&#8217;re not using. You should keep %1$s, the default WordPress theme, %2$s, your current theme, and %3$s, its parent theme.', NULL, NULL, '', 'LINE', NULL, 10, '', '10a7e93e4ac547225f1a1234eaf34278', '', NULL),
(5926, 'en', 'default', 'da75f7bc5ae2d38d37b4036c97e57c55', 'To enhance your site&#8217;s security, we recommend you remove any themes you&#8217;re not using. You should keep your current theme, %1$s, and %2$s, its parent theme.', NULL, NULL, '', 'LINE', NULL, 10, '', '57a82a731666acd43d2ffe970f44d0c8', '', NULL),
(5927, 'en', 'default', 'bc87173cbdcea8f7d6785a2b98c18a07', 'To install the theme so you can preview it with your site&#8217;s content and customize its theme options, click the "Install" button at the top of the left-hand pane. The theme files will be downloaded to your website automatically. When this is complete, the theme is now available for activation, which you can do by clicking the "Activate" link, or by navigating to your Manage Themes screen and clicking the "Live Preview" link under any installed theme&#8217;s thumbnail image.', NULL, NULL, '', 'LINE', NULL, 10, '', 'e84103af1a03dc0bb0d0a64c6daa6541', '', NULL),
(5928, 'en', 'default', '9d391756a75e44cd1f9b8d5fcbd6edca', 'To manage plugins on your site, visit the Plugins page: %s', NULL, NULL, '', 'LINE', NULL, 10, '', '8e358867dd9165484c412d15601cf427', '', NULL),
(5929, 'en', 'default', '786f87db75cab55e159ff51ca557d866', 'To manage themes on your site, visit the Themes page: %s', NULL, NULL, '', 'LINE', NULL, 10, '', '9bac8dad5514986cec579e401a318813', '', NULL),
(5930, 'en', 'default', '023edac785db22df95123ca624d14034', 'To navigate between revisions, <strong>drag the slider handle left or right</strong> or <strong>use the Previous or Next buttons</strong>.', NULL, NULL, '', 'LINE', NULL, 10, '', '07b36ffc749d74fbd6d8bc3ff0994737', '', NULL),
(5931, 'en', 'default', 'bd3c7f7419a9592418e28e35ee3d9a11', 'To perform the requested action, WordPress needs to access your web server.', NULL, NULL, '', 'LINE', NULL, 10, '', 'e02a532c41d8ce16a3540ff712fbf2b1', '', NULL),
(5932, 'en', 'default', '8a37111830da94274e91012b3bf579fd', 'To post to WordPress by email, you must set up a secret email account with POP3 access. Any mail received at this address will be posted, so it&#8217;s a good idea to keep this address very secret. Here are three random strings you could use: %1$s, %2$s, %3$s.', NULL, NULL, '', 'LINE', NULL, 10, '', '4820293d60a6f00200289fe7c2b9b9cd', '', NULL),
(5933, 'en', 'default', '823dfaaa728d7dac64160c882fb49dd8', 'To redistribute.', NULL, NULL, '', 'LINE', NULL, 10, '', 'a59676d1697076a34743b7c70ecbec92', '', NULL),
(5934, 'en', 'default', '273ac586f8c89c098004a170ce915f8b', 'To reorganize menu items, <strong>drag and drop items with your mouse or use your keyboard</strong>. Drag or move a menu item a little to the right to make it a submenu', NULL, NULL, '', 'LINE', NULL, 10, '', 'dd26b4f2b1809abb4425114eedd4128c', '', NULL),
(5935, 'en', 'default', '795829d0fcee6b630ef4b77f3ae7c194', 'To restore a revision, <strong>click Restore This Revision</strong>.', NULL, NULL, '', 'LINE', NULL, 10, '', '760053b1465c53317e8a98e775ecafa1', '', NULL),
(5936, 'en', 'default', '5c2f7af7973de72042765ff09bb803a8', 'To run the program for any purpose.', NULL, NULL, '', 'LINE', NULL, 10, '', '14cbb2ee9d55fd772ed9b6766b69d895', '', NULL),
(5937, 'en', 'default', 'c0209f484f9c4dfd273b6ecbbfd97c13', 'To study how the program works and change it to make it do what you wish.', NULL, NULL, '', 'LINE', NULL, 10, '', '635554e43978b5d980b1181a597de1d5', '', NULL),
(5938, 'en', 'default', '17f06dbd83ff121759e08993ecff7ca0', 'To the top', NULL, NULL, '', 'LINE', NULL, 10, '', '4031d717eca6f1acb1a866e5c166d5c5', '', NULL),
(5939, 'en', 'default', 'b5f53d7f307b7ddcbbac8315d4ed8790', 'To use a background image, simply upload it or choose an image that has already been uploaded to your Media Library by clicking the &#8220;Choose Image&#8221; button. You can display a single instance of your image, or tile it to fill the screen. You can have your background fixed in place, so your site content moves on top of it, or you can have it scroll with your site.', NULL, NULL, '', 'LINE', NULL, 10, '', 'c22df4156e105bc49b789d0823f23726', '', NULL),
(5940, 'en', 'default', 'e51c94c86c384530e3ad332d097b6603', 'To use a subdomain configuration, you must have a wildcard entry in your DNS. This usually means adding a %s hostname record pointing at your web server in your DNS configuration tool.', NULL, NULL, '', 'LINE', NULL, 10, '', '64d9bea83b4e45f17b66cc34219d7594', '', NULL),
(5941, 'en', 'default', '8ce80df2e38d46015f1ec9807fd53c78', 'Toggle panel: %s', NULL, NULL, '', 'LINE', NULL, 10, '', '44597c4aef7b7ee5d32c5670e4265f4e', '', NULL),
