(6136, 'en', 'default', 'f9251b5ea74dd4ca2c3ead011a5555db', 'We have suggested the sections you will need. Under each section heading you will find a short summary of what information you should provide, which will help you to get started. Some sections include suggested policy content, others will have to be completed with information from your theme and plugins.', NULL, NULL, '', 'LINE', NULL, 10, '', '7eb3381a57ff400f1d1db4eba559794c', '', NULL),
(6137, 'en', 'default', 'a8e98ecd6d26825a442ac45c746fb2f7', 'We recommend removing any unused themes to enhance your site&#8217;s security.', NULL, NULL, '', 'LINE', NULL, 10, '', '6876ee4e96df44ecec91bbd19e6e719b', '', NULL),
(6138, 'en', 'default', '0f3d3788ca177d29ef9c0ba70dab6b7c', 'We take privacy and transparency very seriously. To learn more about what data we collect, and how we use it, please visit <a href="%s">our Privacy Policy</a>.', NULL, NULL, '', 'LINE', NULL, 10, '', '8752eb381214ffd5a39a99bd5072ea58', '', NULL),
