(6169, 'en', 'default', 'a898fa08a0cadfff38577d1a8d36312d', 'What&#8217;s the difference between categories and tags? Normally, tags are ad-hoc keywords that identify important information in your post (names, subjects, etc) that may or may not recur in other posts, while categories are pre-determined sections. If you think of your site like a book, the categories are like the Table of Contents and the tags are like the terms in the index.', NULL, NULL, '', 'LINE', NULL, 10, '', '4d97505e61693c0a1aac1b958fe094ac', '', NULL),
(6170, 'en', 'default', '8a71bdc11b7c292f1abfa82c358104cb', 'When a comment contains any of these words in its content, author name, URL, email, IP address, or browser&#8217;s user agent string, it will be held in the <a href="edit-comments.php?comment_status=moderated">moderation queue</a>. One word or IP address per line. It will match inside words, so &#8220;press&#8221; will match &#8220;WordPress&#8221;.', NULL, NULL, '', 'LINE', NULL, 10, '', '1524c0c08badfe45d8d6693c4dfa777a', '', NULL),
(6171, 'en', 'default', '2f3553751af24f1331ce005d9cdf8670', 'When a comment contains any of these words in its content, author name, URL, email, IP address, or browser&#8217;s user agent string, it will be put in the Trash. One word or IP address per line. It will match inside words, so &#8220;press&#8221; will match &#8220;WordPress&#8221;.', NULL, NULL, '', 'LINE', NULL, 10, '', '18dbb786fdad7a0a049c12bf95d96f7d', '', NULL),
(6172, 'en', 'default', '16eb38b0466b758e83ffc1afb65bc986', 'When adding a new category on this screen, you&#8217;ll fill in the following fields:', NULL, NULL, '', 'LINE', NULL, 10, '', '8348240c846a4cb879a67a7a1e6818ca', '', NULL),
(6173, 'en', 'default', '370c15874bf89814187701866c485c9e', 'When adding a new tag on this screen, you&#8217;ll fill in the following fields:', NULL, NULL, '', 'LINE', NULL, 10, '', '2c226506d0afbbba1a770a535751b268', '', NULL),
(6174, 'en', 'default', '7703983ef109c52a423492c4bfa5ffbe', 'When changing themes, there is often some variation in the number and setup of widget areas/sidebars and sometimes these conflicts make the transition a bit less smooth. If you changed themes and seem to be missing widgets, scroll down on this screen to the Inactive Widgets area, where all of your widgets and their settings will have been saved.', NULL, NULL, '', 'LINE', NULL, 10, '', 'a4018b4b9fa0ad74ac664770d4fa25bd', '', NULL),
(6175, 'en', 'default', '91015d74131523d75c8ee1d82db9e132', 'When previewing on smaller monitors, you can use the collapse icon at the bottom of the left-hand pane. This will hide the pane, giving you more room to preview your site in the new theme. To bring the pane back, click on the collapse icon again.', NULL, NULL, '', 'LINE', NULL, 10, '', 'ec0c3d224b684a115d955d14d78a3c2b', '', NULL),
(6176, 'en', 'default', '17a70223e455f00ff3bad51748d73025', 'When this setting is in effect, a reminder is shown in the At a Glance box of the Dashboard that says, &#8220;Search engines discouraged&#8221;, to remind you that you have directed search engines to not crawl your site.', NULL, NULL, '', 'LINE', NULL, 10, '', '31da26677ca2ff5264f1ca35e51b8199', '', NULL),
(6177, 'en', 'default', '4fd5e879927f19de076cca45bc59434a', 'When using Bulk Edit, you can change the metadata (categories, author, etc.) for all selected posts at once. To remove a post from the grouping, just click the x next to its name in the Bulk Edit area that appears.', NULL, NULL, '', 'LINE', NULL, 10, '', 'd70e008926f797f7fa73820eeb9729d4', '', NULL),
(6178, 'en', 'default', 'b18d07e59a875a4350e8cfa10509c5d7', 'When visitors leave comments on the site we collect the data shown in the comments form, and also the visitor&#8217;s IP address and browser user agent string to help spam detection.', NULL, NULL, '', 'LINE', NULL, 10, '', 'da2d58e7f047ffb8843c16d6ddf10432', '', NULL),
(6179, 'en', 'default', 'd999e714d0745e52c344416fde2e7bdb', 'When you assign multiple categories or tags to a post, only one can show up in the permalink: the lowest numbered category. This applies if your custom structure includes %1$s or %2$s.', NULL, NULL, '', 'LINE', NULL, 10, '', '9dd040215a7709056c4dd347c7722bc2', '', NULL),
(6180, 'en', 'default', '2a668b1b4a5c8a0d7d6ccc363cf266a7', 'When you click the button below WordPress will create an XML file for you to save to your computer.', NULL, NULL, '', 'LINE', NULL, 10, '', '3d57ff833f4fae8a369e17d3f5cce00d', '', NULL),
(6181, 'en', 'default', '85540ae266a03383e65007e160616c39', 'When you log in, we will also set up several cookies to save your login information and your screen display choices. Login cookies last for two days, and screen options cookies last for a year. If you select &quot;Remember Me&quot;, your login will persist for two weeks. If you log out of your account, the login cookies will be removed.', NULL, NULL, '', 'LINE', NULL, 10, '', '82da5429bc5561bbe23b1b043e08de1a', '', NULL),
(6182, 'en', 'default', '1d7b8a30c545e74f35989943383cf0ca', 'When you publish a new post, WordPress automatically notifies the following site update services. For more about this, see <a href="%s">Update Services</a> on the Codex. Separate multiple service URLs with line breaks.', NULL, NULL, '', 'LINE', NULL, 10, '', '74a6be1a7662948445cd005231dd2d0e', '', NULL),
(6183, 'en', 'default', '4346e99c8691c5059eeae38fbc6c8f5a', 'When you\'ve been able to update using the "Update now" button on Dashboard > Updates, we\'ll clear this error for future update attempts.', NULL, NULL, '', 'LINE', NULL, 10, '', 'd3c4c7021afca917bd038cd0df92986b', '', NULL),
(6184, 'en', 'default', '79cc13f4de633a7fd0a8dc7c5c03de3d', 'Where we send your data', NULL, NULL, '', 'LINE', NULL, 10, '', 'dc9cfd4a3cd299346ceccf5ec2767598', '', NULL),
(6185, 'en', 'default', 'e9a18968c712016007ca1bde235507df', 'While trying to test your site&#8217;s scheduled events, the following error was returned: %s', NULL, NULL, '', 'LINE', NULL, 10, '', '4cc39e6e65c84d654fcde08c0d4d296f', '', NULL),
(6186, 'en', 'default', 'a038eafad9e01988c1841de565372b3d', 'While you are editing your %1$s file, take a moment to make sure you have all 8 keys and that they are unique. You can generate these using the <a href="%2$s">WordPress.org secret key service</a>.', NULL, NULL, '', 'LINE', NULL, 10, '', '8b4c653c9278b9bdbfe1b5afec5a7663', '', NULL),
(6187, 'en', 'default', '22b183c4e2b3d1367f2a015969eafcf2', 'While your site is being updated, it will be in maintenance mode. As soon as your updates are complete, this mode will be deactivated.', NULL, NULL, '', 'LINE', NULL, 10, '', '80b723371b9bf0285d2131e4537aff60', '', NULL),
(6188, 'en', 'default', '6d54357de16dae873aca455b2a0757b4', 'Who we are', NULL, NULL, '', 'LINE', NULL, 10, '', '4674e96347c0620f35ae54a960e8acf3', '', NULL),
(6189, 'en', 'default', 'b36d0f4f434f0ca2b84a3507673dbf63', 'Who we share your data with', NULL, NULL, '', 'LINE', NULL, 10, '', 'cf98bfb7cb46423fcee1242d5f7f16d4', '', NULL),
(6190, 'en', 'default', '2da0edbcf9d29ab00ecc785b1f8e9b3a', 'Wide Blocks', NULL, NULL, '', 'LINE', NULL, 10, '', '349cba9b1b486dc80125304196021893', '', NULL),
(6191, 'en', 'default', '06d67eb99ad329dc01617be9f85c4d63', 'Widget %s', NULL, NULL, '', 'LINE', NULL, 10, '', '58861891ba33200d0f243c26143a5fc6', '', NULL),
(6192, 'en', 'default', '5f71bda8d746f5a38f8be090639b5e2f', 'Widgets are independent sections of content that can be placed into any widgetized area provided by your theme (commonly called sidebars). To populate your sidebars/widget areas with individual widgets, drag and drop the title bars into the desired area. By default, only the first widget area is expanded. To populate additional widget areas, click on their title bars to expand them.', NULL, NULL, '', 'LINE', NULL, 10, '', '2628ac04367ef5339322e23a38240fb5', '', NULL),
(6193, 'en', 'default', '2a1b56a60634250cd6cf205c74ed00c6', 'Widgets may be used multiple times. You can give each widget a title, to display on your site, but it&#8217;s not required.', NULL, NULL, '', 'LINE', NULL, 10, '', 'cb26d608dcaf5e53bfdccbb076ee7f6b', '', NULL),
(6194, 'en', 'default', 'a1637ad2e4584ca47270831aa1b1c57a', 'With this new version, WordPress brings you fresh colors. The editor helps you work in a few places you couldn’t before—at least, not without getting into code or hiring a pro. The controls you use most, like changing font sizes, are in more places—right where you need them. And layout changes that should be simple, like full-height images, are even simpler to make.', NULL, NULL, '', 'LINE', NULL, 10, '', '7e0f7d4d11295a24057ebbd8651dda75', '', NULL),
(6195, 'en', 'default', '2dcde0b29a51130f79f23dee3acbe2ed', 'Word count: %s', NULL, NULL, '', 'LINE', NULL, 10, '', 'b71bc0ddcb133c472c9ea1793eeba84c', '', NULL),
(6196, 'en', 'default', 'e0fb73f37c6548c6245b307fc9040f49', 'WordCamps', NULL, NULL, '', 'LINE', NULL, 10, '', '01e1ad0258fed3ab9842cdd4f1734f1b', '', NULL),
(6197, 'en', 'default', 'fde31686817fe5029025586d51b35861', 'WordPress', NULL, NULL, '', 'LINE', NULL, 10, '', '6757a2df47df1844cdca13c3a074863e', '', NULL) ;
