(6210, 'en', 'default', 'b33681e5c8f412a380bd985420ae2309', 'WordPress Version', NULL, NULL, '', 'LINE', NULL, 10, '', 'eb98576356063d81be84ef367918585e', '', NULL),
(6211, 'en', 'default', '33c13135df9264a73a6958ca2ae370f5', 'WordPress can also attempt to optimize the database. This improves performance in some situations. Repairing and optimizing the database can take a long time and the database will be locked while optimizing.', NULL, NULL, '', 'LINE', NULL, 10, '', '83b16757e71c057b4ab547e2625df230', '', NULL),
(6212, 'en', 'default', '68ff8e47448b84d116faca89d63a3125', 'WordPress can automatically look for some common database problems and repair them. Repairing can take a while, so please be patient.', NULL, NULL, '', 'LINE', NULL, 10, '', '081462fd6d52c8ec3561736fd9b1b7d5', '', NULL),
(6213, 'en', 'default', 'd1e356a8b5c46bde84443e397a38b9d0', 'WordPress database repair', NULL, NULL, '', 'LINE', NULL, 10, '', '897cf3b84835381a1682a312c55c2546', '', NULL),
