(6216, 'en', 'default', '61aa626dd011102915190ba22fa529d4', 'WordPress directory location', NULL, NULL, '', 'LINE', NULL, 10, '', '2c9ac2fc8444637a7fc0e62b39b911aa', '', NULL),
(6217, 'en', 'default', 'b807ab22453f709deb9e060da519a758', 'WordPress directory size', NULL, NULL, '', 'LINE', NULL, 10, '', '7d750785e16a1bd96b43d6d16bdce53e', '', NULL),
(6218, 'en', 'default', '920b86d822cd25a2a2c592134fd08ce1', 'WordPress grows when people like you tell their friends about it, and the thousands of businesses and services that are built on and around WordPress share that fact with their users. We&#8217;re flattered every time someone spreads the good word, just make sure to <a href="%s">check out our trademark guidelines</a> first.', NULL, NULL, '', 'LINE', NULL, 10, '', '84d9b5767192db384ce1c4e4cddb9c27', '', NULL),
(6219, 'en', 'default', 'ca2e1c6fdebc7887415465aaaf360960', 'WordPress has been installed. Thank you, and enjoy!', NULL, NULL, '', 'LINE', NULL, 10, '', '1745013426dd7b654f51d4fb2a69e0b2', '', NULL),
(6220, 'en', 'default', '924b4ada54bcaa491660c0f5f200b5dd', 'WordPress has been updated! Before we send you on your way, we have to update your database to the newest version.', NULL, NULL, '', 'LINE', NULL, 10, '', '3c03c037f9d0fb84ed283d222a10bfeb', '', NULL),
(6221, 'en', 'default', '87488821d95fad046e6934ba9a27f016', 'WordPress is Free and open source software, built by a distributed community of mostly volunteer developers from around the world. WordPress comes with some awesome, worldview-changing rights courtesy of its <a href="%s">license</a>, the GPL.', NULL, NULL, '', 'LINE', NULL, 10, '', '32bda0a1395f3a803bf05a0164f36dee', '', NULL),
(6222, 'en', 'default', 'ba5a6fbddf1b8a34c5384891c777374f', 'WordPress is at the latest version.', NULL, NULL, '', 'LINE', NULL, 10, '', 'c4ecb640802ec497b6f8133c3ef076ff', '', NULL),
(6223, 'en', 'default', '98139c5279fc772772d86ebf86967fbf', 'WordPress is created by a <a href="%1$s">worldwide team</a> of passionate individuals. <a href="%2$s">Get involved in WordPress</a>.', NULL, NULL, '', 'LINE', NULL, 10, '', '3731b77e9b5aaccad48ba29b43de7270', '', NULL),
(6224, 'en', 'default', '82f771478b6cafba7b96c61a3299c075', 'WordPress is created by a worldwide team of passionate individuals.', NULL, NULL, '', 'LINE', NULL, 10, '', '01c7f502da6911611ca2c5ec1747b156', '', NULL),
(6225, 'en', 'default', '4b8a79aa611a3d5388694ff8ce54bdfb', 'WordPress is not notifying any <a href="%1$s">Update Services</a> because of your site&#8217;s <a href="%2$s">visibility settings</a>.', NULL, NULL, '', 'LINE', NULL, 10, '', 'ad7215a97613adc28341716934624415', '', NULL),
(6226, 'en', 'default', '002ed833af5d0c8a84bbc41ef94724dc', 'WordPress offers you the ability to create a custom URL structure for your permalinks and archives. Custom URL structures can improve the aesthetics, usability, and forward-compatibility of your links. A <a href="%s">number of tags are available</a>, and here are some examples to get you started.', NULL, NULL, '', 'LINE', NULL, 10, '', '4ca5dedd93f643351f1ca0a14baf5b97', '', NULL),
(6227, 'en', 'default', '35075ebfb88a039c3b60fe4283948b31', 'WordPress requires %1$s version %2$s or higher. Contact your web hosting company to correct this.', NULL, NULL, '', 'LINE', NULL, 10, '', '3ae77c586b6b3df2fd082ca559c6a26b', '', NULL),
(6228, 'en', 'default', 'c1f30757544463210a8bbdd9ce2b3a98', 'WordPress security and maintenance releases are blocked by %s.', NULL, NULL, '', 'LINE', NULL, 10, '', 'e7d7ef9e61bb6e02d96703951a8a9618', '', NULL),
