(6251, 'en', 'default', '8313da8dc64047da719bb9cbe56a84ea', 'Yes, delete these files and data', NULL, NULL, '', 'LINE', NULL, 10, '', 'c0d1b6d38fc1d313215a5e1dc9d7d56e', '', NULL),
(6252, 'en', 'default', 'ee6b36df0a0e5ae29804573f7bc0f5ec', 'Yes, take me to my profile page', NULL, NULL, '', 'LINE', NULL, 10, '', '1d3042fbf321b0f29a212ba1fa41b065', '', NULL),
(6253, 'en', 'default', '7cff9b6df2ec3f0734a9bfa274ad5b71', 'You also have some plugins or themes with updates available. Update them now:', NULL, NULL, '', 'LINE', NULL, 10, '', '2b582a384405ef134b2e3732c6752c15', '', NULL),
(6254, 'en', 'default', 'f8ba38900d10b5b21aee002e9e7bd51b', 'You appear to be making direct edits to your plugin in the WordPress dashboard. We recommend that you don&#8217;t! Editing plugins directly may introduce incompatibilities that break your site and your changes may be lost in future updates.', NULL, NULL, '', 'LINE', NULL, 10, '', 'f826278325752cd0128cabb05d582280', '', NULL),
(6255, 'en', 'default', 'ef72f84c87804e66b329f39203efcd76', 'You appear to be making direct edits to your theme in the WordPress dashboard. We recommend that you don&#8217;t! Editing your theme directly could break your site and your changes may be lost in future updates.', NULL, NULL, '', 'LINE', NULL, 10, '', 'b788fde24d2a652e619b5e8494dba9f1', '', NULL),
(6256, 'en', 'default', 'f8c6ee5e73552f569602296fefb93e97', 'You are about to approve the following comment:', NULL, NULL, '', 'LINE', NULL, 10, '', 'a741669e2308fc1b7849c6cea467d4a4', '', NULL),
(6257, 'en', 'default', '2de0cde3d4f7c41a74f39952dfd47c53', 'You are about to delete %s.', NULL, NULL, '', 'LINE', NULL, 10, '', '561dcb4033e66c90b80111cb744268f2', '', NULL),
(6258, 'en', 'default', '5c81416e5ec54afcce8585081aebfaa2', 'You are about to delete the following comment:', NULL, NULL, '', 'LINE', NULL, 10, '', '9774a607e28a78ded0ebe7bb2d32c603', '', NULL),
(6259, 'en', 'default', 'dffbb3fce635732b0e6620dd590f61f9', 'You are about to delete this link \'%s\'\\n  \'Cancel\' to stop, \'OK\' to delete.', NULL, NULL, '', 'LINE', NULL, 10, '', 'a7ed45b50d0811bbee71533027965055', '', NULL),
(6260, 'en', 'default', 'ac4f38ab41fe32062fad243041ab44ad', 'You are about to delete this theme \'%s\'\\n  \'Cancel\' to stop, \'OK\' to delete.', NULL, NULL, '', 'LINE', NULL, 10, '', 'b49de564fe6352d019b2c60f0bf6aaa3', '', NULL),
(6261, 'en', 'default', '0232103929f5d403f6c7958a3b807a8d', 'You are about to install WordPress %s <strong>in English (US).</strong> There is a chance this update will break your translation. You may prefer to wait for the localized version to be released.', NULL, NULL, '', 'LINE', NULL, 10, '', '157295ad1a6686eb670ef26a04b03842', '', NULL),
(6262, 'en', 'default', '3b4ff5a4b188de3878909bd3a9b3cec8', 'You are about to mark the following comment as spam:', NULL, NULL, '', 'LINE', NULL, 10, '', 'c16df9f52a96623f2edb6aac33a659b1', '', NULL),
(6263, 'en', 'default', 'b24c6934170aa498626a6144d6515933', 'You are about to move the following comment to the Trash:', NULL, NULL, '', 'LINE', NULL, 10, '', '7eb50bef1f149a97a512a17b3860c94a', '', NULL),
(6264, 'en', 'default', '67ebe7a24df35d5ec7ed817c5842a194', 'You are about to remove the following plugin:', NULL, NULL, '', 'LINE', NULL, 10, '', 'ea9e1c9dd74972fc87e537c0b8a75783', '', NULL),
(6265, 'en', 'default', 'bbad7ae088e6c0da4561965a1c369358', 'You are about to remove the following plugins:', NULL, NULL, '', 'LINE', NULL, 10, '', '5c3fe5012767405bbfe2446333b20717', '', NULL),
(6266, 'en', 'default', '64443a220d092be6e634e4936de6c082', 'You are accessing this website using HTTPS, but your <a href="%1$s">WordPress Address</a> and <a href="%2$s">Site Address</a> are not set up to use HTTPS by default.', NULL, NULL, '', 'LINE', NULL, 10, '', '2bc9ac3703ddbd1ecf6191663a366c45', '', NULL),
(6267, 'en', 'default', '03e8c8fba7b470fcd88133e6dcf44e6a', 'You are accessing this website using HTTPS, but your <a href="%s">Site Address</a> is not set up to use HTTPS by default.', NULL, NULL, '', 'LINE', NULL, 10, '', '62f061ff8710821aecb52a187bf1efe9', '', NULL),
(6268, 'en', 'default', '5e2e56330bcbe7fad88b2f4f103f7ddb', 'You are currently editing the page that shows your latest posts.', NULL, NULL, '', 'LINE', NULL, 10, '', '8e7076e0d8e43c940232b9e797f28ddf', '', NULL),
(6269, 'en', 'default', '265f2d2ee42bb9df7b5f392bbfe195f5', 'You are currently running the latest version of WordPress available, keep it up!', NULL, NULL, '', 'LINE', NULL, 10, '', 'b48c7772fb2eef344f6768f9928af47f', '', NULL),
(6270, 'en', 'default', '6b5f201ca7c26def0ddc7c8f43ed6102', 'You are in recovery mode. This means there may be an error with a theme or plugin. To exit recovery mode, log out or use the Exit button. <a href="%s">Exit Recovery Mode</a>', NULL, NULL, '', 'LINE', NULL, 10, '', '2703249baf58afeed0f224e6da692939', '', NULL),
(6271, 'en', 'default', '96cef5b3d6d082373acf8e547cf63ed4', 'You are now logged out everywhere else.', NULL, NULL, '', 'LINE', NULL, 10, '', 'eaa09b45dbf6e5106e26f1575642c8a7', '', NULL),
(6272, 'en', 'default', 'f6435aa05732baca22a6de8167d3bfd8', 'You are only logged in at this location.', NULL, NULL, '', 'LINE', NULL, 10, '', '6efa0e36e3fa8fa35878b98eefa724f7', '', NULL),
(6273, 'en', 'default', '3ef00d3972203c518eda748358eaa85d', 'You are updating a plugin. Be sure to <a href="%s">back up your database and files</a> first.', NULL, NULL, '', 'LINE', NULL, 10, '', 'a8b61a67f9d9f9df3743c33d76cb7bf4', '', NULL),
(6274, 'en', 'default', '2fb3350f46e5edd3f5cbe9b81cee672f', 'You are updating a theme. Be sure to <a href="%s">back up your database and files</a> first.', NULL, NULL, '', 'LINE', NULL, 10, '', 'e10abccd6108cb7ed9a2752a2fc6a6b1', '', NULL),
(6275, 'en', 'default', '19c7139d6965a9938e559bd34b9c866a', 'You are uploading an older version of a current plugin. You can continue to install the older version, but be sure to <a href="%s">back up your database and files</a> first.', NULL, NULL, '', 'LINE', NULL, 10, '', 'a89d995cb3958cbe6d3771b389a70531', '', NULL),
(6276, 'en', 'default', '4e25ff8b7425176d753f5d201264c027', 'You are uploading an older version of a current theme. You can continue to install the older version, but be sure to <a href="%s">back up your database and files</a> first.', NULL, NULL, '', 'LINE', NULL, 10, '', 'eea58bb2f8f561935abec1b98483b5a2', '', NULL),
(6277, 'en', 'default', '008e5fbc752cd0058905e49a13f07213', 'You are using a %1$s drop-in which might mean that a %2$s database is not being used.', NULL, NULL, '', 'LINE', NULL, 10, '', '05200ade3af08ea95417481dcd41d26a', '', NULL),
(6278, 'en', 'default', 'a2ffc66c941814a9d5b0bb75664a1438', 'You are using a development version (%1$s). Cool! Please <a href="%2$s">stay updated</a>.', NULL, NULL, '', 'LINE', NULL, 10, '', '1611f33e667d8986d6e5af86e2632027', '', NULL),
(6279, 'en', 'default', '2a99cbddeba5e7dce25d5b064ffb25ef', 'You are using a development version of WordPress.', NULL, NULL, '', 'LINE', NULL, 10, '', 'c802bba0ff0d4ef8c740d945ad90f504', '', NULL),
(6280, 'en', 'default', 'ead95faf097c050ce8272235ab6d14c4', 'You are using a development version of WordPress. These feature plugins are also under development. <a href="%s">Learn more</a>.', NULL, NULL, '', 'LINE', NULL, 10, '', 'c6341544fa2046eec14107fc5e0c2991', '', NULL),
(6281, 'en', 'default', '0f823bed6cba9b8049dc4eecf9eee287', 'You are using an insecure browser!', NULL, NULL, '', 'LINE', NULL, 10, '', '23213d53b58d52a73b5c6b791e0751da', '', NULL),
(6282, 'en', 'default', 'ffa32f3198455426db78715a26184f3d', 'You are using the browser&#8217;s built-in file uploader. The WordPress uploader includes multiple file selection and drag and drop capability. <a href="#">Switch to the multi-file uploader</a>.', NULL, NULL, '', 'LINE', NULL, 10, '', '3762a3858f871b91761c7c17e352fc8d', '', NULL),
(6283, 'en', 'default', '9bda4e39150c80dcb77374d8210ce249', 'You are using the multi-file uploader. Problems? Try the <a href="%1$s" %2$s>browser uploader</a> instead.', NULL, NULL, '', 'LINE', NULL, 10, '', '08f521405de1bdccb653b17cad57d946', '', NULL),
(6284, 'en', 'default', '313fdf221f4a041ed3d772112928e653', 'You attempted to access the "%1$s" dashboard, but you do not currently have privileges on this site. If you believe you should be able to access the "%1$s" dashboard, please contact your network administrator.', NULL, NULL, '', 'LINE', NULL, 10, '', '020de39e8d89520db671b4fe148e7915', '', NULL),
(6285, 'en', 'default', '7f735a3de4fa14b113264f459aa23a72', 'You attempted to edit an attachment that doesn&#8217;t exist. Perhaps it was deleted?', NULL, NULL, '', 'LINE', NULL, 10, '', '08496ed3c471ff8f386f2bfad6e83a98', '', NULL),
(6286, 'en', 'default', '30ea891c72c225103705a6d5327fb6da', 'You attempted to edit an item that doesn&#8217;t exist. Perhaps it was deleted?', NULL, NULL, '', 'LINE', NULL, 10, '', '258ba72a61465a83c608f7bbcb04e28f', '', NULL),
(6287, 'en', 'default', '63e10978f6765868b1d450b854d82fc7', 'You attempted to edit an item that isn&#8217;t an attachment. Please go back and try again.', NULL, NULL, '', 'LINE', NULL, 10, '', '900cefb2779b90dfcb085ea912988321', '', NULL),
(6288, 'en', 'default', '1597e47943552acb2159f24763d2183b', 'You can Search for themes by keyword, author, or tag, or can get more specific and search by criteria listed in the feature filter.', NULL, NULL, '', 'LINE', NULL, 10, '', 'eb4979e5ab1b2ae278daadd1702a0603', '', NULL),
(6289, 'en', 'default', 'a028caf874f7a36b4d04977846a44352', 'You can Upload a theme manually if you have already downloaded its ZIP archive onto your computer (make sure it is from a trusted and original source). You can also do it the old-fashioned way and copy a downloaded theme&#8217;s folder via FTP into your %s directory.', NULL, NULL, '', 'LINE', NULL, 10, '', '333d26c9fe96a9e26648cc1908869146', '', NULL),
(6290, 'en', 'default', '5d8dccaf5152dadcf683142ff8e39d85', 'You can add links here to be displayed on your site, usually using <a href="%s">Widgets</a>. By default, links to several sites in the WordPress community are included as examples.', NULL, NULL, '', 'LINE', NULL, 10, '', 'b76bb7ad7b1732e2160f2f83dbe88287', '', NULL),
(6291, 'en', 'default', '68219ec1373a07050daabcab0c978815', 'You can add or edit links on this screen by entering information in each of the boxes. Only the link&#8217;s web address and name (the text you want to display on your site as the link) are required fields.', NULL, NULL, '', 'LINE', NULL, 10, '', '6912f31d5f004663b4c8e4ad15c73082', '', NULL),
(6292, 'en', 'default', 'b816582da0fe96d33555b82e7cf35504', 'You can also browse a user&#8217;s favorite plugins, by using the Favorites link above the plugins list and entering their WordPress.org username.', NULL, NULL, '', 'LINE', NULL, 10, '', '96e13d80dd4d210f6e818be399382890', '', NULL),
(6293, 'en', 'default', '4f2592dccb64c180a81e4a042fe70670', 'You can also choose a background color by clicking the Select Color button and either typing in a legitimate HTML hex value, e.g. &#8220;#ff0000&#8221; for red, or by choosing a color using the color picker.', NULL, NULL, '', 'LINE', NULL, 10, '', 'b7e503868ca5ca70400ee20723cb8c47', '', NULL),
(6294, 'en', 'default', '007231ab4175ae868fa80a67a9bd0265', 'You can also control the display of your content in RSS feeds, including the maximum number of posts to display and whether to show full text or a summary. <a href="%s">Learn more about feeds</a>.', NULL, NULL, '', 'LINE', NULL, 10, '', 'a3f76c17ee95132ca44e15679558fa6a', '', NULL),
(6295, 'en', 'default', '464b4a78bca01186db0bc144f178c5f1', 'You can also create posts with the <a href="%s">Press This bookmarklet</a>.', NULL, NULL, '', 'LINE', NULL, 10, '', 'd0528ae0c11e8490f10c23327b15cafe', '', NULL),
(6296, 'en', 'default', '972d412b5c2482e96d24171ef27553c5', 'You can also delete individual items and access the extended edit screen from the details dialog.', NULL, NULL, '', 'LINE', NULL, 10, '', '2e77a6c303195f810df4934f2989f298', '', NULL),
(6297, 'en', 'default', '1341a0d2ef08097f1314a97edff04549', 'You can also edit or move multiple posts to the Trash at once. Select the posts you want to act on using the checkboxes, then select the action you want to take from the Bulk actions menu and click Apply.', NULL, NULL, '', 'LINE', NULL, 10, '', 'bb420c6b8a219c61a78f1b672e42aed7', '', NULL) ;
INSERT INTO `wp_icl_strings` ( `id`, `language`, `context`, `name`, `value`, `string_package_id`, `location`, `wrap_tag`, `type`, `title`, `status`, `gettext_context`, `domain_name_context_md5`, `translation_priority`, `word_count`) VALUES
(6298, 'en', 'default', '172eb66275c9932b5cc838bd88c22827', 'You can also embed media from many popular websites including Twitter, YouTube, Flickr and others by pasting the media URL on its own line into the content of your post/page. <a href="https://wordpress.org/support/article/embeds/">Learn more about embeds</a>.', NULL, NULL, '', 'LINE', NULL, 10, '', 'bf8d081e7f1ff47974f3b1d6fd142361', '', NULL),
(6299, 'en', 'default', '001ae354418426ceb96e7d035ad9de3c', 'You can also moderate the comment from this screen using the Status box, where you can also change the timestamp of the comment.', NULL, NULL, '', 'LINE', NULL, 10, '', '8c34b8c1eaba94f7289ab3289a5399fe', '', NULL),
(6300, 'en', 'default', 'cf32f861c95a06c303156be3cd9f8088', 'You can also perform the same types of actions, including narrowing the list by using the filters, acting on a page using the action links that appear when you hover over a row, or using the Bulk actions menu to edit the metadata for multiple pages at once.', NULL, NULL, '', 'LINE', NULL, 10, '', '50bab7ebd72e96feef7fbfcbcbb5a443', '', NULL),
(6301, 'en', 'default', 'ff2945d6f4371f51df1c739ba60f27ae', 'You can assign keywords to your posts using <strong>tags</strong>. Unlike categories, tags have no hierarchy, meaning there&#8217;s no relationship from one tag to another.', NULL, NULL, '', 'LINE', NULL, 10, '', 'df93416910d6e5d402da0166617b2ee4', '', NULL),
(6302, 'en', 'default', '72caeed1ff140d706e86977a0bf7d12c', 'You can assign theme locations to individual menus by <strong>selecting the desired settings</strong> at the bottom of the menu editor. To assign menus to all theme locations at once, <strong>visit the Manage Locations tab</strong> at the top of the screen.', NULL, NULL, '', 'LINE', NULL, 10, '', '9362d167fdacec13de259ffccbd99596', '', NULL),
(6303, 'en', 'default', 'ceb79a4cdaccc9c24ea22489ba03429f', 'You can change the display of this screen using the Screen Options tab to set how many items are displayed per screen and to display/hide columns in the table.', NULL, NULL, '', 'LINE', NULL, 10, '', '59cf444b48715208ad794a188fdb27a3', '', NULL),
(6304, 'en', 'default', 'aa6b50ebfd26013f727b5bddd1a0020a', 'You can change your password, turn on keyboard shortcuts, change the color scheme of your WordPress administration screens, and turn off the WYSIWYG (Visual) editor, among other things. You can hide the Toolbar (formerly called the Admin Bar) from the front end of your site, however it cannot be disabled on the admin screens.', NULL, NULL, '', 'LINE', NULL, 10, '', 'b9b4d0532a778cafb41ef6adf422c685', '', NULL),
(6305, 'en', 'default', '3a94690f89aea910c66bdb3b6fff1fc0', 'You can choose from the theme&#8217;s default header images, or use one of your own. You can also customize how your Site Title and Tagline are displayed.', NULL, NULL, '', 'LINE', NULL, 10, '', 'a9f5169f4cc9dff9335f02dc21036a92', '', NULL),
(6306, 'en', 'default', '60a664b6a8f309a460918c0a26f8a6c1', 'You can choose one of your previously uploaded headers, or show a random one.', NULL, NULL, '', 'LINE', NULL, 10, '', 'd47efcdc40344fa4bb4ed32631d75492', '', NULL),
(6307, 'en', 'default', 'f84196c911ec5a65c48ccee53f33c850', 'You can choose what&#8217;s displayed on the homepage of your site. It can be posts in reverse chronological order (classic blog), or a fixed/static page. To set a static homepage, you first need to create two <a href="%s">Pages</a>. One will become the homepage, and the other will be where your posts are displayed.', NULL, NULL, '', 'LINE', NULL, 10, '', '649280ffbec104f0b86be27e09164287', '', NULL),
(6308, 'en', 'default', '48aa27db004b964027ccbb59d9d68955', 'You can choose whether or not your site will be crawled by robots, ping services, and spiders. If you want those services to ignore your site, click the checkbox next to &#8220;Discourage search engines from indexing this site&#8221; and click the Save Changes button at the bottom of the screen.', NULL, NULL, '', 'LINE', NULL, 10, '', '6a9ea9c5c20f0ba1d03d8841dc3cfcf9', '', NULL),
(6309, 'en', 'default', '4e171722a615bf0a18d4a10f47f71464', 'You can create groups of links by using Link Categories. Link Category names must be unique and Link Categories are separate from the categories you use for posts.', NULL, NULL, '', 'LINE', NULL, 10, '', '4b54c6d68320d2f035fccf562e2bab97', '', NULL),
(6310, 'en', 'default', 'b37e44bc690a283009213e84f746d497', 'You can create the %s file manually and paste the following text into it.', NULL, NULL, '', 'LINE', NULL, 10, '', '76f4b68a6e9d1fcc894f1beae939aebe', '', NULL),
(6311, 'en', 'default', '3f1914dd8eecd9de86a33cddc8389cbb', 'You can customize the display of this screen in a number of ways:', NULL, NULL, '', 'LINE', NULL, 10, '', '75b6f3ea46162ff1ee094bb0533bebb6', '', NULL),
(6312, 'en', 'default', 'd6ea257fc3b6e7e133f43b11581d331a', 'You can customize the display of this screen using the Screen Options tab and/or the dropdown filters above the links table.', NULL, NULL, '', 'LINE', NULL, 10, '', 'e7d15f9c59ea3e6ee7f40b3c1e031594', '', NULL),
(6313, 'en', 'default', '8ac8e55c35195400fff6756b49835523', 'You can customize the display of this screen&#8217;s contents in a number of ways:', NULL, NULL, '', 'LINE', NULL, 10, '', '7ed2cb9c4a7f52993516725cd5168e1c', '', NULL),
(6314, 'en', 'default', 'ea5fcb3e59f97c7e70111b588d78d687', 'You can customize the look of your site without touching any of your theme&#8217;s code by using a custom background. Your background can be an image or a color.', NULL, NULL, '', 'LINE', NULL, 10, '', 'b39450760894637b67668aae44c27c96', '', NULL),
(6315, 'en', 'default', '5aaf5b7354c090ad1a53700fdd8fe022', 'You can delete Link Categories in the Bulk Action pull-down, but that action does not delete the links within the category. Instead, it moves them to the default Link Category.', NULL, NULL, '', 'LINE', NULL, 10, '', 'b8541d8f687d12a898125b597c36ca87', '', NULL),
(6316, 'en', 'default', '1c5817ebea2cf6cad0970da9cb1a26c3', 'You can do more without writing custom code', NULL, NULL, '', 'LINE', NULL, 10, '', '709d0346cfc8b65503885bf4b194acec', '', NULL),
(6317, 'en', 'default', '319980b189e432ee59526496b2fc7bd7', 'You can edit the image while preserving the thumbnail. For example, you may wish to have a square thumbnail that displays just a section of the image.', NULL, NULL, '', 'LINE', NULL, 10, '', '84a98079b9b86c1c74f975e3e854fa1b', '', NULL),
(6318, 'en', 'default', '29a977dfe4c91dbbb1970d8a38a81a2a', 'You can edit the information left in a comment if needed. This is often useful when you notice that a commenter has made a typographical error.', NULL, NULL, '', 'LINE', NULL, 10, '', '995b8ae48206399e7a9530a8154fbbd3', '', NULL),
(6319, 'en', 'default', 'd5fb0f5d059e20b79f51ba2cb67696b2', 'You can enable distraction-free writing mode using the icon to the right. This feature is not available for old browsers or devices with small screens, and requires that the full-height editor be enabled in Screen Options.', NULL, NULL, '', 'LINE', NULL, 10, '', 'dda7292d6cc6432d85981a7dcd8632bc', '', NULL),
(6320, 'en', 'default', '439e85bf8c00d0e5d97a3f08a503f1ce', 'You can export a file of your site&#8217;s content in order to import it into another installation or platform. The export file will be an XML file format called WXR. Posts, pages, comments, custom fields, categories, and tags can be included. You can choose for the WXR file to include only certain posts or pages by setting the dropdown filters to limit the export by category, author, date range by month, or publishing status.', NULL, NULL, '', 'LINE', NULL, 10, '', '9588f209116dc30d63fdf43bb35e6897', '', NULL),
(6321, 'en', 'default', '893b004b3b255507cc8437e21994eadb', 'You can filter the list of posts by post status using the text links above the posts list to only show posts with that status. The default view is to show all posts.', NULL, NULL, '', 'LINE', NULL, 10, '', '014d2d802fc8f834f23987d4b037d30a', '', NULL),
(6322, 'en', 'default', '336a3ba49f4fd88e0d9f10b69511d0df', 'You can filter the list of users by User Role using the text links above the users list to show All, Administrator, Editor, Author, Contributor, or Subscriber. The default view is to show all users. Unused User Roles are not listed.', NULL, NULL, '', 'LINE', NULL, 10, '', '8653fbcfa867f1c95e2d3b856e2d8b47', '', NULL),
(6323, 'en', 'default', '415205a59aff75e660caf73215b1dce4', 'You can find additional themes for your site by using the Theme Browser/Installer on this screen, which will display themes from the <a href="%s">WordPress Theme Directory</a>. These themes are designed and developed by third parties, are available free of charge, and are compatible with the license WordPress uses.', NULL, NULL, '', 'LINE', NULL, 10, '', 'b7b2dd7c837caf0e94c8104888321a73', '', NULL),
(6324, 'en', 'default', '9bea0c271327cb079a65941caacb3afe', 'You can find more details and make changes on the Plugins screen.', NULL, NULL, '', 'LINE', NULL, 10, '', '88b1e38993f80c274b187598124e1da5', '', NULL),
(6325, 'en', 'default', 'a5e9fa049e365383e4a4f856f9fbd851', 'You can find more details and make changes on the Themes screen.', NULL, NULL, '', 'LINE', NULL, 10, '', 'a35fdb54fab1ac4df384daff45d7789a', '', NULL),
(6326, 'en', 'default', '2a4f1cc2e99d292a9132ee9cfb9c3b26', 'You can find new plugins to install by searching or browsing the directory right here in your own Plugins section.', NULL, NULL, '', 'LINE', NULL, 10, '', 'f21a09c0e4a3b3eee841ef6b410151fa', '', NULL),
(6327, 'en', 'default', 'd6e863468c3551518fa205b1060b3cf3', 'You can hide/display columns based on your needs and decide how many posts to list per screen using the Screen Options tab.', NULL, NULL, '', 'LINE', NULL, 10, '', '767d49624cffb7efeb180fe4bdd5e07a', '', NULL),
(6328, 'en', 'default', '67e7c46d3d5c2108c0e99ceea6441dee', 'You can hide/display columns based on your needs and decide how many users to list per screen using the Screen Options tab.', NULL, NULL, '', 'LINE', NULL, 10, '', '48e4f7cb4f7122f5b317b5c99b0da496', '', NULL),
(6329, 'en', 'default', 'e23f79b11a13bd88eec85dc6d423b328', 'You can insert media files by clicking the button above the post editor and following the directions. You can align or edit images using the inline formatting toolbar available in Visual mode.', NULL, NULL, '', 'LINE', NULL, 10, '', '6786b278bc73962aa64b8519de21a4c8', '', NULL),
(6330, 'en', 'default', 'b9ee24b2ed698a7774a132f859a7440b', 'You can log out of other devices, such as your phone or a public computer, by clicking the Log Out Everywhere Else button.', NULL, NULL, '', 'LINE', NULL, 10, '', '1b241a88804ad03a64423db084510037', '', NULL),
(6331, 'en', 'default', '54b5a7d49cf609b5be3f081d1cadd66b', 'You can manage comments made on your site similar to the way you manage posts and other content. This screen is customizable in the same ways as other management screens, and you can act on comments using the on-hover action links or the bulk actions.', NULL, NULL, '', 'LINE', NULL, 10, '', 'f7f5eefcbfcaf930039ac959766d9c4c', '', NULL),
(6332, 'en', 'default', '82169939daa05d25d68df1a2d649d306', 'You can narrow the list by file type/status or by date using the dropdown menus above the media table.', NULL, NULL, '', 'LINE', NULL, 10, '', 'db58d14d2240eb7c402d9fbd316f6e77', '', NULL),
(6333, 'en', 'default', '21262f43b06cde8884aa3d86533780a7', 'You can now manage and live-preview Custom Backgrounds in the <a href="%s">Customizer</a>.', NULL, NULL, '', 'LINE', NULL, 10, '', '351259710af36a8ecba1ebc169961279', '', NULL),
(6334, 'en', 'default', 'bc2344754fd42bb73f71ffd3b54b0269', 'You can now manage and live-preview Custom Header in the <a href="%s">Customizer</a>.', NULL, NULL, '', 'LINE', NULL, 10, '', '9f9d4231616e872bd3bc419b883cfa7d', '', NULL),
(6335, 'en', 'default', '82deca0fb59319be08a217a38bcd7d23', 'You can proportionally scale the original image. For best results, scaling should be done before you crop, flip, or rotate. Images can only be scaled down, not up.', NULL, NULL, '', 'LINE', NULL, 10, '', 'f8773edde68d4c1d2cea0cef4a3554d0', '', NULL),
(6336, 'en', 'default', 'a4e5684835acb802ee3194c309c7ed1a', 'You can refine the list to show only posts in a specific category or from a specific month by using the dropdown menus above the posts list. Click the Filter button after making your selection. You also can refine the list by clicking on the post author, category or tag in the posts list.', NULL, NULL, '', 'LINE', NULL, 10, '', '392e9b74ecaedf4daa058dcc790516c4', '', NULL),
(6337, 'en', 'default', '3466e4fdb669b751b77cbac98d3b8a72', 'You can select an image to be shown at the top of your site by uploading from your computer or choosing from your media library. After selecting an image you will be able to crop it.', NULL, NULL, '', 'LINE', NULL, 10, '', '970337f1d4150e8b177c927ebf99c80b', '', NULL),
(6338, 'en', 'default', 'ecf5914ee8ec7cfa4e0744d83a3cfb09', 'You can select the language you wish to use while using the WordPress administration screen without affecting the language site visitors see.', NULL, NULL, '', 'LINE', NULL, 10, '', 'fd5735268d8e29b5fb70169e194cfcba', '', NULL),
(6339, 'en', 'default', 'bc6ead191133be47290a0774386abc1e', 'You can set a custom image header for your site. Simply upload the image and crop it, and the new header will go live immediately. Alternatively, you can use an image that has already been uploaded to your Media Library by clicking the &#8220;Choose Image&#8221; button.', NULL, NULL, '', 'LINE', NULL, 10, '', '811547aebb06fa74b5ec521c1f410710', '', NULL),
(6340, 'en', 'default', 'ca07cec969f8aa527834073e21e414b6', 'You can set maximum sizes for images inserted into your written content; you can also insert an image as Full Size.', NULL, NULL, '', 'LINE', NULL, 10, '', 'a6516e825fa24e1b092cc7b8c1eabd17', '', NULL),
(6341, 'en', 'default', '8f52d6a439157f46ebbd2782a6ce2a22', 'You can set the language, and the translation files will be automatically downloaded and installed (available if your filesystem is writable).', NULL, NULL, '', 'LINE', NULL, 10, '', '308e8d0b6f06c46087b020dda71cb159', '', NULL),
(6342, 'en', 'default', '0587e968316b6f9279f46763cd67c781', 'You can still use your site but any subdomain you create may not be accessible. If you know your DNS is correct, ignore this message.', NULL, NULL, '', 'LINE', NULL, 10, '', '91538971a3045305eef53a3d987e6a97', '', NULL),
(6343, 'en', 'default', '562a2da5ecf13083d751ce8dd9905d10', 'You can submit content in several different ways; this screen holds the settings for all of them. The top section controls the editor within the dashboard, while the rest control external publishing methods. For more information on any of these methods, use the documentation links.', NULL, NULL, '', 'LINE', NULL, 10, '', 'f86ab1682d11f3bf7e8923776b1c375c', '', NULL),
(6344, 'en', 'default', '5ccb16e968a00b2e5465eb56008e851d', 'You can update from WordPress %1$s to <a href="%2$s">WordPress %3$s</a> manually:', NULL, NULL, '', 'LINE', NULL, 10, '', 'cebc21c3e4c094b3473a6570a234f30d', '', NULL),
(6345, 'en', 'default', '080615ec71729a1adfcc449582e34e29', 'You can update to the latest nightly build manually:', NULL, NULL, '', 'LINE', NULL, 10, '', 'a7ee06fdd7a514001e0be4b87510a32e', '', NULL),
(6346, 'en', 'default', 'e4d5552eac3895bbac77d104bb1ac888', 'You can upload and insert media (images, audio, documents, etc.) by clicking the Add Media button. You can select from the images and files already uploaded to the Media Library, or upload new media to add to your page or post. To create an image gallery, select the images to add and click the &#8220;Create a new gallery&#8221; button.', NULL, NULL, '', 'LINE', NULL, 10, '', '63c19f99a08798af50e2a88aa8044305', '', NULL),
(6347, 'en', 'default', '09df6ae117e587dd779421384cd15bff', 'You can upload media files here without creating a post first. This allows you to upload files to use with posts and pages later and/or to get a web link for a particular file that you can share. There are three options for uploading files:', NULL, NULL, '', 'LINE', NULL, 10, '', '5f22753ed743a0fce788ebbb26a44f91', '', NULL),
(6348, 'en', 'default', '4d26943fa96797a4136ef47c5084b772', 'You can use categories to define sections of your site and group related posts. The default category is &#8220;Uncategorized&#8221; until you change it in your <a href="%s">writing settings</a>.', NULL, NULL, '', 'LINE', NULL, 10, '', '58e0f4bd0db3f201181a24e22518af6b', '', NULL),
(6349, 'en', 'default', 'c5466e9372fdad7ba27494dd68c9fcb2', 'You can use one of these cool headers or show a random one on each page.', NULL, NULL, '', 'LINE', NULL, 10, '', '8f8ebb3ba270539ec6f49120ea9c16cc', '', NULL),
(6350, 'en', 'default', '5d3cfb1969cd32ce072f4a154329dbf9', 'You can use the following controls to arrange your Dashboard screen to suit your workflow. This is true on most other administration screens as well.', NULL, NULL, '', 'LINE', NULL, 10, '', '96659bd2478b2ec608973ec63c74de4c', '', NULL),
(6351, 'en', 'default', '91e911ce8d0050d8cfc24f01a37232d9', 'You can use the plugin editor to make changes to any of your plugins&#8217; individual PHP files. Be aware that if you make changes, plugins updates will overwrite your customizations.', NULL, NULL, '', 'LINE', NULL, 10, '', '138273fc820ff94e59e90d66890748d8', '', NULL),
(6352, 'en', 'default', 'c022344f4cfbf11db6fc8251b206111b', 'You can use the theme editor to edit the individual CSS and PHP files which make up your theme.', NULL, NULL, '', 'LINE', NULL, 10, '', '23313b179ca748203fd313e32484a7ad', '', NULL),
(6353, 'en', 'default', '809cd0ac3a99a17e88b7af070dcb1d97', 'You can view all posts made by a user by clicking on the number under the Posts column.', NULL, NULL, '', 'LINE', NULL, 10, '', '057d0d295c4e9c03bbba615601760927', '', NULL),
(6354, 'en', 'default', '69bf2bc0a778d2be3e4a04bc44a4f549', 'You can view posts in a simple title list or with an excerpt using the Screen Options tab.', NULL, NULL, '', 'LINE', NULL, 10, '', '186aa98f7201ceb39e7ebc98f6e8a5ae', '', NULL),
(6355, 'en', 'default', '536f7f35770e99a3c83984d589a7e2c1', 'You can view your media in a simple visual grid or a list with columns. Switch between these views using the icons to the left above the media.', NULL, NULL, '', 'LINE', NULL, 10, '', '2ddc8f8aa19c7d488c4cf1ec77e75812', '', NULL),
(6356, 'en', 'default', '0ba7d2aceb1e3523389309177b68f301', 'You can&#8217;t delete the current user.', NULL, NULL, '', 'LINE', NULL, 10, '', 'e6666e309ecbdfe0130e85f382aead42', '', NULL),
(6357, 'en', 'default', '8f202ef980323b961b4772629bedd1e1', 'You can&#8217;t edit this attachment because it is in the Trash. Please move it out of the Trash and try again.', NULL, NULL, '', 'LINE', NULL, 10, '', 'cfc058edbc65f0e4e05713f17e853065', '', NULL),
(6358, 'en', 'default', 'b5333201742ac9a2e60ea70d0f3259d7', 'You can&#8217;t edit this comment because the associated post is in the Trash. Please restore the post first, then try again.', NULL, NULL, '', 'LINE', NULL, 10, '', '2a0ba1a6f64d03fb1cbba5d4dea09467', '', NULL),
(6359, 'en', 'default', '2e55a67bc4775ccbeb957f8ac48542d6', 'You can&#8217;t edit this item because it is in the Trash. Please restore it and try again.', NULL, NULL, '', 'LINE', NULL, 10, '', '2fd0c2ec1e5e32349b9c52297dcaaafc', '', NULL),
(6360, 'en', 'default', '1ed040d2bd69736871c3b386dc066d07', 'You can&#8217;t remove users.', NULL, NULL, '', 'LINE', NULL, 10, '', '9a340ce96923e19e7186b326b75bb879', '', NULL),
(6361, 'en', 'default', '42760c290b5dd70549bd26bd19df254b', 'You can\'t remove the current user.', NULL, NULL, '', 'LINE', NULL, 10, '', '865abc726875f0e6044ef01e8bfd28ad', '', NULL),
(6362, 'en', 'default', '3f334c7e52a82632c6c079af0e2fd865', 'You cannot delete a plugin while it is active on the main site.', NULL, NULL, '', 'LINE', NULL, 10, '', '17cd18c5c77c3a46acddf5f4a8396581', '', NULL),
(6363, 'en', 'default', 'a59e9803ef8f9c934b599c7bc82ebb85', 'You cannot delete a theme while it has an active child theme.', NULL, NULL, '', 'LINE', NULL, 10, '', 'a9819b45ff4f1ccced946d75a412f263', '', NULL),
(6364, 'en', 'default', '2240885a440abf5c6f17324c80d66df6', 'You cannot install because <a href="%1$s">WordPress %2$s</a> requires MySQL version %3$s or higher. You are running version %4$s.', NULL, NULL, '', 'LINE', NULL, 10, '', '5e2de1111c9ce2342428af5919414d45', '', NULL),
(6365, 'en', 'default', 'a8b52d3d12ef2533d3d08c3ee05b4914', 'You cannot install because <a href="%1$s">WordPress %2$s</a> requires PHP version %3$s or higher and MySQL version %4$s or higher. You are running PHP version %5$s and MySQL version %6$s.', NULL, NULL, '', 'LINE', NULL, 10, '', 'c4ac4755f506fc0efbe1a116c7709272', '', NULL),
(6366, 'en', 'default', '635f28c4bfb78d8768801d5e9b34bfac', 'You cannot install because <a href="%1$s">WordPress %2$s</a> requires PHP version %3$s or higher. You are running version %4$s.', NULL, NULL, '', 'LINE', NULL, 10, '', '83496ed4c4aaa7b00906403a6b2ed135', '', NULL),
(6367, 'en', 'default', '89511b0ab3c0336f7966eb386c55310e', 'You cannot move this item to the Trash. %s is currently editing.', NULL, NULL, '', 'LINE', NULL, 10, '', 'c6115809e477528aa86010d11ad152f0', '', NULL),
(6368, 'en', 'default', 'bc1ff86eddbbfd948b12502d0be5f1bb', 'You cannot update because <a href="%1$s">WordPress %2$s</a> requires MySQL version %3$s or higher. You are running version %4$s.', NULL, NULL, '', 'LINE', NULL, 10, '', '9a94d1711c83eb7e6ece646855410433', '', NULL),
(6369, 'en', 'default', 'fe8b24fc9c95a5d9ac053197ed29a5bb', 'You cannot update because <a href="%1$s">WordPress %2$s</a> requires PHP version %3$s or higher and MySQL version %4$s or higher. You are running PHP version %5$s and MySQL version %6$s.', NULL, NULL, '', 'LINE', NULL, 10, '', '50d34ce471f1a4715e52ac206d135ae2', '', NULL),
(6370, 'en', 'default', 'a6b8706db92fd35a5ce5921e06383892', 'You cannot update because <a href="%1$s">WordPress %2$s</a> requires PHP version %3$s or higher. You are running version %4$s.', NULL, NULL, '', 'LINE', NULL, 10, '', '53b999ee8b581b03b596c0c3500f8423', '', NULL),
(6371, 'en', 'default', '576012198a972289caa42a9d0335efa1', 'You deactivated this plugin on %s and may no longer need this policy.', NULL, NULL, '', 'LINE', NULL, 10, '', '1bc78d9c248ef6f20b7962cbf890eb4d', '', NULL),
(6372, 'en', 'default', 'a34c26b14e4cc0bbbc7539acf0fd8c13', 'You did not enter a category name.', NULL, NULL, '', 'LINE', NULL, 10, '', 'bf8173990f84489006dd9def7d3eaa40', '', NULL),
(6373, 'en', 'default', 'e15fb7addf8eb9749136275482f556bf', 'You have %1$s and %2$s.', NULL, NULL, '', 'LINE', NULL, 10, '', 'b2418cd4bfe76e0ffedcf84970b8d4d7', '', NULL),
(6374, 'en', 'default', '231c8ae8e02bd4937e66b0fa0b9588ad', 'You have chosen to delete the following users from all networks and sites.', NULL, NULL, '', 'LINE', NULL, 10, '', '743cf80abb6d03cae3640471aabe3491', '', NULL),
(6375, 'en', 'default', '50ba57aa7975ab51d7c025e4b23bb478', 'You have chosen to delete the user from all networks and sites.', NULL, NULL, '', 'LINE', NULL, 10, '', '4f76bb390c3e3e0eee0c6ad4b850feac', '', NULL),
(6376, 'en', 'default', 'c62f4650863190251339f9c26a723840', 'You have plugins waiting to be updated', NULL, NULL, '', 'LINE', NULL, 10, '', '75a693228f5c91f21e7be3f6f063af9f', '', NULL),
(6377, 'en', 'default', '3ffd956536e1922c7f5fdb831039af4d', 'You have specified these users for deletion:', NULL, NULL, '', 'LINE', NULL, 10, '', '6655504129856a6b11475fc5bcd5fddb', '', NULL),
(6378, 'en', 'default', 'dcf56f1f987777a64b0797a6280c7630', 'You have specified these users for removal:', NULL, NULL, '', 'LINE', NULL, 10, '', '1db9520cb37b952cfab013eafa7de642', '', NULL),
(6379, 'en', 'default', 'd45015d783e12de12c64715139082a95', 'You have specified this user for deletion:', NULL, NULL, '', 'LINE', NULL, 10, '', '1a2452c1c335bc83f1fe02980cc3c685', '', NULL),
(6380, 'en', 'default', 'cecaf3df13302d167b563c6f2c980397', 'You have specified this user for removal:', NULL, NULL, '', 'LINE', NULL, 10, '', '8d377aebf8e8feeef80e9b285767ba0d', '', NULL),
(6381, 'en', 'default', '5e1d755e43145fcf50b50f74de799f9d', 'You have the latest version of WordPress.', NULL, NULL, '', 'LINE', NULL, 10, '', 'ff2d031a36ae6ec0c3e8a4fe8fffee07', '', NULL),
(6382, 'en', 'default', '8da867ed2d60f83f0a853175b9e845cc', 'You have themes waiting to be updated', NULL, NULL, '', 'LINE', NULL, 10, '', 'f114073ef9f46e084dde065406337aae', '', NULL),
(6383, 'en', 'default', '910de734a93033bfae5c872ab94014de', 'You have version %1$s installed. Update to %2$s.', NULL, NULL, '', 'LINE', NULL, 10, '', '0a67da94779d8b09e9a300e81f18970e', '', NULL),
(6384, 'en', 'default', '9afc94ea9920155044857e2a6f58559a', 'You may also browse based on the most popular tags in the Plugin Directory:', NULL, NULL, '', 'LINE', NULL, 10, '', 'b266bcecfb6fce486a0191acd42470dc', '', NULL),
(6385, 'en', 'default', 'b9209ebd71e334a6b5c114b956bd04ba', 'You must be a member of at least one site to use this page.', NULL, NULL, '', 'LINE', NULL, 10, '', '138a858bcaed698543f788e5f8bd74d4', '', NULL),
(6386, 'en', 'default', '84760e95a02e1b21fd067dcf8d357fdc', 'You must click the Save Changes button at the bottom of the screen for new settings to take effect.', NULL, NULL, '', 'LINE', NULL, 10, '', '40de51e1c0d646fdf0d7d9f4efaa3ea7', '', NULL),
(6387, 'en', 'default', '8c2bf6c76b2e996aee15001305864362', 'You must provide a domain name.', NULL, NULL, '', 'LINE', NULL, 10, '', '1322fae1121e7cb69cf04cd8b740e787', '', NULL),
(6388, 'en', 'default', 'e8730e81bbcd3c1a192571908f8ccbd0', 'You must provide a name for your network of sites.', NULL, NULL, '', 'LINE', NULL, 10, '', '38318c699d2ad2c069b095ab3c904a84', '', NULL),
(6389, 'en', 'default', '5d91af26a811fea9f83a2c345f142333', 'You must provide a valid email address.', NULL, NULL, '', 'LINE', NULL, 10, '', 'daccce93d18aa9636599502c2635414c', '', NULL),
(6390, 'en', 'default', 'd21ee1e755e1f20f741241633e4c2c94', 'You must provide an email address.', NULL, NULL, '', 'LINE', NULL, 10, '', 'cee4081dcafb607585d9b25919ba4e82', '', NULL),
(6391, 'en', 'default', '7c2217673b6d04c1a90bf975b9819f61', 'You need JavaScript to choose a part of the image.', NULL, NULL, '', 'LINE', NULL, 10, '', 'b2a19886e07bbcedf751944a51ba2c01', '', NULL),
(6392, 'en', 'default', '3218284746a857892fa6726093c3230d', 'You need to make this file writable before you can save your changes. See <a href="%s">Changing File Permissions</a> for more information.', NULL, NULL, '', 'LINE', NULL, 10, '', '7d6644615c8f73b9fb0c733d4f3963d0', '', NULL),
(6393, 'en', 'default', '6188c977a07d60341263e3468f63fc53', 'You only have one theme enabled for this site right now. Visit the Network Admin to <a href="%1$s">enable</a> or <a href="%2$s">install</a> more themes.', NULL, NULL, '', 'LINE', NULL, 10, '', '074021ed5d224492b983c728b5a36337', '', NULL),
(6395, 'en', 'default', '7097e2a188421ac372935d51cf73a26c', 'You only have one theme enabled for this site right now. Visit the Network Admin to <a href="%s">enable</a> more themes.', NULL, NULL, '', 'LINE', NULL, 10, '', 'd69ed960e713a8e48dbbef7a1edca787', '', NULL),
(6396, 'en', 'default', '4fead004d501ab5fe7fdf10f1ce81066', 'You only have one theme installed right now. Live a little! You can choose from over 1,000 free themes in the WordPress Theme Directory at any time: just click on the <a href="%s">Install Themes</a> tab above.', NULL, NULL, '', 'LINE', NULL, 10, '', '650eb45a7cbc5f876ba3d67795cae07a', '', NULL),
(6397, 'en', 'default', '2b0bb6f25d9c926d8717eae9d9a94454', 'You should also note any collection and retention of sensitive personal data, such as data concerning health.', NULL, NULL, '', 'LINE', NULL, 10, '', 'cf565abf2a4b72a4ba7401b2f229d7b4', '', NULL),
(6398, 'en', 'default', 'e48d877ffe90d1093eff68a0bca8fede', 'You should be able to get this info from your web host, if %s doesn&#8217;t work.', NULL, NULL, '', 'LINE', NULL, 10, '', '3e79998aef2fa2408a3b32f68d5a471a', '', NULL) ;
INSERT INTO `wp_icl_strings` ( `id`, `language`, `context`, `name`, `value`, `string_package_id`, `location`, `wrap_tag`, `type`, `title`, `status`, `gettext_context`, `domain_name_context_md5`, `translation_priority`, `word_count`) VALUES
(6399, 'en', 'default', '1ccfc8f045c5792b05d1ee53e7d5e4dc', 'You should remove inactive plugins', NULL, NULL, '', 'LINE', NULL, 10, '', '0eb8188a9b37f310e17a127056bc6857', '', NULL),
(6400, 'en', 'default', 'a685178c6924d99115f675b2e278f23c', 'You should remove inactive themes', NULL, NULL, '', 'LINE', NULL, 10, '', '1f63703e0fcbd052e712dd85e679e271', '', NULL),
(6401, 'en', 'default', 'a6df7329278c7c6545871a478886cca4', 'You should update your %s file now.', NULL, NULL, '', 'LINE', NULL, 10, '', '92684ad555dfe198b00f4c6393c8bceb', '', NULL),
(6402, 'en', 'default', 'd9b601080173a572713c8e14213e05aa', 'You will be given a password to manually enter into the application in question.', NULL, NULL, '', 'LINE', NULL, 10, '', '958b8353e6e5a6a7b16363bafdc6d6c7', '', NULL),
(6403, 'en', 'default', '863c9161afbb85d37dfa8aee1a2ad7c0', 'You will be returned to the WordPress Dashboard, and no changes will be made.', NULL, NULL, '', 'LINE', NULL, 10, '', '7ba5a7ec797d250e9a6b1c3365f59763', '', NULL),
(6404, 'en', 'default', 'b72e60c64fe5dfa80d4e66f91c7c7a90', 'You will be sent to %s', NULL, NULL, '', 'LINE', NULL, 10, '', '76ba62d78cd1e84e88999bf087f9b059', '', NULL),
(6405, 'en', 'default', 'b24f00f7649c8e0f0568505c10235836', 'You will need this password to log&nbsp;in. Please store it in a secure location.', NULL, NULL, '', 'LINE', NULL, 10, '', 'e2ccc4453eb6ac3de50cd5638ad31b64', '', NULL),
(6406, 'en', 'default', '3e3bfeb71011d2cbaeb8cca3e9d10f23', 'You would have received an email because of this.', NULL, NULL, '', 'LINE', NULL, 10, '', '3f7127e88bf2922ac6d772deac3b7304', '', NULL),
(6407, 'en', 'default', 'f76e4db80f55377f59e2e227d9f211a2', 'You&rsquo;re using the auto-generated password for your account. Would you like to change it?', NULL, NULL, '', 'LINE', NULL, 10, '', 'f8210fb068ffb7b92bbe0b15d095ba2f', '', NULL),
(6408, 'en', 'default', '775833fe7c543fadb8f08ed4e57b4441', 'Your %s file contains only core WordPress features.', NULL, NULL, '', 'LINE', NULL, 10, '', 'b0da340efa2e3a520f40899af3090849', '', NULL),
(6409, 'en', 'default', '0c63e7e2d28f2137f79b53d9cc65ea54', 'Your %s file has an empty database table prefix, which is not supported.', NULL, NULL, '', 'LINE', NULL, 10, '', 'e9ec4831d437519e621dd2a69a281391', '', NULL),
