(132, 1, '2021-04-19 17:42:20', '2021-04-19 17:42:20', '<!-- wp:paragraph -->\r\n<p>Облачные игры называют будущим видеоигр, где все действия производятся в центре обработки данных, а не на дорогом ПК или домашней консоли.</p>\r\n<p>Преимущества включают в себя отсутствие необходимости загружать обновления программного обеспечения и возможность играть где угодно, а не только в гостиной, но для работы геймерам потребуется хорошее подключение к Интернету.</p>\r\n<p>Крис Фокс из BBC Click протестировал четыре облачных игровых сервиса, чтобы увидеть, насколько хорошо они работают: Nvidia GeForce Now, PlayStation Now, Xbox Cloud Gaming и Google Stadia.</p>\r\n<!-- /wp:paragraph -->', 'Тестирование Stadia, GeForce Now, Xbox и PS Now', '', 'publish', 'open', 'open', '', 'stadia-geforce-now-xbox-and-ps-now-put-to-the-test', '', '', '2021-05-13 16:16:48', '2021-05-13 16:16:48', '', 0, 'http://kardanets.fkinart.com/stadia-geforce-now-xbox-and-ps-now-put-to-the-test/', 0, 'post', '', 0),
(133, 1, '2021-05-13 16:16:48', '2021-05-13 16:16:48', '<!-- wp:paragraph -->\r\n<p>Облачные игры называют будущим видеоигр, где все действия производятся в центре обработки данных, а не на дорогом ПК или домашней консоли.</p>\r\n<p>Преимущества включают в себя отсутствие необходимости загружать обновления программного обеспечения и возможность играть где угодно, а не только в гостиной, но для работы геймерам потребуется хорошее подключение к Интернету.</p>\r\n<p>Крис Фокс из BBC Click протестировал четыре облачных игровых сервиса, чтобы увидеть, насколько хорошо они работают: Nvidia GeForce Now, PlayStation Now, Xbox Cloud Gaming и Google Stadia.</p>\r\n<!-- /wp:paragraph -->', 'Тестирование Stadia, GeForce Now, Xbox и PS Now', '', 'inherit', 'closed', 'closed', '', '132-revision-v1', '', '', '2021-05-13 16:16:48', '2021-05-13 16:16:48', '', 132, 'http://kardanets.fkinart.com/en/?p=133', 0, 'revision', '', 0),
