(141, 1, '2021-04-30 17:17:25', '2021-04-30 17:17:25', 'Стивен Пол Джобс (/ dʒɒbz /; 24 февраля 1955 - 5 октября 2011) был американским бизнес-магнатом, промышленным дизайнером, инвестором и владельцем СМИ. Он был председателем совета директоров, главным исполнительным директором (CEO) и соучредителем Apple Inc. председатель и мажоритарный акционер Pixar; член совета директоров The Walt Disney Company после приобретения Pixar; а также основатель, председатель и генеральный директор NeXT. Джобс широко известен как пионер революции персональных компьютеров 1970-х и 1980-х годов, как и его ранний деловой партнер и соучредитель Apple Стив Возняк.\r\n\r\nДжобс родился в Сан-Франциско, штат Калифорния, и был принят на усыновление. Он вырос в районе залива Сан-Франциско. Он учился в Рид-колледже в 1972 году, прежде чем бросить учебу в том же году, и в 1974 году путешествовал по Индии в поисках просветления и изучении дзен-буддизма.\r\n\r\nДжобс и Возняк стали соучредителями Apple в 1976 году, чтобы продавать персональный компьютер Возняка Apple I. Вместе этот дуэт приобрел известность и богатство год спустя, выпустив Apple II, один из первых очень успешных микрокомпьютеров массового производства. В 1979 году Джобс увидел коммерческий потенциал Xerox Alto, который управлялся мышью и имел графический пользовательский интерфейс (GUI). Это привело к разработке неудачной Apple Lisa в 1983 году, за которой последовал прорыв в Macintosh в 1984 году, первый серийный компьютер с графическим интерфейсом. Macintosh представил индустрию настольных издательских систем в 1985 году с добавлением Apple LaserWriter, первого лазерного принтера с векторной графикой. Джобс был вынужден уйти из Apple в 1985 году после долгой борьбы за власть с советом директоров компании и ее тогдашним генеральным директором Джоном Скалли. В том же году Джобс взял с собой нескольких членов Apple, чтобы основать NeXT, компанию по разработке компьютерных платформ, специализирующуюся на компьютерах для высшего образования и бизнеса. Кроме того, он помогал развивать индустрию визуальных эффектов, когда в 1986 году профинансировал подразделение компьютерной графики Lucasfilm Джорджа Лукаса. Новой компанией стала Pixar, которая выпустила первый компьютерный анимационный 3D-фильм «История игрушек» (1995), а затем перешла на стала крупной анимационной студией, выпустившей с тех пор более 20 фильмов.\r\n\r\nДжобс стал генеральным директором Apple в 1997 году после приобретения его компанией NeXT. Во многом он отвечал за возрождение Apple, которая находилась на грани банкротства. Он работал в тесном сотрудничестве с дизайнером Джони Айвом над разработкой линейки продуктов, имевших более широкие культурные разветвления, начиная с 1997 года с рекламной кампании «Думай иначе» и заканчивая iMac, iTunes, iTunes Store, Apple Store, iPod, iPhone, App Store. , и iPad. В 2001 году исходная Mac OS была заменена полностью новой Mac OS X (теперь известной как macOS), основанной на платформе NeXTSTEP от NeXT, что впервые предоставило ОС современную основу на основе Unix. В 2003 году у Джобса была диагностирована нейроэндокринная опухоль поджелудочной железы. Он умер от остановки дыхания, связанной с опухолью, в возрасте 56 лет 5 октября 2011 года.', 'Алекс Сивро', '', 'publish', 'closed', 'closed', '', 'alex-sivro', '', '', '2021-05-13 16:55:45', '2021-05-13 16:55:45', '', 0, 'http://kardanets.fkinart.com/team/alex-sivro/', 0, 'team', '', 0),
(142, 1, '2021-05-13 16:54:59', '2021-05-13 16:54:59', 'Стивен Пол Джобс (/ dʒɒbz /; 24 февраля 1955 - 5 октября 2011) был американским бизнес-магнатом, промышленным дизайнером, инвестором и владельцем СМИ. Он был председателем совета директоров, главным исполнительным директором (CEO) и соучредителем Apple Inc. председатель и мажоритарный акционер Pixar; член совета директоров The Walt Disney Company после приобретения Pixar; а также основатель, председатель и генеральный директор NeXT. Джобс широко известен как пионер революции персональных компьютеров 1970-х и 1980-х годов, как и его ранний деловой партнер и соучредитель Apple Стив Возняк.\n\nДжобс родился в Сан-Франциско, штат Калифорния, и был принят на усыновление. Он вырос в районе залива Сан-Франциско. Он учился в Рид-колледже в 1972 году, прежде чем бросить учебу в том же году, и в 1974 году путешествовал по Индии в поисках просветления и изучении дзен-буддизма.\n\nДжобс и Возняк стали соучредителями Apple в 1976 году, чтобы продавать персональный компьютер Возняка Apple I. Вместе этот дуэт приобрел известность и богатство год спустя, выпустив Apple II, один из первых очень успешных микрокомпьютеров массового производства. В 1979 году Джобс увидел коммерческий потенциал Xerox Alto, который управлялся мышью и имел графический пользовательский интерфейс (GUI). Это привело к разработке неудачной Apple Lisa в 1983 году, за которой последовал прорыв в Macintosh в 1984 году, первый серийный компьютер с графическим интерфейсом. Macintosh представил индустрию настольных издательских систем в 1985 году с добавлением Apple LaserWriter, первого лазерного принтера с векторной графикой. Джобс был вынужден уйти из Apple в 1985 году после долгой борьбы за власть с советом директоров компании и ее тогдашним генеральным директором Джоном Скалли. В том же году Джобс взял с собой нескольких членов Apple, чтобы основать NeXT, компанию по разработке компьютерных платформ, специализирующуюся на компьютерах для высшего образования и бизнеса. Кроме того, он помогал развивать индустрию визуальных эффектов, когда в 1986 году профинансировал подразделение компьютерной графики Lucasfilm Джорджа Лукаса. Новой компанией стала Pixar, которая выпустила первый компьютерный анимационный 3D-фильм «История игрушек» (1995), а затем перешла на стала крупной анимационной студией, выпустившей с тех пор более 20 фильмов.\n\nДжобс стал генеральным директором Apple в 1997 году после приобретения его компанией NeXT. Во многом он отвечал за возрождение Apple, которая находилась на грани банкротства. Он работал в тесном сотрудничестве с дизайнером Джони Айвом над разработкой линейки продуктов, имевших более широкие культурные разветвления, начиная с 1997 года с рекламной кампании «Думай иначе» и заканчивая iMac, iTunes, iTunes Store, Apple Store, iPod, iPhone, App Store. , и iPad. В 2001 году исходная Mac OS была заменена полностью новой Mac OS X (теперь известной как macOS), основанной на платформе NeXTSTEP от NeXT, что впервые предоставило ОС современную основу на основе Unix. В 2003 году у Джобса была диагностирована нейроэндокринная опухоль поджелудочной железы. Он умер от остановки дыхания, связанной с опухолью, в возрасте 56 лет 5 октября 2011 года.', 'Алекс Сивро', '', 'inherit', 'closed', 'closed', '', '141-autosave-v1', '', '', '2021-05-13 16:54:59', '2021-05-13 16:54:59', '', 141, 'http://kardanets.fkinart.com/en/?p=142', 0, 'revision', '', 0),
(143, 1, '2021-04-30 17:15:55', '2021-04-30 17:15:55', 'Steven Paul Jobs (/dʒɒbz/; February 24, 1955 – October 5, 2011) was an American business magnate, industrial designer, investor, and media proprietor. He was the chairman, chief executive officer (CEO), and co-founder of Apple Inc.; the chairman and majority shareholder of Pixar; a member of The Walt Disney Company\'s board of directors following its acquisition of Pixar; and the founder, chairman, and CEO of NeXT. Jobs is widely recognized as a pioneer of the personal computer revolution of the 1970s and 1980s, along with his early business partner and fellow Apple co-founder Steve Wozniak.\r\n\r\nJobs was born in San Francisco, California, and put up for adoption. He was raised in the San Francisco Bay Area. He attended Reed College in 1972 before dropping out that same year, and traveled through India in 1974 seeking enlightenment and studying Zen Buddhism.\r\n\r\nJobs and Wozniak co-founded Apple in 1976 to sell Wozniak\'s Apple I personal computer. Together the duo gained fame and wealth a year later with the Apple II, one of the first highly successful mass-produced microcomputers. Jobs saw the commercial potential of the Xerox Alto in 1979, which was mouse-driven and had a graphical user interface (GUI). This led to the development of the unsuccessful Apple Lisa in 1983, followed by the breakthrough Macintosh in 1984, the first mass-produced computer with a GUI. The Macintosh introduced the desktop publishing industry in 1985 with the addition of the Apple LaserWriter, the first laser printer to feature vector graphics. Jobs was forced out of Apple in 1985 after a long power struggle with the company\'s board and its then-CEO John Sculley. That same year, Jobs took a few of Apple\'s members with him to found NeXT, a computer platform development company that specialized in computers for higher-education and business markets. In addition, he helped to develop the visual effects industry when he funded the computer graphics division of George Lucas\'s Lucasfilm in 1986. The new company was Pixar, which produced the first 3D computer animated feature film Toy Story (1995), and went on to become a major animation studio, producing over 20 films since then.\r\n\r\nJobs became CEO of Apple in 1997, following his company\'s acquisition of NeXT. He was largely responsible for helping revive Apple, which had been on the verge of bankruptcy. He worked closely with designer Jony Ive to develop a line of products that had larger cultural ramifications, beginning in 1997 with the "Think different" advertising campaign and leading to the iMac, iTunes, iTunes Store, Apple Store, iPod, iPhone, App Store, and the iPad. In 2001, the original Mac OS was replaced with the completely new Mac OS X (now known as macOS), based on NeXT\'s NeXTSTEP platform, giving the OS a modern Unix-based foundation for the first time. Jobs was diagnosed with a pancreatic neuroendocrine tumor in 2003. He died of respiratory arrest related to the tumor at age 56 on October 5, 2011.', 'Шон Романилос', '', 'publish', 'closed', 'closed', '', 'shawn-romanillos', '', '', '2021-05-13 16:56:59', '2021-05-13 16:56:59', '', 0, 'http://kardanets.fkinart.com/team/shawn-romanillos/', 0, 'team', '', 0),
